(72784, 'frFR', 'Soutenir l\assemble de Cobalt', 'Parlez  Venthi  l\assemble de Cobalt.', 'Vous tombez  pic, $n.\n\nAvez-vous entendu parler de l\assemble de Cobalt? C\tait autrefois un lieu fabuleux o vivaient la plupart de mes congnres.\n\nHlas, nous nous sommes fait chasser par la Flamme fracture qui s\en est empare.\n\nNous esprions reconqurir notre sanctuaire, mais les dernires informations qui nous arrivent du front tendent  prouver que nous sommes en position d\infriorit.\n\nSi vous tes $gdispos:dispose;  nous aider, allez voir Venthi, elle vous attend sur place.', '', '', '', '', '', 'Parlez  Venthi  l\assemble de Cobalt.', 47187),
(72783, 'frFR', 'Commandes d\artisanat', 'Parlez  la responsable des ventes Mimzy Rockenpaf pour en apprendre davantage sur les commandes d\artisanat.', 'C\est un sacr petit bidule que vous avez rcupr de l\appareil des Titans. Passez-moi donc a!\n\nJe plaisante! J\ai pas la moindre ide de ce qu\on pourrait en faire, de ce machin Et vous?\n\nAllez donc en causer avec Mimzy Rockenpaf. Elle a toute une organisation en place pour aider les gens avec des commandes d\artisanat.\n\nSuffit d\apporter le matos et quelqu\un d\autre prend le tout pour vous fabriquer un truc.\n\nC\est simple comme bonjour, pas vrai? Et lui dites surtout pas que c\est moi qui vous envoie.', '', '', '', '', '', '', 47187),
(72773, 'frFR', 'Apprentissage d\ingniosit', 'Allez voir Grizik Rasfitodoigt  Valdrakken.', 'Des Gobelines et Gobelins de Valdrakken s\intressent  un vieil objet des Titans.\n\nTrs franchement, leurs recherches sment une sacre pagaille. Certaines personnes pensent mme que tout a fera plus de mal que de bien.\n\nLa population de Valdrakken vous serait reconnaissante de bien vouloir aller parler  ces cratures pour les aider  trouver une solution\n\n sans dtruire la moiti de la ville.', '', '', '', '', '', 'Allez voir Grizik Rasfitodoigt  Valdrakken.', 47187),
