(72729, 'frFR', 'Le grand Buffon', 'Apportez la pice des les rouille au grand Bufflon dans les plaines d\Ohn\ahra.', 'Une pice trange pche dans les eaux des les aux Dragons.\n\n en croire certains pcheurs et pcheuses, une crature des plaines d\Ohn\ahra en ferait la collection.', '', '', '', '', '', '', 47187),
(72728, 'frFR', 'Le monde vous attend', 'Accomplissez 10 expditions sur les les aux Dragons.', 'Vous savez ce que c\est, la preuve de la vraie force? C\est d\aider la communaut des les aux Dragons!\n\nLes problmes  rsoudre ne manquent pas, dans le coin. Montrez-moi ce que vous avez dans le ventre en aidant les gens autour de vous!', '', '', '', '', '', '', 47187),
(72709, 'frFR', 'Financement d\une chasse au trsor', 'Achetez l\tude d\artfacts archologiques  l\inventoriste Jakes.', '<L\inventoriste Jakes fouille rapidement son propre sac de fournitures pour en tirer une carte tout rcemment trace.>\n\nNos archologues ont fait de nouvelles dcouvertes sur un artfact perdu qui se trouverait dans la rgion.\n\nSi vous acceptez de faire don de ces fournitures pour le financement de leur prochaine expdition, je vous donnerai cette carte qui indique l\emplacement d\un trsor non loin d\ici.', '', '', '', '', '', '', 47187),
(72708, 'frFR', 'Fournitures des les aux Dragons', 'Apportez un sac de fournitures des les aux Dragons  l\inventoriste Jakes,  l\ambassade de Trve-Aile.', '<Le proto-dragon a srement arrach ce sac de fournitures  un membre malchanceux de l\expdition du Dracaret.\n\nL\inventoriste Jakes, de l\ambassade de Trve-Aile, saura l\utiliser  bon escient.>', '', '', '', '', '', 'Apportez un sac de fournitures des les aux Dragons  l\inventoriste Jakes,  l\ambassade de Trve-Aile.', 47187),
