(72686, 'frFR', 'ruption de tempte', 'Venez  bout des cratures imprgnes par les lments pour rcuprer des dbordements lmentaires lorsque vous tes dans une tempte lmentaire.', 'Les Primalistes ont russi  invoquer de puissantes temptes lmentaires dans toutes les les aux Dragons, $n.\n\nDs qu\une tempte se manifeste, rendez-vous sur place et tuez les cratures imprgnes qui s\y trouvent.\n\nEnsuite, rcuprez le dbordement lmentaire qui s\chappe de vos victimes. Prenez garde, car plus votre adversaire est redoutable, plus le dbordement lmentaire sera important.\n\nNous ne pouvons pas laisser la corruption lmentaire des Primalistes se rpandre impunment.', '', '', '', '', '', '', 47187),
