(72648, 'frFR', 'tincelles de vie: trave d\Azur', 'Rcuprez $1oatincelles de vie sur la trave d\Azur en mode Guerre.', 'Fourmillantes de vie, les mares sont remontes, apportant leurs richesses  la trave d\Azur.\n\nIl est temps de se retrouver entre proches, avec nos familles, autour d\un bon repas,  crer de nouvelles histoires.', '', '', '', '', '', 'Parlez au matre de campagne Fortibraise  Valdrakken.', 47187),
