(72585, 'frFR', 'Orientation ouverte', 'Terminez les qutes d\orientation dans les centres de chacune des grandes factions: le camp de base du Dracaret, Maruuka, Iskaara et Valdrakken.', 'Vous avez tant fait pour les les aux Dragons, $ghros:hrone;.\n\nBien des gens vous sont reconnaissants pour vos contributions et souhaitent vous accueillir durablement dans leurs communauts. Allez donc les voir, et familiarisez-vous avec leurs us et coutumes.\n\nJe gage qu\aprs tout ce que vous avez donn pour les les, les autochtones vous rendront la pareille!', '', '', '', '', '', '', 47187),
(72584, 'frFR', 'Tendre ses filets', 'Posez un filet dans le coin de pche de l\embouchure.', 'Vous voulez essayer votre filet? Rendez-vous  l\embouchure de la rivire, au sud des rivages de l\veil, et trouvez un endroit o le poisson est abondant. Vous y trouverez  coup sr un coin adapt  la pche au filet.', '', '', '', '', '', '', 47187),
