(72525, 'frFR', 'quipement de catalogage basique', 'Utilisez le kit de fournitures d\expdition pour rechercher l\quipement de catalogage.', 'Tout inventoriste mrite de possder son propre appareil photo!\n\nRien ne vous oblige  lui donner un petit nom, mais je vous conseille vivement de le faire. C\est bien plus amusant ainsi.\n\nBref: le guide Jeb devrait pouvoir vous fournir tout ce qu\il vous faut.\n\nVraiment, il a prvu tout le ncessaire. Il est incroyable!', '', '', '', '', '', '', 47187),
(72524, 'frFR', 'quipement d\escalade basique', 'Utilisez le kit de fournitures d\expdition pour rechercher l\quipement d\escalade.', '<Le guide Jeb esquisse un geste vers le kit de fournitures  ct de lui.>\n\nSi vous voulez survivre ici, vous allez avoir besoin de fournitures.\n\nJ\ai ici tout le ncessaire pour vous lancer dans l\escalade.', '', '', '', '', '', '', 47187),
(72519, 'frFR', 'Accordage temporel', 'Utilisez le chronocristal sur ternia et Chromie  Azmerloth pour les empcher de tomber dans le temps.', 'Je vois Elles dgringolent  travers le temps et l\infini des possibles.\n\nIl n\y a pas un instant  perdre. J\ai repr un autre point dans la ligne temporelle o nous sommes susceptibles de les rattraper. C\est un monde trange, mais il ne faut pas que cela vous ralentisse pour autant. Le sort de Chronormu est entre vos mains.', '', '', '', '', '', 'Retournez voir Nozdormu dans le prsent.', 47187),
(72512, 'frFR', 'Le murmure de la brise', 'Allez voir Ohn\ahra au perchoir d\Ohn\ahra.', '<Godoloto penche la tte d\un air interrogateur, l\incline en signe de salut, et pour finir, soutient votre regard. Aprs quelques longs instants, elle lve les yeux vers le ciel et vers la montagne derrire Maruuka. Vous comprenez qu\elle veut que vous vous rendiez au perchoir d\Ohn\ahra.>', '', '', '', '', '', 'Allez voir Ohn\ahra au perchoir d\Ohn\ahra.', 47187),
(72488, 'frFR', 'Tour de Thaldraszus avanc', 'lancez-vous sur tous les circuits de Thaldraszus en niveau avanc.', 'Retrouvons Thaldraszus et ses pics, valles et circuits qui n\attendent plus que vous.\n\nAllez  la rencontre de mes collgues de bronze pour vous lancer sur les parcours avancs et conclure votre tour express des les aux Dragons!', '', '', '', '', '', '', 47187),
(72487, 'frFR', 'Tour de Thaldraszus', 'lancez-vous sur tous les circuits de Thaldraszus.', 'Thaldraszus Foyer du sige des Aspects et de tant d\autres tmoignages de l\histoire des peuples draconiens.\n\nCes terres abritent galement des hauteurs vertigineuses et de profonds ravins qui n\attendent que d\tre survols!\n\nUne fois de plus, mes collgues de bronze ont labor des parcours permettant d\explorer la rgion tout en volant  toute allure.\n\nQue diriez-vous de les essayer pour conclure votre dcouverte des les aux Dragons?', '', '', '', '', '', '', 47187),
(72486, 'frFR', 'Tour de la trave d\Azur avanc', 'lancez-vous sur tous les circuits de la trave d\Azur en niveau avanc.', 'Les circuits de niveau avanc de la trave d\Azur ont t conus pour faire atteindre de nouveaux sommets  vos talents de vol  dos de Dragon.\n\nSeulement Faites attention  ne pas en tomber!\n\nQuand vous serez $gprt:prte;, trouvez mes collgues de bronze et dcouvrez leurs circuits!', '', '', '', '', '', '', 47187),
(72485, 'frFR', 'Tour de la trave d\Azur', 'lancez-vous sur tous les circuits de la trave d\Azur.', 'Les circuits de la trave d\Azur offrent une exprience unique. Les sommets vertigineux, les terrains enneigs et les forts luxuriantes de la rgion regorgent d\obstacles surprenants et de dfis!\n\nTant que vous tes dans le coin, cherchez mes collgues de bronze et essayez leurs parcours!', '', '', '', '', '', '', 47187),
(72484, 'frFR', 'Tour des plaines d\Ohn\ahra avanc', 'lancez-vous sur tous les circuits des plaines d\Ohn\ahra en niveau avanc.', 'Les circuits de niveau avanc sont un peu plus corss, mais rien d\impossible pour vous!\n\nMes collgues de bronze ont install dans les plaines d\Ohn\ahra des parcours avancs avec de nombreux obstacles et surprises. Vous pouvez galement tenter de battre vos propres records!\n\nBonne chance!', '', '', '', '', '', '', 47187),
(72483, 'frFR', 'Tour des plaines d\Ohn\ahra', 'lancez-vous sur tous les circuits des plaines d\Ohn\ahra.', 'Ah, les plaines d\Ohn\ahra! Leurs vastes tendues, leurs vents, leurs panoramas infinis sans oublier leurs circuits de course!\n\nComme sur les rivages de l\veil, si vous croisez mes collgues de bronze, n\hsitez pas  leur parler de leur parcours.', '', '', '', '', '', '', 47187),
(72482, 'frFR', 'Tour des rivages de l\veil avanc', 'lancez-vous sur tous les circuits des rivages de l\veil en niveau avanc.', ' prsent que vous avez essay tous les circuits rudimentaires des les aux Dragons et fait la preuve de vos capacits, que diriez-vous de relever un nouveau dfi?\n\nLes circuits de niveau avanc sont similaires aux parcours normales, mais disposent d\un itinraire de vol ajust ou d\obstacles supplmentaires pour mettre vos talents  l\preuve.\n\nCommenons par les circuits des rivages de l\veil!', '', '', '', '', '', '', 47187),
(72481, 'frFR', 'Le tour des rivages de l\veil', 'lancez-vous sur tous les circuits des rivages de l\veil.', 'Vous savez ce qui est le plus amusant, quand on vole  dos de Dragon? Faire la course!\n\nMes collgues de bronze organisent des courses aux quatre coins des les aux Dragons. Leurs paysages sont si varis et dynamiques qu\ils nous supplient presque de les explorer  toute vitesse.\n\nSi vous passez prs de l\un des points de dpart sur les rivages de l\veil, pourquoi ne pas essayer?', '', '', '', '', '', '', 47187),
(72456, 'frFR', 'Les tomes de la vrit', 'Rcuprez les volumes de la Gnalogie d\obsidienne et apportez-les aux intendantes d\Irion et Sabellian.', 'Nous avons eu beau scuriser les remparts suprieurs de la citadelle d\Obsidienne, les forces djaradines continuent de piller la cour. Cette zone est remplie d\archives historiques inestimables! Nous devons agir vite si nous voulons sauver cet hritage du Vol draconique noir.\n\nIrion comme Sabellian convoitent ces documents et vous pourrez vous attirer leurs faveurs en vous procurant un exemplaire de chaque tome.\n\nVoyagez vers la tour effondre de la citadelle et tchez de sauver quelque chose de valeur.', '', '', '', '', '', '', 47187),
(72448, 'frFR', 'Protger notre hritage', 'liminez deux adversaires rares dans la citadelle d\Obsidienne ou aux Scories.', 'Je n\ai pas travaill d\arrache-pied jusqu\ prsent pour perdre la citadelle maintenant!\n\nMalheureusement, de nouvelles menaces se profilent. Puis-je compter sur votre aide pour les contrer?\n\nAidez-nous  scuriser la zone. Puis trouvez et liminez deux de nos adversaires les plus redoutables.', '', '', '', '', '', '', 47187),
(72447, 'frFR', 'La plus terrible des menaces', 'liminez deux adversaires rares dans la citadelle d\Obsidienne ou aux Scories.', 'De puissants Djaradins et d\autres cratures menacent  la fois la citadelle d\Obsidienne, et la sret de mon Vol.\n\nCela ne peut plus durer.\n\nAidez-nous  scuriser la zone et liminez deux de nos adversaires les plus redoutables.', '', '', '', '', '', '', 47187),
(72435, 'frFR', 'Orientation: Iskaara', 'Faites connaissance avec des marchands et marchandes d\articles prcieux.', 'Bienvenue  Iskaara, l\$gami:amie;.\n\nNous avons eu vent de vos exploits au creux des Fougerobes. Vous avez dj rencontr bon nombre d\entre nous et d\autres aimeraient avoir la chance d\changer des informations et des marchandises avec vous.\n\nPrenez le temps de faire connaissance avec les gens d\Iskaara. Notre petite communaut est base sur l\entraide et si vous avez beaucoup  nous offrir, vous verrez que nous avons largement de quoi vous aider en retour.', '', '', '', '', '', '', 47187),
(72434, 'frFR', 'Boucle du sanctuaire de l\Essence rubis', 'Terminez la boucle du sanctuaire de l\Essence rubis.', 'On m\a dit que je n\tais pas encore assez grand pour participer aux courses.\n\na ne m\empche pas de regarder les autres. Vous devriez concourir! Comme a, je pourrais vous regarder.', '', '', '', '', '', 'Terminez la boucle du sanctuaire de l\Essence rubis.', 47187),
(72429, 'frFR', 'Orientation: Maruuka', 'Rencontrez la gardienne du renom et l\intendant de renom  Maruuka.', '<Okir interprte les signes de la khan Sansok.>\n\nLes Maruuks ne sont pas fermement opposs aux races trangres, mais nous attendons de nos allis potentiels qu\ils prouvent leur valeur. En rencontrant les clans et en nous aidant dans nos affaires, vous ferez peu  peu connatre votre soutien.\n\nAu niveau infrieur du krutal, sur la colline, vous trouvez l\une des filles de la Khanam Matra, qui vous indiquera ce que vous pouvez faire pour nous aider. Pensez  vous prsenter  elle.', '', '', '', '', '', '', 47187),
(72428, 'frFR', 'Amasseurs bufflaciens', 'Rcuprez 20gemmes odorantes sur les bufflaciens des les aux Dragons pour Gnoklin Folbobine, de l\expdition du Dracaret.', 'Tout le monde sait que les bufflaciens des environs sont fascins par les pierres prcieuses et tout ce qui brille. L\autre jour, j\ai mme trouv un joyau trs rare dans des excrments de bufflacien!\n\nJe sais bien que ce n\est pas la tche la plus ragotante, mais il semblerait que les bufflaciens ne se contentent pas de rcuprer les objets de valeur, ils les mangent galement.', '', '', '', '', '', '', 47187),
(72427, 'frFR', 'Infusion anime', 'Rcuprez 13feuilles hrisses sur les flagellants des les aux Dragons pour Dhurrel, des Centaures maruuks.', 'J\ai une petite requte  vous soumettre aujourd\hui.\n\nLes alchimistes sont  court d\un ingrdient qui entre dans la composition d\un breuvage particulirement complexe. C\est une herbe que l\on trouve assez facilement, il suffit de reprer des plantes agressives et d\en prlever des chantillons. Pourriez-vous vous en occuper?', '', '', '', '', '', '', 47187),
(72423, 'frFR', 'Faire face  la tempte', 'Rcuprez 12armes imprgnes de tempte sur les Centaures nokhuds des les aux Dragons pour Temnaayu, une Rohart d\Iskaara.', 'Ah, vous tombez  point nomm! Selon la rumeur, les Centaures nokhuds disposent de puissantes armes imprgnes de tempte. Nous aimerions en apporter quelques chantillons  nos enchanteurs et enchanteresses.\n\nEt quoi qu\il en soit, nous pouvons mettre ces armes hors d\tat de nuire et en faire meilleur usage.', '', '', '', '', '', '', 47187),
(72410, 'frFR', 'Aiguilles et mandibules', 'Rcuprez 10mandibules pointues sur les scythides des les aux Dragons pour Gnoklin Folbobine, de l\expdition du Dracaret.', 'Ces derniers temps, nous sommes constamment  court d\aiguilles pour la couture. Ces salets se brisent si facilement!\n\nQuelques piques prleves sur les scythides des environs pourraient trs bien faire l\affaire.', '', '', '', '', '', '', 47187),
(72406, 'frFR', 'Orientation: Valdrakken', 'Faites connaissance avec les fournisseuses et fournisseurs officiels du concordat de Valdrakken.', 'Bienvenue  Valdrakken, $p. Je suis Unatos, gardien du renom auprs du concordat.\n\nEn guise de reconnaissance pour votre soutien aux Vols draconiques, plusieurs fournisseurs et fournisseuses de la ville ont reu l\autorisation de vous procurer ce qui se fait de mieux dans nos ateliers.\n\nJe vous invite donc  prendre un moment pour dcouvrir leurs choppes et les marchandises que vous pourrez y trouver.', '', '', '', '', '', '', 47187),
(72399, 'frFR', 'Le jardin de l\ermite', 'Parlez  Szareth au rebord de l\Ombre.', 'Nos parents nous interdisent de mettre les pieds dans les jardins qui surplombent Gelikyr sous prtexte qu\ils sont gards par une sale brute.\n\nMais c\est faux! Malgr son temprament ronchon, c\est une vraie crme!\n\nLe vrai problme, ce sont les Primalistes. Par leur faute, les lieux sont devenus trop dangereux pour qu\on ose s\y aventurer J\espre seulement que notre camarade va bien. Vous pourriez aller voir sur place?', '', '', '', '', '', '', 47187),
(72397, 'frFR', 'Orientation: camp de base du Dracaret', 'Rencontrez les fournisseurs et fournisseuses les plus importants du camp de base du Dracaret.', 'Bienvenue au camp de base, $p.\n\nIl nous a fallu un moment,  Toddy et moi, pour trouver l\endroit idal o tablir notre campement, mais je ne pourrais pas tre plus satisfaite de notre choix.\n\nNous sommes  proximit des ruines, du lieu de reproduction des proto-dragons, et bien sr, des Vols draconiques.\n\nQue dites-vous de prendre quelques minutes pour explorez le camp et rencontrer certains des fournisseurs et fournisseuses de notre expdition?', '', '', '', '', '', 'Retrouvez Toddy Bourbon dans la tente du camp de base du Dracaret.', 47187),
