(72380, 'frFR', 'L\union fait la force', 'Retournez au sige des Aspects et informez Alexstrasza de ce qui est arriv aprs la dfaite de Raszageth dans le caveau des Incarnations.', '$n, il faut que vous expliquiez ce qui s\est pass ici  Alexstrasza et Nozdormu.\n\nKhadgar et moi vous retrouverons sous peu au sige des Aspects.', '', '', '', '', '', 'Retournez voir Alexstrasza la Lieuse-de-Vie au sige des Aspects de Valdrakken.', 47187),
(72374, 'frFR', 'Aider le concordat: le donjon du Flau-des-Dragons', 'Rendez-vous sur les rivages de l\veil pour assiger le donjon de Flau-des-Dragons. Continuez  aider le concordat de Valdrakken et ses allis aux quatre coins des les aux Dragons.', 'Nos allis ont encore besoin de votre aide alors que nous poursuivons notre entreprise sur les les. Vos efforts pour assurer notre avenir ont redonn espoir  la population de Valdrakken.\n\nBref, parlons plutt affaires.\n\nLa menace djaradine sur les rivages de l\veil se prcise alors que les troupes ennemies s\agitent dans les profondeurs infernales du donjon du Flau-des-Dragons. Il faut  tout prix leur faire obstacle.\n\nNous attendrons votre retour avec impatience, $n.', '', '', '', '', '', '', 47187),
(72373, 'frFR', 'Aider le concordat: la chasse est ouverte', 'Aidez les Maruuks lors d\une chasse sur les les aux Dragons. Continuez  aider le concordat de Valdrakken et ses allis aux quatre coins des les.', 'Nos allis sur les plaines d\Ohn\ahra nous ont envoy un message pour faire appel  celles et ceux qui chassent sur ces terres.\n\nPendant que vous continuez  servir notre cause  travers les les, profitez-en pour leur rendre visite dans l\un de leurs camps de chasse et venez-leur en aide.\n\nCe n\est pas le travail qui manque. Mieux vaut vous y mettre tout de suite.', '', '', '', '', '', '', 47187),
