(72354, 'frFR', 'La grande chambre forte', 'Procurez-vous un objet entrepos dans la grande chambre forte.', 'Au fil des annes, les Aspects et leurs congnres ont acquis toutes sortes d\artfacts et d\armes remarquables. Un caveau enchant a donc t amnag afin d\y entreposer ces prcieux objets en attendant qu\une me noble vienne les chercher.\n\nVous trouverez cette grande chambre forte dans l\enceinte de la banque. Si vous vous en montrez digne, elle acceptera peut-tre de vous octroyer l\un de ses fabuleux trsors.', '', '', '', '', '', '', 47187),
