(72293, 'frFR', 'S\aventurer dans les les aux Dragons', 'Examinez la carte de reconnaissance et slectionnez une rgion des les aux Dragons  laquelle apporter votre aide.', 'Oh, je sais ce que vous pouvez faire!\n\nL\expdition du Dracaret a mis  votre disposition une magnifique carte des les aux Dragons.\n\nLe niveau de dtail est assez impressionnant, si je peux me permettre. Dsole, vous n\tes pas ici pour parler d\art.\n\nVous devriez aller y jeter un coup d\il et dcouvrir quelles rgions des les aux Dragons auraient besoin de votre aide!', '', '', '', '', '', '', 47187),
(72292, 'frFR', 'Rcit d\une victoire spectaculaire', 'Racontez votre victoire  l\ancienne Poa,  Iskaara.', 'Un combat des plus majestueux!\n\nL\ancienne Poa d\Iskaara sera curieuse d\entendre le rcit de cette victoire impressionnante.', '', '', '', '', '', '', 47187),
(72291, 'frFR', 'L\histoire d\une victoire mmorable', 'Racontez votre victoire  l\ancienne Poa,  Iskaara.', 'C\tait un beau combat!\n\nL\ancienne Poa d\Iskaara sera curieuse d\entendre le rcit de cette victoire.', '', '', '', '', '', '', 47187),
