(72269, 'frFR', 'Thaldraszus', 'Allez  Valdrakken et rencontrez Alexstrasza la Lieuse-de-Vie.', 'Alexstrasza la Lieuse-de-Vie organise une runion au sige des Aspects afin d\voquer la menace primaliste.\n\nElle y convie toutes les mes vaillantes volontaires.', '', '', '', '', '', 'Allez  Valdrakken et rencontrez Alexstrasza la Lieuse-de-Vie.', 47187),
(72268, 'frFR', 'La trave d\Azur', 'Parlez  Masud le Sage dans les plaines d\Ohn\ahra.', 'Le Kirin Tor a besoin de toute l\aide possible pour mettre la main sur la pierre de vu du Vol draconique bleu.\n\nPlusieurs de ces mages recherchent de l\aide dans les plaines d\Ohn\ahra.', '', '', '', '', '', '', 47187),
(72267, 'frFR', 'Les plaines d\Ohn\ahra', 'Allez voir l\ambassadeur Taurasza  l\avant-poste de l\caille rubis.', 'Le Vol draconique vert a besoin de l\aide d\aventuriers et d\aventurires. Pour pouvoir lui prter main-forte, vous devrez vous allier aux Centaures des plaines.\n\nL\ambassadeur Taurasza pourra vous aider.', '', '', '', '', '', '', 47187),
(72266, 'frFR', 'Les rivages de l\veil', 'Retrouvez Sendrax sur les rivages de l\veil.', 'La Draknide nomme Sendrax aurait besoin d\assistance pour venir en aide aux nouveaux venus sur les rivages de l\veil', '', '', '', '', '', '', 47187),
(72263, 'frFR', 'Un vorquin qui a bon dos', 'Apprenez  chevaucher votre vorquin personnel.', '$gvocateur:vocatrice;! Il y a toujours des troupeaux de vorquins par ici!\n\nJ\ai russi  en attraper quelques-uns qui pourraient vous servir de montures quand vos ailes ont besoin de repos. Vous vous rappelez comment les chevaucher?\n\nCelui-ci vous a t spcialement dsign, vu que notre hirarchie vous envoie  droite et  gauche. Prenez-en bien soin.', '', '', '', '', '', '', 47187),
(72261, 'frFR', 'Plus qu\une prison?', 'Apportez l\artfact du caveau ancien  Lillian Brillelune.', '<Cet artfact ancien semble de nature lmentaire. Lillian Brillelune, de Valdrakken, pourra peut-tre vous en dire plus.>', '', '', '', '', '', '', 47187),
(72260, 'frFR', 'Artfacts du caveau', '', '', '', '', '', '', '', '', 47187),
(72259, 'frFR', 'Artfacts du caveau', '', '', '', '', '', '', '', '', 47187),
(72256, 'frFR', 'Les Serres-Noires', 'Relayez les ordres de la squammandante  Kodethi et aux Serres-Noires.', 'Naleda ne manque pas d\enthousiasme, mais c\est une historienne, pas une soldate. Elle ne sait rien des dangers qui nous attendent sur les les aux Dragons.\n\nQuoi qu\il en soit, il n\y a pas  s\inquiter avec les Serres-Noires pour protger l\expdition.\n\nJe vais discuter des dtails logistiques de la mission avec byssian et vos pontes de la Horde.\n\nMon lieutenant, Kodethi, est en train d\explorer la ville avec les autres Dracthyrs. Faites votre devoir de $gsoldat:soldate; et dites-lui que nous nous retrouverons  la tour des zeppelins. Il transmettra mes ordres  tout le monde.', '', '', '', '', '', 'Retrouvez Naleda Mirerive  la tour des zeppelins, prs d\Orgrimmar.', 47187),
