(72246, 'frFR', 'Rves sereins', 'Parlez au grant du spa.', 'Bienvenue au spa Rves sereins!\n\nJe vous prsente toutes mes excuses, mais nous ne sommes pas en mesure d\accueillir de nouveaux clients suite  des circonstances indpendantes de notre volont!\n\nJe vous suggre de parler au grant du spa, Xijan Piquepatte. Il pourra rpondre  toutes vos questions.', '', '', '', '', '', '', 47187),
(72245, 'frFR', 'Alchimie des les aux Dragons', '', '', '', '', '', '', '', '', 47187),
(72244, 'frFR', 'Calligraphie des les aux Dragons', '', '', '', '', '', '', '', 'Parlez  Jessamine Spitz dans l\ambassade de Trve-Aile.', 47187),
(72243, 'frFR', 'Herboristerie des les aux Dragons', '', '', '', '', '', '', '', '', 47187),
(72242, 'frFR', 'Ingnierie des les aux Dragons', '', '', '', '', '', '', '', '', 47187),
(72241, 'frFR', 'Les leons de notre pass', 'Parlez  la squammandante Ardenthal.', 'Je suis Ardenthal, squammandante des Dracthyrs. Irion nous est venu en aide aprs que nous avons quitt notre longue stase, et c\est  prsent  moi de lui prter main-forte.\n\nJ\imagine que vous avez des questions sur mon peuple et son histoire. J\en avais aussi, jusqu\ peu.\n\nMais Nozdormu l\Intemporel m\a dvoil des vrits perdues sur les Dracthyrs. Il m\a montr une vision de nos origines et la raison de notre long sommeil.\n\nLaissez-moi vous raconter ce que j\ai vu.', '', '', '', '', '', '', 47187),
(72240, 'frFR', 'Les gardes d\obsidienne', 'Relayez les ordres du squammandant  Dervichane et aux gardes d\obsidienne.', 'J\admire l\enthousiasme de cette Toddy, mais j\espre qu\il ne l\aveuglera pas face aux dangers qui nous guettent sur les les aux Dragons.\n\nDans tous les cas, nous sommes les gardes d\obsidienne, et il est de notre devoir de protger l\expdition.\n\nJe dois discuter de la mission  venir avec Irion et le seigneur-commandant.\n\nLes autres dracthyrs sont en train d\explorer la ville. Cherchez Dervichane, ma fidle lieutenante, et dites-lui que nous nous retrouverons sur les quais. Elle transmettra mes ordres aux autres.', '', '', '', '', '', 'Informez Toddy Bourbon de votre succs au port de Hurlevent.', 47187),
(72193, 'frFR', 'Acadmie d\Algeth\ar', 'Visitez l\acadmie d\Algeth\ar.', 'J\ai cru comprendre que l\acadmie d\Algeth\ar a rouvert ses portes au public.\n\nIl fut un temps o ses salles sacres taient rserves aux Dragons, mais au cours des annes passes, la doyenne a compris l\intrt d\accueillir quiconque a soif de connaissance et elle m\a demand de lui recommander des lves aux talents prometteurs.\n\nEn tant qu\$galli:allie; des peuples draconiens, ce serait un honneur de vous voir intgrer notre noble acadmie. La dcision vous revient, mais je suis sr que Doragosa adorerait vous faire faire le tour du propritaire.', '', '', '', '', '', '', 47187),
(72192, 'frFR', 'Salles de l\Imprgnation: du chaos  l\ordre', 'Entrez dans les salles de l\Imprgnation et liminez le tsunami primordial.', 'Les Primalistes essaient de replonger ce monde dans le chaos lmentaire et ne reculeront devant rien pour y parvenir.\n\nJ\ai reu des informations inquitantes: les forces ennemies auraient infiltr les salles de l\Imprgnation amnages dans les profondeurs du bastion de Tyr et tenteraient d\utiliser les ouvrages du gardien titan pour leurs desseins nfastes.\n\nJe vous prie instamment de bien vouloir mettre un terme  la menace primaliste au sein de ce lieu sacr, $n.', '', '', '', '', '', '', 47187),
(72191, 'frFR', 'Rcompense de raret', '', '', '', '', '', '', '', '', 47187),
(72190, 'frFR', 'Les rserves du rservoir', 'Trouvez Zuttiki.', '$C! Je connais quelqu\un qui a grandement besoin de vos talents.\n\nLe rservoir du bastion de Tyr vient d\tre attaqu par des Primalistes. C\est un miracle que j\aie russi  m\enfuir Et j\ai bien peur que les autres n\aient pas eu cette chance.\n\nC\est juste au nord d\ici. Trouvez Zuttiki, elle vous expliquera tout.\n\nEnfin  condition qu\elle soit encore en vie.', '', '', '', '', '', '', 47187),
(72189, 'frFR', 'Varit de jardin', 'Parlez  Gryrmpech.', 'Le jardin aux Papillons vous plat?\n\nVous savez, il en existe un autre bien plus grand au sud d\ici. C\est un vieux Draknide du nom de Gryrmpech qui s\en occupe.\n\nIl n\aurait sans doute rien contre un coup de main. Il a bien un assistant, mais je ne l\ai encore jamais vu, donc je doute fort qu\il lui soit d\une grande utilit.\n\nSi vous passez le voir, dites-lui bien que c\est Xina qui vous envoie.', '', '', '', '', '', '', 47187),
