(72175, 'frFR', 'Sceptr-aculaire', 'Fabriquez $1oasceptres de spectacle: feu et $2oasceptres de spectacle: air pour Soragosa,  Valdrakken.', 'Nous avons reu des commandes hors du commun cette semaine! Les lves de l\acadmie d\Algeth\ar sont tout feu tout flammes pour ces sceptres, qui sont si divertissants.\n\nQue diriez-vous de nous aider  en fabriquer?', '', '', '', '', '', '', 47187),
(72172, 'frFR', 'Essences, clats et poussire chromatique', 'Fabriquez $1oapoussires chromatiques pour Soragosa,  Valdrakken.', 'Nous courons constamment aprs les composants les plus rudimentaires. Essences, clats mme notre stock de poussire chromatique est presque toujours  sec.\n\nSi vous voulez bien nous aider, nous arriverons peut-tre enfin  passer une journe entire sans avoir  reconstituer nos rserves.', '', '', '', '', '', '', 47187),
(72171, 'frFR', ' l\preuve des combats en solo', 'Terminez 12manches de Brassage solo.', 'L\ardeur que vous mettez  chercher la bagarre fait plaisir  voir. Si vous avez entire confiance en vos talents, moi, je demande  voir. Et puis, a me divertira.\n\nNe revenez pas me voir avant d\avoir fait vos preuves.', '', '', '', '', '', '', 47187),
(72168, 'frFR', ' l\preuve des escarmouches', 'Obtenez des points d\honneur lors d\escarmouches en arne.', 'Vous avez confiance en vos capacits tactiques? Il parat que vous autres cratures mortelles vous livrez rgulirement de petites escarmouches. Allez donc chercher des volontaires pour vous affronter.\n\nNe revenez pas me voir avant d\avoir fait vos preuves.', '', '', '', '', '', '', 47187),
(72167, 'frFR', ' l\preuve de la guerre', 'Obtenez des points d\honneur sur des champs de bataille piques.', 'Vous cherchez un vrai dfi? Vous allez tre $gservi:servie;. J\ai eu vent d\affrontements  grande chelle qui mettraient mes talents eux-mmes  rude preuve.\n\nJ\ai hte de vous voir chouer euh, de vous voir  l\uvre, pardon. Voyons si vous russissez  faire vos preuves.', '', '', '', '', '', '', 47187),
(72166, 'frFR', ' l\preuve des batailles', 'Obtenez des points d\honneur sur des champs de bataille alatoires.', 'O que vous mettiez les pieds, vous autres cratures mortelles n\aimez rien tant que vous bagarrer.\n\nAu moins, une chose est sre, le spectacle promet d\tre amusant. Pour moi, du moins. Voyons un peu comment vous vous en sortez.', '', '', '', '', '', '', 47187),
(72159, 'frFR', 'cailles de beaut', 'Rcuprez $1oapeaux cailleuses lustres pour Ralathor le Burin,  Valdrakken.', 'Les cailles ont toutes sortes d\utilisations possibles. Elles offrent une protection amliore et prsentent des proprits rflchissantes incroyables. Un grand nombre de nos miroirs en sont faits.\n\nOr, il se trouve que ces miroirs sont trs populaires. Rcuprez-moi quelques peaux cailleuses et je partagerai certains de mes secrets de fabrication avec vous.', '', '', '', '', '', '', 47187),
(72154, 'frFR', 'Skag le Lanceur', '', '', '', '', '', '', '', '', 47187),
(72137, 'frFR', 'Petit dtail', '', '', '', '', '', '', '', '', 47187),
(72135, 'frFR', 'Neltharus: Secrets enfouis', 'Rcuprez $1oanotes de Neltharion, $2oajournaux d\obsidienne et un tome de recherches  Neltharus.', 'Nous avons un problme, $gvoyageur:voyageuse;. Les Djaradins sont d\abord apparus  Neltharus, ce qui signifie que ses salles sont menaces!\n\nNeltharus contient de nombreux trsors, mais surtout d\innombrables connaissances: l\histoire de notre Vol, son dclin Sabellian et Irion sont tous deux  la recherche de plus d\informations sur la vie et l\uvre de Neltharion.\n\nAllez-y! Rcuprez tout ce que vous pourrez avant que l\ennemi ne dtruise tout!', '', '', '', '', '', '', 47187),
(72134, 'frFR', 'Une aide prcieuse', 'Utilisez la carte de reconnaissance pour choisir votre premire zone.', 'Nous avons dcouvert que les terres que nous survolons, les les Brises, rencontrent bien des problmes.\n\nNous allons faire de notre mieux pour coordonner nos efforts. J\aimerais que vous jetiez un coup d\il  cette carte et que vous dcidiez  quelle rgion venir en aide en premier.', '', '', '', '', '', '', 47187),
(72131, 'frFR', 'Surplus', '', '', '', '', '', '', '', '', 47187),
(72130, 'frFR', 'Griffon oubli', '', '', '', '', '', '', '', '', 47187),
(72129, 'frFR', 'Aider Khadgar', 'Parlez  Khadgar dans la citadelle Pourpre de Dalaran.', 'Bienvenue  Dalaran, $n. Ravi que vous soyez $garriv:arrive; sans encombre.\n\nVenez me trouver dans la citadelle Pourpre. Nous avons beaucoup  faire.', '', '', '', '', '', 'Parlez  Khadgar dans la citadelle Pourpre de Dalaran.', 47187),
