(72122, 'frFR', 'cologistes d\autrefois', 'Allez voir les cologistes introuvables.', 'Les blesss ne sont plus en danger, mais autre chose me proccupe, $n.\n\nDes cologistes draconides avaient fait un crochet par l\avant-poste avant de partir tudier les marais. Je n\ai plus aucune nouvelle depuis l\attaque et je commence  m\inquiter.\n\nSi vous comptez vous aventurer dans les marais, vous voulez bien ouvrir l\il et vous assurer de leur scurit?\n\nFaites bien attention. Il parat que cette rgion est infeste de Gorlocs.', '', '', '', '', '', '', 47187),
