(72089, 'frFR', 'Vers l\observatoire du guet du Firmament', 'Traversez les anneaux en planant.', 'Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 47187),
(72083, 'frFR', 'Mon leurre ftiche', 'Rcuprez le leurre ftiche du capitaine Haab.', 'Tel que vous me voyez, je suis au trente-sixime dessous, $r, et a a rien  voir avec le fait que je sois mort.\n\nJ\ai cass ma pipe en chassant. Je tenais  m\assurer que la bte qu\avait massacres mon quipe pourrait plus jamais remettre a. Quoi de plus naturel, hein? D\ailleurs, c\est ce que mon vieux paternel aurait voulu.\n\nNon, le problme, c\est que le combat s\est sold par une galit!\n\nL\esprit du monstre court toujours, aussi sr que je me tiens l, devant vous. Et comme je suis plus qu\un fantme, impossible de reprendre mon leurre ftiche aux bestioles qu\ont nettoy mon cadavre! Cet appt, j\en ai besoin pour faire un sort  cette sale bte.\n\nVous voulez bien me donner un coup de main?', '', '', '', '', '', '', 47187),
(72079, 'frFR', 'Festin tribal', '', '', '', '', '', '', '', '', 47187),
(72075, 'frFR', 'Coque en stock', 'Attrapez des poissons pour rapprovisionner le coin de pche et chevauchez votre drake pour les relcher par au-dessus.', 'a ne mord pas franchement, vous ne trouvez pas?\n\nVous savez quoi? a me donne une ide. Une lgende raconte que ces lacs de lave n\ont pas toujours abrit de poissons aimant particulirement la chaleur En fait, ce sont les Dragons qui auraient lch leurs proies dans ces bassins! Vous y croyez?\n\nPeut-tre que votre drake et vous pourriez essayer de faire la mme chose?', '', '', '', '', '', '', 47187),
(72072, 'frFR', 'Approvisionnement des sources draconiques', 'Attrapez des poissons pour rapprovisionner le coin de pche et chevauchez votre drake pour les relcher par au-dessus.', 'a ne mord pas franchement, hein?\n\nVous savez quoi? a me donne une ide. Une lgende raconte que ces lacs et rivires n\ont pas toujours abrit de poissons En fait, ce sont les Dragons qui auraient lch leurs proies dans ces trous d\eau! Vous y croyez?\n\nPeut-tre que votre drake et vous pourriez essayer de faire la mme chose?', '', '', '', '', '', '', 47187),
(72071, 'frFR', 'Deuxime manche, face de raie!', 'Tuez Mochoby.', 'Une petite partie de pche, a vous tente, $n?\n\nJuste au large de la cte, l, y a un banc de poissons-appts que le monstre attaque systmatiquement. Ce corniaud se souvient mme plus qu\il est mort!\n\nRendez-vous sur place  la nage et agitez ce leurre un peu partout. Dbrouillez-vous pour imiter un phoque bless, et je vous parie qu\il pourra pas rsister.', '', 'La terreur des profondeurs.\n\nElle est morte en mme temps que le capitaine Haab, mais sa soif de vengeance reste intacte malgr tout.', 'Mochoby', '', '', '', 47187),
(72068, 'frFR', 'Aider le concordat: un festin pour toutes et tous', 'Rendez-vous  Iskaara, dans la trave d\Azur, et participez  un festin tribal. Continuez  aider le concordat de Valdrakken et ses allis aux quatre coins des les aux Dragons.', 'Nos allis ont besoin de vous, $n!\n\nVos efforts aux quatre coins des les ne sont pas passs inaperus, et nos camarades du sud, les Roharts iskaariens, tiennent  clbrer vos exploits en organisant un grand festin!\n\nFaites route vers Iskaara tout en continuant  seconder les allis du concordat. Et quand vous atteindrez les eaux chatoyantes des terres du sud, profitez-en pour prendre part aux festivits!', '', '', '', '', '', '', 47187),
(72067, 'frFR', 'Relaxation totale!', 'Rendez-vous au spa Rves sereins.', 'H, vous!\n\nVous semblez $gfatigu:fatigue;. $Gpuis:puise;, mme. Vous avez besoin d\un moment de dtente. Je sais exactement ce qu\il vous faut: un tour au spa Rves sereins!\n\nNos nouveaux cours de moiga font FUREUR!  moins que vous ne prfriez un soin du visage? Je recommande notre masque de boue. Mais le mieux, c\est encore d\allier les deux!\n\nPour rejoindre le spa, dirigez-vous vers le nord en sortant de la ville!', '', '', '', '', '', '', 47187),
(72063, 'frFR', 'Le bateau-jouet de Yennu', 'Rapportez le bateau-jouet  Yennu.', 'C\est le bateau-jouet de Yennu. Il sera ravi de le rcuprer.', '', '', '', '', '', '', 47187),
