(71242, 'frFR', 'Soutien des recherches sur la tempte', 'Apportez l\amas de dbordement lmentaire  un chercheur ou une chercheuse de Valdrakken.', 'Ce gros amas dborde de l\nergie des cratures issues de la tempte primaliste.\n\nVoil qui devrait susciter l\intrt d\un chercheur ou d\une chercheuse de Valdrakken.', '', '', '', '', '', '', 47187),
(71241, 'frFR', 'Pche aux canards', 'Renclenchez les piges du clan des Aylaags dans le val Primordial.', 'Le bosquet qu\on appelle le val Primordial regorge de la magie des anciens Dragons. La fourrure d\un type de rusard de la rgion est trs prise de mon clan, mais ces animaux sont aussi discrets que difficiles  trouver.\n\nPlutt que de vous envoyer sur leurs traces, vous pourriez plutt trouver certains de nos piges et les renclencher en utilisant la viande des canards du coin. J\enverrai des membres du clan rcuprer les cratures qui s\y laisseront prendre.', '', '', '', '', '', '', 47187),
(71239, 'frFR', 'Perdue dans les cieux', 'Trouvez Harleen Sarcasiffle sur les falaises Plumebleue.', 'J\ai besoin d\un service, et vous m\avez l\air du genre serviable.\n\nUne vieille amie  moi, Harleen Sarcasiffle, devait me retrouver en ville il y a quelques jours. On avait prvu de se remplir la panse au Festin rubis, de passer au salon de coiffure et de visiter leur fameux htel des ventes.\n\nSauf qu\elle s\est jamais pointe Il lui arrive de se perdre dans son boulot, mais je prfrerais savoir qu\elle va bien.\n\nAllez donc jeter un coup d\il dans les montagnes au sud d\ici. Elle comptait y passer avant notre rendez-vous.', '', '', '', '', '', '', 47187),
(71238, 'frFR', 'Le Festin rubis!', 'Parlez aux chefs Rumiastrasza et Couac au Festin rubis.', 'Avis aux fricasseurs et fricasseuses en herbe!\n\nSi votre cur aspire aux saveurs les plus subtiles de ce monde, que vous cherchez une opportunit de vivre d\incroyables aventures et que vous n\avez pas peur de risquer votre vie pour de parfaits inconnus\n\nVenez vite vous prsenter au duo de chefs mondialement clbre, j\ai nomm les virtuoses de la cuisine Rumiastrasza et Couac! Vous les trouverez au Festin rubis organis de la ville de Valdrakken!', '', '', '', '', '', '', 47187),
(71235, 'frFR', 'Des mages de terrain', 'Allez voir les mages du Kirin Tor prs de la chute des Rusards, dans la trave d\Azur.', 'Lok\tar, $r.\n\nSi vous avez un peu de temps devant vous, nos deux mages en mission sur le terrain auraient sans doute besoin d\un coup de main.\n\nCes terres sont dangereuses, mme quand tout va pour le mieux dans le meilleur des mondes.\n\nOr, c\est loin d\tre le cas actuellement.', '', '', '', '', '', '', 47187),
(71234, 'frFR', 'Dernires nouvelles de la crique', 'Rendez-vous  la crique du Baleinier, dans la trave d\Azur.', 'Vous, l-bas, $r.\n\nVous m\avez tout l\air d\$gun grand voyageur:une grande voyageuse;.\n\nMon cousin Wayun est all pcher dans la crique du Baleinier et  son retour, il nous a dit que que d\tranges individus y avaient lu domicile.\n\nPas grand-chose  signaler de leur ct pour l\instant, mais a me rassurerait que vous alliez prendre de ses nouvelles\n\nIl manque parfois de diplomatie.', '', '', '', '', '', '', 47187),
(71233, 'frFR', 'Chute d\eau', 'Parlez  Willa au guet des Trois-Cascades, dans la trave d\Azur.', 'J\adore les cascades.\n\nVous savez ce qu\il y a de mieux qu\une cascade?\n\nDeux cascades!\n\nMieux que a, je vois pas Encore que, allez donc jeter un coup d\il au guet des Trois-Cascades, vous serez pas $gdu:due; du voyage!\n\nEn plus, l\aubergiste qui y travaille est une vraie crme.', '', '', '', '', '', '', 47187),
(71232, 'frFR', 'La renomme des les aux Dragons', 'Parlez  Thrazal  Valdrakken.', 'Il y a encore fort  faire pour venir en aide aux les aux Dragons.\n\nAllez voir Thrazal, je vous prie. Il saura vous dire qui a besoin de soutien sur ces terres.', '', '', '', '', '', 'Parlez  Thrazal  Valdrakken.', 47187),
(71231, 'frFR', 'L\appel de le chasse', 'Allez parler au matre Frodrum dans les plaines d\Ohn\ahra.', '<Roki pose le message au creux de votre main.>\n\n$n, le clan des Shikaars vous invite  sa grande chasse. Prsentez-vous au matre Frodrum dans les plaines d\Ohn\ahra.', '', '', '', '', '', '', 47187),
(71230, 'frFR', 'Matriel de pche rohart', 'Parlez  Tavio  Iskaara, dans la trave d\Azur.', 'Rebonjour, $n.\n\n<Rowie regarde autour de lui en fredonnant.>\n\nOh, c\est vrai! Tavio me fabriquait un nouveau filet et elle a dit qu\elle pourrait en faire un pour vous aussi. Mme d\autres sortes de matriel de pche si vous lui apportez tout ce qu\il lui faut.\n\nVous devriez aller la voir.', '', '', '', '', '', '', 47187),
(71229, 'frFR', 'Appel des plaines', 'Allez parler  la khan Hadari dans les plaines d\Ohn\ahra.', '<Roki vous pose un message au creux de la main.>\n\n$n, vos exploits sont arrivs jusqu\aux oreilles du clan des Aylaags. Nous vous invitons  venir  notre rencontre pour dcouvrir nos coutumes.\n\n Khan Hadari', '', '', '', '', '', '', 47187),
(71227, 'frFR', 'Dfis ariens', 'Parlez  un chronomtreur ou  une chronomtreuse de bronze pour en savoir plus sur les dfis ariens.', '<Tire-d\ailes bat des ailes avec excitation et dpose  vos pieds une note ainsi qu\un rongeur lgrement roussi.>\n\n$gChevaucheur:Chevaucheuse; de Dragon! Vos prouesses en vol sont sur toutes les lvres. Venez mettre vos talents  l\preuve dans le cadre des dfis ariens organiss aux quatre coins des les aux Dragons.\n\nAdressez-vous aux chronomtreuses et chronomtreurs de bronze pour vous lancer.', '', '', '', '', '', '', 47187),
(71226, 'frFR', 'Tuer des escargots de pierre', 'Tuez $1oa $llapin funeste:lapins funestes; sur la Place d\entranement.', ' l\aide! Ces lapins me dvorent! Je vous en supplie, massacrez-les avant qu\ils ne nous achvent tous!', '', '', '', '', '', '', 47187),
(71219, 'frFR', 'Une garde des chemins imprvisible', 'Trouvez la garde des chemins Alvi.', 'Il semblerait qu\une partie de nos gardes des chemins les plus jeunes manque  leurs devoirs depuis quelque temps.\n\nLa garde des chemins Nori m\a demand d\aller prendre des nouvelles de sa sur cadette Alvi, qui est en poste  l\entre du passage du Temps. Apparemment, ses performances rcentes laissent  dsirer.\n\nSi vous vous dirigez vers l\est et croisez sur la garde des chemins Alvi, rappelez-lui l\importance de sa mission. Et prvenez-la que sa sur s\inquite  son sujet.', '', '', '', '', '', '', 47187),
(71212, 'frFR', ' l\assaut des Fougerobes', '', '', '', '', '', '', '', '', 47187),
(71210, 'frFR', 'En route pour le donjon du Flau-des-Dragons!', 'Rendez-vous aux rivages de l\veil et participez au sige du donjon du Flau-des-Dragons avec les parias d\obsidienne.', '<Tire-d\ailes dpose un message lgrement roussi dans votre main.>\n\n$n, les parias d\obsidienne ont eu vent de vos exploits. Notre ancien quartier gnral au donjon du Flau-des-Dragons est tomb aux mains de l\arme djaradine et nous ne pouvons pas en rester l. Joignez-vous  nous et aidez-nous  reprendre le contrle de notre territoire.\n\nBoss', '', '', '', '', '', '', 47187),
(71209, 'frFR', 'La bte des plaines', 'Prenez les rnes de Lizi.', 'Je pense que Lizi est prte  retrouver sa libert. Elle vous aime autant que moi dsormais, mais je sens bien que l\appel de la nature est le plus fort.\n\nUn jour, quand je serai sage-du-vent, j\explorerai le monde qui s\tend au-del de ces sources. Mais avant a, je dois passer mes preuves d\initiation de mi-saison! Comme le temps file!\n\nJ\ai fabriqu une selle et des rnes avec la laine que vous avez rcolte. Lizi sera ravie de rpondre  votre appel.\n\nJe vous en prie, emmenez-la dans vos aventures, $p.', '', '', '', '', '', '', 47187),
