(71196, 'frFR', 'Apprivoiser une chine-de-tonnerre', 'Rcuprez $1oafluides fluorescents sur les insectes des les aux Dragons et $2oafournitures des les aux Dragons.', 'Je suis tellement heureuse que Lizi soit de retour parmi nous, saine et sauve.\n\nMalheureusement, ses blessures mettent plus de temps  gurir que prvu. J\espre que la magie qui lui a t inflige n\a pas caus de lsions irrversibles.\n\nPourriez-vous m\aider  rcolter de l\ichor sur les insectes? Je sais, a a l\air dgotant, mais c\est l\ingrdient principal de nombreux onguents.', '', '', '', '', '', '', 47187),
(71195, 'frFR', 'Apprivoiser une chine-de-tonnerre', 'Rcuprez le curry vert de Meluun dans les sources des Ohn\irs et $2oafournitures des les aux Dragons.', 'Je crois que c\est le nouveau coin prfr de Lizi. Elle n\est pas revenue  la maison depuis. C\est une bte sauvage, aprs tout.\n\nJe dois vous avouer quelque chose Je n\ai pas parl  Meluun depuis que nous avons sauv Lizi. Je sais qu\elle avait raison, mais j\ignore comment aborder le sujet. On dirait qu\elle dsapprouve tout ce que je fais. Il faudrait que je me concentre davantage sur ma formation.\n\nMeluun fait un excellent curry que Lizi adorerait. Vous pourriez lui en demander? D\ordinaire, elle travaille dans la maison de l\ohn,  l\ouest des sources.', '', '', '', '', '', '', 47187),
(71194, 'frFR', 'Grenouilles de feu', 'Apprenez  2cornpines  viter la dcoction glaciaire.', 'J\ai trouv le coin idal o poser mon filet, mais quelque chose me tracasse Les cornpines. Je vous parie qu\ils ravageront mes filets ds que j\aurai le dos tourn. Comment faire?\n\n J\ai une ide. Nous imprgnons tous nos filets de dcoction glaciaire pour les rendre rsistants  la chaleur. Il nous suffira d\apprendre  ces cornpines  garder leur distance avec cette odeur.\n\nLancez un flacon de dcoction glaciaire sur l\un d\entre eux, puis attaquez-le. Mais surtout, ne le tuez pas, sans quoi la leon n\aura servi  rien.', '', '', '', '', '', '', 47187),
(71193, 'frFR', 'Menace aquatique', 'Utilisez 5conques sinistres dans le trou de pche du bastion de Tyr pour faire apparatre une crature sous-marine gante et rapportez une preuve de sa mort.', 'Vous avez vu a, sous l\eau? Une norme bte cuirasse et affame! Hors de question que je m\approche de l\eau tant que cette monstruosit rde dans les parages. Si a vous tente, vous devriez pouvoir l\attirer avec une poigne de conques sinistres. Vous n\aurez pas de mal  en attraper.', '', '', '', '', '', '', 47187),
(71192, 'frFR', 'Contrle des prdateurs', 'Installez les effigies effrayantes.', 'Salutations, l\$gami:amie;!\n\nJe cherche un bon endroit o placer mes filets, mais le secteur est infest de coureurs qui dvorent les alevins avant mme qu\ils aient le temps d\atteindre l\ge adulte.\n\nJ\ai confectionn des pouvantails dans l\espoir d\effrayer au moins une partie de ces volatiles insatiables. Cela devrait nous aider  prserver les stocks de poisson des sources draconiques.\n\nPouvez-vous m\aider  les installer?', '', '', '', '', '', '', 47187),
(71191, 'frFR', 'Filet gagn', 'Rcuprez le filet du pcheur taciturne dans les trous de glace de la trave d\Azur.', 'Mon filet a t emport par le courant. C\est bien ma veine. <Soupire.> Je n\aime pas trop utiliser des cannes  pche comme mes amis\nSi jamais vous tombez sur mon filet en vous promenant dans les parages, pourriez-vous me le rapporter?', '', '', '', '', '', '', 47187),
(71182, 'frFR', 'Archivistes imprvisibles', 'Retrouvez Sindragosa au niveau suprieur des archives d\Azur.', 'Vous, Dracthyr.\n\nDeux de vos semblables fouillent les archives au sud d\ici. Il faut que j\aille me prsenter  eux, et je n\aurais rien contre un peu de compagnie.\n\nSi vous avez le temps, retrouvez-moi au niveau suprieur des archives.', '', '', '', '', '', '', 47187),
(71179, 'frFR', 'Rencontre au belvdre', 'Allez parler au commandant Thadezus au belvdre des Gelikyrs.', '$n, j\ai une autre tche  vous confier.\n\nOn nous a rapport des signes d\activit primaliste prs du poste Gelikyr, ce qui pourrait menacer notre contrle du bastion de Tyr.\n\nParlez au commandant Thadezus et voyez en quoi vous pouvez l\assister.', '', '', '', '', '', 'Allez parler au commandant Thadezus au belvdre des Gelikyrs.', 47187),
(71178, 'frFR', 'Portail d\accs: sanctuaire Ombrag', 'Localisez le portail d\accs inactif du sanctuaire Ombrag, dans les plaines d\Ohn\ahra.', 'Notre expdition a repr une pierre inerte sur les versants luxuriants au sud-ouest. C\est  une petite trotte d\ici, mais  mon avis, a vaut le coup d\envoyer quelqu\un de votre trempe pour l\examiner.', '', '', '', '', '', '', 47187),
