(71165, 'frFR', 'Portail d\accs: marges des ons', 'Trouvez le portail inactif aux marges des ons, en Thaldraszus.', 'Dans les lointaines rgions de Thaldraszus se trouve une petite auberge niche  flanc de montagne. Elle abrite, depuis longtemps oublie dans son entre, une pierre inactive.\n\nAlors, vous en pensez quoi? Une autre aventure, a vous dit, $n?', '', '', '', '', '', '', 47187),
(71162, 'frFR', 'Portail d\accs: Algeth\ar', 'Trouvez le portail inactif au sommet de la flche d\Algeth\ar, en Thaldraszus.', 'Une autre pierre, une autre flche.\n\nVous devriez vous mettre en route, vous avez un bon bout de chemin  faire et dangereux, en plus! En tout cas,  croire celles et ceux qui l\ont dcouvert.\n\nAlors, a vous dit toujours?', '', '', '', '', '', '', 47187),
(71161, 'frFR', 'Portail d\accs: Vakthros', 'Trouvez le portail inactif au sommet de la flche de Vakthros, dans la trave d\Azur.', 'On nous a signal une autre de ces pierres inertes dans la rgion hivernale au sud-est.\n\nMais avant que vous vous mettiez dans tous vos tats, je prfre vous prvenir: c\est pas le genre d\endroit o on va de son plein gr. Cela dit, si vous avez soif d\aventure et pas peur de mourir, vous allez vous rgaler!\n\na va, je vous l\ai bien vendu? Super!\n\nEnfilez vite vos vtements les plus chauds et partez  l\est, jusqu\ ce que le froid vous chatouille les narines, et l, continuez. Vous saurez que vous y tes quand vous commencerez  sentir votre souffle se durcir et vos os se glacer.', '', '', '', '', '', '', 47187),
(71157, 'frFR', 'Portail d\accs: observatoire du guet du Firmament', 'Localisez le portail d\accs inactif de l\observatoire du guet du Firmament, aux rivages de l\veil.', 'D\aprs certains de nos explorateurs, une autre de ces pierres se trouve au sommet de la flche au nord-est.\n\nIl parat qu\elle est assez difficile  atteindre, vu l\altitude, mais vous trouverez certainement un moyen!', '', '', '', '', '', '', 47187),
(71155, 'frFR', 'Les caveaux d\Azur', 'Arrtez la Flamme fracture dans les caveaux d\Azur.', 'Nous avons un problme, $n.\n\nLes profondeurs des archives abritent le caveau d\Azur, o j\ai de mon vivant entrepos de nombreuses curiosits magiques aussi prcieuses que redoutables.\n\nUn vaste bataillon de la Flamme fracture s\y est rcemment introduit dans l\espoir d\en dcouvrir les secrets.\n\nRendez-vous sur place et arrtez-les avant que ces misrables ne librent des forces occultes qui les dpassent.\n\nCes imbciles ignorent tout de ce qui les attend  l\intrieur.', '', '', '', '', '', '', 47187),
(71153, 'frFR', 'Expditions, objectifs bonus et scnarios, waouh', 'Accomplissez 3expditions lies aux Tortollans.', 'Prtez main-forte aux Tortollans en accomplissant 3expditions.', '', '', '', '', '', 'Retournez voir le collectionneur Kojo.', 47187),
(71152, 'frFR', 'Retour dans le grand hall', 'Retrouvez Toddy dans le grand hall.', 'Maintenant qu\on a accs aux consoles de contrle, on devrait pouvoir passer cette barrire.\n\nJe vous retrouverai dans le grand hall pour le vrifier!', '', '', '', '', '', '', 47187),
(71151, 'frFR', 'Exploration continue de portails', 'Prsentez-vous  Thaelin Sombrenclume  l\avant-poste de l\caille rubis sur les rivages de l\veil.', '<La lettre est propre et sans le moindre pli, et elle arbore le sceau de l\expdition du Dracaret.\n\nThaelin Sombrenclume fait appel  vous.>', '', '', '', '', '', '', 47187),
(71150, 'frFR', 'Exploration continue de portails', 'Prsentez-vous  Thaelin Sombrenclume  l\avant-poste de l\caille rubis sur les rivages de l\veil.', '<Une odeur dplaisante de moisissure mane du parchemin. Vous parvenez toutefois  vous concentrer et  lire le message de Thaelin, qui a besoin de votre aide pour analyser ses dernires dcouvertes.\n\nTout ce qu\il vous reste  faire, c\est de trouver comment vous dbarrasser de ce parchemin malodorant.>', '', '', '', '', '', '', 47187),
(71149, 'frFR', 'Exploration continue de portails', 'Prsentez-vous  Thaelin Sombrenclume  l\avant-poste de l\caille rubis sur les rivages de l\veil.', '<tonnamment, le messager ne vous a pas confi de sacoche ou de note cette fois, mais un objet provenant de la collection personnelle de Thaelin.\n\nEn y regardant de plus prs, vous y trouvez un minuscule message de Thaelin vous demandant de l\aide une fois de plus.>', '', '', '', '', '', '', 47187),
(71148, 'frFR', 'Exploration continue de portails', 'Prsentez-vous  Thaelin Sombrenclume  l\avant-poste de l\caille rubis sur les rivages de l\veil.', '<L\trange crature vous tend une note signe et arborant le sceau de l\expdition du Dracaret.\n\nUn appel  l\aide de quelque illustre explorateur ou exploratrice, peut-tre>', '', '', '', '', '', '', 47187),
(71146, 'frFR', 'Exploration continue de portails', 'Prsentez-vous  Thaelin Sombrenclume  l\avant-poste de l\caille rubis sur les rivages de l\veil.', '<L\apprenti explorateur vous tend un morceau de papier roul. Vous l\ouvrez et dcouvrez un message d\un vieil ami, Thaelin Sombrenclume, vous demandant de l\aide.\n\nAvant de partir, la crature tend la main vers vous, comme si elle attendait une rcompense. Quelques instants plus tard, un cri strident retentit alors que l\trange crature s\loigne, bredouille.>', '', '', '', '', '', '', 47187),
