(71144, 'frFR', 'Le cauchemar de l\Alliance', 'Tuez 10soldats de l\Alliance sans mourir alors que votre tte est mise  prix.', 'Excellent! Continuez  massacrer ces chiens de l\Alliance!\n\nTuez-en encore une bonne poigne et vous pourriez bien tablir un nouveau record, $c.\n\nMais cela ne sera pas de tout repos, car l\Alliance a mis votre tte  prix. Alors, soyez $gprudent:prudente;!\n\nPour la Horde!', '', '', '', '', '', '', 47187),
(71143, 'frFR', 'Le cauchemar de la Horde', 'Tuez 10soldats de la Horde sans mourir alors que vous tes $gpourchass:pourchasse; par les forces ennemies.', 'Fichtre! Continuez comme a!\n\nTuez quelques nergumnes de la Horde supplmentaires et votre nom restera dans les annales de l\Alliance.\n\nMais ce ne sera pas de tout repos, car la Horde a mis votre tte  prix. Alors, soyez $gprudent:prudente;!\n\nPour l\Alliance!', '', '', '', '', '', '', 47187),
(71141, 'frFR', 'Gare aux Gorlocs', 'Tuez Gurblbrblr l\Envahisseur au camp de l\Escarpade.', 'Kad\irsza est tmraire, mais elle connat les crabes mieux que personne. Les Gorlocs ont dpass les bornes!\n\nJ\ai remarqu qu\ils tournent sans cesse autour de ce Gurblbrblr. C\est mme lui qui leur a ordonn de capturer les crabes. Nous ne pouvons pas leur permettre de continuer, autant pour l\quilibre de la vie que pour la scurit de ceux qui le dfendent.\n\nTerrassez Gurblbrblr. Empchez les Gorlocs de s\tendre au-del de cette rivire!', '', 'Un Gorloc d\une taille dmesure? Il en existe bien un.', 'Gurblbrblr l\Envahisseur', '', '', '', 47187),
