(71138, 'frFR', 'Portail d\accs: confins de Rusza\thar', 'Localisez le portail d\accs inactif des confins de Rusza\thar, dans les plaines d\Ohn\ahra.', 'Une personne de l\expdition a signal la prsence d\une pierre inerte au sommet d\un promontoire des plaines d\Ohn\ahra.\n\na vous tente, une petite aventure?', '', '', '', '', '', '', 47187),
(71135, 'frFR', 'Un litige en souffrance', 'Affrontez Morglas au camp des Pelages-de-neige, dans la trave d\Azur.', 'S\il y a quelque chose que j\ai appris  force de sjourner en pleine nature, c\est qu\il faut toujours prendre les problmes  bras le corps. Quand on laisse le mal s\enraciner, la menace ne cesse de crotre et elle devient d\autant plus difficile  radiquer.\n\nDepuis ma plus tendre enfance, l\existence de Morglas est un chancre sur la face de ces montagnes et les choses ne feront qu\empirer si par malheur il venait  prendre le contrle total de la tribu des Pelages-de-neige.\n\nJ\aurais d ragir bien plus tt, mais  prsent, personne d\autre que nous ne peut rattraper ma ngligence.', '', 'L\heure est venue de mettre un terme au rgne sanglant de Morglas.', 'Morglas', '', '', '', 47187),
(71097, 'frFR', 'Une griffe secourable', 'Activez l\artfact dans la tour qui surplombe l\assemble de Cobalt et surveillez bien Venderthvan.', 'Bon, maintenant que vous avez charg l\artfact, essayons plutt de l\activer.\n\n Ben quoi, me regardez pas comme a! Vous me ferez pas croire que vous tes pas $gcurieux:curieuse; de voir s\il fonctionne.\n\nSecouez-le encore une fois, cartez-vous lentement et laissez-moi finir le travail.', '', '', '', '', '', '', 47187),
(71096, 'frFR', ' Qu\on reconnat ses vrais camarades', 'Tentez d\activer l\artfact.', '<Venderthvan se frotte les yeux et pousse un grognement de douleur.>\n\nTrs bien. Puisque vous refusez de me le donner, vous avez qu\ vous dbrouiller pour le faire fonctionner.\n\nAprs tout, j\aurai qu\ vous le prendre quand vous en aurez termin. De gr ou de force.\n\nAlors, a vient? Ragissez, bon sang! Je sais pas moi, secouez-le, pour voir.', '', '', '', '', '', '', 47187),
(71095, 'frFR', 'C\est dans l\adversit', 'Demandez  Venderthvan comment vous pouvez l\aider et faites ce qu\il vous dit.', 'Voyons ce qu\on peut faire pour aider cet animal!\n\n<Heleth se penche vers vous et se met  chuchoter.>\n\nPas de panique, on va pas le laisser nous dpouiller non plus. Au contraire, on va bien s\amuser, vous allez voir!\n\na fait des lustres que personne est venu nous voir. C\est d\un ennui!\n\n<Heleth vous adresse un clin d\il.> \n\nEt si vous lui demandiez plutt ce qu\il veut?', '', '', '', '', '', '', 47187),
(71094, 'frFR', 'La loi de l\entraide', 'Trouvez des bandages pour panser les plaies de Venderthvan dans la tour qui surplombe l\assemble de Cobalt.', 'Salut!\n\nVous tes l pour nous aider? Vous m\avez tout l\air de savoir vous rendre utile!\n\n<Heleth dsigne les Dracthyrs mal en point.>\n\nCelui-ci s\est bless l\aile en essayant de voler jusqu\ici! J\ai bien l\impression que c\est un des sales types d\en bas, mais il en faut plus que a pour me faire peur! Je vais quand mme lui donner un coup de main, ne serait-ce que pour le faire dgager de notre chemin!\n\n<Heleth bombe le torse.> \n\nJe me charge de le surveiller pendant que vous allez cherchez des bandages.', '', '', '', '', '', '', 47187),
(71093, 'frFR', 'Hritage de Tyr: les secrets du pass', 'Entrez dans Uldaman: l\hritage de Tyr, dans les terres Ingrates, et rcuprez le disque.', 'Si nous voulons empcher Raszageth de librer les autres Incarnations, nous devons rendre leur pouvoir aux Aspects.\n\nMalheureusement, les Titans sont assez proccups, et le gardien Tyr est mort depuis longtemps.\n\nLa reine Alexstrasza a propos un plan: dans les profondeurs des terres Ingrates, on trouve une installation des Titans connue sous le nom d\Uldaman, et il semblerait que des proches de Tyr y aient dissimul un disque de ses souvenirs.\n\nAttention cependant, on raconte que l\endroit grouillerait de Troggs. Rassemblez vos allis et rendez-vous  Uldaman. Rcuprez ce disque au nom de la reine des Dragons!', '', '', '', '', '', '', 47187),
