(71029, 'frFR', 'Techniques de chasse: dressage de l\animal', 'Choisissez une nouvelle technique  utiliser par votre animal lors de la grande chasse.', 'Votre renomme auprs des Maruuks a encore grandi. En rcompense de vos efforts, je vais vous apprendre  donner des ordres plus efficaces  votre animal de chasse lors des combats.', '', '', '', '', '', '', 47187),
(71028, 'frFR', 'Techniques de chasse: bndiction d\Ohn\ahra', 'Choisissez une bndiction d\Ohn\ahra  utiliser lors de la grande chasse.', 'Votre renomme auprs des Maruuks grandit. coutez attentivement, et je vous apprendrai  demander une bndiction  Ohn\ahra pour vous protger, ainsi que vos camarades.', '', '', '', '', '', '', 47187),
(71027, 'frFR', 'ON RECHERCHE: Mara\nar l\Orageux', 'Tuez Mara\nar l\Orageux dans le val Primordial et rcuprez une de ses plaques.', 'On recherche $gun chasseur:une chasseuse; extraordinaire capable d\abattre une bte dchane!\n\nUn lzard-tonnerre connu sous le nom de Mara\nar l\Orageux s\est fray un chemin depuis le fourr des chines-de-tonnerre jusqu\au val Primordial, perturbant la faune locale. Il a lectrifi l\eau, abattu des arbres et cras des nids de canards.\n\nCette menace doit tre radique. Tuez-le et apportez l\une de ses plaques au garde du khanat Jebota en guise de preuve.\n\nPuisse Ohn\ahra vous guider.', '', 'Grand perturbateur de la faune du val Primordial, ce monstre a broy le nid de canards qui a fait dborder l\tang.', 'Mara\nar l\Orageux', '', '', '', 47187),
(71026, 'frFR', 'Surmonter l\insurmontable', 'Tuez 25personnages-joueurs de la Horde de niveau70 sur les les aux Dragons.', 'Si vous autres pitres cratures mortelles avez conclu une trve, le bruit court que tout le monde n\a pas oubli ses anciens griefs.\n\nRassemblez donc quelques camarades. Je connais un endroit o vous pourrez en remontrer  vos adversaires.\n\nEt si cela peut vous motiver, j\aurai une rcompense  vous remettre en cas de victoire.', '', '', '', '', '', '', 47187),
(71024, 'frFR', 'Chaos et commotion', 'Aidez rima  enquter sur l\incident survenu au rez-de-chausse du sige des Aspects.', '$n! Avez-vous entendu ce vacarme? Il a d se passer quelque chose au rez-de-chausse.\n\nMon fidle enquteur rima tait le premier sur place. Il aura besoin de quelqu\un pour rassembler des indices pendant qu\il s\occupe d\interroger les tmoins.', '', '', '', '', '', '', 47187),
(71023, 'frFR', 'Renomme auprs du concordat de Valdrakken', 'Parlez  Unatos  Valdrakken.', 'Vos exploits sont  la hauteur de la fabuleuse rputation qui vous a $gprcd:prcde; sur les les aux Dragons.\n\nJ\aimerais vous aider davantage en vous fournissant du matriel supplmentaire. Pour ce faire, je vous invite  venir me trouver  Valdrakken.', '', '', '', '', '', '', 47187),
(71022, 'frFR', 'La loi du blier', 'Ordonnez  Tavan de faire face au blier obstin.', 'Puisque les argalis ne semblent pas avoir beaucoup de respect pour Tavan, voyons s\il peut s\occuper du blier du troupeau.\n\nC\est le mle dominant de tous les argalis du coin, et il est plutt du genre ttu. Si Tavan parvient  imposer sa volont au blier, le troupeau commencera  lui obir.\n\nIl se trouve l-bas, sur la colline. Bonne chance, Tavan. Si a ne marche pas, je crains que nous ne puissions jamais faire de toi un gardien de troupeau!', '', '', '', '', '', '', 47187),
(71020, 'frFR', 'Caveau des Incarnations: des ufs  casser', 'Rcuprez 3fragments du grand bton de la garde-couve Diurna dans le caveau des Incarnations en mode mythique.', 'La garde-couve Diurna se trouve quelque part  l\intrieur de cette forteresse; elle surveille certainement le caveau depuis sa salle. Si vous parvenez  mettre la main sur quelques morceaux de son grand bton, nous devrions pouvoir lancer un assaut direct sur son repaire.\n\nTrois fragments devraient suffire; quatre, ce serait trop.', '', '', '', '', '', '', 47187),
(71019, 'frFR', 'Caveau des Incarnations: des ufs  casser', 'Rcuprez 3fragments du grand bton de la garde-couve Diurna dans le caveau des Incarnations en mode hroque.', 'La garde-couve Diurna se trouve quelque part  l\intrieur de cette forteresse; elle surveille certainement le caveau depuis sa salle. Si vous parvenez  mettre la main sur quelques morceaux de son grand bton, nous devrions pouvoir lancer un assaut direct sur son repaire.\n\nTrois fragments devraient suffire; quatre, ce serait trop.', '', '', '', '', '', '', 47187),
(71018, 'frFR', 'Caveau des Incarnations: des ufs  casser', 'Rcuprez 3fragments du grand bton de la garde-couve Diurna dans le caveau des Incarnations en mode normal.', 'La garde-couve Diurna se trouve quelque part  l\intrieur de cette forteresse; elle surveille certainement le caveau depuis sa salle. Si vous parvenez  mettre la main sur quelques morceaux de son grand bton, nous devrions pouvoir lancer un assaut direct sur son repaire.\n\nTrois fragments devraient suffire; quatre, ce serait trop.', '', '', '', '', '', '', 47187),
(71017, 'frFR', 'La lettre de Naluki', 'Apportez la tte de poisson de Naluki au vieux Dfense-Sinistre.', 'Laissez-moi deviner Mon frre vous a dfendu d\ouvrir cette lettre, pas vrai?\n\nEt on dirait que vous avez obi. Pas tonnant qu\il ait entire confiance en vous!\n\nApportez-lui cette tte de poisson, je vous prie. Il comprendra le message.', '', '', '', '', '', 'Remettez la tte de poisson de Naluki  Dfense-Sinistre.', 47187),
(71016, 'frFR', 'La sur de Dfense-Sinistre', 'Apportez la lettre de Dfense-Sinistre  sa sur, Naluki,  Iskaara.', 'La dernire personne  contacter est ma sur, Naluki. Elle travaille actuellement  l\auberge d\Iskaara.\n\nApportez-lui cette lettre.\n\nEt surtout, ne vous avisez pas de l\ouvrir.', '', '', '', '', '', 'Apportez la lettre de Dfense-Sinistre  sa sur Naluki,  Iskaara.', 47187),
(71015, 'frFR', 'Un esprit vain dans un corps sain', 'Trouvez Varsek au promontoire Antique.', 'Varsek est l\un des Draknides les plus coriaces que cette terre ait jamais ports. Et c\est aussi un abruti de premire, mme s\il ne l\admettra jamais.\n\nAprs notre chauffoure avec Morglas, il a eu la frousse et il a dcid de se reconvertir Il a t pris d\une envie soudaine d\tudier les vestiges laisss par ses anctres. Du jour au lendemain, il nous a fauss compagnie pour se rinventer en tant qu\rudit.\n\nAllez me le chercher, et plus vite que a. De toute faon, il n\a rien  faire l-bas!', '', '', '', '', '', 'Trouvez Varsek au promontoire Antique.', 47187),
(71014, 'frFR', 'Un fidle frre d\armes furbolg', 'Trouvez Barst sur l\le de Longuegriffe.', 'Barst est l\un des Furbolgs les plus coriaces que je connaisse. Quand je pense que Morglas et sa meute l\ont vaincu Ce n\est pas rien.\n\nAux dernires nouvelles, il comptait se rendre sur une le, au large d\Iskaara, histoire de prendre sa retraite ou je ne sais quelle autre nerie de ce genre.\n\nAllez le voir et dites-lui qu\il est temps de reprendre du service.\n\nEt surtout, ne vous fiez pas  sa faon de parler. Au moindre regard de travers, il vous taillera en pices.', '', '', '', '', '', 'Trouvez Barst sur l\le de Longuegriffe.', 47187),
(71013, 'frFR', 'Point de vengeance le ventre vide', 'Pchez $2oapoissons-dard gels dans la planque de Dfense-Sinistre.', 'Maintenant qu\on peut enfin revenir  nos moutons, il va falloir qu\on discute, vous et moi. Ce Gnoll  qui vous avez parl, Morglas\n\nC\est une longue histoire, entre lui et nous.\n\na risque de prendre un moment, alors profitez-en pour pcher pendant que je vous mets au parfum. Il faut bien qu\on nourrisse tout ce petit monde. On va avoir besoin de toutes nos forces pour ce qui nous attend.', '', '', '', '', '', '', 47187),
(71012, 'frFR', 'Varsek recrut', 'Faites savoir  Dfense-Sinistre que vous avez recrut Varsek.', 'J\ai dsormais toutes les cartes en main pour lucider les mystres de cet endroit.\n\nEt surtout, pas un mot au vieux Dfense-Sinistre, compris?\n\nJe vais de ce pas aller le trouver dans sa planque. Me passer les nerfs sur Morglas me fera le plus grand bien.', '', '', '', '', '', 'Retournez voir Dfense-Sinistre.', 47187),
(71011, 'frFR', 'Recherche: lys torrentiel', 'Trouvez le lys torrentiel.', '<L\affiche est rdige dans une magnifique calligraphie.>\n\nLes archivistes prient humblement les membres de l\expdition de bien vouloir trouver le lys torrentiel pour nos archives d\artfacts.\n\nSi vous en faites l\acquisition, merci de le remettre  l\inventoriste Jakes qui vous ddommagera.\n\nDes membres de l\expdition auraient vu une puissante Primaliste portant une fleur magique au cou au belvdre des Gelikyrs de Thaldraszus.', '', 'Une puissante Primaliste d\eau porte le lys torrentiel pingl  sa capuche.', 'Alora Brisebrumeuse', '', '', 'Retournez voir l\inventoriste Jakes au camp de base du Dracaret.', 47187),
(71010, 'frFR', 'Recherche: longue-vue temporelle', 'Trouvez la longue-vue temporelle.', '<L\affiche est rdige dans une magnifique calligraphie.>\n\nLes archivistes prient humblement les membres de l\expdition de bien vouloir rechercher la longue-vue temporelle pour nos archives d\artfacts.\n\nSi vous en faites l\acquisition, merci de la remettre  l\inventoriste Jakes qui vous ddommagera.\n\nDes membres de l\expdition ont entendu un Nain se vanter de sa longue-vue magique dans les auberges du sud de Thaldraszus. Nous vous recommandons de concentrer vos recherches dans cette rgion.', '', 'Un guetteur primaliste a emmen la longue-vue temporelle en Thaldraszus pour prparer sa prochaine attaque.', 'Guetteur Mordren', '', '', 'Retournez voir l\inventoriste Jakes au camp de base du Dracaret.', 47187),
(71009, 'frFR', 'lmentaire, mon cher Draknide', 'Aidez Varsek  lucider le mystre du promontoire Antique.', 'Le vieux Dfense-Sinistre veut encore attaquer Morglas? Au risque de le dcevoir, j\ai laiss cette vie derrire moi pour me consacrer exclusivement  la qute du savoir.\n\nEn ce moment mme, je m\efforce de remonter le fil de l\histoire et d\en crire un nouveau chapitre, mais ces ruines  combien mystrieuses me donnent du fil  retordre.\n\nDs que je touche un de ces cristaux, il me dit de suivre le modle, mais je n\ai pas la moindre ide de ce que a peut bien signifier!\n\nJe vais vous dire Aidez-moi  rsoudre cette nigme et j\aiderai Dfense-Sinistre  se dbarrasser dfinitivement de Morglas.', '', '', '', '', '', '', 47187),
(71008, 'frFR', 'Recherche: cur de pierre de Cur-de-Pierre', 'Trouvez le cur de pierre de Cur-de-Pierre.', '<L\affiche est rdige dans une magnifique calligraphie.>\n\nLes archivistes prient humblement les membres de l\expdition de bien vouloir rechercher le cur de pierre de Cur-de-Pierre pour nos archives d\artfacts.\n\nSi vous en faites l\acquisition, merci de le remettre  l\inventoriste Jakes qui vous ddommagera.\n\nDes membres de l\expdition ont signal la prsence de Cur-de-Pierre dans une grotte du centre de la trave d\Azur.', '', 'Le cur de pierre de Cur-de-Pierre se trouve Vous pouvez sans doute le deviner par vous-mme.', 'Cur-de-Pierre', '', '', 'Retournez voir l\inventoriste Jakes au camp de base du Dracaret.', 47187),
(71004, 'frFR', 'Recherche: totem de lien de masse d\ohunas', 'Trouvez le totem de lien de masse d\ohunas.', '<L\affiche est rdige dans une magnifique calligraphie.>\n\nLes archivistes prient humblement les membres de l\expdition de bien vouloir rechercher le totem de lien de masse d\ohunas pour nos archives d\artfacts.\n\nSi vous en faites l\acquisition, merci de le remettre  l\inventoriste Jakes qui vous ddommagera.\n\nDes membres de l\expdition disent avoir vu un Primaliste particulirement puissant manier les pouvoirs de ce totem  la cime Chant-du-Vent, dans les plaines d\Ohn\ahra.', '', 'Le totem de lien de masse d\ohunas est en possession d\un puissant Primaliste d\air des plaines d\Ohn\ahra.', 'Prozla Bourrasque', '', '', 'Retournez voir l\inventoriste Jakes au camp de base du Dracaret.', 47187),
(71002, 'frFR', 'Le meilleur sort jamais invent', 'Lisez La tempte de mana pour les novices et dcouvrez le sort secret de Millhouse.', '<En lvitation sous l\effet de la magie des arcanes dont il est imprgn, ce grimoire enchant contient d\innombrables sorts et enchantements invents par l\esprit aussi brillant que chaotique de Millhouse Tempte-de-Mana.>', '', '', '', '', '', '', 47187),
(71001, 'frFR', 'Recherche: noyau primordial li  la terre', 'Trouvez le noyau primordial li  la terre  Neltharus.', '<L\affiche est rdige dans une magnifique calligraphie.>\n\nLes archivistes prient humblement les membres de l\expdition de bien vouloir rechercher le noyau primordial li  la terre pour nos archives d\artfacts.\n\nSi vous en faites l\acquisition, merci de le remettre  l\inventoriste Jakes qui vous ddommagera.\n\nD\aprs les archives rcemment obtenues dans la citadelle d\Obsidienne, il aurait  une poque t conserv dans le Trsor du Dragon de Neltharus, bien que son emplacement actuel demeure inconnu.', '', 'Le noyau aurait t perdu au Trsor du Dragon de Neltharus.', 'Noyau primordial li  la terre', '', '', 'Retournez voir l\inventoriste Jakes au camp de base du Dracaret.', 47187),
(71000, 'frFR', 'Barst recrut', 'Faites savoir  Dfense-Sinistre que vous avez recrut Barst.', 'Ma foi, un march est un march. Si Dfense-Sinistre a besoin d\aide pour liminer dfinitivement Morglas, il peut compter sur moi.\n\nLe peu de haine que j\ai conserv, c\est  lui et  lui seul que je le rserve. Dfense-Sinistre vous a racont ce qui s\tait pass?\n\nOn formait un bon groupe de chasse, nous autres,  tel point qu\on se croyait invincibles jusqu\au jour o on a crois la route de Morglas.\n\nNon content de nous battre  plates coutures, il en a profit pour nous humilier devant tout le monde.\n\nIl s\est servi de nous pour faire un exemple. Si vous aviez vu l\tat dans lequel il nous a laisss  la planque\n\nL\heure est venue de nous venger.', '', '', '', '', '', 'Retournez voir le vieux Dfense-Sinistre.', 47187),
(70996, 'frFR', 'Varech-moi si tu peux', 'Terrassez l\lmentaire de varech sauvage sur l\le de Longuegriffe.', 'Misre,  vous entendre, j\ai bien l\impression que Dfense-Sinistre est dans de sales draps. En temps normal, je refuserais de me mler des conflits qui ont lieu sur le continent, mais l\n\nJ\ai un compte  rgler avec Morglas. C\est une longue histoire, entre lui et moi.\n\nMais j\y pense! Avec cet lmentaire qui fait des siennes sur la plage, je ne peux pas me permettre de planter les autres sans crier gare. Je suis le seul ici  pouvoir lui tenir tte. Le bougre est pire encore qu\une anguille au sens propre comme au sens figur.\n\nVoil ce que je vous propose Vous allez tuer ce monstre pour moi, et en change, j\irai voir Dfense-Sinistre dans son camp.\n\nAlors, qu\est-ce que vous en dites?', '', 'C\est parti!', 'lmentaire de varech', '', '', '', 47187),
(70995, 'frFR', 'Recherche: crne de Fenistrasza', 'Trouvez le crne de Fenistrasza.', '<L\affiche est rdige dans une magnifique calligraphie.>\n\nLes archivistes prient humblement les membres de l\expdition de bien vouloir trouver le crne de Fenistrasza pour nos archives d\artfacts.\n\nSi vous en faites l\acquisition, merci de le remettre  l\inventoriste Jakes en change d\une compensation.\n\nDes membres de l\expdition l\auraient aperu entre les mains d\un paria djaradin dans les montagnes de l\ouest, mais personne n\a encore russi  le convaincre de s\en sparer.', '', 'Un Djaradin isol expose le crne enchant dans une alcve.', 'Tarjin l\Aveugle', '', '', 'Retournez voir l\inventoriste Jakes au camp de base du Dracaret.', 47187),
(70994, 'frFR', 'Solutions de drainage', 'Siphonnez $1oaruisseaux scintillants dans la grotte  l\est du caveau d\Essence.', 'a vous dirait d\assister le plus grand gologue de l\expdition du Dracaret? Eh oui. C\est bien moi. Et je suis dans le ptrin!\n\nJ\tudiais cette rivire pour y trouver de nouveaux chantillons sdimentaires quand l\eau s\est retire avec les morceaux de limon les plus intressants!\n\nJ\ai avec moi mon dispositif de capture d\eau brevet, mais il me manque quelqu\un pour aspirer ces lmentaires.\n\nVous vous sentez  la hauteur de la tche?', '', '', '', '', '', '', 47187),
(70992, 'frFR', 'Recherche: cerf-volant rohart perdu', 'Trouvez le cerf-volant rohart perdu.', '<L\affiche est rdige dans une magnifique calligraphie.>\n\nLes archivistes prient humblement les membres de l\expdition de bien vouloir rechercher le cerf-volant rohart perdu pour nos archives d\artfacts.\n\nSi vous en faites l\acquisition, merci de le remettre  l\inventoriste Jakes en change d\une compensation.\n\nDes membres de l\expdition auraient vu un tel cerf-volant accroch  un transport rohart sur la cte ouest, mais personne n\a russi  l\atteindre, car le transport continue de s\loigner.', '', 'Le cerf-volant suit la course de l\Arvillo perdu', 'Cerf-volant rohart perdu', '', '', 'Retournez voir l\inventoriste Jakes au camp de base du Dracaret.', 47187),
(70990, 'frFR', 'Laine sauvage', 'Tondez des argalis sabot-abrupt pour rcuprer leur laine.', 'Si le gros de notre laine provient de nos propres troupeaux, il nous arrive aussi parfois de nous servir dans la nature lorsque nos argalis viennent  manquer.\n\nOn trouve un certain nombre de spcimens sauvages dans les plaines des environs, au caractre bien plus tremp que ceux de notre clan. Si vous vouliez bien prendre cette lame pour tenter de les tondre, vous rendriez un fier service aux Aylaags.', '', '', '', '', '', '', 47187),
(70989, 'frFR', 'Esprit de meute', 'Chassez le drake vorace avec Tavan et la meute de bakars.', 'Peut-tre que votre bakar a besoin de voir comment chassent ceux de son espce.\n\nPrenez quelques-uns de nos bakars expriments et emmenez-les chasser le proto-drake qui survole les environs.\n\nVoyons comment Tavan se comporte en meute!', '', '', '', '', '', '', 47187),
(70987, 'frFR', 'Curs de mas', 'Parlez  Mliane Enorath aux ruines du caveau d\Essence, sur les rivages de l\veil.', 'Quoi de mieux qu\un repas que l\on peut emporter avec soi quand on part  l\aventure?\n\nPartout dans le monde, la cuisine de rue est la substantifique moelle des villes o l\on vit  cent  l\heure. Mais tous les plats ne sont pas adapts  une consommation sur le pouce. Voyager, a creuse, et on a besoin de crales et de fculents pour tenir le coup. Pains, pommes de terre, riz et autres sont au cur de la cuisine  emporter.\n\nJ\aimerais faire goter  ma collgue pandarne ici prsente un mets particulirement savoureux qu\on appelle le mas bondissant. C\est Couac qui me l\a fait dcouvrir lorsque nous avons fait connaissance prs des ruines des Titans, sur les rivages de l\veil.', '', '', '', '', '', '', 47187),
