(70985, 'frFR', 'L\claireuse esseule', 'Parlez aux Dryades dans le sanctuaire Ombrag.', 'Je sais, je sais, c\est idiot. Une Centaure et une Dryade on ne peut pas tre plus diffrentes.\n\nDepuis que j\ai pos les yeux sur les jardins d\meraude, je meurs d\envie de mieux les connatre. Mais rien que je puisse dire ou faire ne semble digne de leur intrt.\n\nIl parat qu\elles aiment les plantes. Et les bbs animaux mignons. Et peut-tre mme tuer les braconniers, mais je ne sais pas par o commencer.\n\nVous leur parlez, n\est-ce pas? Pourriez-vous leur demander ce qu\elles aiment? Comme a, je pourrais peut-tre avoir ma chance.', '', '', '', '', '', 'Retournez voir l\claireuse Santouun.', 47187),
