(70981, 'frFR', 'Saveurs marines', 'Parlez  Wayun  la crique du Baleinier, dans la trave d\Azur.', 'Vous sentez, $n? C\est l\odeur du grand large! Percevez-vous cette vaste palette de saveurs minrales savamment releves par le sel de mer?\n\nIl manque un mets de choix parmi les dlices que nous avons prpars aujourd\hui. Une varit de poisson fort rare que j\ai eu la chance de goter autrefois  Iskaara, dans la trave d\Azur, o deux compres roharts faisaient rtir  la broche un beau spcimen dont les armes subtils se rpandaient aux quatre coins de la toundra!\n\nVoyez si vous pouvez nous trouver l\un de ces poissons. Je vous parie que nos htes tomberont comme moi sous le charme de ses saveurs marines.', '', '', '', '', '', '', 47187),
