(70976, 'frFR', 'Farniente et promenade en luge', 'Allez voir Kiopo sur l\le au sud-est.', 'Comme vous le savez peut-tre dj, les enfants d\Iskaara sont particulirement autonomes. Ds leur plus jeune ge, on leur apprend  se dbrouiller sans l\aide de personne.\n\n partir d\un certain ge, nos jeunes filent en douce pour se rendre sur l\iceberg, au sud-ouest. C\est une sorte de rite initiatique, si vous voulez. Kiopo, l\an de notre progniture, y est en ce moment mme. Dites-lui que vous venez de ma part et il vous offrira l\une de nos luges!\n\nAh, tout a me rappelle ma jeunesse quand nous partions  l\aventure avec mes camarades', '', '', '', '', '', '', 47187),
