(70970, 'frFR', 'De bonnes intentions', 'Arrtez Alia Lever-de-Soleil et dtruisez le Valthrux.', 'Je crois savoir o est cach l\artfact. J\ai entendu Alia murmurer comme une damne quand vous avez rapport tous ces artfacts.\n\nElle n\arrtait pas de rpter quelque chose  propos d\une grotte qui exercerait une attraction irrsistible sur les araignes.\n\nComme il n\y a pas de grotte dans les parages, j\en viens  penser qu\elle se trouve peut-tre quelque part dans les profondeurs des ruines.\n\nNous, on reste ici pour vous assurer une chappatoire en cas de besoin, $n. Je vous en prie, sauvez Alia et dtruisez cet artfact maudit.', '', 'Reste  esprer qu\on arrive  temps, avant qu\Alia ne succombe au pouvoir impie de cet artfact.', 'Valthrux', '', '', '', 47187),
