(70958, 'frFR', 'Festin de truffes extrafines', 'Parlez  la capitaine de la garde Sinjoirmi  la Confluence Temporelle de Thaldraszus.', 'La cuisine gastronomique dcoule naturellement de l\association des meilleures techniques et des ingrdients les plus savoureux qui soient. C\est un plaisir que l\on croit trop souvent rserv aux classes privilgies, mais nous ne voulons pas de a au Festin rubis!\n\nCouac a trouv l\ingrdient idal pour le thme d\aujourd\hui. Un aliment si rare et si exquis qu\il n\existe pas encore  ce jour! Allchant, n\est-ce pas?\n\nLe Vol de bronze a dcouvert un portail menant  un avenir particulirement dangereux. Un avenir dans lequel on trouve une truffe noire au parfum indescriptible!\n\nIl faut que vous y alliez!', '', '', '', '', '', '', 47187),
(70957, 'frFR', 'La mer de l\ouest', 'Parlez  Brindemiel au sanctuaire Ombrag, dans les plaines d\Ohn\ahra.', 'Vous tes $gtomb:tombe; sous le charme de notre contre verdoyante, $n?\n\nToute cette verdure me rappelle un plat que deux surs dryades et leur gentil compagnon trant m\ont fait goter un jour. Brindemiel, c\est ainsi qu\il s\appelle, et il habite le sanctuaire Ombrag, sur la cte ouest des plaines.\n\nC\tait un savant mlange d\herbes fraches, de lgumes et d\pices, avec en son cur une belle couche du varech le plus dlicieux que j\aie jamais mang!\n\nQuoi? Vous n\avez jamais mang de varech? Bon, vous savez ce qu\il vous reste  faire. Et surtout, n\oubliez pas d\en rapporter suffisamment pour tout le monde!', '', '', '', '', '', '', 47187),
(70956, 'frFR', 'On n\y voit que du bleu', '', '', '', '', '', '', '', '', 47187),
(70955, 'frFR', 'Une dcouverte fascinante', '', '', '', '', '', '', '', '', 47187),
