(70946, 'frFR', 'L\artfact de la perdition', 'Persuadez Alia de dtruire le Valthrux.', ' en croire les informations que vous avez recueillies, le pouvoir de cet artfact aurait scell la perte de quiconque a cherch  s\en servir.\n\nLes Draconides qui vivaient ici se sont entretus pour se l\approprier, et les agents de la Flamme fracture commencent eux aussi  succomber  son influence.\n\nCe genre d\artfact ne nous servirait  rien, bien au contraire. Il nous faut le dtruire avant qu\il ne fasse davantage de victimes.\n\nReste  convaincre Alia et Kattigat.', '', '', '', '', '', '', 47187),
(70945, 'frFR', 'Un filet qui m\aille', '', '', '', '', '', '', '', '', 47187),
