(70941, 'frFR', 'Coins de pche', 'Parlez  Nunvuq  Iskaara, dans la trave d\Azur.', 'Rebonjour! Vous saviez que je vais devenir le meilleur des meilleurs pcheurs du village? J\ai attrap un piranha gant, une fois. Mme qu\il a essay de me manger tout cru!\n\n<Rowie regarde autour de lui d\un air distrait.>\n\nOh, c\est vrai! J\ai un message pour vous. Nunvuq vous attend  Iskaara, il veut vous parler des coins de pche.', '', '', '', '', '', '', 47187),
(70940, 'frFR', 'Rcits des champions et championnes roharts', '', '', '', '', '', '', '', '', 47187),
(70939, 'frFR', 'Ustensiles de cuisine', '', '', '', '', '', '', '', '', 47187),
(70938, 'frFR', 'Festins tribaux', 'Parlez au Gros Kinook  Iskaara, dans la trave d\Azur.', 'Vous tombez bien, $n! C\est l\heure de la soupe!\n\nVous avez intrt  foncer  Iskaara en quatrime vitesse, parce que le Gros Kinook vous cherche.\n\nUne fois, il m\a demand de lui apporter un poisson-hrisson, mais comme je les trouve dgotants, je lui ai dit: Pas moyen!.\n\nIl a piqu une telle colre que j\ai bien cru qu\il allait me jeter dans la soupe!', '', '', '', '', '', '', 47187),
(70937, 'frFR', 'Ce qu\tait autrefois le Valthrux', 'Trouvez des indices quant  la vritable nature du Valthrux.', '<To\tik murmure  votre oreille.> \n\nJe n\aime pas a. Des artfacts mystrieux qui promettent monts et merveilles, moi, a ne me dit rien qui vaille.\n\nPour autant, on ne peut pas se contenter de tourner les talons, sans quoi la Flamme fracture fera main basse sur ce truc\n\nJe connais bien les ruines de ce genre. Les Dragons bleus y ont frquemment laiss des notes sur leurs travaux. Ouvrez l\il, et vous en trouverez peut-tre dans les parages.\n\nTout indice susceptible de mettre en garde Alia et Kattigat est bon  prendre.', '', '', '', '', '', '', 47187),
(70936, 'frFR', 'Totems roharts vols', '', '', '', '', '', '', '', '', 47187),
(70935, 'frFR', 'Attraper et relcher: dorade nageoire-des-les', '', '', '', '', '', '', '', '', 47187),
(70932, 'frFR', 'Le piment de la vie', 'Parlez  Eskrokar au trne d\Obsidienne.', 'Pour beaucoup, la viande est un aliment indispensable  tout repas digne de ce nom. Mais qu\est-ce qui est indispensable  un bon plat de viande, je vous le demande?\n\nLes pices, bien sr!\n\nEt justement, il existe sur ces les une pice qui surpasse toutes les autres en termes de saveur, de texture et de raret. Malheureusement, on la trouve exclusivement sur les lmentaires qui vivent dans les profondeurs du bastion d\Obsidienne, un secteur actuellement occup par les troupes djaradines.\n\nPeut-tre pourriez-vous en discuter avec ce Troll que j\ai rencontr sur place Un certain Eskrokar, si mes souvenirs sont bons.', '', '', '', '', '', '', 47187),
(70931, 'frFR', 'Fragments murmurants', 'Rcuprez $1oafragments murmurants auprs de la Flamme fracture.', 'Je pense que le Valthrux cherche  communiquer avec nous par l\intermdiaire de l\clat que nous avons rcupr.\n\nNous pouvons tourner ceci  notre avantage tant que nous prenons garde de ne pas laisser son influence s\insinuer dans notre esprit.\n\nJ\avais tort,  propos de la Flamme fracture. Ces misrables ont malheureusement russi  mettre la main sur plusieurs fragments.\n\n en croire les murmures du Valthrux, la concurrence ne va pas tarder  localiser son emplacement exact.\n\nAllez vite leur reprendre ces clats avant qu\on se fasse coiffer au poteau!', '', '', '', '', '', '', 47187),
(70930, 'frFR', 'Du th et rien que du th', 'Parlez  Lilial Aubclat dans le val de Tremble-Toile.', 'Aujourd\hui, nous mettons le th  l\honneur, qu\il soit chaud, glac ou autre! Nous avons aussi de succulents petits gteaux et biscuits.\n\n ce propos, il y a sur les les un ingrdient rare qui donnerait une nouvelle dimension gustative  nos crations! Dans les profondeurs du val de Tremble-Toile, au sein d\un territoire infest de rampantes, pousse une varit de buisson dont les feuilles font merveille sur le moral, j\ai nomm la sagitte de Morsebise.\n\nL\expdition du Dracaret ayant explor les lieux rcemment, ses membres pourront peut-tre vous aider  en dnicher.', '', '', '', '', '', '', 47187),
