(70919, 'frFR', 'L\idole de la mare', 'Ramenez le caneton embull au camp des cologistes.', '<Ce caneton est rest embull si longtemps qu\il s\est endormi. Il cancane doucement tout en ronflant.>\n\n<Les cologistes sauront peut-tre quoi faire pour l\aider>', '', '', '', '', '', 'Ramenez le caneton embull au camp des cologistes.', 47187),
(70918, 'frFR', 'Sauver ses plumes', 'Ramenez le caneton embull au camp des cologistes.', '<Ce caneton cancane frntiquement. Si personne ne l\aide, il risque d\nerver les Gorlocs!>\n\n<Les cologistes sauront peut-tre quoi faire pour l\aider>', '', '', '', '', '', 'Ramenez le caneton embull au camp des cologistes.', 47187),
(70917, 'frFR', 'Copains comme canards', 'Ramenez le caneton embull au camp des cologistes.', '<Ce caneton est terriblement nerveux. Il semble press de se sortir de l\embarras.>\n\n<Les cologistes sauront peut-tre quoi faire pour l\aider>', '', '', '', '', '', 'Ramenez le caneton embull au camp des cologistes.', 47187),
