(70893, 'frFR', 'Festin tribal', 'Ralisez $1oatches lors du festin tribal.', 'Notre festin tribal a lieu en ce moment mme! Tout le monde met la main  la pte pour prparer la meilleure soupe possible.\n\nVous devriez vous joindre  nous!', '', '', '', '', '', '', 47187),
