(70883, 'frFR', 'Main verte', 'Allez voir Gryrmpech dans les jardins d\Unit.', 'Bien le bonjour. J\ai reu des nouvelles de notre jardinier en chef, Gryrmpech. Il semblerait que les jardins soient dans un triste tat, mais je ne saurais pas dire si c\est anormal.\n\nIl m\a affirm qu\il avait la situation bien en mains, ou au bout de sa pelle, plus prcisment. Je ne sais pas trop ce qu\il entend par-l, mais il vous en dira plus,  n\en pas douter. Allez donc le voir, il vous fournira tout l\quipement requis.', '', '', '', '', '', '', 47187),
(70882, 'frFR', 'Fournitures de renom', '', '', '', '', '', '', '', '', 47187),
(70880, 'frFR', 'Cuisiner avec raffinement', '', '', '', '', '', '', '', '', 47187),
(70879, 'frFR', 'Rapport sur les rebelles', 'Allez voir la capitaine Drine au dernier tage du sige des Aspects.', 'Ce n\est pas un mince exploit que nous avons accompli aujourd\hui. N\est-ce pas, $n?\n\nNos efforts pour mettre un terme aux activits nfastes de ces rebelles  la solde des Primalistes ont port leurs fruits. Pour l\instant, du moins.  compter d\aujourd\hui, nous devrons rester sur nos gardes au cas o de nouvelles dissensions clateraient.\n\nRetournez voir la capitaine Drine ds que vous le pourrez. Notre rapport l\intressera.', '', '', '', '', '', '', 47187),
(70878, 'frFR', 'Anneau de feu', 'Protgez Maldra Langue-de-Feu pendant qu\elle scelle le portail des Primalistes.', 'Dans les plus profonds recoins de la caverne Braisardoise, les Primalistes ont rig un portail ardent qui leur permet d\invoquer des lmentaires.\n\nJe suis capable de le sceller, mais mon intervention attirera la fureur de ce qui se trouve de l\autre ct. Et nous pouvons galement compter sur une visite de Magmaticus, le revenant que les Primalistes ont aid.\n\nJ\aurai besoin de votre protection pour les arrter.', '', 'Ce revenant incendiaire dchan doit tre limin avant que les Primalistes ne le lchent sur les les aux Dragons.', 'Magmaticus', '', '', '', 47187),
(70877, 'frFR', 'Sauvetage de palmipde', 'Ramenez le caneton embull au camp des cologistes.', '<Ce caneton est abattu. Il cancane faiblement et darde son regard terrifi dans toutes les directions.>\n\n<Les cologistes sauront peut-tre quoi faire pour l\aider>', '', '', '', '', '', 'Ramenez le caneton embull au camp des cologistes.', 47187),
(70876, 'frFR', 'Fracture de focalisateur', 'Dtruisez $1oafocalisateurs primalistes dans la caverne Braisardoise.', 'Si Maldra dit vrai, c\est dans la caverne Braisardoise que les rebelles faonnent leurs pierres runiques.\n\n en juger par la nature de ces appareils, on sait que des focalisateurs primalistes sont en cause.\n\nDtruisez-les. Vous les reconnatrez sans peine quand vous les verrez.\n\nNous devons empcher les rebelles de crer d\autres armes aussi destructrices.', '', '', '', '', '', '', 47187),
(70875, 'frFR', 'Le pire du pire', 'Tuez $1oarebelles et $2oalmentaires dans la caverne Braisardoise.', 'Les rebelles de la caverne Braisardoise vouent une fidlit sans faille aux Primalistes. C\est donc une terrible menace pour Valdrakken.\n\nliminez-les ainsi que tous les lmentaires sous leur contrle.', '', '', '', '', '', '', 47187),
(70874, 'frFR', ' travers le mur de feu', 'Recevez la bndiction lmentaire de Maldra.', 'Les rebelles dans la caverne bnficient d\une bndiction lmentaire, ce qui leur permet de traverser le mur de feu sans se brler. Je peux vous accorder cette mme bndiction.\n\nNe vous en faites pas. Plusieurs personnes ont t bnies sous mes yeux. Je ne devrais avoir aucun problme  reproduire les bons gestes.', '', '', '', '', '', '', 47187),
(70873, 'frFR', 'Chasse aux cascades', 'Collectez $1oagranules de la Chute d\eau.', 'La vritable menace se tapit dans la caverne Braisardoise. C\est l que les pierres runiques sont tailles et imprgnes d\un feu primordial.\n\nVous avez certainement remarqu le mur de flammes qui en bloque l\entre. Je ne peux pas le dissiper, mais nous allons contourner le problme. Grce  la Chute d\eau, nous devrions pouvoir le traverser sans encombre.\n\nRcuprez des granules d\eau sur les lmentaires  proximit.', '', '', '', '', '', '', 47187),
(70871, 'frFR', 'Filet de pche iskaarien', 'Apportez les matriaux  Tavio pour qu\elle fabrique un filet de pche iskaarien.', 'Je vois que vous vous entendez bien avec les gens du village.\n\nVous dites que vous voulez en savoir plus sur nos techniques de pche? Eh bien, pour commencer, personne ne pche  la main. Je peux vous fabriquer un filet bien solide, digne d\Iskaara.', '', '', '', '', '', '', 47187),
(70867, 'frFR', 'Le donjon des Plaiedcailles', '', '', '', '', '', '', '', '', 47187),
(70859, 'frFR', 'Ce que contemple le gardien', 'Rcuprez l\clat murmurant auprs d\Edavix, le gardien corrompu.', 'Je vous remercie pour votre aide, $c. J\ai t la premire des mages du Kirin Tor  dcouvrir l\existence du Valthrux et des vises de la Flamme fracture.\n\nLa rcupration et l\analyse de ce puissant artfact que l\on dit dot d\une conscience sont de la plus haute importance, et vous pouvez me croire quand je vous dis que personne ne me volera mon heure de gloire.\n\nQuand la Flamme fracture se contente de ttonner  sa recherche, j\ai employ ma magie pour nous tracer un chemin jusqu\ lui.\n\nIl y a dans les parages un gardien corrompu ayant en sa possession un clat magique issu du Valthrux et dont je vais avoir besoin pour localiser le reste de l\artfact.', '', 'Gardien corrompu par le pouvoir du Valthrux, dtenteur des secrets permettant de localiser l\artfact.', 'Edavix', '', '', '', 47187),
(70858, 'frFR', 'Remise en service', 'Administrez l\antidote glacial  Alia Lever-de-Soleil.', 'Bien, l\antidote est prt. Je vais immobiliser Alia pendant que vous versez le contenu du flacon dans sa bouche.\n\nJ\espre qu\elle s\en sortira Nous avons besoin de sa magie pour remonter la piste de cet artfact.', '', '', '', '', '', 'Parlez  Alia Lever-de-Soleil.', 47187),
(70856, 'frFR', 'limination par le feu', 'Dtruisez $1oacadavres infects avec la torche lance-flammes.', 'Ces salets d\araignes pondent leurs ufs dans les cadavres.\n\nEnfin, quand elles ne jettent pas leur dvolu sur des victimes bien vivantes\n\nD\ailleurs, plusieurs membres de la Flamme fracture en ont galement fait les frais.\n\nSi nous voulons survivre ici et vaincre notre adversaire, ces ufs ne doivent surtout pas clore.\n\nPrenez cette torche imprgne du pouvoir de l\air et du feu. Il vous suffira de l\orienter dans la direction de la cible  incendier, et elle se chargera du reste.\n\nNous autres Roharts, on ne plaisante pas avec les araignes, raison pour laquelle j\ai prvu le ncessaire.', '', '', '', '', '', '', 47187),
(70854, 'frFR', 'Alors, comment a s\est pass?', 'Retournez voir Jyhanna  la nourricerie draconique de Valdrakken.', 'Vous avez bien travaill, $n. Lubbins va beaucoup mieux, son moral est au beau fixe.\n\nJyhanna sera ravie de l\apprendre, vous devriez y retourner et lui annoncer la bonne nouvelle!', '', '', '', '', '', '', 47187),
(70853, 'frFR', 'Une amie pour Lubbins', 'Capturez une mouche-farouche dans le domaine Sauvage des rivages de l\veil.', 'Comme je vous l\ai dit, Lubbins a besoin de deux choses: de l\amiti et un bon combat.\n\nJe crois que nous pouvons faire d\une pierre deux coups.\n\nCette zone est un terrain de reproduction de choix pour les mouches-farouches. En cherchant un peu, vous devriez en apercevoir un certain nombre.\n\nN\oubliez pas, vous devrez les affaiblir avant de pouvoir les capturer avec votre pige.\n\nRevenez me voir quand vous en aurez attrap une. Elle sera peut-tre un peu esquinte, mais j\ai des pierres de combat d\entranement pour la remettre en forme en un claquement de doigts!', '', '', '', '', '', '', 47187),
(70851, 'frFR', 'Sauvagerie inne', 'coutez Haniko vous dire ce dont Lubbins a besoin.', 'Il y a beaucoup de choses que vous devez savoir. Discutons un peu avant de dcider de ce qui convient le mieux  Lubbins.', '', '', '', '', '', '', 47187),
(70850, 'frFR', 'Maldra est dans le ptrin', 'Sauvez Maldra d\Orian Eaunoire.', 'Excellent travail. Pendant que vous vous occupiez de semer la pagaille, j\en ai profit pour explorer le camp. Et contre toute attente, j\y ai retrouv une vieille amie  moi, Maldra Langue-de-Feu.\n\nElle avait disparu depuis quelque temps, et la rumeur affirmait qu\elle avait rejoint les rebelles. En ralit, elle est leur prisonnire!\n\nNous ne pouvons pas la laisser ici. Arrachez-la aux griffes de son gelier draconide!', '', 'Ce chef rebelle retient Maldra Langue-de-Feu captive  l\aide de chanes d\eau primordiale.', 'Orian Eaunoire', '', '', '', 47187),
(70849, 'frFR', 'Besoin d\une spcialiste', 'Parlez  Haniko dans le domaine Sauvage des rivages de l\veil.', 'Lubbins s\en sort bien mieux maintenant, mais je pense qu\il a encore besoin d\aide.\n\nIl y a quelque temps, j\ai rencontr une Vulprine trs intelligente de l\expdition du Dracaret nomme Haniko. Elle travaille beaucoup avec les proto-drakes et est aussi dresseuse de mascottes. Je suis sre qu\elle pourrait aider Lubbins!\n\nIl me semble qu\elle se rendait aux rivages de l\veil. Nul doute que vous la trouverez si vous allez l-bas.\n\nJe suis ravie d\avoir pu vous aider!\n\n<Elle vous salue joyeusement.>\n\nAu revoir! Bonne chance, Lubbins.', '', '', '', '', '', '', 47187),
(70848, 'frFR', 'Insigne draconique oubli', 'Apportez l\objet  Exadria.', '<Cet objet pourrait intresser Exadria.>', '', '', '', '', '', '', 47187),
(70847, 'frFR', 'Amulette d\obsidienne ancienne', 'Apportez l\objet  la traque-serre Kavia.', '<La traque-serre Kavia sera sans doute intresse par ceci.>', '', '', '', '', '', '', 47187),
(70845, 'frFR', 'Dans les pas de Tyr', 'Trouvez la premire preuve de Tyr dans la trave d\Azur.', 'Le gardien Tyr a par  toute ventualit. Il a cr le moteur de l\Innovation en sachant qu\il faudrait un jour aider les spcialistes en artisanat du royaume  atteindre de nouveaux sommets. Son moteur est ainsi capable de crer un matriau unique pouvant confrer  un objet un niveau d\expertise dpassant tout ce qui est mortellement possible.\n\nIl m\a ensuite cre pour veiller  ce que le moteur ne soit pas utilis  mauvais escient. J\ai la charge de jauger celles et ceux qui entendent s\arroger sa puissance.\n\nVous sentez-vous  la hauteur de cette preuve?', '', '', '', '', '', 'Trouvez la premire preuve de Tyr dans la trave d\Azur.', 47187),
(70843, 'frFR', 'Des pierres runiques  ruiner', 'Dtruisez les caches de pierres runiques incendiaires.', '<Cette pierre runique est trangement similaire  celle que les rebelles ont tent de placer  Valdrakken.\n\nSi celle-ci n\est pas termine, vous en apercevez d\autres compltes un peu plus loin.\n\nAutant dtruire ces caches avant que les rebelles ne puissent s\en servir.>', '', '', '', '', '', '', 47187),
(70842, 'frFR', 'Emplacements des explosions', 'Rcuprez des cartes du val Brumeux.', 'Si les rebelles ont document des attaques  venir, ce dont je ne doute pas, nous devons dcouvrir ce que mijote l\adversaire avant que cela ne se produise.\n\nFouillez leur camp  la recherche de cartes marques comme celle que nous avons trouve  Valdrakken.', '', '', '', '', '', '', 47187),
(70841, 'frFR', 'D\autres reliques des Titans', '', '', '', '', '', '', '', '', 47187),
