(70838, 'frFR', 'La cause rebelle', 'Tuez $1oarebelles et Primalistes.', 'La cachette des rebelles nous la cherchions depuis longtemps. Quelle chance que la ngligence de leur tratre nous ait montr la voie!\n\nMes congnres sont tombs bien bas, pour pactiser avec les Primalistes. Nous ne pouvons pas les laisser faire. liminez les rebelles et leurs acolytes primalistes avant que ces misrables ne causent encore plus de dgts.', '', '', '', '', '', '', 47187),
(70837, 'frFR', 'Sur la piste des indices', 'Retrouvez l\enquteur rima dans le val Brumeux.', '<L\enquteur rima examine la carte.>\n\nIl n\y a aucun doute  avoir sur la signification de la croix griffonne sur le sige des Aspects.\n\nQuant au cercle qui entoure le val Brumeux c\est peut-tre la prochaine cible des rebelles. Ou une base d\o ils montent leurs oprations.\n\nJe ne vois qu\une seule faon d\en avoir le cur net. Retrouvez-moi dans le val.', '', '', '', '', '', '', 47187),
