(70781, 'frFR', 'Les grandes bleues', 'Trouvez Harleen Sarcasiffle sur les falaises Plumebleue.', 'Vous avez vu a?!\n\nCette crature aile vient de tomber du ciel! Je ne sais pas de quelle espce il s\agit, mais elle ne vient pas des les.\n\nUn instant Je me souviens qu\une petite Gobeline nergique m\a demand son chemin sur les falaises Plumebleue qui nous surplombent. Elle sait peut-tre ce qui s\est pass?', '', '', '', '', '', '', 47187),
