(70779, 'frFR', 'Les fables de Tarjin', 'Rcuprez $1oacrnes de Dragons impressionnants sur de puissants Dragons et proto-dragons des les aux Dragons.', '<Tarjin ne dtourne pas le regard de l\le distante tandis qu\il s\adresse  vous.>\n\nVous vous pensez digne des incroyables lgendes djaradines?\n\nAlors que vous ne faites mme pas la taille d\une de nos armes? Pff!\n\nJe doute que vous ayez les paules pour assumer l\hritage de mon peuple.\n\nEssayez donc de me prouver le contraire. Cherchez des Dragons, les seuls dignes de nous affronter sur ces les.\n\nApportez-moi la preuve de votre victoire contre leurs meilleurs lments.', '', '', '', '', '', '', 47187),
