(70750, 'frFR', 'Aider le concordat', 'Continuez  aider le concordat de Valdrakken et ses allis aux quatre coins des les aux Dragons.', 'Vous, l-bas! Oui, c\est  vous que je parle! Vous voyez quelqu\un d\autre, ici?\n\n<Thrazal jette un bref coup d\il  quelques badauds.>\n\nIgnorez-les. Leur prsence n\a rien  voir avec ce que j\ai  vous dire. C\est de vous que j\ai entendu parler, et  vous que je souhaite parler!\n\nLe concordat de Valdrakken m\a charg d\entrer en contact avec toutes celles et ceux qui cherchent  se faire un nom et pour qui la scurit de nos allis constitue une priorit.\n\nEn bref, faites ce que vous savez faire de mieux, l\$gami:amie;. Il y a de belles rcompenses  la cl.', '', '', '', '', '', '', 47187),
(70748, 'frFR', 'La chasse garde du Vol bleu', 'Fouillez les archives d\Azur  la recherche des notes de Malygos.', 'Il n\est gure tonnant que les vtres n\aient encore rien trouv.\n\nVoyez-vous, ces livres ont t conus exclusivement pour les membres du Vol bleu.\n\nCela tant dit, ma prsence devrait suffire  vous dvoiler les secrets des ouvrages les plus pertinents.', '', '', '', '', '', '', 47187),
(70747, 'frFR', 'Le magicien d\azur', 'Parlez  l\Archimage Khadgar au camp d\Antonidas.', 'Je n\ai pas le temps d\ergoter avec des adeptes de la sorcellerie.\n\nAllez vous occuper de cet archimage, $p. Apprenez tout ce que vous pourrez, et restez perptuellement sur vos gardes. Qui sait si nous avons affaire  des allis ou  des adversaires\n\nD\aprs nos rapports, il y aurait un grand btiment d\archives au sud d\ici.\n\nC\est l que je vais aller.', '', '', '', '', '', '', 47187),
(70746, 'frFR', 'Nuances de bleu', 'Accompagnez Ardenthal et Telash jusqu\au camp d\Antonidas.', 'Vous, $p!\nC\est un plaisir de voir un visage amical par ici. J\tais en train de discuter avec Telash des nouveaux venus dont la prsence a t signale dans les environs.\n\n<Ardenthal baisse la voix.>\n\nDes Dragons bleus.\n\ntant donn notre pass commun, Telash et moi pensons qu\il est ncessaire d\valuer la situation nous-mmes.\n\nVoulez-vous bien vous joindre  nous?', '', '', '', '', '', '', 47187),
(70745, 'frFR', 'Dtente force', 'Tuez l\invocatrice lmentaire.', 'Les Primalistes que vous avez croiss ne semblaient pas du genre  diriger les oprations, vu la frayeur que leur a faite un petit chien! Ha!\n\nSi ces brutes ont voqu Vadn, c\est srement elle la responsable de tout ce bazar. Or, pour nous dbarrasser des lmentaires, il nous faut commencer par liminer leur invocatrice. Elle ne doit pas tre bien loin, pour russir  occasionner autant de dgts. Il y a une grotte juste en dessous de nous, allez donc y jeter un coup d\il! Je sais que certains employs indlicats y vont souvent pour tirer au flanc.', '', 'Capable d\invoquer flammes et vapeur, cette Primaliste n\aime rien tant que cuire ses victimes vives.', 'Vadn Curgris', '', '', '', 47187),
(70744, 'frFR', 'Regardez ces os!', 'Nettoyez $1oatas de cochonneries.', '<Le grant du spa prfrerait srement viter qu\il y ait du sang partout>', '', '', '', '', '', '', 47187),
(70743, 'frFR', 'Prcieux Bb', 'Trouvez le bb d\Elzara.', 'Vous l, $pr! Avez-vous la moindre comptence?\n\nEt un tant soit peu de sens des priorits?\n\nParfait!\n\nMon bb a disparu. Vous devez la sauver sur-le-champ, elle est incapable de se dbrouiller seule dans ces horribles conditions.', '', '', '', '', '', '', 47187),
(70742, 'frFR', 'C\est de famille', 'Fouillez l\observatoire d\Obsidienne  la recherche d\indices sur le pass des Dracthyrs.', 'Depuis les airs, j\ai repr l\un des artfacts qu\Edress a dcouverts,  l\entre des ruines. Il y en a d\autres  l\intrieur, c\est certain.\n\nIls semblent dots d\une protection, mais je devrai m\en approcher davantage avant de pouvoir en dire plus. La magie qui opre ici est ancienne.\n\nLes lieux semblent dserts, mais cela ne durera pas longtemps, quand nous serons $gentrs:entres;. Restez sur vos gardes. Tchons de dcouvrir tout ce que nous pourrons.', '', '', '', '', '', '', 47187),
(70741, 'frFR', 'Effets gars', 'Rcuprez $1oaobjets gars.', '<Visiblement, le cours de moiga a t interrompu subitement et les effets des lves sont parpills un peu partout.\n\nRassembler toutes ces affaires aidera srement le personnel du spa Rves sereins.>', '', '', '', '', '', '', 47187),
(70740, 'frFR', 'Nettoyage vapeur', 'Tuez $1oalmentaires dans le spa infrieur.', 'Si l\incursion des lmentaires dans notre spa de luxe n\a pas l\air d\inquiter Xijan, les flammes et la vapeur qui y font rage doivent tre jugules immdiatement.\n\nNous avons lou les services de plusieurs orchestres pour le spa infrieur, mais les lmentaires ont dtruit leur quipement. Nous n\avions encore jamais connu pareille crise dans la rgion, et je souponne les Primalistes d\tre  l\origine de nos ennuis.\n\nSi vous voulez vous rendre utile, occupez-vous donc des lmentaires dans la partie est du spa infrieur. C\est l que nos premiers concerts doivent avoir lieu.', '', '', '', '', '', '', 47187),
(70739, 'frFR', 'Amour de Teera', 'Aidez le chasseur Narman a obtenir une bndiction traditionnelle pour sa demande en mariage.', 'J\ai chass avec les khans, j\ai battu notre bakar le plus rapide  la course et j\ai affront un bruffalon adulte  mains nues. En tant que chasseur, je n\ai plus rien  prouver.\n\nCependant, en tant que compagnon, j\ai encore beaucoup  apprendre.\n\nLe sage-du-vent Dawa, du clan des Ohn\irs, est la prunelle de mes yeux. J\aimerais tellement me montrer digne de son amour, mais je ne connais rien des traditions et rituels. Je dois demander conseil aux anciens,  Maruuka.', '', '', '', '', '', 'Parlez au chasseur Narman sur la colline des Shikaars,  Maruuka.', 47187),
(70738, 'frFR', 'Le cours de moiga', 'Trouvez la professeure de moiga et $1oalves.', 'Tout se passait on ne peut mieux jusqu\ ce que ces lmentaires ne viennent nous euh nous asticoter, dirons-nous.\n\nNos htes profitaient de nos installations quand ces monstres ont dbarqu sans crier gare! Rsultat, le spa est sens dessus dessous. Notre toute nouvelle professeure de moiga en a sans doute fait les frais, elle aussi.\n\nVous ne connaissez pas le moiga? C\est une nouvelle mthode d\tirements facilitant la mditation. Elle est si efficace que notre intervenante et ses lves n\ont probablement mme pas remarqu la prsence des lmentaires.\n\nEnfin, dans le doute, je compte sur vous pour aller voir si tout va bien.', '', '', '', '', '', '', 47187),
(70732, 'frFR', 'Une joute amicale', 'Gagnez un combat de mascottes contre Gwosh.', 'Bien! Maintenant que vous avez utilis la pierre sur Lubbins, organisons un entranement pour tester ses comptences de combat!\n\nUn gros bufflacien du nom de Gwosh vit sur le rivage au nord d\ici. Gwosh adore combattre! Enfin jouer, plutt. Et il s\entend trs bien avec les autres mascottes!\n\nAvec lui, Lubbins va bien s\amuser. Enfin combattre, je veux dire.', '', '', '', '', '', '', 47187),
(70730, 'frFR', 'Gnrosit shikaar', 'Aidez le sage-du-vent Dawa  prparer une demande en mariage parfaite.', 'Oh, $p.\n\nVous sentez-vous  l\aise sous le soleil? Vous sentez-vous en scurit dans sa douce lumire? Est-ce que chaque jour nouveau est synonyme d\espoir en l\avenir et de chance de vivre votre vie comme vous en avez toujours rv?\n\nDans ce cas, vous connaissez l\amour qui m\anime.\n\nNarman, du clan des Shikaars, est mon soleil. Il est ma chaleur, ma lumire, mon espoir.\n\nUn Centaure comme lui mrite une demande digne de sa stature.\n\nNous devons demander conseil aux ohns.', '', '', '', '', '', '', 47187),
(70723, 'frFR', 'Destruction des Primalistes de terre', 'Apportez le noyau primordial  Rethelshi.', 'Rethelshi,  Valdrakken, recevra cette aide pour ses recherches sur les Primalistes avec le plus grand plaisir.', '', '', '', '', '', '', 47187),
(70722, 'frFR', 'Les besoins de Lubbins', 'Parlez  Patchou  Iskaara.', 'Je crois que je sais ce que nous avons  faire, $n.\n\nMais commenons par en parler.\n\nJ\aurai mme un cadeau pour vous quand nous aurons fini! Amusant, non?', '', '', '', '', '', '', 47187),
(70721, 'frFR', 'L o mon cur me porte', 'Aidez le sage-du-vent Dawa et le chasseur Narman avec leur demande en mariage.', 'C\est lors de ma formation d\initi, au bord d\un petit tang prs du miroir cleste, que Narman et moi nous sommes rencontrs pour la premire fois.\n\nLes jeunes novices se rendent l-bas pour se rapprocher d\Ohn\ahra et ressentir le vent. La premire fois que je l\ai aperu dans le reflet de l\eau, une brise soudaine m\a ouvert les yeux. C\est le plus bel endroit de toutes les plaines.\n\nCe sera le dcor idal pour notre demande en mariage.', '', '', '', '', '', '', 47187),
