(70708, 'frFR', 'Un vide', 'Buvez avec Kolgar.', 'J\ai l\impression que a fait des annes quand je n\ai pas l\impression que c\tait il y a une minute.\n\nJ\aurais bien besoin d\une oreille pour m\couter, si vous avez un peu de temps devant vous.\n\nVous voulez bien nous commander  boire? Prenez ce que vous voulez, c\est moi qui rgale.', '', '', '', '', '', '', 47187),
(70706, 'frFR', 'Portail d\accs: sanctuaire Ombrag', 'Localisez le portail d\accs inactif du sanctuaire Ombrag, dans les plaines d\Ohn\ahra.', 'Notre expdition a repr une pierre inerte sur les versants luxuriants au sud-ouest. C\est  une petite trotte d\ici, mais  mon avis, a vaut le coup d\envoyer quelqu\un de votre trempe pour l\examiner.', '', '', '', '', '', '', 47187),
(70703, 'frFR', 'L\hritage du bastion de Tyr', 'Apprenez-en plus sur l\caille d\argent avec Koranos au bastion de Tyr.', 'Le gardien Tyr a toujours eu un got prononc pour les nigmes. Il doit y avoir un sens plus profond au cadeau qu\il nous a fait. Comme l\caille a trs probablement t forge dans son ancienne citadelle, peut-tre nous aidera-t-elle  en lucider les secrets.\n\nAccompagnez Koranos au bastion de Tyr, $n. En tant que fidle conseiller et gardien de ces terres, il pourra vous guider dans votre mission.', '', '', '', '', '', 'Parlez  Koranos au bastion de Tyr.', 47187),
(70702, 'frFR', 'Exploration continue de portails', 'Prsentez-vous  Thaelin Sombrenclume  l\avant-poste de l\caille rubis sur les rivages de l\veil.', '<Le cri strident du petit messager retient votre attention. Celui-ci vous remet un message avant de partir en courant.\n\nIl provient de Thaelin Sombrenclume, qui vous demande de l\aide.>', '', '', '', '', '', '', 47187),
(70701, 'frFR', 'Argalis perdus, rve de bakar', 'Guidez les argalis perdus jusqu\au clan des Aylaags.', 'Certains argalis du clan se sont  nouveau loigns du troupeau.\n\nLa crte qui nous entoure est trop dangereuse pour que nos bergers et bergres aillent les chercher. Ce serait vraiment trs aimable  vous si vous vouliez bien vous en charger, avec l\aide d\un de nos bakars. Nos quipes pourront vous dire plus prcisment o aller.', '', '', '', '', '', '', 47187),
