(70697, 'frFR', 'L\avis d\une experte', 'Parlez  Patchou dans la trave d\Azur.', 'Les blessures de Lubbins sont peut-tre guries, mais il n\a toujours pas retrouv sa confiance en lui. Je crois qu\il est temps de demander de l\aide ailleurs.\n\nLoin au sud-ouest, dans une rgion recule de la trave d\Azur, se trouve une dresseuse de mascottes nomme Patchou. C\est une des plus grandes expertes au monde en la matire.\n\nPourriez-vous lui rendre visite? Je suis sre qu\elle saura aider Lubbins!', '', '', '', '', '', '', 47187),
