(70647, 'frFR', 'O peut-il bien tre?', 'Sauvez Lubbins et ramenez-le  Jyhanna,  la nourricerie Petites cailles de Valdrakken.', '$n, quel soulagement de vous voir! Je me fais un sang d\encre, j\ai besoin de votre aide.\n\nJ\ai rcemment sauv un jeune proto-drake abandonn, que j\ai baptis Lubbins. Je l\ai amen ici pour pouvoir prendre soin de lui et lui trouver une famille d\adoption.\n\nSeulement voil, il a disparu et j\ai trs peur qu\il ne se soit gar ou bless. Je ne peux pas laisser les petits qui sont sous ma garde pour partir  sa recherche, mais peut-tre pourriez-vous le faire  ma place?', '', '', '', '', '', '', 47187),
