(70641, 'frFR', 'Le rveil d\un vu', 'Parlez avec les membres du Vol draconique rouge au sanctuaire de l\Essence rubis.', 'Un instant, $p. Je tiens  vous remercier personnellement pour votre aide dans la restauration de notre pierre de vu.\n\nJ\ignorais l\existence des Dracthyrs jusqu\ votre rveil dans les confins Interdits. Votre arrive parmi nous a soulev de nombreuses interrogations. Nous nous sommes demand si vous tiez un espoir ou une menace  la dfense de la vie.\n\nJe vous invite  vous intresser  notre pierre de vu. Parlez  d\autres membres de mon Vol au sanctuaire de l\Essence rubis. Certains de nos rcits vous seront peut-tre familiers.', '', '', '', '', '', '', 47187),
(70640, 'frFR', 'RECHERCHE: Boss', 'Tuez Frigellus prs du camp d\Antonidas.', '<Le texte de la page brille d\une faible lueur bleue.>\n\nAutrefois jouet prfr de Malygos, l\lmentaire Frigellus a grandement souffert d\tre abandonn par son matre.\n\nTandis que ses souvenirs heureux ont disparu en mme temps que ces lieux, la crature autrefois simple et joueuse a t corrompue par le mal qui svit ici.\n\nVeillez  ce que Frigellus soit neutralis.\n\nEt prvenez Cynegos une fois que ce sera fait.', '', '', 'Frigellus', '', '', '', 47187),
