(70633, 'frFR', 'Alimentation du moteur', 'Utilisez l\essence en bouteille pour alimenter le moteur de l\Innovation.', 'Vous avez surmont avec brio la premire preuve conue par le gardien Tyr. Bien qu\il s\agisse seulement du dbut de votre priple, j\ai toute confiance en vos capacits. Vous avez gagn le droit de vous amliorer en dbloquant les secrets de la forge.\n\nAjoutez l\essence en bouteille au moteur de l\Innovation et voyez ce qui se produit.', '', '', '', '', '', '', 47187),
(70627, 'frFR', 'Et le clan des Crins-d\Hiver?', 'Allez voir Sonova Antreneige au guet de Theron.', 'Nous pourrions rejoindre un autre clan mais ce serait risqu.\n\nJ\ai peur que les troupes primalistes s\en prennent aux autres clans, comme elles l\ont fait avec le ntre.\n\nCette expdition du Dracaret nous informe qu\elles se sont tablies prs des Crins-d\Hiver.\n\nJ\ignore si ce clan est de leur ct ou s\il faut l\avertir. Dans les deux cas, nous devons nous lancer  son secours.\n\nIl y a un expert des Furbolgs, Sonova Antreneige, au guet de Theron. Allez le voir, et apprenez ce qu\il sait  ce sujet.', '', '', '', '', '', '', 47187),
(70625, 'frFR', 'Crations sorforges', '', '', '', '', '', '', '', '', 47187),
(70620, 'frFR', 'Le secret de Ralathor', 'Rcuprez $1oacailles adamantines pour Ralathor le Burin,  Valdrakken.', 'Beaucoup de gens me demandent comment je m\y connais si bien en dpeage. Et je leur rponds que tout est dans les cailles.\n\nVous voulez en apprendre davantage? Apportez-m\en donc quelques-unes afin que je puisse vous montrer.', '', '', '', '', '', '', 47187),
(70618, 'frFR', 'L\appel de la forge', 'Apportez $1oachantillons de minerai de srvite  Skita le Fouisseur,  Valdrakken.', 'La forge Elle m\appelle. Et elle exige de la srvite. Vous, l! Apportez-moi de la srvite! Oui, beaucoup de srvite! <Skita clate d\un rire fanatique.>', '', '', '', '', '', '', 47187),
(70617, 'frFR', ' moi! Rien qu\ moi!', 'Apportez $1oachantillons de minerai de draconium  Skita le Fouisseur,  Valdrakken.', 'Il n\existe rien de plus utile que le minerai de draconium. On peut en faire toutes sortes de choses! C\est le minerai idal, d\une puret ingale. \n\nApportez-moi du draconium. Il m\en faut! Vous tes $gun mineur:une mineuse;, n\est-ce pas? Alors, minez!', '', '', '', '', '', '', 47187),
(70613, 'frFR', 'Tordues comme il faut', 'Rcuprez $1oacorces tordues pour Agrikus,  Valdrakken.', 'Vous avez de solides connaissances en herboristerie, n\est-ce pas, $p? Des alchimistes viennent sans cesse frapper  ma porte enfin, faon de parler en qute d\corce tordue. Au point que nos rserves sont presque puises!\n\nPourriez-vous en rcuprer davantage? Je crains que ces alchimistes ne finissent par mener leurs expriences sur mes propres affaires s\ils n\ont pas de quoi crer les flasques qui leur font dfaut.', '', '', '', '', '', '', 47187),
(70595, 'frFR', 'Des services de couture trs demands', 'Honorez des commandes de couture pour le Consortium d\artisanat.', 'Bonjour, bonjour, bonjour, $p! Nous croulons sous les commandes!\n\nSi vous cherchez du travail, le Consortium d\artisanat aura toujours de quoi vous occuper!\n\nJetez donc un coup d\il  nos requtes publiques, ou honorez des commandes personnelles ou de guilde si vous avez dj votre propre clientle. Mais travaillez, travaillez, travaillez!', '', '', '', '', '', '', 47187),
