(70586, 'frFR', 'Gare aux taches!', 'Confectionnez $1oatoques en trame-sauvage pour Fulafong,  Valdrakken.', 'S\il y a bien une chose que j\ai apprise au cours de ma carrire de couturire, $p, c\est que la plupart des chefs ont tendance  se tacher.\n\nDans le cas qui nous occupe, j\allais sortir boire un verre quand j\ai reu une commande de dernire minute pour une garde-robe complte d\uniformes de cuisine.\n\nSi vous voulez bien coudre les toques, je me chargerai du reste.', '', '', '', '', '', '', 47187),
(70582, 'frFR', 'Tissage solitaire', 'Confectionnez $1oarouleaux de trame-sauvage pour Fulafong,  Valdrakken.', 'S\il y a bien une chose que j\ai apprise au cours de ma carrire de couturire, $p, c\est l\importance de la pratique.\n\nExercez-vous sans relche, mme lorsque vous pensez matriser parfaitement votre mtier. Je veux que vous puissiez vous passer de ma supervision pour tisser les plus belles toffes qui soient.\n\nPourquoi ne tisseriez-vous pas quelques rouleaux de trame-sauvage de la meilleure qualit possible cette semaine?', '', '', '', '', '', '', 47187),
(70571, 'frFR', 'Tambours battants', 'Fabriquez $1oatambours en peau farouche pour le corroyeur Koruz,  Valdrakken.', 'Nos tambours sont rputs par monts et par vaux. Les Centaures ont peaufin leurs techniques des gnrations durant. Malheureusement, cela signifie que nos rserves de tambours fondent comme neige au soleil ces temps-ci.\n\nMais je vois que vous avez un certain talent, vous aussi. Peut-tre pourriez-vous m\aider  fabriquer quelques tambours?', '', '', '', '', '', '', 47187),
(70569, 'frFR', 'Des paniers pour Trisket', 'Fabriquez $1oapaniers de fleurs d\herboriste pour le corroyeur Koruz,  Valdrakken.', 'Tous mes clients et clientes comptent  mes yeux, mais j\avoue avoir un faible pour Trisket. Il est rcemment venu  moi, car sa bourse d\herboriste est en piteux tat.\n\nJ\ai profit de l\occasion pour lui proposer de lui fabriquer quelques paniers en remplacement de sa vieille bourse.\n\nPourriez-vous m\aider, $p? Trisket nous en serait reconnaissant.', '', '', '', '', '', '', 47187),
(70567, 'frFR', 'Un os  ronger pour les bakars', 'Fabriquez $1oaarbaltes osseuses pour le corroyeur Koruz,  Valdrakken.', 'J\avais de magnifiques arcs en os, mais nos bakars les ont chips avant qu\ils ne puissent servir. Les bakars adorent ronger des os, sous toutes leurs formes, et maintenant, ces arcs ne sont plus bons  rien!\n\nPourriez-vous m\en fabriquer d\autres?', '', '', '', '', '', '', 47187),
(70565, 'frFR', 'Distinction par diffrentiation', 'Fabriquez $1oapendentifs des prils imminents pour Tuluradormi,  Valdrakken.', 'Mon collier vous plat, $gjoaillier:joaillire;?\n\nBien sr qu\il vous plat. Mais je ne le montrerai que s\il fait l\objet de l\admiration gnrale.\n\nJe sais! Nous allons inonder le march avec quelques pendentifs simples de votre fabrication. Une fois que tout le monde portera vos crations, mon collier se distinguera brillamment du reste!', '', '', '', '', '', '', 47187),
(70564, 'frFR', 'Admirez-moi le travail!', 'Fabriquez $1oapaires de lunettes de joaillerie pour Tuluradormi,  Valdrakken.', '$gJoaillier:Joaillire;! Nous allons bientt organiser une exposition et je crains que notre clientle ne puisse admirer la beaut de chacune de nos pierres sans lunettes adaptes.\n\nInutile de vous lancer dans quelque chose de trop compliqu. Fabriquez simplement quelques paires afin que nos acheteurs et acheteuses puissent voir nos crations sans s\abmer les yeux.', '', '', '', '', '', '', 47187),
(70560, 'frFR', 'Les avantages d\une solide documentation', 'Rdigez $1oacompendiums d\exploration du Cur pour Talendara,  Valdrakken.', 'Vous tes d\humeur  faire un peu de calligraphie, $gapprenti:apprentie;? L\expdition du Dracaret a rapport de nombreuses notes de ses excursions, et j\ai t charge de recopier leurs pattes de mouche pour en faire des compendiums utilisables sur le terrain. Hlas, je ne me sens pas  la hauteur de la tche, aujourd\hui. Puis-je  nouveau faire appel  vos talents?', '', '', '', '', '', '', 47187),
(70559, 'frFR', 'Une femme de plume', 'Fabriquez $1oaplumes de calligraphe attaches pour Talendara,  Valdrakken.', 'Je suis ravie de vous voir, $gapprenti:apprentie;.\n\nUn petit groupe de novices est venu me voir tantt pour s\essayer  la calligraphie. Mais ces nophytes ont cass la pointe de leurs plumes en appuyant trop fort!\n\nJe m\en veux de vous demander a, mais pourriez-vous m\en tailler quelques-unes pour regarnir mon stock?', '', '', '', '', '', '', 47187),
(70557, 'frFR', 'Pas de viseur', 'Fabriquez $1oafuses d\artifice bronze pour Clicclac Fracaboume,  Valdrakken.', 'Par tous les gadgets, j\ai un gros truc  vous proposer aujourd\hui, l\tincelle!\n\nLes feux d\artifice sont  la mode chez les chasseurs et chasseuses qui se sont mis dans l\ide d\en balancer pour faire flipper les canards et les obliger  s\envoler.  mon avis, les canards sont bien trop futs pour se faire avoir, mais c\est pas une raison pour ne pas en profiter! Vous vous sentez  la hauteur?', '', '', '', '', '', '', 47187),
(70550, 'frFR', 'Bienvenue  l\assemble', 'Parlez  Xavin  l\assemble de Cobalt pour prendre connaissance des techniques disponibles dans la zone.', 'On aurait bien besoin d\un peu d\aide.\n\nLa Flamme fracture a pris le contrle de presque toute l\assemble de Cobalt.\n\nDe grce, aidez-nous dans notre combat. S\il est vrai que nous sommes en infriorit numrique, nous pouvons nanmoins vous tre utiles.', '', '', '', '', '', '', 47187),
