(70541, 'frFR', 'Techniques de chasse: compagnon', 'Choisissez un bakar ou un ohuna pour vous accompagner lors de la grande chasse.', 'Votre renomme auprs des Maruuks se renforce. Vous pouvez dsormais chasser aux cts d\un compagnon bakar tenace ou d\un ohuna vloce.', '', '', '', '', '', '', 47187),
(70540, 'frFR', 'Le meilleur ami des ingnieurs', 'Fabriquez $1oaoutils multifonctions pour Clicclac Fracaboume,  Valdrakken.', 'H, l\tincelle, auriez-vous vu mon\n\nEuh passez-moi donc le\n\na commence  bien faire! Je crois qu\il est grand temps de nous constituer un stock d\outils dignes de ce nom. Pas besoin de vous faire un dessin, j\imagine?', '', '', '', '', '', '', 47187),
(70533, 'frFR', 'Huile de finition', 'Fabriquez $1oahuiles tord-flammes pour Conflago,  Valdrakken.', 'Saviez-vous que l\huile tord-flammes est un excellent composant de finition pour la plupart des breuvages? Moi, oui. Hlas, je n\en ai plus une goutte et je ne peux rien faire sans. Soyez assez aimable pour m\aider  reconstituer les rserves de mon laboratoire, $p.', '', '', '', '', '', '', 47187),
(70532, 'frFR', 'Soutien au raid', 'Fabriquez $1oapotions de soins rafrachissantes pour Conflago,  Valdrakken.', 'Oh, $p, vous tombez  pic. Plusieurs de nos championnes et champions ont t blesss au cours du dernier assaut contre les Primalistes et nous avons grand besoin de potions de soins. J\imagine qu\$gun aventurier:une aventurire; de votre calibre en a toujours sur $glui:elle;, mais il nous en faut un grand nombre.', '', '', '', '', '', '', 47187),
