(70501, 'frFR', 'Permis de chasser', 'Terminez les tches d\entranement de la grande chasse.', 'Ah, vous souhaitez enfin faire vos preuves  la chasse? N\oubliez pas qu\il ne s\agit pas simplement de galoper partout en frappant tout ce qui bouge. Les Shikaars chassent avec des buts bien prcis en tte: cette activit nous permet de nourrir notre clan et de l\habiller, de prouver notre force face  des adversaires redoutables et d\apporter un quilibre  la nature.\n\nNous ne chassons pas pour anantir la faune; nous plantons les graines des grandes chasses  venir chaque fois que nous partons. Prouvez-nous que vous tes capable de suivre ces instructions, et peut-tre alors, nous vous accepterons parmi nous.\n\nCela tant, j\ai des doutes quant aux capacits de votre compagnon.', '', '', '', '', '', '', 47187),
(70450, 'frFR', 'La menace loutrke', 'Effrayez les loutrkes agaantes.', 'Bonjour! Ces loutrkes, l-bas, ne font que me voler mes prises!\n\nSi a ne tenait qu\ moi, je les ferais bien exploser, mais les Roharts ne semblent pas raffoler de mes mthodes. J\ai bien fabriqu cet appareil  repousser les loutrkes, le MK-R3QU1N, mais je ne nage pas trs bien.\n\nVous, vous semblez $gtaill:taille; pour cette mission. Rendez-nous service: activez l\appareil et faites quelques longueurs dans le coin, histoire de leur faire une petite frayeur.', '', '', '', '', '', '', 47187),
(70446, 'frFR', 'Une histoire personnelle', 'Allez voir Ardenthal  l\observatoire d\Obsidienne.', 'En me plongeant dans ces archives, j\ai dcouvert que l\observatoire d\Obsidienne aurait t un lieu d\importance pour le Gardeterre. Je ne peux imaginer le savoir que ce lieu contient sur notre Vol.\n\ntant donn l\intrt qu\Ardenthal porte au sujet, je l\ai informe de ma dcouverte. J\espre que ce n\tait pas une erreur.\n\nElle est dj partie en reconnaissance. S\il vous plat, veillez sur elle. C\est une guerrire comptente, mais cette affaire est troublante. Qui sait ce quelles vrits elle dcouvrira?', '', '', '', '', '', '', 47187),
(70444, 'frFR', 'Les champs de Frocit', 'Allez voir Gurgthock aux champs de Frocit.', 'Aux plus courageux et courageuses des Shikaars!\n\nRassemblez-vous et partez en direction des champs de Frocit, o sera couronne la personne la plus froce d\entre toutes!\n\nProuvez votre force. Montrez-nous vos talents au combat!\n\nDes conditions s\appliquent.', '', '', '', '', '', '', 47187),
