(70438, 'frFR', 'Poissons volants', 'Attrapez des poissons pour rapprovisionner le coin de pche et chevauchez votre drake pour les relcher par au-dessus.', 'a ne mord pas franchement, hein?\n\nVous savez quoi? a me donne une ide. Une lgende raconte que ces lacs et rivires n\ont pas toujours abrit de poissons En fait, ce sont les Dragons qui auraient lch leurs proies dans ces trous d\eau! Vous y croyez?\n\nPeut-tre que votre drake et vous pourriez essayer de faire la mme chose?', '', '', '', '', '', '', 47187),
(70437, 'frFR', 'En route vers le bastion de Tyr', 'Retrouvez Alexstrasza au sige des Aspects.', 'Cela fait des sicles que les Vols n\ont plus remis les pieds au bastion de Tyr.\n\nPourtant, nous devons nous y rendre pour vrifier si la pierre de vu originelle est encore oprationnelle.\n\nVenez me rejoindre au sige des Aspects. Nous devons dcouvrir quels dangers nous attendent dans l\ancien bastion de Tyr.', '', '', '', '', '', 'Allez voir Alexstrasza au bastion de Tyr.', 47187),
