(70414, 'frFR', 'En terrain incertain', 'Placez les totems en clats pour librer les caverneux pigs.', 'Par Khaz\goroth, que se passe-t-il ici?\n\nCe magma semble dou de raison et consomme les caverneux lmentaires qui se trouvent en bas a ne peut pas tre un hasard. J\essaie de tirer les choses au clair!\n\nPlacez ces totems en clats prs des caverneux pour les librer!', '', '', '', '', '', '', 47187),
