(70377, 'frFR', 'Faux pas de style', 'Trouvez le ou la propritaire des lunettes de soleil.', '<Cette paire de lunettes de soleil rpugnante dgouline de boue, mais elle semble coteuse.\n\nCe style est trs tendance en ce moment et son propritaire aimerait srement la rcuprer.>', '', '', '', '', '', '', 47187),
(70376, 'frFR', 'Deuxime preuve de Tyr: puissance', 'Terminez la deuxime preuve de Tyr dans les plaines d\Ohn\ahra.', '< votre approche, une faible lueur illumine l\inscription sur la statue.>\n\nFaites appel au pouvoir du gardien ainsi qu\ l\inbranlable dtermination de celles et ceux qui ne baissent jamais les bras.', '', '', '', '', '', '', 47187),
(70374, 'frFR', 'Himia la Bnie', 'Terrassez les lments.', 'Les lments revendiquent cette terre et n\acceptent pas notre intrusion.\n\n lments, avez-vous oubli notre protecteur? L\air! Invisible, et pourtant omniprsent et crucial pour toutes les formes de vie! Oubli, aussi vite qu\on le respire. Affrontez-moi, et plus jamais vous ne l\oublierez.', '', '', '', '', '', 'Retournez voir l\ancienne Nazuun  Teeraka.', 47187),
(70373, 'frFR', 'Aile de morgurlugull!', 'Embarquez dans la sautilleuse et terrassez Aile de morgurlugull!', 'Aile de morgurlugull! Aile de morgurlugull! Aile de morgurlugull delgrbrrl!\n\nGrrrooooooooom blarglg!\n\n<Pas besoin de traduction pour comprendre ce que l\on attend de vous: que vous liminiez la version murloc d\Aile de mort. Avant mme que vous ayez le temps d\accepter ou de refuser cette mission, le rugissement tonitruant d\un engin motoris en approche se fait entendre!>', '', 'Aile de morgurlugull! Aile de morgurlugull! Aile de morgurlugull delgrbrrl!', 'Aile de morgurlugull', '', '', '', 47187),
