(70370, 'frFR', 'Recherche professionnelle', 'Rpondez au questionnaire d\Haephesta pour dcouvrir votre mtier idal.', 'Bonjour! Que diriez-vous de collaborer avec le Consortium d\artisanat? Vous pourriez vous faire un joli pcule en fournissant des biens et des services prcieux  des clients et clientes de tout Azeroth.\n\nExcellent! Quels sont vos deux mtiers de prdilection?\n\nHum Vous n\en avez qu\un? Voil qui est fort regrettable pour vous!\n\n<Haephesta rflchit quelques instants.>\n\nJe sais! Je vais vous poser une srie de questions sur votre personnalit, et nous dterminerons ensemble quel second mtier vous conviendrait le mieux en fonction du premier! Qu\en dites-vous?', '', '', '', '', '', '', 47187),
