(70352, 'frFR', 'Grande course aux cailles', 'Tuez des bufflaciens et des proto-drakes territoriaux avec Toluiqi.', 'Vous, l! Vous avez dj tu des proto-dragons, je me trompe?\n\nAlors en toute vraisemblance, entre votre exprience et mes talents  la chasse, nous devrions pouvoir en abattre un certain nombre! Il y a des sources prs d\ici qui attirent les cratures draconiques.\n\nAidez-moi  prouver  ma moiti que de nous deux, c\est moi qui chasse le mieux.', '', '', '', '', '', '', 47187),
(70351, 'frFR', 'Fte en plein air', 'Parlez  Akora aux bassins de l\Essence rubis.', 'Je m\occupe de ce jardin depuis des annes dans l\attente du jour o j\accepterai enfin ma Vocation, et ce jour est arriv!\n\nJ\aime les fleurs, les arbres, les plantes et mme les insectes qui vivent parmi eux. Je peux ressentir la prsence de l\esprit de la nature, le grand esprit draconique, quand je prends soin d\eux.\n\nIl ne me reste qu\une chose  faire. Je vais invoquer le grand esprit draconique, comme dans la lgende.\n\n<Un sourire illumine le visage d\Akora.>\n\nRetrouvez-moi dans le jardin, prs du bassin o reposent ses ossements. Je vous expliquerai tout l-bas.', '', '', '', '', '', '', 47187),
(70341, 'frFR', 'Une victoire bien mrite', 'Retournez auprs du moteur de l\Innovation,  Valdrakken.', 'Les plus petites choses peuvent contenir les plus prcieux trsors.\n\nApportez l\essence au moteur de l\Innovation.', '', '', '', '', '', '', 47187),
(70339, 'frFR', 'Dans les pas de Tyr: les plaines d\Ohn\ahra', 'Trouvez la deuxime preuve de Tyr dans les plaines d\Ohn\ahra.', 'Bien que vous ayez brillamment surmont votre premire preuve, ne vous imaginez pas qu\il en ira ncessairement de mme avec les suivantes. Le gardien Tyr tenait  ce que nul ne puisse utiliser le moteur de l\Innovation avant de s\en tre montr digne.\n\nSi vous tes $gdtermin:dtermine;  poursuivre sur cette voie, vous trouverez la prochaine preuve dans les plaines d\Ohn\ahra. J\ai hte de tester vos capacits, $gaventurier:aventurire;.', '', '', '', '', '', 'Trouvez la deuxime preuve de Tyr dans les plaines d\Ohn\ahra.', 47187),
(70338, 'frFR', 'Ravisseurs de rusardeaux', 'Sauvez les rusardeaux.', 'Si Rusette est aussi affole, c\est srement parce que ses petits sont l-dedans!\n\nLes gants ont d profiter de sa faiblesse pour enlever ses bbs.\n\n cet ge-l, les rusardeaux ne tiennent pas en place et j\espre qu\ils ont russi  fausser compagnie  leurs ravisseurs\n\nTenez, je vous confie mon charme d\invisibilit. Allez vite les sauver avant qu\ils se fassent dvorer!', '', '', '', '', '', '', 47187),
(70337, 'frFR', 'La Garde ardente', 'Apportez les carillons  vent ohn\irs  la Garde ardente.', 'Bonjour.\n\nLes vents m\ont parl d\un groupe qui se serait abrit dans les ruines de la Garde ardente. Son unique intrt semble tre le pass, tandis que nous, Centaures, choisissons de vivre pour le prsent, par la grce d\Ohn\ahra.\n\nCes gens sont malgr tout nos htes, et je leur ai fabriqu ces carillons  vent pour leur permettre d\entendre la prsence d\Ohn\ahra. Puissent-ils tre source de joie et de confort dans leur foyer!', '', '', '', '', '', '', 47187),
(70335, 'frFR', 'Outils d\excavation rudimentaires', '', '', '', '', '', '', '', '', 47187),
(70319, 'frFR', 'Nergazura', 'Apportez un cur de loutrke, un fmur de rochecroc, une caille de trotte-bois et un gsier de vautour  Muqur Pluviot  l\avant-poste de Pas-de-bois.', 'Mon oncle m\a souvent parl d\une bataille qui l\avait oppos  un trotte-bois du nom de Nergazura. Il m\a notamment dcrit ses serres tranchantes comme un rasoir, sa morsure venimeuse, et la faon dont ses cailles fuchsia glissaient sur les collines  la poursuite de sa proie.\n\nLors de ma dernire chasse, j\ai aperu un clair blouissant, mais il tait dj trop tard; j\avais reu un coup de crocs au niveau de l\paule. La crature tait aussi effrayante que ce que disait mon oncle, mais je suis encore en vie.\n\nJe dois dsinfecter sa morsure. Je vous en supplie, rapportez-moi les composants dont j\ai besoin Le temps joue contre moi.', '', '', '', '', '', '', 47187),
(70279, 'frFR', 'Sang des Dragons', 'Tuez Karkidan.', 'Comme vous l\aurez certainement constat, on trouve dans ces contres des animaux atteignant des tailles inhabituelles.\n\nNous considrons ces cratures comme bnies par les dieux de la nature, et elles font bien souvent des cibles honorables pour les chasseurs et chasseresses dsirant prouver leur force. L\une de ces cratures, que nous avons surnomme Karkidan, se trouve justement non loin d\ici. Vous m\impressionnerez grandement en parvenant  le terrasser.', '', '', '', '', '', '', 47187),
(70268, 'frFR', 'Souvenirs ravivs', 'Donnez le journal  Vritistrasz.', 'Vous avez trouv un journal partiellement dtruit. Il semble avoir t crit du point de vue d\une jeune Dragonne noire, avant la corruption.\n\nLe dos du journal est illisible, mais en feuilletant les premires pages, vous reconnaissez un nom: Vritistrasz.', '', '', '', '', '', 'Donnez le journal  Vritistrasz au sanctum Rubis.', 47187),
(70244, 'frFR', 'Nokhuds et punition', 'Entrez dans le village avec la khanam matra Sarest et reprenez-le aux mains des Nokhuds.', 'Voil des millnaires que les Teeras protgent le cor de Drusahl, la plus sacre de nos reliques. En pillant ce village, Balakar a trahi toutes les valeurs des Maruuks. Il peut faire une croix sur toute forme de rdemption.\n\nNous devons reprendre le cor avant que Balakar n\ait le temps de le dtruire, et sauver les Teeras encore en vie. Je vais vous accompagner pour rendre la justice  ce khan usurpateur. Les Nokhuds vont connatre la colre de la khanam matra!', '', '', '', '', '', '', 47187),
(70242, 'frFR', 'La vie aprs la vie', 'Obtenez un rceptacle inerte auprs de Trellain, au sanctuaire de l\Essence rubis.', 'J\ai senti que son ami portait une profonde cicatrice. Quelque chose ici l\a rouverte; peut-tre pour qu\elle puisse gurir pleinement, cette fois.\n\n prsent, c\est  Kolgar de gurir.\n\nAllez trouver mon ami Trellain, qui travaille  des enchantements sur la terrasse au-dessus de nous. Dites-lui que j\ai besoin d\un des rceptacles qu\il utilise dans son travail. Il devrait vous le remettre gratuitement.', '', '', '', '', '', '', 47187),
(70241, 'frFR', 'Jusqu\au bout', 'Emmenez Bathoras auprs de Duroz et Kolgar.', 'C\est arriv sans prvenir, je Il dormait, et j\ai dtourn le regard, et On revenait ici tous les jours, il voulait simplement s\asseoir avec les Dragonnets, je ne savais pas qu\il\n\n<Le visage de Kolgar est clairement macul de larmes. Il se frotte les yeux du dos de la main.>\n\nNon, je savais. Je savais. Mais maintenant, je ne sais pas quoi faire. Qu\est-ce que je dois faire de lui?\n\nPouvez-vous Pouvez-vous aller chercher Bathoras?', '', '', '', '', '', '', 47187),
(70240, 'frFR', 'Gestion de la douleur', 'Rassemblez $1oamorfales laiteuses, $2oafleurs des bas-fonds et une fiole des bassins de l\Essence remplie.', 'Vous avez bien fait de me l\amener. Je peux voir qu\il souffre terriblement, mme s\il le cache bien. Nous le devons tous, quand vient notre tour.\n\nJe crains que ce soit son ge qui l\afflige, et non la maladie, mais je ferai mon possible pour apaiser un peu son mal.\n\nPourriez-vous aller me chercher des morfales laiteuses, des lys des bas-fonds et de l\eau pure dans le jardin? a me permettra de prparer une potion qui attnuera sa souffrance.', '', '', '', '', '', '', 47187),
(70239, 'frFR', 'Regrets silencieux', 'Marchez avec Duroz et Kolgar pour trouver de l\aide.', 'Duroz est vieux, malade et plus born qu\un kodo. Personne n\aurait pu l\empcher de monter  bord du vaisseau et de voyager jusqu\ici. Tout ce que je pouvais faire, c\tait de lui servir de canne de marche.\n\nJe l\ai assez vu souffrir sur le champ de bataille pour savoir qu\il cache sa douleur. Son tat empire de jour en jour. Pourriez-vous m\aider  l\emmener voir des spcialistes des potions? La bibine ne lui suffit plus.\n\nSi vous pouvez porter nos armes, moi, je l\aiderai  marcher.', '', '', '', '', '', '', 47187),
(70236, 'frFR', 'il de dragon dlog', 'Apportez l\objet  Emilia Bellocq.', '<C\est peut-tre ce que recherche Emilia Bellocq.>', '', '', '', '', '', '', 47187),
(70235, 'frFR', 'Facture de rparation', 'Fabriquez $1oamarteaux de rparation en srvite pour la sculpte-mtal Kuroko,  Valdrakken.', 'Cela fait des millnaires que les les aux Dragons n\avaient plus connu pareil conflit. Malgr l\excellence de notre travail, toute armure aussi robuste soit-elle finit par s\user. Ce qui explique que j\ai reu une grosse commande de marteaux de rparation en srvite et j\ai besoin de tous les bras disponibles pour l\honorer. Si vous m\aidez, je vous confierai de nouvelles connaissances qui vous permettront de dvelopper vos comptences de forge des les aux Dragons.', '', '', '', '', '', '', 47187),
(70229, 'frFR', 'Bokou le mystique', 'Allez voir Bokou  Teeraka.', 'Les mystiques ont reu l\ordre de se rendre au refuge d\Ondecrte il y a quelques jours, mais l\un d\entre eux est rest en arrire. Il s\appelle Bokou, et vous le trouverez au sommet de la colline, au sanctuaire d\Ohn\ahra.\n\nCe n\est encore qu\un initi, mais il devrait pouvoir communier avec Ohn\ahra et obtenir sa bndiction. Si la desse est avec nous, nous pourrons peut-tre remporter cette guerre avant mme qu\elle n\clate.', '', '', '', '', '', 'Allez voir Bokou  Teeraka.', 47187),
(70221, 'frFR', 'Sacre trempe', '', '', '', '', '', '', '', 'Recevez la trempe d\artisanat de Thomas Briand.', 47187),
(70220, 'frFR', 'Sanctuaire Ombrag', 'Allez parler  la capitaine de la garde Alowen,  Sariosa,  Sidra la Soigneuse et  Viranikus.', 'Nous devons prvenir le reste du Vol draconique vert que la barrire des frondaisons Antiques est menace. Grithus et moi avons beaucoup de choses  discuter.\n\n$n, je vais apposer ma marque sur vous. Les autres Dragons qui la verront sauront ainsi que vous portez mon message.\n\nAllez rallier mon Vol. Ils doivent prendre connaissance de la situation et se prparer pour la bataille qui approche.', '', '', '', '', '', '', 47187),
(70215, 'frFR', 'La curiosit est reine', 'Parlez  l\invocatrice dimensionnelle Dlandra au camp d\Antonidas.', 'Si j\hsitais  discuter de ces symboles avec vous, ce n\est pas par manque de confiance, mais en raison de leur nature inconnue et des pierres sur lesquelles ils se trouvent.\n\nOui, j\ai bien dit pierres. En l\occurrence, elles se trouvent un peu partout sur les les.\n\n<L\invocatrice dimensionnelle Dlandra vous lance un regard. Son expression trahit un soupon de curiosit et d\enthousiasme.>\n\nVous l\ignoriez.\n\nTrs bien. Votre empressement et votre obstination  venir me parler me prouvent que vous souhaitez en savoir davantage sur votre rcente dcouverte. Il est temps que nous en discutions plus avant.', '', '', '', '', '', '', 47187),
