(70210, 'frFR', 'Tradition respecte', 'Placez de l\encens et liminez les cratures fantomatiques aux Kurgans ternels.', 'Quand nous sommes dans ce camp, les Aylaags ont pour tradition de se rendre en plerinage aux Kurgans ternels afin d\y demander  ce que nos voyages soient pargns des flaux connus par nos anctres. Hlas, la prsence des Nokhuds rend ce dplacement prilleux.\n\nSi a ne vous drange pas, j\aimerais que vous fassiez ce plerinage  notre place.', '', '', '', '', '', '', 47187),
