(70198, 'frFR', 'L\appel des les', 'Retrouvez Naleda Mirerive  Durotar.', 'Notre groupe se rassemble  Durotar. Comme c\est palpitant!\n\nRejoignez-nous, $n! Il est temps de mettre les voiles, cap sur les les aux Dragons!', '', '', '', '', '', '', 47187),
(70197, 'frFR', 'L\appel des les', 'Allez voir Toddy Bourbon au port de Hurlevent.', 'Vous tes $gprt:prte; pour l\aventure de votre vie? Moi, oui!\n\nNotre expdition est au complet, et le matriel est charg. Alors, qu\attendez-vous?\n\nRetrouvez-moi sur les quais de Hurlevent. Il est temps de mettre les voiles, cap sur les les aux Dragons!', '', '', '', '', '', '', 47187),
