(70195, 'frFR', 'Dans la tempte', 'Sauvez Altan et cherchez des indices sur la personne extrieure.', 'D\aprs nos rapports, les Nokhuds avaient  leurs cts une personne extrieure qui utilise une magie indite et qui a perc nos rangs comme une tempte.\n\nSi les Nokhuds ont des allis capables de semer une telle dvastation, nous devons obtenir un maximum d\informations au plus vite.\n\nJ\ai envoy mon ohuna, Altan,  la recherche de cette mystrieuse personne. Elle n\est pas encore rentre, et je commence  m\inquiter. $n, pourriez-vous chercher des indices sur cette personne et dcouvrir ce qui est arriv  Altan?', '', '', '', '', '', '', 47187),
