(70185, 'frFR', 'Crature mystrieuse', 'Trouvez la crature et tuez-la, puis rapportez une preuve de votre exploit  l\claireuse Tomul.', '<Vous tombez sur une grande empreinte de patte dans la terre. Vous jetez un regard alentour, mais ne voyez aucune crature dote de pattes, et encore moins de cette taille.\n\nVous pourriez peut-tre impressionner les Centaures en chassant ce grandiose animal.>', '', '', '', '', '', 'Apportez la peau de Konkhoular  l\claireuse Tomul.', 47187),
