(70182, 'frFR', 'Le doux parfum de la victoire', 'Retournez auprs du moteur de l\Innovation,  Valdrakken.', 'Mme les plus petites choses peuvent dtenir un grand potentiel. L\essence en bouteille a beau sembler aussi lgre qu\une plume, sa puissance n\en est pas moins considrable.\n\nApportez-la au moteur de l\Innovation.', '', '', '', '', '', '', 47187),
(70181, 'frFR', 'Premire preuve de Tyr: finesse', 'Terminez la premire preuve de Tyr dans la trave d\Azur.', '<L\inscription sur la statue met une faible lueur  votre approche.>\n\nFaites appel au pouvoir du gardien et illuminez notre avenir de sa lumire.', '', '', '', '', '', '', 47187),
(70180, 'frFR', 'Aide au dmarrage', 'Aidez Grizik  alimenter le mystrieux appareil.', 'Certaines personnes en ville prtendent que cette machine a t cre par le lgendaire gardien titan Tyr. \n\nLe problme, ce qu\elle refuse obstinment de fonctionner! Nous avons pourtant tout essay: dmontage, gyroscopage, lgre lectrocution.  l\exception de cette dernire, tous nos efforts se sont solds par des checs. Mais je viens d\avoir une ide gniale!\n\nVous voyez ce gyrocoptre, l-bas? Montez  bord et voyons si on ne pourrait pas donner un peu plus de jus  ce truc des Titans.', '', '', '', '', '', '', 47187),
(70179, 'frFR', 'D\une pierre deux coups', 'Obtenir des matriaux de construction sur les lmentaires de terre de la rgion.', 'Salutation, $gaventurier:aventurire;! Dites-moi, vous m\avez l\air habile. Vous pourriez me donner un coup de main?\n\nAzkra et moi sommes charges de surveiller cette tour, qui est dans ce que j\aime appeler: un palpitant tat de pr-rnovation. Le problme, c\est que quand on a voulu commencer lesdites rparations, des lmentaires de terre nous ont attaques!\n\nAlors, je me suis dit: Zfren, pourquoi ne pas s\occuper de ces lmentaires et en profiter pour rcuprer quelques matriaux? C\est l que vous entrez en jeu! Vous tes $gpartant:partante;?', '', '', '', '', '', '', 47187),
(70178, 'frFR', 'Kit de fournitures d\expdition', 'Examinez les nouveaux outils disponibles dans le kit de fournitures d\expdition au camp de base du Dracaret.', 'Vos dcouvertes se sont avres inestimables, $gexplorateur:exploratrice;.\n\nIl reste encore beaucoup  dcouvrir, et nous avons les outils qui pourront vous y aider.\n\nRevenez au camp de base du Dracaret et quipez-vous via le kit de fournitures d\expdition.', '', '', '', '', '', '', 47187),
(70175, 'frFR', 'Bande brise', 'Apportez l\objet  Emilia Bellocq.', '<C\est peut-tre ce que recherche Emilia Bellocq.>', '', '', '', '', '', '', 47187),
(70174, 'frFR', 'Les Shikaars', 'Allez voir la khan Sansok.', 'La khan Sansok est la chasseresse la plus talentueuse de notre clan. Malgr sa surdit, elle nous prouve chaque jour davantage qu\elle est capable de nous guider aussi bien  la chasse qu\au quotidien.\n\nC\est un mentor pour tout le clan, une cheffe respecte et une ardente dfenseuse des Maruuks.\n\nC\est un honneur pour vous de pouvoir lui parler.', '', '', '', '', '', '', 47187),
(70172, 'frFR', 'Mystres des montagnes', '', '', '', '', '', '', '', '', 47187),
(70171, 'frFR', 'Petits accidents heureux', 'Trouvez le dernier tableau d\Hudson.', '<Les yeux de Ranpiata semblent humides.>\n\nC\est moi, c\est a? C\est  cause de moi qu\il a perdu son tincelle?\n\nIl dit qu\il m\aime, mais vous avez entendu  quel point renoncer  peindre le touche.\n\nJe ne veux que ce qu\il y a de mieux pour lui Si je suis la cause de son dsarroi alors je partirai.\n\nIl y a un dernier tableau dont il s\est dbarrass La dernire chose qu\il a tent de peindre avant d\abandonner.\n\nJe ne pouvais pas supporter qu\il disparaisse, alors je l\ai cach chez nous. Je vous en prie Apportez-le-lui en souvenir.', '', '', '', '', '', '', 47187),
(70170, 'frFR', 'Terrasser les dmons', 'Rcuprez les tableaux perdus d\Hudson en terrassant les derniers boss des donjons des salles de l\Imprgnation, de l\acadmie d\Algeth\ar, du caveau d\Azur et de Neltharus.', 'J\ai peur qu\il puisse tre aussi ttu qu\une mule\n\nMais que pouvons-nous faire d\autre que ressayer? Je ne peux pas le laisser comme a\n\nIl avait jet d\autres tableaux,  des endroits encore plus dangereux J\espre que vous n\avez pas froid aux yeux!', '', '', '', '', '', '', 47187),
(70169, 'frFR', 'Mmes les arbres ont besoin d\amis', 'Allez parler  Rauvros.', 'Je sais que Ran et vous essayez seulement de m\aider.\n\nMais je crois que mon cas est dsespr. Mon tincelle a disparu, purement et simplement.\n\nMais Ran a raison. Je vous dois de faire au moins un essai.\n\nPrsentez-moi donc votre ami artiste en herbe.', '', '', '', '', '', '', 47187),
(70168, 'frFR', 'Petits accidents malencontreux', 'Rcuprez les tableaux perdus d\Hudson en terrassant les derniers boss des donjons des bassins de l\Essence rubis, de l\offensive nokhud et du creux des Fougerobes.', 'Vous avez fait tout ce chemin Je suis vraiment dsole.\n\nMon cher Hudson adorait peindre C\tait mme toute sa vie! Je ne sais pas d\o lui vient ce blocage.\n\nIl y a quelques semaines de cela, en rentrant d\une promenade pour aller peindre, il a pris toutes ses uvres inacheves et les a jetes dans un accs de colre.\n\nJe vous en prie, sans vouloir vous commander Est-ce que vous pourriez les retrouver? Elles lui rendraient peut-tre l\tincelle qui semble l\avoir abandonn.\n\nHudson n\hsite pas  s\aventurer dans des lieux dangereux pour trouver la perspective idale. J\espre que vous avez l\quipement adquat.', '', '', '', '', '', '', 47187),
(70166, 'frFR', 'Les joies de la peinture', 'Apportez le tableau de prsentation de Rauvros  Hudson.', 'Ma collection vous plat? Tous ces tableaux sont l\uvre admirable de Hudson, le plus grand peintre de tous les temps.\n\nCes uvres sont rares et probablement trs prcieuses. Il vit reclus et n\a plus touch un pinceau depuis un certain temps. Mon plus grand rve serait de le rencontrer un jour ou mieux encore, qu\il m\enseigne son art!\n\nMais dites vous ne semblez pas manquer d\audace. Vous pourriez aller lui parler pour moi? T-tenez! Prenez des exemples de mon travail Il sera peut-tre impressionn!\n\nOu alors, pas du tout Oh bon sang', '', '', '', '', '', '', 47187),
(70164, 'frFR', 'Une occasion unique', 'Parlez au tempomancien Phosildral et  Sibrit Claquepage dans les ruines du caveau d\Essence.', '$p, vous avez un moment? Je suis sur le point de faire une dcouverte!\n\nQuand le couvoir s\est effondr, j\ai perdu bien plus que ma capacit  me battre. J\ai perdu mon identit de Dracthyr. Vous pouvez peut-tre me comprendre.\n\nComme j\ai toujours aim assembler et dmonter des objets, j\ai dcid de rejoindre l\expdition, mais l\artfact qu\on m\a confi est plutt complexe.\n\nPourriez-vous demander  Phosildral et Sibrit de relire mes notes? Je veux leur prouver de quoi je suis capable  eux, mais aussi  moi-mme.', '', '', '', '', '', '', 47187),
(70163, 'frFR', 'Rseau des grottes  Avanc', 'Traversez les anneaux en planant.', 'Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 47187),
(70161, 'frFR', 'Rseau des grottes', 'Traversez les anneaux en planant.', 'Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 47187),
(70159, 'frFR', 'Le got de la maison', 'Demandez aux membres de la Horde du camp de base du Dracaret de vous donner les ingrdients dont vous avez besoin.', 'Ah, enfin! $gUn:Une; autre Dracthyr pour nous prter main-forte.\n\nMon frre et moi avons essay de cuisiner des rations  manger, mais\n\n<Scaralesh dsigne les environs.>\n\nTout est si diffrent, ici. Difficile de trouver les ingrdients qu\on a l\habitude d\utiliser.\n\nMais on peut s\adapter. Allez demander  la Horde de nous transmettre ce qui pourrait nous servir de matire vgtale, de protines et d\mulsifiant. Ensuite, on pourra se mettre aux fourneaux.', '', '', '', '', '', '', 47187),
