(70156, 'frFR', 'Un rveil ancien', 'Alimentez le portail d\accs.', 'Le portail d\accs se trouve derrire moi. Il est impossible de savoir quand l\enchantement du rceptacle prendra fin, ou pire, se brisera.\n\nLa libration d\une telle quantit d\nergie instable pourrait avoir des consquences catastrophiques.\n\nDevons-nous poursuivre?', '', '', '', '', '', '', 47187);
