(70155, 'frFR', 'Regarder, couter et respirer', 'Pchez avec Treshrak.', 'Salutations, $r. Rares sont celles et ceux qui s\arrtent pour dire bonjour, et encore moins pour passer un moment. La plupart ne pensent qu\ se rendre  leur prochaine destination.\n\nVoulez-vous pcher avec moi?', '', '', '', '', '', '', 47187),
(70154, 'frFR', 'Portail  destination inconnue', 'Suivez l\invocatrice dimensionnelle Dlandra jusqu\au portail d\accs.', 'L\enchantement nous protgera de l\nergie instable contenue dans le rceptacle.\n\nJe vous ouvrirai le chemin jusqu\ la pierre la plus proche.\n\nRestez  ct de moi.  notre arrive, j\aurai besoin de votre aide pour alimenter l\appareil.', '', '', '', '', '', '', 47187),
(70148, 'frFR', 'Sans but', 'Cherchez la serre thrthi dans l\ambassade de Trve-Aile.', 'Vous pourriez m\accorder un instant?\n\nJe m\inquite pour un autre Dracthyr qui est pass par ici. Il nous a pos tout un tas de questions,  mes associs et  moi, mais a paru du de nos rponses.\n\nIl s\est prsent sous le nom de serre thrthi, je suppose donc qu\il est encore assez bas dans votre hirarchie?\n\nJ\ai eu l\impression qu\il avait besoin d\aide. Vous voulez bien m\aider  prserver la paix?\n\nJe l\ai vu parler  Kholmar, un peu plus loin.', '', '', '', '', '', '', 47187),
(70146, 'frFR', 'Rfutation des hautes-terres', '', '', '', '', '', '', '', '', 47187),
(70139, 'frFR', 'L o il y a une protection, il y a une solution', 'valuez l\tendue des dgts subis par les pierres de protection dans le rservoir du bastion de Tyr.', 'Ce rservoir tait entour de trois pierres de protection places ici par Tyr en personne.\n\nLeur rle est de stabiliser la magie lmentaire qui rgne sur les les aux Dragons.\n\nQuand vous m\avez rveille, j\ai aussitt senti que la pierre de l\ouest tait endommage et je crains que les Primalistes n\en aient fait autant aux deux autres.\n\nAvant de dcider de la marche  suivre, il nous faut valuer l\tendue des dgts.', '', '', '', '', '', '', 47187),
(70136, 'frFR', 'Pas le temps de souffrir', 'Rcuprez le bton de marcheur du temps et les notes de marcheur du temps, et tuez l\ours alpha enrag dans la fort Ondoyante de Thaldraszus.', 'Euh Un instant, je vous prie\n\nMa toute premire mission L\nergie temporelle instable s\infiltre dans la fort Elle affecte la faune et la flore. Il faut en valuer l\impact et rcuprer cette magie pour que les marcheurs du temps puissent ventuellement l\utiliser\n\n<Zera secoue la tte.>\n\nJ\tais en train d\observer un troupeau de vorquins quand un ours rendu fou par la magie temporelle m\a attaque sans crier gare. J\en ai rchapp de justesse.\n\nPourriez-vous retrouver mon quipement, $c? Mfiance, cet ours n\a peut-tre pas dit son dernier mot.', '', '', '', '', '', '', 47187),
(70135, 'frFR', 'lmentaires envahissants', 'Tuez $1oalmentaires primordiaux  l\ambassade de Trve-Aile.', 'L\expdition du Dracaret verse dans l\artisanat et l\exploration, pas dans l\art de la guerre.\n\nMais c\est une discipline que nous matrisons, vous et moi, $p.\n\nMettons nos forces  la disposition des plus vulnrables, ici, sur les les aux Dragons.\n\nliminez les lmentaires qui gagnent du terrain au nord afin que l\expdition puisse se concentrer sur sa noble mission.', '', '', '', '', '', '', 47187),
(70134, 'frFR', 'Souvenirs', 'Rcuprez la capsule temporelle de Vritistrasz.', 'Merci de m\avoir cout, mon enfant. J\ai une faveur  vous demander.\n\nRassurez-vous, fini les histoires.\n\nLorsque nous avons quitt cet endroit, j\ai laiss une capsule temporelle. Pourriez-vous la rcuprer pour moi? Nous l\avons laisse au fond des bassins de l\Essence rubis, cache derrire l\un des piliers.\n\nJe l\ai camoufle  l\aide d\un cachet. Si vous l\activez, vous devriez la voir.', '', '', '', '', '', '', 47187),
(70132, 'frFR', 'Rester un instant', 'Asseyez-vous un moment et admirez le paysage.', '<Le vieux Nain ne ragit pas  votre prsence lorsque vous l\approchez. Il observe le paysage, les sourcils froncs. C\est un beau panorama; il serait peut-tre agrable de faire une pause et de l\admirer.>', '', '', '', '', '', '', 47187),
(70129, 'frFR', 'Torteil le Terrible', 'Aidez Rowie  terrasser Torteil le Terrible.', 'C\est vrai, je suis pas assez fort pour affronter un monstre pareil en tout cas, pas tout seul!\n\nMais vous, vous tes l!\n\nLe repaire de cet horrible yti, Torteil le Terrible, est un peu plus loin. Sa grotte est grande. Mais pas effrayante! Enfin, juste un peu, peut-tre\n\nVous pourriez y aller et me l\affaiblir un peu? Je je serai juste derrire vous!', '', '', '', '', '', '', 47187),
(70126, 'frFR', 'La touche finale', 'Persuadez le client de Miguel de lui confier ses futures commandes.', 'Ah, $p, quelle joie de vous voir!\n\nVous avez apport une aide exceptionnellement prcieuse au Consortium d\artisanat, ainsi qu\ Thomas et moi-mme. Je vous en remercie.\n\nIl vous reste toutefois une chose  apprendre en tant qu\$gartisan:artisane;: nouer des liens avec votre clientle et la fidliser.\n\nJe viens justement de terminer une commande. Pourriez-vous aller voir l\acheteur pour moi? Essayez de le convaincre de s\adresser  moi pour ses futures requtes. Et rappelez-lui qu\il doit venir me voir personnellement s\il veut la meilleure qualit possible.', '', '', '', '', '', '', 47187),
(70125, 'frFR', 'O est Irion?', 'Demandez  Sendrax quand les Dragons arriveront.', 'Hum je me demande o est pass Irion.\n\nIl avait dit qu\il nous attendrait avec une dlgation d\Alexstrasza la Lieuse-de-Vie, reine des Dragons.\n\nEt il ne semble pas tre le genre de Dragon qui ne tient pas parole\n\nBon, au moins, cette petite Draknide impatiente est venue  notre rencontre. Vous voulez bien aller lui demander quand arriveront les autres?', '', '', '', '', '', '', 47187),
(70124, 'frFR', 'Matriel d\entranement', 'Rcuprez $1oacailles de proto-dragonnets primordiaux.', 'Jamais je n\avais vu de cratures semblables  ces proto-drakes.\n\nLeurs cailles sont naturellement ignifuges et plus rsistantes que l\acier, mais n\en restent pas moins flexibles. C\est incroyable!\n\nTous les artisans et artisanes se battent pour mettre la main dessus.\n\nCommencez par les drakes juvniles. Les petites cailles devraient tre plus souples et nous permettre de parfaire nos techniques.', '', '', '', '', '', 'Allez voir Thaelin Sombrenclume  l\ambassade de Trve-Aile.', 47187),
(70123, 'frFR', 'Vermine primordiale', 'Tuez $1oaproto-drakes primordiaux sur la cte Sauvage.', '<Azurathel lance un regard suspicieux aux proto-dragons qui rdent sur la crte derrire lui.>\n\nJe jurerais que ces proto-dragons se rapprochent un peu plus du camp chaque fois que je tourne le dos\n\nCe ne sont pas les Dragons qu\Irion a invits  nous rencontrer.\n\nLes proto-dragons sont d\impitoyables prdateurs avec qui il est impossible de raisonner. Nous devons tre impitoyables en retour.\n\nRduisez leur nombre pour refroidir leurs ardeurs, ou notre expdition prendra fin avant mme d\avoir commenc.', '', '', '', '', '', 'Allez voir le squammandant Azurathel  l\ambassade de Trve-Aile.', 47187),
(70122, 'frFR', 'Prilleuse exploration', 'Secourez 3membres de l\expdition du Dracaret sur la cte Sauvage.', 'Ne mprenez pas les aspirations acadmiques de l\expdition pour de la couardise, $p.\n\nNous ne sommes pas des ermites qui tudient d\antiques manuscrits dans des tours d\ivoire.\n\nNous sommes des aventuriers et aventurires en qute de connaissances aux quatre coins d\Azeroth!\n\nC\est  cause de cette mme soif d\aventure que nous nous retrouvons souvent dans des situations prilleuses. Et justement, quelques membres de l\expdition ont eu les yeux plus gros que le ventre\n\nMais bon, le danger pimente un peu les choses!', '', '', '', '', '', 'Allez voir Toddy Bourbon  l\ambassade de Trve-Aile.', 47187),
