(70070, 'frFR', 'Encore une victoire de canard!', 'Trouvez Flambec et ramenez-le  Gracus.', 'Une seconde J\ai un pressentiment\n\n<Gracus regarde partout.>\n\nFlambec! Ce garnement a encore d suivre la rivire! J\ai beau le mettre en garde, il faut toujours qu\il essaie d\aller jouer avec les bufflaciens!\n\nAllez voir s\il va bien, s\il vous plat. Pourvu qu\il ne se soit pas encore fait gober', '', '', '', '', '', 'Dites  Gracus ce que vous avez vu.', 47187),
(70069, 'frFR', 'On m\appelle garde-canard', 'Nourrissez $1oacanetons et retournez voir Gracus.', 'Je ne rajeunis pas Mais j\ai encore tant  faire.\n\nLa couve devrait tre runie prs du ruisseau. Je l\y laisse dans l\espoir qu\elle gagne en autonomie, car elle devra bientt se dfendre par elle-mme.\n\nMais aujourd\hui, elle va pouvoir compter sur vous. Apportez-lui la nourriture que vous avez trouve, puis conduisez-la jusqu\ moi. Mais mfiez-vous de Pilote et de ses tendances  la fugue!', '', '', '', '', '', '', 47187),
