(70062, 'frFR', 'On m\appelle attrape-insectes', 'Rcuprez $1oamorceaux de scarabe aileton.', 'Ah, jeune $r, j\aurais besoin de vos services. J\ai lev ici des gnrations entires.\n\nJ\ai toujours eu une affection toute particulire pour les canetons, mais mon corps n\est plus aussi rsistant que dans ma jeunesse et le cycle de la vie n\a aucune piti.\n\nPourriez-vous rapporter de quoi nourrir ma couve?', '', '', '', '', '', '', 47187),
(70061, 'frFR', 'Entranement arien', 'Accompagnez un Dragonnet pour liminer $2oaherbelins agits, $3oasphex intrusifs et $4oabourrasques acharnes.', 'Les Dragons ont t absents des les pendant trs longtemps, $p. Pour ne rien vous cacher certaines de nos comptences se sont atrophies avec le temps, car elles taient transmises de gnration en gnration.\n\nNous ne devrions avoir aucun problme  duquer ces Dragonnets, et pourtant, nous avons bien du mal  les contrler.\n\nMais dites-moi\n\ntant donn que mme Slistra vous juge digne d\accomplir des tches cruciales, pourriez-vous nous venir en aide et soutenir l\un de nos jeunes?', '', '', '', '', '', '', 47187),
