(70058, 'frFR', 'Un ami mal en point', 'Collectez $1oaplumes de rubis douces, $2oamorceaux de tissu et $3oaperle de verre dans les alentours du sanctuaire de l\Essence rubis pour rparer Couac.', 'Couac s\est bless pendant qu\on volait Il se dbrouillait trs bien, et puis j\ai fonc dans un arbre!\n\n<Lillistrasza dsigne tristement le canard en peluche abm sur sa tte.>\n\nIl perd son rembourrage! Ses plumes sont toutes tordues! Il a mme perdu un il! Nooon!\n\nVous pouvez rparer mon petit Couac, pas vrai?', '', '', '', '', '', '', 47187),
(70055, 'frFR', 'Cachet des temptes', 'Apportez le cachet des temptes au chasse-temptes William,  Hurlevent.', '<Une personne ayant de grandes connaissances en matire de magie pourrait tre intresse par une telle trouvaille.>', '', '', '', '', '', 'Apportez le cachet des temptes au chasse-temptes William,  Hurlevent.', 47187),
