(70050, 'frFR', 'Chasse aux temptes', 'Parlez au chasse-temptes William, au port de Hurlevent.', 'Alors comme a, les huiles vous envoient  l\aventure, hein?\n\nPas d\souci. De toute faon, l\expdition pourra pas mett\ les voiles tant qu\ces temptes lmentaires feront rage.\n\nAllez donc voir le chasse-temptes William. C\est lui qui mne les efforts pour calmer les intempries, il pourra vous fournir tout l\quipement qu\il vous faut.\n\nD\mon ct, j\vais coordonner le reste des prparatifs pendant qu\vous vous clatez.\n\nMais faudra pas oublier d\me rendre la pareille!', '', '', '', '', '', 'Parlez au chasse-temptes William, au port de Hurlevent.', 47187),
(70049, 'frFR', 'Calmer les temptes', 'Rcuprez $1oaparticules d\nergie primordiale sur des adversaires dans les temptes primordiales actives  travers Kalimdor et les royaumes de l\Est.', 'Ces Primalistes ne connaissent pas la fatigue et sment une dvastation lmentaire sans pareille sur Kalimdor et les royaumes de l\Est.\n\nVous devez faire preuve de la mme dtermination, $n. C\est la seule faon de les arrter.\n\nTrouvez leur prochain point d\incursion, retirez nos adversaires des temptes primordiales avant qu\il soit trop tard et anantissez leurs efforts.\n\nNous devons protger Azeroth!', '', '', '', '', '', '', 47187),
(70048, 'frFR', 'Menace primordiale', 'Rcuprez $1oaparticules d\nergie primordiale sur des adversaires dans les temptes primordiales actives  travers Kalimdor et les royaumes de l\Est.', 'Raszageth n\a pas perdu une seconde pour former ses armes de Primalistes.\n\nLe Kirin Tor a dtect de gigantesques temptes  diffrents points stratgiques de Kalimdor et des royaumes de l\Est.\n\nLes Primalistes dchanent la puissance des lments pour se renforcer. Les armes ennemies semblent avoir pour but de semer le chaos non seulement sur les les aux Dragons, mais aussi sur les territoires de l\Alliance et de la Horde.\n\nDbusquez notre adversaire et tudiez ses mthodes. Nous devons l\arrter avant qu\il ne soit trop tard.', '', '', '', '', '', '', 47187),
(70047, 'frFR', 'Prisons glaces', '', '', '', '', '', '', '', '', 47187),
(70042, 'frFR', 'Des occasions  foison', 'Trouvez des objets pour Vish le Furtif.', 'Vous m\avez fait peur, j\ai cru qu\on me volait!\n\nRegardez ces courageux explorateurs et exploratrices prts  conqurir les les aux Dragons leurs sacs remplis  craquer d\outils et d\quipement.\n\nOn pourrait devenir riches, ici!\n\nVoyez si vous pouvez me trouver quelques objets dans le coin, et je partagerai mes gains avec vous.', '', '', '', '', '', '', 47187),
(70041, 'frFR', 'La fureur de la Mange-temptes', 'Embarquez  bord du disque volant de Khadgar et repoussez l\arme primaliste.', 'Raszageth cherche  extraire toute la magie arcanique contenue dans cette tour afin de la dtruire!\n\nKalecgos fait ce qu\il peut pour la retenir pendant que je me sers de mes pouvoirs pour restaurer l\nergie tellurique.\n\nHlas, j\ai bien peur que nous ne soyons bientt  bout de force alors mme que des renforts primalistes s\apprtent  nous submerger.\n\nPrenez mon disque arcanique modifi, repoussez-les et priez pour qu\un miracle se produise.', '', '', '', '', '', 'Parlez  Kalecgos au pied du Vakthros.', 47187),
(70040, 'frFR', 'Dgringolade temporelle', 'Rassemblez vos allis et parlez  Nozdormu.', 'Lorsque les magies de bronze et de l\infini sont entres en collision, cela a envoy Chronormu et ternia dans une chute incontrle  travers le temps.\n\nEn tombant, elles dchirent la trame temporelle elle-mme et envoient d\innombrables ondes dans l\espace et le temps. Pour viter que cela ne provoque d\autres dgts, nous devons absolument les trouver et les ramener. D\aprs mes visions, c\est vous qui allez arrter la chute de Chronormu.\n\nRunissez les allis dont vous aurez besoin pour la sauver pendant que je me concentre sur sa magie.', '', '', '', '', '', 'Rassemblez vos allis et parlez  Nozdormu.', 47187),
(70035, 'frFR', 'Descente des rapides avec Ruriq', '', '', '', '', '', '', '', '', 47187),
(70034, 'frFR', 'Ravitaillement du Consortium: caille de dracamandre', 'Apportez 1caille de dracamandre  Haephesta, au sanctuaire de l\Essence rubis.', 'Ah, $gun dpeceur:une dpeceuse;. Vous cherchez du travail? Le Consortium d\artisanat m\a demand de lui dnicher une caille de dramacandre pour ses clients.\n\nJe suis une artisane, moi, pas une lampiste corvable  merci.\n\nMais ah, peut-tre que vous pourriez en trouver une  ma place?', '', '', '', '', '', 'Apportez 1caille de dracamandre  Haephesta, au sanctuaire de l\Essence rubis.', 47187),
(70033, 'frFR', 'Ravitaillement du Consortium: bottes de migration en cuir', 'Apportez des bottes de migration en cuir  Haephesta, au sanctuaire de l\Essence rubis.', 'Vous savez travailler le cuir, n\est-ce pas? Le Consortium d\artisanat m\a demand de fabriquer des bottes pour ses clients.\n\nIls ne mesurent manifestement pas  quel point je suis occupe! Savez-vous combien d\explorateurs ou d\exploratrices viennent ici chaque jour se plaindre de trous dans leurs chaussures?\n\nSi vous avez le temps, voici les mesures. Ce Consortium d\artisanat pourrait vous offrir d\intressantes perspectives commerciales.', '', '', '', '', '', 'Apportez des bottes de migration en cuir  Haephesta, au sanctuaire de l\Essence rubis.', 47187),
(70032, 'frFR', 'Ravitaillement du Consortium: lunettes de joaillerie', 'Apportez des lunettes de joaillerie en onyx fractur  Haephesta, au sanctuaire de l\Essence rubis.', 'Vous cherchez du travail en joaillerie? Le Consortium d\artisanat m\a demand de lui fabriquer des lunettes pour ses clients.\n\n moi! Comme si j\avais le temps pour a.\n\nVous pouvez vous en charger?', '', '', '', '', '', 'Apportez des lunettes de joaillerie en onyx fractur  Haephesta, au sanctuaire de l\Essence rubis.', 47187),
(70031, 'frFR', 'Ravitaillement du Consortium: rouleau  ptisserie lisse', 'Apportez 1rouleau  ptisserie lisse  Haephesta, au sanctuaire de l\Essence rubis.', 'Vous cherchez  exercer vos talents de calligraphe?\n\nJ\ai reu une commande d\une socit nomme le Consortium d\artisanat.\n\nCette demande me semble tout  fait dans les cordes d\$gun apprenti tel:une apprentie telle; que vous.', '', '', '', '', '', 'Apportez 1rouleau  ptisserie lisse  Haephesta, au sanctuaire de l\Essence rubis.', 47187),
(70030, 'frFR', 'Ravitaillement du Consortium: binocles de qualit garantie', 'Apportez 1paire de binocles de qualit garantie  Haephesta, au sanctuaire de l\Essence rubis.', 'Ah, $gun ingnieur:une ingnieure;! Vous ne pouviez pas mieux tomber.\n\nJ\ai des schmas  corriger, mais une cliente de grande taille est venue me commander des binocles.\n\nVous savez comment en fabriquer, n\est-ce pas?\n\nAlors, mettez-vous au travail puis apportez-les au sanctuaire de l\Essence rubis. Je crois que la cliente reprsentait le Consortium d\artisanat ou quelque chose du genre', '', '', '', '', '', 'Apportez 1paire de binocles de qualit garantie  Haephesta, au sanctuaire de l\Essence rubis.', 47187),
(70029, 'frFR', 'Ravitaillement du Consortium: btonnets runiques en srvite', 'Apportez $1oabtonnets runiques en srvite  Haephesta, au sanctuaire de l\Essence rubis.', 'Vous semblez $gdot:dote; d\une indniable sensibilit magique, $genchanteur:enchanteresse;. Accepteriez-vous de m\aider  honorer une commande?\n\nLe Consortium d\artisanat m\a demand de lui fournir quelques btonnets en srvite pour quelqu\un, mais ces objets ne font pas partie de mon champ d\expertise.\n\nHaephesta vous ddommagera pour ce service. Vous la trouverez au sanctuaire de l\Essence rubis.', '', '', '', '', '', '', 47187),
(70028, 'frFR', 'Ravitaillement du Consortium: amas de cristaux de sel', 'Apportez $1oaamas de cristaux de sel  Haephesta, au sanctuaire de l\Essence rubis.', 'Vous tes d\humeur  bosser un peu? Parfait, j\ai justement besoin d\$gun mineur:une mineuse;.\n\nHaephesta m\a dit que le Consortium d\artisanat a besoin de sel pour sa clientle.\n\nLe hic, c\est que j\ai pas envie de m\en occuper.\n\nAlors, soyez sympa et allez lui chercher a.', '', '', '', '', '', 'Apportez $1oaamas de cristaux de sel  Haephesta, au sanctuaire de l\Essence rubis.', 47187),
(70027, 'frFR', 'Ravitaillement du Consortium: poignets de gomtre en tissu', 'Apportez des poignets de gomtre en tissu  Haephesta, au sanctuaire de l\Essence rubis.', 'Vous cherchez du travail de couture? Le Consortium d\artisanat m\a demand de lui confectionner des protge-poignets pour sa clientle.\n\nBien que je me flicite de voir que ces explorateurs s\intressent  notre noble mtier, je n\ai pas le temps d\honorer de telles demandes.\n\nCela vous intresserait-il de vous charger de ce projet?', '', '', '', '', '', 'Apportez des poignets de gomtre en tissu  Haephesta, au sanctuaire de l\Essence rubis.', 47187),
(70026, 'frFR', 'Ravitaillement du Consortium: hannetons de lave', 'Apportez $1oahannetons de lave  Haephesta, au sanctuaire de l\Essence rubis.', 'Vous cherchez du travail, herboriste? a tombe bien, le Consortium d\artisanat m\a demand de lui procurer des hannetons pour ses clients.\n\nCes terres sont certes gnreuses, mais pas suffisamment pour que je cesse ce que je suis en train de faire afin honorer cette commande.\n\nSi vous avez l\intention d\aller faire un tour, essayez de me dnicher quelques hannetons au passage, voulez-vous?', '', '', '', '', '', 'Apportez $1oahannetons de lave  Haephesta, au sanctuaire de l\Essence rubis.', 47187),
(70025, 'frFR', 'Ravitaillement du Consortium: faucille en draconium', 'Apportez 1faucille en draconium  Haephesta, au sanctuaire de l\Essence rubis.', 'Vous m\avez l\air $gdsuvr:dsuvre;. Que diriez-vous de vous remonter les manches?\n\nJ\ai reu une commande du Consortium d\artisanat pour une faucille en draconium. Je pourrais videmment m\en charger, mais une telle requte sied davantage  l\$gapprenti:apprentie; que vous tes.\n\nFabriquez la faucille demande et apportez-la au sanctuaire de l\Essence rubis. Une Draene du nom d\Haephesta vous rtribuera pour vos efforts.', '', '', '', '', '', 'Apportez 1faucille en draconium  Haephesta, au sanctuaire de l\Essence rubis.', 47187),
