(69981, 'frFR', 'Satisfaction de la clientle', 'Demandez aux clients et clientes du Consortium d\artisanat si leurs commandes rpondent  leurs attentes.', 'Salut, $c! a vous ennuierait de m\aider?\n\nCertains de nos meilleurs clients et clientes ont demand au Consortium d\artisanat de leur reforger des objets, mais nous n\avons eu aucun retour sur notre travail.\n\nSi vous les croisez, pourriez-vous vous assurer qu\ils sont contents de leurs commandes? La satisfaction, satisfaction, satisfaction est notre priorit!', '', '', '', '', '', 'Apportez l\quipement  Mahra Sylvecourbe au gu de la Fourche.', 47187),
(69980, 'frFR', 'Liane-de-mer: un cadeau du pcheur Tinnak', 'Apportez la corde en liane-de-mer  Nunvuq,  Iskaara.', '<Vous constatez que la main spectrale du pauvre pcheur est encore agrippe  un fil tress de varech trs solide, mais lger. Nunvuq,  Iskaara, lui trouvera certainement une utilit.>', '', '', '', '', '', '', 47187),
(69979, 'frFR', 'Une proie lgendaire', 'Tuez Millelieues le cerf ancestral.', 'La sagesse ne s\obtient pas, elle se mrite. Si vous voulez prouver votre valeur, faites-le  la manire de mon peuple, en apprenant comment nous agissons.\n\nTraquez et chassez Millelieues, le cerf ancestral qui nous chappe depuis des gnrations.\n\nVous trouverez ainsi la sagesse que vous recherchez.', '', 'Millelieues a chapp  des gnrations de chasseurs et chasseresses. Peut-tre serez-vous $gcelui:celle; qui aura l\honneur de l\attraper?', 'Millelieues', '', '', '', 47187),
