(69965, 'frFR', 'Assurance qualit', 'Essayez les outils d\Haephesta sur des godes  proximit pour le Consortium d\artisanat.', 'Cherchez-vous du travail, $c?\n\nJe reprsente une nouvelle socit de ngoce, le Consortium d\artisanat, qui met en contact artisans et clients via un rseau de commandes.\n\nL\expdition du Dracaret a rclam des outils de minage enchants. Ceux-ci sont prts, mais nous souhaiterions les essayer avant de procder  la livraison.\n\nVous serez $grmunr:rmunre; pour vos services, bien entendu.', '', '', '', '', '', '', 47187),
