(69946, 'frFR', 'Le matre de son art', 'Allez trouver matre Khadin pour approfondir vos connaissances de mtier.', 'J\ai rencontr un vieux Centaure dans une grotte au nord d\ici lors de ma traverse de ces plaines. Il avait manifestement atteint la pleine matrise de son art et semblait prt  partager son savoir.\n\nC\est lui qui m\a aid  comprendre le savoir que j\ai tir des les aux Dragons.\n\nSi l\ide de vous spcialiser dans votre mtier vous intrigue, vous seriez bien $ginspir:inspire; d\aller trouver ce matre du clan des Teeras nomm Khadin.', '', '', '', '', '', 'Parlez  Khadin dans la grotte de Khadin.', 47187),
(69944, 'frFR', 'Chasse aux temptes', 'Parlez  la chasse-temptes Suhrakka,  la tour des zeppelins.', 'Eh bien, ce sorcier a un talent certain pour les entres en fanfare!\n\nNous ne pourrons pas prendre la mer tant que ces temptes lmentaires feront rage.\n\nAllez voir la chasse-temptes Suhrakka, c\est elle qui mne les efforts pour calmer les intempries. Elle pourra vous fournir tout l\quipement dont vous avez besoin.\n\nPendant ce temps, je vais coordonner le reste des prparatifs. Au moins, a me laissera le temps de lire quelques ouvrages de plus sur l\histoire des Dragons avant le dpart.', '', '', '', '', '', 'Parlez  la chasse-temptes Suhrakka,  la tour des zeppelins.', 47187),
(69939, 'frFR', 'Secours sylvestre', 'Procurez-vous un cornet de neige et donnez-le  la loutre surmene.', 'Ah, vous voil, $n! Je vous ai $gcherch:cherche; partout!\n\nUne autre de nos bestioles locales souffre d\un manque cruel d\affection et de friandises ces derniers temps. Pourriez-vous aller lui trouver quelque chose de dlicieux  grignoter?', '', '', '', '', '', '', 47187),
(69938, 'frFR', 'Frnsie de pche!', '', '', '', '', '', '', '', '', 47187),
(69936, 'frFR', 'Zambul, vandale en chef', 'Terrassez le surveillant Zambul.', 'Bon travail. Ces hrtiques ne pourront plus forcer mes anctres  combattre pour eux. Mais il faut maintenant nous occuper de la brute qui les dirige.\n\nC\est leur surveillant, Zambul. Nous devons l\arrter.\n\nliminez-le.', '', '', 'Surveillant Zambul', '', '', '', 47187),
(69934, 'frFR', 'Curs  vif', 'Livrez les fournitures mdicales.', 'Les potions sont prtes, il ne reste plus qu\ les livrer.\n\nApportez une caisse dans une petite grotte dans la gorge en contrebas. Personne ne sera l pour la rcuprer, mais soyez $gcertain:certaine; que les potions trouveront preneur.\n\nApportez la deuxime caisse  l\infirmerie du poste Gelikyr. C\est une vieille connaissance qui s\occupe des patients l-bas.\n\nJe je sais que rien ne vous oblige  faire tout cela. Mais votre aide a t tonnamment prcieuse, et ces fournitures permettront peut-tre de sauver des vies.', '', '', '', '', '', '', 47187),
(69933, 'frFR', 'Le prix de la curiosit', 'Prlevez un chantillon de liane tenace.', 'Regardez de l\autre ct des gorges, $r. Les Primalistes ont attaqu le poste Gelikyr voil plusieurs jours, et les combats font toujours rage.\n\nCes gens ont besoin d\onguents et de matriel mdical. Je peux leur en prparer, mais mes rserves fondent comme neige au soleil. Puisque vous vous tes $ginvit:invite; chez moi, considrez-vous comme mon $gassistant:assistante;.\n\nAllez dans mon jardin et trouvez la plus grosse liane possible. Dracinez-la et rapportez-la-moi.', '', '', '', '', '', '', 47187),
(69932, 'frFR', 'Chaque vie compte', 'Rcuprez les ingrdients pour remplacer le bandage d\Ara.', 'La fabrication de potions pour les Gelikyrs accapare tout mon temps. Rsultat, je nglige mes autres attributions.\n\nUne cane s\est pose dans mon jardin, avec une cte casse. Je me suis occup de sa blessure, mais son pansement doit tre chang. Et comme vous brlez d\envie de m\aider\n\n<Szareth vous glisse une liste d\ingrdients dans la main.>\n\nVoil ce dont vous aurez besoin. Apportez-moi le reste.', '', '', '', '', '', '', 47187),
(69930, 'frFR', 'Basrikron', '', '', '', '', '', '', '', '', 47187),
(69925, 'frFR', 'Calmer les temptes', 'Rcuprez $1oaparticules d\nergie primordiale sur des adversaires dans les temptes primordiales actives  travers Kalimdor et les royaumes de l\Est.', 'Ces Primalistes ne connaissent pas la fatigue et sment une dvastation lmentaire sans pareille sur Kalimdor et les royaumes de l\Est.\n\nVous devez faire preuve de la mme dtermination, $n. C\est la seule faon de les arrter.\n\nTrouvez leur prochain point d\incursion, retirez nos adversaires des temptes primordiales avant qu\il soit trop tard et anantissez leurs efforts.\n\nNous devons protger Azeroth!', '', '', '', '', '', '', 47187),
(69923, 'frFR', 'Menace primordiale', 'Rcuprez $1oaparticules d\nergie primordiale sur des adversaires dans les temptes primordiales actives  travers Kalimdor et les royaumes de l\Est.', 'Raszageth n\a pas perdu une seconde pour former ses armes de Primalistes.\n\nLe Kirin Tor a dtect de gigantesques temptes  diffrents points stratgiques de Kalimdor et des royaumes de l\Est.\n\nLes Primalistes dchanent la puissance des lments pour se renforcer. Les armes ennemies semblent avoir pour but de semer le chaos non seulement sur les les aux Dragons, mais aussi sur les territoires de l\Alliance et de la Horde.\n\nDbusquez notre adversaire et tudiez ses mthodes. Nous devons l\arrter avant qu\il ne soit trop tard.', '', '', '', '', '', '', 47187),
(69919, 'frFR', 'Besoins en artisanat', 'Parlez  Azley pour apprendre  honorer des commandes d\artisanat.', 'Vous n\avez pas l\air d\avoir deux mains gauches. a vous dirait d\honorer quelques commandes pour des collgues aventuriers et devenir riche, riche, riche?\n\nLaissez-moi vous expliquer les rgles du Consortium d\artisanat, puis vous pourrez accepter des commandes  n\importe quel atelier des les aux Dragons!', '', '', '', '', '', '', 47187),
(69918, 'frFR', 'Fondations prcaires', 'Terrassez la dmolisseuse de rocs Tokara, Molka la Broyeuse et les lmentaires qu\elles ont librs.', 'Les lieuses-de-pierres djaradines menacent de dtruire les fondations de la citadelle! Il faut les arrter!\n\nNous n\avons mme pas encore eu l\occasion de reprendre ses remparts, nous ne pouvons pas les laisser la dtruire!\n\nFaites tout votre possible, $n Et par l j\entends, tez-leur la vie!', '', 'La dmolisseuse de rocs Tokara et Molka savent manipuler la solide pierre d\obsidienne qu\on trouve sous la citadelle mieux que quiconque.', 'Molka la Broyeuse', '', '', '', 47187),
(69915, 'frFR', 'Publicits cibles', 'Rcuprez des prospectus promotionnels sur des chvres de la Fourche et des chvres curieuses.', 'Bonjour, bonjour, bonjour! Vous cherchez du boulot?\n\nOn compte organiser une MGA promo pour notre nouveau service d\artisanat, et il faut que tout le monde soit au courant! Hlas, le vent a dispers mes prospectus et je crois que certaines chvres des environs ont fil avec.\n\nVous pourriez me les rapporter?', '', '', '', '', '', '', 47187),
(69914, 'frFR', 'Les Djaradins se sont rveills', 'coutez les ordres de Slistra, camriste de la reine.', 'J\aimerais avoir le temps pour de plus plaisantes prsentations, mais tout le monde n\est pas Chronormu, n\est-ce pas?\n\nJe suis Slistra, camriste d\Alexstrasza la Lieuse-de-Vie, reine des Dragons.\n\nLa reine Alexstrasza m\a demand de vous transmettre ses gards et de vous escorter aux bassins de l\Essence.\n\nMalheureusement, je vais avoir besoin de votre assistance avant de vous mener  elle.\n\nLe peuple djaradin, notre rival de toujours, s\est veill de son sommeil souterrain et a lanc un assaut contre l\un de nos avant-postes!', '', '', '', '', '', 'Parlez  Sendrax  l\ambassade de Trve-Aile.', 47187),
(69912, 'frFR', 'Ma premire urgence vritable!', 'Convainquez Sendrax d\envoyer sa fuse de signalisation pour prvenir les Dragons de votre arrive.', '<Sendrax semble dconcerte.>\n\nJe n\avais encore jamais vu Slistra en retard, et encore moins aussi en retard, qui plus est  un vnement aussi important.\n\nJe n\y crois pas\n\n<L\expression de Sendrax s\illumine.>\n\nJe pourrais utiliser ma fuse de signalisation pour prvenir de votre arrive. Un dtachement viendrait vous saluer sur-le-champ!\n\nMais je ne l\ai encore jamais utilise', '', '', '', '', '', 'Allez voir Irion  l\ambassade de Trve-Aile.', 47187),
(69911, 'frFR', 'Pardon pour le dsordre', 'Aidez l\ambassadeur Fastrasz  restaurer l\ambassade.', 'J\aimerais pouvoir vous souhaiter la bienvenue sur les les aux Dragons en bonne et due forme, mais je ne suis qu\une sentinelle.\n\n<Sendrax dsigne d\un geste la tour derrire elle.>\n\nAdressez-vous plutt  l\ambassadeur Fastrasz, au centre des visiteurs. Il pourra rpondre  vos questions avant l\arrive des Dragons.\n\nAttention o vous mettez les pieds. La dernire fois que j\y suis alle, il nettoyait encore les gravats', '', '', '', '', '', '', 47187),
(69910, 'frFR', 'O est Irion?', 'Demandez  Sendrax quand les Dragons arriveront.', 'Quelle surprise!\n\nbyssian avait affirm qu\Irion attendrait notre arrive en compagnie d\une dlgation d\Alexstrasza la Lieuse-de-Vie, reine des Dragons.\n\nUn Dragon tient toujours ses promesses.\n\nAu moins, cette Draknide impatiente est venue  notre rencontre. Allez donc vous renseigner sur l\arrive des autres, voulez-vous?', '', '', '', '', '', '', 47187),
(69904, 'frFR', 'Un calme inquitant', 'Trouvez les recrues de Noriko au camp d\Antonidas.', 'Vous auriez une minute  m\accorder, $p? Mes recrues Barbott et Tucky n\ont plus donn signe de vie depuis un bon moment.\n\nC\est inquitant.\n\nJe leur ai demand d\aller nous chercher des fournitures pour l\auberge, elles n\ont pas d aller bien loin\n\nRetrouvez-les, s\il vous plat. Mais j\aime autant vous prvenir Ces canailles peuvent se montrer trs pnibles.', '', '', '', '', '', '', 47187),
(69902, 'frFR', 'De la thorie  la pratique', 'Aidez Tyrgon  soigner la crature.', '$n, j\ai besoin de votre assistance.\n\nJ\espre que personne ne s\attendait  ce que je concocte les remdes, que je calme et soigne le proto-dragonnet, et que j\enseigne aux enfants en mme temps! Faire plusieurs choses  la fois, c\est courir  la catastrophe.\n\nVous pouvez commencer par utiliser ces fleurs. Quant  moi, j\ai besoin de quelques minutes pour me prparer  soigner ce petit.\n\nAvec un peu de chance, les enfants tireront un enseignement de cet incident.', '', '', '', '', '', '', 47187),
(69901, 'frFR', 'Place aux pros', 'Obtenez $1oafleurs de soleil.', 'Iyali vous a-t-elle dit depuis combien de temps cette pauvre crature souffre? Si elle a trop mal pour se nourrir, nous devons la soigner au plus vite.\n\nEn temps normal, un camp de l\expdition du Dracaret disposerait de tout le ncessaire pour nous en occuper, mais nous rencontrons des difficults pour nous approvisionner ici,  la frontire des les aux Dragons.\n\nNe vous en faites pas: la terre nous fournira ce qu\il nous faut! Si vous m\apportez des fleurs de soleil, je pourrai prparer une pommade pour calmer le drake et procder aux soins.', '', '', '', '', '', '', 47187),
(69900, 'frFR', 'Identifier la source', 'Tuez le ou la Primaliste qui exprimente dans le domaine Sauvage.', 'D\aprs ce que m\ont racont les enfants, il y a peut-tre un ou une Primaliste dans le domaine Sauvage.\n\nNous devons enquter immdiatement.\n\nD\aprs les observations de nos chercheurs et chercheuses, les Primalistes ont tendance  voler leurs ufs et leurs petits pour les imprgner de magie et les corrompre. Ceux qui ne s\adaptent pas  leurs pouvoirs succombent  une mort lente Ces Primalistes n\ont aucune compassion.\n\nNous devons les chasser du domaine. Occupez-vous-en pendant que je calme les enfants. Inutile de leur en dire davantage.', '', '', '', '', '', '', 47187),
(69899, 'frFR', 'Recherches secrtes', 'Aidez Iyali et les autres enfants.', 'Je sais que j\agis bizarrement Je suis dsole!\n\nVous avez srement devin que je mentais.\n\nJe veux bien vous confier mon secret, mais vous devez me promettre de ne rien dire aux adultes!', '', '', '', '', '', '', 47187),
(69898, 'frFR', 'tude carnivore', 'Rcuprez $1oapice de dlicieuse viande de potamodonte.', 'J\ai un autre devoir  faire Les leons du professeur Tyrgon sont super difficiles! Il veut qu\on trouve ce que mangent les proto-dragonnets.\n\nJe connais dj la rponse: de la viande de potamodonte!\n\nVous pourriez m\en rapporter un bout? a ferait un trs bon support visuel pour mon projet.\n\nMais il faut que ce soit de la TRS bonne viande, hein? Du potamodonte potel, par exemple. Un morceau qu\une maman proto-drake donnerait  son petit proto-dragonnet pour l\aider  devenir fort. Parce que, euh a ferait plaisir  monsieur Tyrgon.', '', '', '', '', '', '', 47187),
(69897, 'frFR', 'Devoir sur le comportement', 'Caressez $4oaDragonnets endormis et retournez voir Iyali.', 'Je cherche quelqu\un qui s\y connat en proto-dragonnets. Comme ceux qui vivent dans le domaine Sauvage!\n\nEst-ce qu\ils sont aussi colriques que les gros? Est-ce qu\ils mordent, ou ils vous crachent du feu dessus?\n\nEt si je euh, vous caressiez un proto-dragonnet? Est-ce qu\il saurait que vous essayez de l\aider?\n\nJe demande pour la science, bien sr. Tyrgon nous dit toujours de tester nos hypa non hypou Hmph! Hypataterre Rah! Nos THORIES!\n\nJe crois qu\ils aimeraient bien qu\on les caresse, et que a les rendrait heureux. Vous voudriez bien essayer pour moi?', '', '', '', '', '', '', 47187),
(69896, 'frFR', 'Dtour dsastreux', 'Allez voir l\lmentaliste Taiyang dans les ruines du caveau d\Essence.', 'Quand j\ai rejoint l\expdition du Dracaret, je savais que l\on s\aventurerait en territoire dangereux, mais je ne m\attendais pas  affronter des lmentaires!\n\nNotre site de fouilles aux ruines du caveau d\Essence a succomb au chaos le plus total. Des monstruosits de pierre ont commenc  sortir du sol! Nous avons appel une lmentaliste  l\aide, mais je crois qu\elle aura besoin de toute l\aide disponible.\n\nVous pouvez peut-tre l\aider? Notre camp se trouve sur l\autre rive de la rivire.', '', '', '', '', '', '', 47187),
