(69870, 'frFR', 'Des photos pour la science', 'Allez voir Akunda l\Inventoriste et l\artilleuse Fren prs des rapides Intarissables.', 'Les photos rassemblent les gens, $p.\n\nNos inventoristes se dplacent gnralement par deux pour des raisons de scurit, et nous sommes ravis de voir des membres provenant de diffrentes factions et milieux travailler la main dans la main afin de mieux connatre ces les incroyables.\n\nL\un de ces duos est justement en train de cartographier l\une des rivires centrales des rivages de l\veil.\n\nSi vous souhaitez nous aider, participez  leurs efforts de catalogage de la faune locale.', '', '', '', '', '', 'Allez voir Akunda l\Inventoriste et l\Artilleuse Fren prs des rapides Intarissables.', 47187),
(69869, 'frFR', 'Le paradis des Inventoristes', 'Allez voir l\inventoriste Coralie au camp de base du Dracaret.', '<Doc Sinok est  bout de souffle lorsqu\il vous remet une lettre d\invitation  un entranement au camp de base de l\expdition du Dracaret. Il s\empresse de vous expliquer.>\n\nGentille Elfe. Petit homme fier. Plein d\appareils photo. D\accord?\n\n<Doc Sinok attend votre rponse avec impatience.>', '', '', '', '', '', 'Allez voir l\inventoriste Coralie au camp de base du Dracaret.', 47187),
