(69096, 'frFR', 'Le rle de Tavan', 'Essayez de rconforter l\orpheline centaure Chime.', 'Vous voyez cette silhouette solitaire, sur la rive?\n\n<Elle tend la main vers le nord-est, o vous apercevez une jeune Centaure, le regard fix sur l\eau.>\n\nChime a perdu ses deux parents dans l\assaut des Nokhuds. J\ai soign toutes ses blessures physiques, mais impossible de lui faire avaler quoi que ce soit ou prononcer un seul mot depuis. Son regard reste plong dans le vide, sans bouger.\n\nSon tat dpasse le cadre de mes comptences, et je ne sais plus quoi faire. Pourriez-vous essayer de lui parler, $n?', '', '', '', '', '', '', 47187),
(69095, 'frFR', 'Chien domestique', 'Chevauchez Tavan jusqu\ Maruuka.', 'Nous avons pu stabiliser tout le monde, grce  Tavan et  vous, mais un certain nombre de ces Centaures auront besoin d\une convalescence un peu plus longue  Maruuka.\n\nEt si vous preniez la tte de notre caravane pour le retour? Vous avez tous les deux largement mrit cet honneur, aprs tout!', '', '', '', '', '', '', 47187),
(69094, 'frFR', 'Sauver les Centaures', 'Portez secours aux Centaures blesss dans le village de Daruukhan.', 'Les Nokhuds sont les pires tratres qui soient! Le village de Daruukhan n\abrite que des artisans et artisanes qui n\ont rien pu faire contre une telle attaque.\n\nNous avons dsesprment besoin de votre aide, $n. Les Nokhuds sont toujours dans les environs, et il faut s\occuper des blesss!\n\nFouillez le village et amenez-moi les victimes. Nous tcherons de soigner au plus vite les blessures les plus srieuses et nous les stabiliserons du mieux que nous pourrons!', '', '', '', '', '', '', 47187),
(69093, 'frFR', 'Un nouveau mystre', 'Allez voir Naleda Mirerive au camp de base du Dracaret.', '<Doc Sinok est  bout de souffle lorsqu\il vous remet une lettre d\invitation au camp de base de l\expdition du Dracaret. Il s\empresse de vous expliquer.>\n\nPorte scelle. Secrets des Titans. D\accord?\n\n<Doc Sinok attend votre rponse avec impatience.>', '', '', '', '', '', 'Allez voir Naleda Mirerive au camp de base du Dracaret.', 47187),
(68799, 'frFR', 'Retour au sanctuaire de l\Essence rubis', 'Retournez au sanctuaire de l\Essence rubis.', 'Et votre aventure  dos de Dragon ne fait que commencer!\n\nNe passez pas  ct des nouvelles aventures et expriences qui vous attendent sur les les aux Dragons, et rendez-nous visite dans n\importe lequel de nos avant-postes.\n\nEn attendant, retournez voir Alexstrasza afin de poursuivre votre exploration de ces terres.', '', '', '', '', '', 'Retournez voir Alexstrasza au sanctuaire de l\Essence rubis.', 47187),
(68798, 'frFR', 'Les dracoglyphes et vous', 'Obtenez le dracoglyphe  l\observatoire du guet du Firmament, puis parlez  Lithragosa pour utiliser votre talent.', 'Bien entendu, il n\y a pas que Glensera et moi qui nous intressons aux aventuriers et aventurires. Lithragosa est impatiente de vous aider  matriser le vol  dos de Dragon, et par chance, vous connaissez dj Clormu.\n\nIl existe un peu partout sur les les aux Dragons des glyphes permettant d\apprendre des astuces et techniques de vol. D\ailleurs, il y en a un ici-mme, dans l\observatoire du guet du Firmament.\n\nQuand vous l\aurez trouv, Lithragosa vous aidera  l\utiliser!', '', 'Trouvs sur les les aux Dragons, ces glyphes vous permettent d\apprendre de nouvelles astuces et techniques pour le vol  dos de dragon.', 'Dracoglyphe', '', '', '', 47187),
(68797, 'frFR', 'Une nouvelle paire de cornes', 'Allez voir Glensera  la tribune de transformation pour personnaliser l\apparence de votre drake.', 'Les Dragons aiment soigner leur apparence tout autant que les cratures mortelles. Celle de votre drake pourra voluer en fonction de vos trouvailles et de votre exprience.\n\nAdressez-vous  Glensera,  la tribune de transformation, pour en savoir plus!', '', '', '', '', '', '', 47187),
(68796, 'frFR', 'L\observatoire du guet du Firmament', 'Rendez-vous  l\observatoire du guet du Firmament, aux rivages de l\veil.', 'Voil pour les rudiments du vol  dos de Dragon! Vous vous en sortez trs bien.\n\nJ\aimerais  prsent vous prsenter  d\autres personnes qui participent  cette aventure. Nous avons fait de l\observatoire du guet du Firmament notre foyer.\n\nClormu vous montrera le chemin. Lorsque vous serez $gprt:prte;  votre envol, allez le voir!\n\n bientt sur place!', '', '', '', '', '', 'Allez voir le seigneur Andestrasz  l\observatoire du guet du Firmament.', 47187),
(68795, 'frFR', 'Vol  dos de Dragon', 'Parlez au seigneur Andestrasz au sanctuaire de l\Essence rubis.', 'Vous l\avez peut-tre dj constat: les les aux Dragons reprsentent un vaste territoire.\n\nCertains des drakes ont une envie imprieuse d\explorer le moindre recoin de ces les ressuscites, y compris ses parties les moins accessibles depuis le sol. Ces drakes ont hte qu\une seconde paire d\yeux les assiste dans leurs voyages, et en change, ils sont prts  accompagner un chevaucheur ou une chevaucheuse aux quatre coins de la rgion.\n\nAdressez-vous au seigneur Andestrasz, au sanctuaire de l\Essence rubis, pour en savoir plus sur leurs projets.', '', '', '', '', '', 'Parlez au seigneur Andestrasz au sanctuaire de l\Essence rubis.', 47187),
(68794, 'frFR', 'Allis des Dragons', 'Parlez  Alexstrasza au sige des Aspects de Valdrakken.', 'Votre assistance envers les les aux Dragons n\est pas passe inaperue, $n.\n\nAfin de vous remercier pour votre soutien indfectible, la Lieuse-de-Vie en personne souhaite vous montrer quelque chose.\n\nAllez lui parler au sommet de la tour. Les Aspects vous attendent.', '', '', '', '', '', 'Parlez  Alexstrasza au sige des Aspects de Valdrakken.', 47187),
(68644, 'frFR', 'Le cur sur la main', 'Aidez  soigner Rusette.', 'Bien, j\ai  prsent tout le ncessaire pour soigner Rusette!\n\nIl tait temps, je doute qu\elle rsiste encore bien longtemps dans son tat.\n\nJe vais avoir besoin de quelqu\un pour m\aider. Je ferais bien appel  Calli, mais si a ne vous embte pas, vous pourriez peut-tre la remplacer?\n\nFaites-moi savoir quand vous serez $gprt:prte;  commencer, $n.', '', '', '', '', '', '', 47187),
(68643, 'frFR', 'Vitamines et minraux', 'Obtenez $1oafioles d\eau minrale.', 'J\aurais d me douter que Stria m\en voudrait de vous avoir demand d\attaquer des animaux\n\nIl est vrai que d\autres mthodes s\offrent  nous.\n\nPrenez ces fioles et remplissez-les d\eau provenant des cristaux de glace des environs.\n\nJe les souponne de contenir des minraux imprgns d\nergie de cristal tellurique et d\tre  l\origine de cette crise.', '', '', '', '', '', '', 47187),
(68642, 'frFR', 'Une situation pineuse', 'Rcuprez $1oapines imprgnes d\arcanes.', 'Je suis toujours dtermine  aider Rusette, mais je ne veux pas retarder Calli dans son travail.\n\nPour lui administrer le remde, je vais avoir besoin d\pines imprgnes d\arcanes prleves sur les cristalpines. Ils ne verront srement pas d\inconvnient  ce que vous en preniez quelques-unes!\n\nEn revanche, mfiez-vous des bakars! Ils raffolent des cristalpines et ils risquent de ne pas apprcier que vous les touchiez. Au pire, s\ils vous attaquent, vous pourrez en profiter pour rcuprer des pines au passage.\n\nMais seulement en dernier recours.', '', '', '', '', '', '', 47187),
(68641, 'frFR', 'Mousse toujours', 'Rcuprez $1oamorceaux de drakmousse.', 'Pauvre bte\n\nJ\ai bien peur qu\elle souffre d\une intoxication alimentaire.\n\nPar chance, mon grand-pre tait druide et il m\a appris  soigner les maladies de type arcanique.\n\nJe n\ai pas tous les ingrdients  disposition, mais nous devrions pouvoir nous en sortir avec les moyens du bord.\n\nPour commencer, je vais avoir besoin de drakmousse. C\est une sorte de lichen rare qui ne pousse que sur les os de dragons.', '', '', '', '', '', '', 47187),
(68639, 'frFR', 'Prdateurs polaires en maraude', 'Tuez $1oapelages-algides infects.', 'Nous sommes ici pour tudier les pelages-algides.\n\nLeurs terrains de chasse ont t corrompus par les lignes telluriques et les nergies arcaniques s\infiltrent dans les nappes phratiques et les plantes au point de contaminer certaines proies, comme les rusards.\n\nMais contrairement aux autres organismes, les pelages-algides survivent  l\infection et s\en trouvent mme renforcs.\n\nLe problme, c\est qu\ils deviennent galement agressifs. Affrontez-en quelques-uns et j\en profiterai pour observer leur force et leur comportement.\n\nMon rapport aidera le Kirin Tor  trouver une solution adapte.', '', '', '', '', '', '', 47187),
(68087, 'frFR', 'Dangers  Daruukhan', 'Parlez au messager teera pour couter la requte urgente de Selbekh.', 'J\imagine que je n\ai pas le choix Je vais devoir vous renvoyer  Maruuka avec Tavan.\n\nMais attendez Qui voil? J\espre qu\on ne m\amne pas encore un bakar gant!', '', '', '', '', '', '', 47187),
(68085, 'frFR', 'Former un berger', 'Apprenez  Tavan  conduire les troupeaux d\argalis au Mallakh.', 'Vous voulez que je dresse votre animal pour en faire un bakar de berger? Eh bien, c\est en effet notre spcialit, mais je n\en avais encore jamais vu d\aussi gros\n\nCela dit, les argalis n\ont pas l\air perturbs par sa prsence, et ils ont un instinct remarquable, a, vous pouvez me croire!\n\nJe suis dispos  lui laisser une chance, mais un bakar de berger ne doit pas seulement tre docile, il doit aussi tre malin. Et s\il n\est pas capable de contrler le troupeau, jamais les argalis ne lui obiront. C\est une tche bien plus complique qu\il n\y parat! Allez-y, essayez. Je vais vous observer.', '', '', '', '', '', '', 47187),
(68084, 'frFR', 'Le gentil gant', 'Envoyez Tavan auprs du berger Tvate au Mallakh pour tre dress.', 'Si Tavan est vraiment aussi doux que le prtend Jadar, c\est peut-tre qu\il a l\instinct d\un bakar de berger!\n\nLes Aylaags sont rputs pour leurs grands troupeaux d\argalis, mais ce clan n\est pas orgueilleux au point d\exiger de fastueux cadeaux en change d\un service.\n\nConduisez Tavan au berger Tvate, au Mallakh; c\est un recoin entre deux collines au sud-ouest d\ici, o les Aylaags dressent leurs bakars.\n\nPrions Ohn\ahra pour que Tvate puisse faire quelque chose, sans quoi je serai  court d\ides.', '', '', '', '', '', '', 47187),
(68083, 'frFR', 'Essaye encore, Tavan!', 'Retournez voir la gurisseuse Selbekh  Maruuka pour lui annoncer la mauvaise nouvelle.', 'Retournez voir les Teeras et dites-leur que personne ne pourra faire de Tavan un bakar de chasse, pas mme moi. Il n\en a tout simplement pas l\toffe.\n\nC\est le bakar le moins froce qu\il m\ait t donn de rencontrer. Je suis prt  parier qu\il irait mme jusqu\ se lier d\amiti avec le gibier, si on le laissait faire! Ha!', '', '', '', '', '', 'Retournez voir la gurisseuse Selbekh  Maruuka.', 47187),
(67921, 'frFR', 'Le chien de chasse', 'Chassez des btes dangereuses avec Tavan pour prouver qu\il est digne d\tre dress.', 'Allez chasser les cratures du coin avec votre bakar. Plus la proie sera grande, mieux ce sera. Je vais vous observer d\ici, a me permettra de dcider si votre animal est digne de recevoir les enseignements des Shikaars.\n\nMais je vous prviens: je n\accepte que l\lite.', '', '', '', '', '', '', 47187),
(67772, 'frFR', 'Des ennuis avec Tavan', 'Aidez la gurisseuse Selbekh  prparer Tavan pour l\entranement.', 'Bonjour, mon $uami:amie;. Bienvenue  Maruuka. Je suis Selbekh, la gurisseuse du clan des Teeras.\n\nVous savez vous y prendre avec les animaux, $n? Qui sait, je pourrai peut-tre rsoudre mon problme avec une perspective diffrente.\n\nCe cher Tavan est un excellent compagnon, mais il est devenu un poids pour le clan. Si nous ne lui trouvons pas d\utilit, je crains que nous ne devions le chasser Pouvez-vous m\aider?', '', '', '', '', '', '', 47187),
