(67724, 'frFR', 'Flammes salvatrices', 'Rcuprez $1oafils de soie de tremble-toile.', 'Kattigat et moi avons effectu le trajet jusqu\ici pour faire nos preuves face  la Flamme fracture et rcuprer le Valthrux.\n\nMais il a fallu que cette Elfe se fasse mordre par les araignes de glace, ce qui nous oblige  rester ici pour veiller sur elle. Rsultat, nous n\avons toujours pas eu l\occasion d\en dcoudre et ces araignes risquent de nous faire la peau sans nous en laisser le temps!\n\nIl va falloir nous arranger pour les garder  distance.\n\nPar chance, il existe une mthode naturelle pour les repousser. En brlant la soie de leurs cocons, on peut produire une odeur qu\elles ne supportent pas.\n\nAllez donc en chercher et je les jetterai au feu de manire  les tenir en respect!', '', '', '', '', '', '', 47187),
(67717, 'frFR', 'Tissereine Ashkaz', '', '', '', '', '', '', '', '', 47187),
(67700, 'frFR', 'Direction, les les aux Dragons!', 'Embarquez  bord du Dracaret robuste pour les les aux Dragons sur les quais de Hurlevent.', 'Bonne nouvelle, $p! Notre expdition avance a atteint les les aux Dragons.\n\nGrce  vos efforts et  ceux des autres membres du Dracaret, nous avons tabli une tte de pont scurise et nous avons pu entrer en contact avec l\ambassade draconique.\n\ntes-vous $gprt:prte;  nous accompagner dans notre prochain voyage vers les les aux Dragons?', '', '', '', '', '', 'Rejoignez Toddy Bourbon sur les rivages des les aux Dragons.', 47187),
(67606, 'frFR', 'Remde de dryade', 'Procurez-vous une friandise pour oisillon savoureuse et donnez-la au caneton dcourag.', 'Pendant votre absence, un livre onirique m\a informe qu\un des canetons locaux avait le moral en berne. Fort heureusement, je sais exactement comment rgler ce problme!\n\nChaque fois que je ne me sens pas bien, je grignote une petite douceur sucre. En tant qu\experte en cratures mignonnes, je suis certaine de pouvoir appliquer le mme principe.\n\nCe caneton aime tout particulirement un dessert local appel friandise pour oisillon savoureuse. Pourriez-vous en trouver et en rapporter  ce pauvre chri? C\est ce que ferait une Dryade, aprs tout!', '', '', '', '', '', '', 47187),
(67605, 'frFR', 'Les plaines du tonnerre', 'Rcuprez la corne d\Ayanga.', 'Une immense crature des temptes rde sur cette crte. Bien des chasseurs et chasseuses shikaars ont tent de l\abattre, mais peu ont survcu face  sa sauvagerie.\n\nSi vous tes en qute de gloire  la chasse, vous pourriez tenter de terrasser cet animal et me rapporter sa corne en tribut.', '', 'Un lzard-tonnerre vicieux avec un penchant pour la destruction des campements centaures.', 'Ayanga', '', '', '', 47187),
(67566, 'frFR', 'Survol glaciaire  Avanc', 'Traversez les anneaux en planant.', 'Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 47187),
(67565, 'frFR', 'Survol glaciaire', 'Traversez les anneaux en planant.', 'Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 47187),
(67564, 'frFR', 'Missive artisanale', 'Apportez la facture du Consortium d\artisanat  Thomas Briand.', '$gAventurier:Aventurire;! Vous allez au sanctuaire de l\Essence?\n\nDans ce cas, auriez-vous l\amabilit d\apporter cette facture  Thomas Briand? Il a command quelques bouteilles sur mesure et notre souffleur de verre vient enfin de rentrer avec le prix des matriaux requis.\n\nVous devriez le trouver un peu plus loin sur ce chemin, probablement en train d\assommer quelque pauvre hre avec les qualits de son mari\n\nJe suis sre qu\il vous ddommagera pour votre peine.', '', '', '', '', '', 'Apportez la facture du Consortium d\artisanat  Thomas Briand, au sanctuaire de l\Essence rubis.', 47187),
(67299, 'frFR', 'Sus aux drakes', 'Servez-vous d\une ptoire des arcanes pour abattre $1oaproto-drakes.', 'Les Primalistes ne cessent de harceler notre camp avec leurs drakes!\n\nJusqu\ prsent, nos boucliers ont suffi  les tenir en respect, mais nous aurions bien besoin d\aide pour les abattre.\n\nServez-vous d\une de nos ptoires pour liquider ces drakes!', '', '', '', '', '', '', 47187),
(67298, 'frFR', 'Les merveilles du monde', 'Dcouvrez comment Thomas trouve l\inspiration pour ses crations d\artisanat.', 'Thomas, mon poux, a compris bien des choses en explorant ces terres primordiales.\n\nSuivre son exemple vous inspirera peut-tre vos propres rvlations.', '', '', '', '', '', '', 47187),
