(67296, 'frFR', 'Tour d\Iskaara', 'Traversez les anneaux en planant.', 'Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 47187),
(67295, 'frFR', 'C\est ma spcialit', 'Parlez  Miguel Briand.', 'Ah, vous avez choisi une spcialisation,  ce que je vois. Rien de tel qu\avoir un mtier bien  soi, pas vrai?\n\nEn tant que membre du Consortium d\artisanat, je serais ravi de vous aider  perfectionner votre savoir-faire.\n\nAuriez-vous quelques minutes  m\accorder? J\ai de prcieux conseils  vous prodiguer qui vous seront sans doute utiles dans vos aventures.', '', '', '', '', '', '', 47187),
(67222, 'frFR', 'Des nuages plus sombres', 'liminez la menace primaliste  la cime Chant-du-Vent.', 'Les Primalistes ont infect la cime Chant-du-Vent de leurs enseignements ineptes, et nos congnres qui y vivent commettent la terrible erreur d\y croire.\n\nSi nous les aidons  chasser la menace primaliste de cette terre sacre, les autres clans accepteront peut-tre de nous rendre la pareille le moment venu. Vous pensez pouvoir faire quelque chose?', '', '', '', '', '', '', 47187),
(67221, 'frFR', 'Expertise mtallique', 'Rcuprez $1oamorceaux de draconium cristallis dans le filon Cendrclat.', 'Si vous esprez exploiter le plein potentiel de la forge du Gardeterre, vous devez connatre les bases de la cration de l\alliage calcin de Dragon noir. Ensuite, vous pourrez marcher dans les pas des plus grands forgerons et forgeronnes de Neltharion.\n\nApportez-moi un morceau de draconium cristallis, que l\on trouve dans les profondeurs du filon Cendrclat. En change, je vous offrirai le savoir que vous convoitez.', '', 'Dangereusement anim par la puissance du draconium  l\intrieur.', 'clacier cristallis', '', '', '', 47187),
(67220, 'frFR', '10.0 [DNT] [GAMEPLAY TEST] - [SPAWNTRACKING] (JSS)', '', '', '', '', '', '', '', '', 47187),
(67178, 'frFR', 'Yeux blancs, Dragon bleu', 'Aidez Yumadormu  battre Setogosa.', '$PC, pouvez-vous faire en sorte que la partie se droule le plus quitablement possible?\n\nSetogosa a une certaine tendance  contourner les rgles pour satisfaire ses caprices.\n\nJe n\ai pas trs envie de voir perdre Yumadormu face  ses tricheries.', '', '', '', '', '', '', 47187),
(67177, 'frFR', 'ON RECHERCHE: Ripail', 'Tuez Ripail et rcuprez ses cornes.', 'Puisque vous allez sjourner parmi les Roharts, vous feriez bien de vous rendre utile!\n\nUne redoutable crature surnomme Ripail s\est installe dans les parages il y a peu.\n\nEt ses congnres commencent  lui emboter le pas. Autant en profiter pour tirer parti de la situation.\n\nTuez Ripail et rapportez-moi ses cornes. Nous en aurons besoin pour confectionner des fournitures afin d\agrandir notre avant-poste.', '', 'Une bte colossale ayant lu domicile bien loin de son terrain de chasse habituel.', 'Ripail', '', '', '', 47187),
(67175, 'frFR', 'Comment neutraliser un bateau jouet explosif', 'Parlez  la mre de Toulk, puis rcuprez le bateau jouet.', 'Bien que je rpugne  l\ide de priver une enfant de son jouet, le Kirin Tor pourrait en apprendre long en l\tudiant afin de comprendre comment il a pu absorber une telle quantit d\arcana.\n\nCela tant dit je ne tiens pas  froisser les Roharts alors que notre amiti est si rcente. J\ai ici une baguette capable de dissiper la magie\n\nAllons d\abord voir la mre de Toulk, nous aviserons ensuite.', '', '', '', '', '', '', 47187),
(67174, 'frFR', 'Dtection arcanique', 'Inspectez les effets roharts du coin de pche de Khuri en qute de traces de magie arcanique.', 'Salutations! Je m\appelle Miva il-des-Astres, et c\est moi qui supervise les recherches arcaniques dans le secteur.\n\nLa trave d\Azur regorge de magie, aussi bien bnigne que particulirement dangereuse, c\est selon.\n\nJe suis cense m\assurer qu\il ne reste plus la moindre trace d\nergies arcaniques dans les effets des Roharts.\n\nEt pour cause, nous avons dj eu un cas de combustion spontane sur une bote  pche au camp d\Antonidas!\n\nPouvez-vous inspecter quelques objets  l\aide de mon dtecteur? De mon ct, j\ai encore deux mots  dire  Julk, l-bas.', '', '', '', '', '', '', 47187),
(67173, 'frFR', 'Klepto-Gnolls', '', '', '', '', '', '', '', '', 47187),
(67167, 'frFR', 'L\heure du duel est arrive!', 'Dfiez $1oaDracthyrs  une partie de Hearthstone.', 'Maintenant que j\ai rcupr mon deck, je peux me concentrer sur le recrutement de nouveaux membres pour le club! Je pensais demander aux Dracthyrs\n\nOh, mais vous pouvez m\aider pour a aussi, $n!\n\nJe vais tre assez occup  tenter de convaincre d\autres Dragons de me rejoindre, mais je tiens aussi  recruter des Dracthyrs.\n\nVous voulez bien leur parler pour moi? Par contre, je vous prviens, il y en a plein qui n\ont encore jamais jou de leur vie.', '', '', '', '', '', '', 47187),
(67154, 'frFR', 'Vestiges entropiques', 'Rcuprez $1oaplaque(s) de sable vitrifi sur les cratures des Sables changeants.', 'Lorsqu\une entit s\aventure dans les voies temporelles, il arrive que les sables du temps s\accumulent sur son corps.\n\nEn gnral, ils disparaissent spontanment au bout de quelques instants, mais parfois, les fluctuations entropiques inhrentes au voyage dans le temps dclenchent un processus de vitrification qui les rend trs difficiles  enlever. Vous pouvez me croire, cela m\a cot plus d\une paire de chaussures flambant neuves.\n\nCela tant dit, les proprits du sable vitrifi pourraient nous aider dans notre tche. Rcuprons-en autant que possible.', '', '', '', '', '', '', 47187),
(67143, 'frFR', 'L\offrande d\un cur', 'Fabriquer un cur en bouteille |A:Professions-Icon-Quality-Tier3-Small:20:20|a en faisant appel  n\importe quelle profession.', 'Maintenant que nous avons l\essence lmentaire, auriez-vous l\obligeance de la placer dans cette bouteille?\n\nC\est un jeu d\enfant. Procdez comme pour n\importe quelle autre recette.\n\nEt n\hsitez pas  retourner prlever des composants de grande qualit sur les lmentaires du creux des Bufflaciens si vous en avez perdu ou si vous les avez dj utiliss.', '', '', '', '', '', 'Apportez le cadeau de Miguel Briand au sanctuaire de l\Essence rubis.', 47187),
(67142, 'frFR', 'Festin de wyrm', 'Collectez la chair calcine par la lave des rdeurs de la surface,  Ruisse-Braise.', 'Protger la citadelle d\Obsidienne est un travail qui creuse, et les Dragons ont un grand apptit. Nous devons renouveler nos rserves de nourriture.\n\nSous la lave durcie, vous trouverez de dlicieux vers qui se tortillent dans le magma. Pour vous, a n\est sans doute pas trs ragotant, mais pour un Dragon affam, c\est un vritable festin.\n\nEmmenez notre serviteur, Gulchack, et utilisez son pointeur pour le diriger vers les perturbations dans la lave. Il attirera les vers et vous n\aurez plus qu\ les rcuprer!', '', '', '', '', '', '', 47187),
(67137, 'frFR', 'Par des pros, pour des pros', 'Parlez  Mahra Sylvecourbe.', 'Si j\en crois Haephesta, vous seriez vous aussi $gun artisan:une artisane;.\n\nNous aimerions vous offrir de l\quipement de qualit professionnelle en remerciement de l\aide que vous nous avez apporte. C\est bien naturel entre nous.\n\nAllez parler  notre tailleuse, Mahra Sylvecourbe.', '', '', '', '', '', 'Parlez  Mahra Sylvecourbe sanctuaire de l\Essence rubis.', 47187),
(67111, 'frFR', 'L\apprentie mal en point', 'Rcuprez $1oaglandes  venin geles.', 'Cette mission tait une erreur depuis le dpart. Alia Lever-de-Soleil a fait appel  nous pour l\aider  empcher la Flamme fracture de mettre la main sur un dangereux artfact dont nous avons remont la piste jusqu\ ces ruines.\n\nHlas, l\adversaire nous a devancs et le secteur est infest d\araignes de glace. Alia a t gravement empoisonne, j\ai bien peur qu\elle succombe bientt faute de soins adapts.\n\nJe connais la formule du contrepoison, mais je vais avoir besoin de glandes  venin prleves sur les araignes des environs et je ne peux pas la laisser seule dans son tat. Pourriez-vous aller m\en chercher?', '', '', '', '', '', '', 47187),
(67100, 'frFR', 'Un cadeau pour Miguel', 'Apprenez-en plus sur la qualit auprs de Thomas, puis rcuprez $2oaesprits incandescents prs du creux des Bufflaciens pour le cadeau de Miguel.', 'Vous voulez bien me rendre un service, $p?\n\nJe veux offrir un cadeau  Miguel, mon mari.\n\nVous n\imaginez pas  quel point il compte pour moi, mais j\ai eu tant  faire ces derniers temps que je n\ai pas eu le temps de lui prparer une surprise.\n\nPourriez-vous m\aider  lui faire le cadeau qu\il mrite?', '', '', '', '', '', '', 47187),
(67099, 'frFR', 'Dragons aux aguets', 'Parlez  Myridian, Zpharion et vorian dans les rgions  proximit.', 'Nous savons que les troupes djaradines prparent un assaut frontal, mais je m\inquite aussi d\autres dangers moins vidents.\n\nJ\ai ordonn  trois Dragons d\inspecter les alentours et de relever toute menace potentielle.\n\nAllez trouver chacun d\eux et rcuprez leurs rapports. Une fois tous ces renseignements en main, revenez me voir pour que nous puissions nous prparer  ragir aux plans de notre adversaire.', '', '', '', '', '', '', 47187),
