(67094, 'frFR', 'Une Dryade ne se repose jamais', 'Aidez Thalendra  nourrir la faune abondante de Valdrakken.', 'C\est un rel plaisir de voir la vie revenir  Valdrakken, mais tant de choses ont souffert pendant ces millnaires  l\abandon Et ces adorables cratures qui vivent dans la ville en font partie! Hlas, les Dryades ne sont pas suffisamment nombreuses pour s\occuper d\elles comme elles le mritent.\n\nQu\est-ce que vous diriez si je vous octroyais le titre honorifique de Dryade de Valdrakken? Certaines de ces mignonnes petites btes n\ont pas eu leurs friandises prfres depuis bien trop longtemps. Vous allez bien m\aider  m\occuper d\elles, non?', '', '', '', '', '', '', 47187),
(67093, 'frFR', 'Un bien curieux sanctuaire', 'Trouvez un moyen de rcuprer la relique cache dans le sanctuaire des Sables, puis rapportez-la  Nozdormu au sige des Aspects de Valdrakken.', 'Mon quipe de recherches a dcouvert un trange sanctuaire non loin d\ici. Nous avons russi  dchiffrer une partie des inscriptions graves sur ses parois extrieures Des runes des Titans, pour tre exact. Nous pensons qu\elles font rfrence  Aman\Thul, le Patriarche, seigneur des Titans.\n\nQuand nous avons voulu inspecter les lieux de plus prs, nous avons malencontreusement activ les dfenses du sanctuaire. Rsultat, un amalgame de sable nous est tomb dessus, et nous en avons rchapp de justesse.\n\nNous ignorons ce qu\il protge exactement, mais ce doit tre important. Pourriez-vous aller mener l\enqute sur place?', '', '', '', '', '', 'Retournez voir Nozdormu  Valdrakken.', 47187),
(67084, 'frFR', 'Le dessein argent', 'Placez les anciens lingots d\acier-titan dans la forge et terminez la tche confie par Tyr.', '<L\cho de Tyr s\active en votre prsence.>\n\nL\heure de la dernire tape a sonn.\n\nPlacez les lingots dans le feu et activez la forge. J\ai dj prpar les diffrentes oprations  accomplir.\n\nL\caille d\argent est la cl de vote de notre projet, et sa raison d\tre va  prsent vous tre rvle.', '', '', '', '', '', 'Parlez  Alexstrasza dans le bastion de Tyr.', 47187),
(67081, 'frFR', 'Imprgnation des matriaux', 'Rcuprez $1oaanciens lingots d\acier-titan et liminez le tsunami primordial dans les salles de l\Imprgnation.', '<L\image de Tyr parle  nouveau.>\n\nVous avez ractiv la forge, mais la prochaine tche qui vous attend sera autrement plus difficile.\n\nAu cur de l\caille sont retranscrits les plans d\un objet que je souhaite vous voir forger. J\ai confi  l\un de mes gardiens, Iridus, les matriaux dont vous allez avoir besoin. Ils ont une provenance bien particulire, et il n\en reste que trs peu au monde.\n\nAllez trouver Iridus dans les salles de l\Imprgnation. J\espre que, sous sa supervision, l\endroit fonctionne toujours comme il se doit.', '', '', '', '', '', '', 47187),
(67080, 'frFR', 'Ravitaillement du Consortium: solution alchimique de Dragon', 'Utilisez la recette Recyclage de dcoctions pour prparer $1oabouteilles de solution alchimique de Dragon pour Haephesta du sanctuaire de l\Essence rubis.', 'Vous cherchez du travail, alchimiste?\n\nLe Consortium d\artisanat vient de me passer une commande de solutions alchimiques. Les pratiques commerciales de ce groupe m\intriguent, mais j\ai vraiment trop  faire en ce moment.\n\nC\est peut-tre l\occasion de vous distinguer, $gapprenti:apprentie;. Prparez une solution alchimique en recyclant vos anciennes dcoctions et suivez ce chemin pour l\apporter  Haephesta.', '', '', '', '', '', '', 47187),
(67079, 'frFR', ' double tour', 'Rcuprez le disque de scurit principal et le disque de scurit secondaire dans le bastion de Tyr.', 'Les mesures de scurit qui gardent la forge sont encore plus strictes que partout ailleurs dans le bastion de Tyr. Cela ne va pas nous faciliter la tche, $c.\n\nSeules quelques units au sein de la citadelle ont la capacit de contourner ces garde-fous, et, en cas de corruption, le protocole exige certainement plusieurs codes.\n\nCes units ne se spareront pas sans broncher de leurs dispositifs d\accs, vous devrez les leur prendre de force. Soyez $gprudent:prudente;, $n.', '', '', '', '', '', '', 47187),
(67078, 'frFR', 'Instructions de dpart', 'Placez l\caille d\argent dans la forge du bastion de Tyr.', '<L\cho parle avec une voix ancienne.>\n\n mes proches camarades, je vous prie de bien vouloir excuser mon dpart prcipit.\n\nCependant, je ne vous abandonne pas totalement  votre sort. Je sais que vous faites face  une crise sans prcdent, mais je dois nanmoins vous imposer une srie d\preuves afin de m\assurer que mon cadeau ne soit pas utilis  mauvais escient.\n\nLa premire est assez simple: ractiver la forge au sein du bastion de Tyr. L\caille d\argent que vous avez reue en est la cl.', '', '', '', '', '', 'Parlez  Koranos au bastion de Tyr.', 47187),
(67077, 'frFR', 'Mmoires du pass', 'Parlez  Nozdormu pour assister aux vnements du pass.', 'C\est ici que nous avons vu notre ami Tyr pour la dernire fois.\n\nSur le moment, nous n\avons pas compris pourquoi, mais il tait persuad de devoir partir, et ce, pour des motifs d\une importance capitale.\n\nMme si l\preuve s\annonce douloureuse, je crois que cette tincelle nous a fait venir jusqu\ici pour que nous revivions ces adieux dchirants. Nozdormu nous y aidera, et nous verrons alors si Tyr a laiss un autre indice  notre attention.', '', '', '', '', '', '', 47187),
(67076, 'frFR', 'L\tincelle de la dcouverte', 'Inspectez l\tincelle de Titan dans le bastion de Tyr.', 'Si l\origine de cette tincelle est assez singulire, elle a nanmoins quelque chose de familier. Je ne suis pas certain de son utilit, mais je pense qu\elle peut nous aider  rsoudre ce mystre.\n\nSuivez-la et voyez si vous pouvez en apprendre davantage sur son fonctionnement. De mon ct, je vais voir ce que je peux dcouvrir en parallle.', '', '', '', '', '', 'Aller voir Kalecgos au bastion de Tyr.', 47187),
(67075, 'frFR', 'La magie au cur', 'Extrayez la magie cache dans les consoles du bastion de Tyr pour lucider le mystre de l\caille d\argent.', 'Voil qui est curieux. Cette citadelle abrite bien des mystres que personne n\est en mesure de comprendre, hormis le gardien Tyr lui-mme. Si nous voulons en apprendre davantage, nous allons devoir continuer  explorer son bastion.\n\nL\caille nous permettra srement d\y dceler d\autres secrets dissimuls.\n\nCela tant dit, il y a une petite complication. Les gardiens de ce sanctuaire sont encore instables, et ils n\apprcieront srement pas que vous veniez fouiner dans leur pr carr. Prenez ce conduit, il vous aidera en cas d\chauffoure.', '', '', '', '', '', '', 47187),
(67074, 'frFR', 'Un don argent', 'Parlez  Alexstrasza pour dcouvrir le cadeau de Tyr.', 'Peu avant sa mort, le gardien Tyr nous a confi une caille de Dragon forge dans l\argent le plus pur. Nous l\avons mise  l\abri dans les caveaux de Valdrakken en notre absence, mais  prsent, l\heure est venue pour elle de ressortir de l\ombre.\n\nNous n\avons pas encore dcouvert sa fonction, mais nous l\avons toujours considre comme un symbole d\unit et d\amiti. En tant que vritable $galli:allie; des peuples draconiens, nous aimerions la partager avec vous. Venez me parler lorsque vous serez $gprt:prte;, $n.', '', '', '', '', '', '', 47187),
(67073, 'frFR', 'Aube rouge', 'Trouvez Alexstrasza.', 'Nous avons presque recouvr notre puissance Si Raszageth parvenait  ses fins avant que nous ayons russi, les voies temporelles mneraient Azeroth  un sombre futur.\n\nNous ne pouvons pas rester sans rien faire, $n!\n\nVite, vous devez trouver Alexstrasza et l\aider avant qu\il ne soit trop tard!', '', '', '', '', '', '', 47187),
(67067, 'frFR', ' travers le mas bondissant', 'Rcuprez $1oatiges de mas bondissant sauvage.', 'Il y a une cuisinire dragonne  Valdrakken? Vraiment? Je vais lui demander de prparer ma fameuse bisque arc-foudre! C\est une vieille recette transmise de gnration en gnration au sein de ma famille.\n\nJe connais la plante que vous recherchez. Elle pousse prs des cours d\eau de la rgion, et cela nous cause bien des soucis.\n\nLes tiges de mas bondissant sont l\aliment principal des scarabes et des petites dracamandres, les proies naturelles des bufflaciens. Ce n\est pas un problme tant qu\on les aperoit de loin, mais certains ont la fcheuse habitude de vous tomber dessus sans crier gare.\n\n votre place, je surveillerais mes arrires.', '', '', '', '', '', 'Retournez voir Rumiastrasza au Festin rubis de Valdrakken.', 47187),
(67066, 'frFR', 'Savoureuse lamproie', 'Procurez-vous une lamproie revisite apptissante.', 'Rumi et Couac?\n\nBon sang, a ne nous rajeunit pas, tout a! Dguster un bon poisson en compagnie d\un canard et d\une Dragonne, cuisiniers de surcrot, voil qui ressemble fort au genre d\histoires que l\ancienne Poa pourrait raconter  nos jeunes. Une exprience pareille, on ne risque pas de l\oublier de sitt!\n\nCe jour-l, nous nous sommes rgals d\une lamproie revisite, l\un des mets prfrs des Roharts! C\est une espce rare, mais qu\on trouve gnralement au large de nos ctes.\n\nMfiez-vous, la saison des amours des dents-d\azur bat son plein et ces monstres sanguinaires n\hsiteront pas  vous attaquer s\ils vous voient pcher leur en-cas prfr.', '', '', '', '', '', 'Retournez voir Rumiastrasza au Festin rubis de Valdrakken.', 47187),
(67065, 'frFR', 'Champignon frais du futur', 'Capturez 7trufflettes souffles dans le temps dans l\avenir des Primalistes.', 'Un champignon dlicieux? Les avenirs alternatifs ne sont pas des garde-manger que l\on pille pour le seul plaisir de se remplir la panse, voyons.\n\nCela tant dit je mentirais si je vous disais que je n\ai jamais rv de goter  nouveau aux bons petits plats de Rumi et Couac.\n\nTrs bien! Vous avez ma permission de franchir le portail, mais je vous dconseille d\y aller $gseul:seule;.\n\nMes gardes m\ont dj parl de ces champignons noirs, et il semblerait qu\ils ne restent jamais bien longtemps au mme endroit.  bon entendeur', '', '', '', '', '', 'Retournez voir Rumiastrasza au Festin rubis de Valdrakken.', 47187),
(67064, 'frFR', 'Dlice droutant', 'Rcuprez $1oabulbes de promenalgue luisante.', 'Oh, Rumiastrasza! Comment l\oublier? Nous avons pass une charmante soire  cuisiner pour elle, avec les surs Clina et Flina.\n\nLe varech que nous avons dgust ce soir-l provient d\une souche unique surnomme la promenalgue luisante. Les pescorpes qui vivent le long de nos ctes en raffolent, et je ne serais pas surpris qu\ils vous attaquent s\ils vous voient vous servir dans leur chasse garde des fonds marins.\n\nSaluez les chefs de ma part, quand vous les verrez. Les portes de notre sanctuaire leur sont toujours grandes ouvertes.', '', '', '', '', '', 'Retournez voir Rumiastrasza au Festin rubis de Valdrakken.', 47187),
(67063, 'frFR', 'Des rtis de 10000 ans', 'Rcuprez $1oadoses d\pices de lave pices.', 'Des pices? Oh! Vous devez travailler pour cette bonne vieille gargotire, l. Vous savez, la Dragonne qui se balade avec un petit chef canard sur la tte?\n\nLes gte-sauces djaradins rcoltent une sorte de poudre sur les lmentaires de feu en contrebas. Les pices de lave pices, qu\ils appellent a.\n\nBen quoi, me regardez pas comme a! C\est pas moi qu\ai invent ce nom  la noix!\n\nBonne chance, vous en aurez besoin.  votre place, j\viterais d\y aller seul.', '', '', '', '', '', 'Retournez voir Rumiastrasza au Festin rubis de Valdrakken.', 47187),
(67053, 'frFR', 'Une chance de paix', 'Prsentez-vous aux reprsentants de la Horde.', 'La Lumire soit avec vous, $p.\n\nCette expdition bnficie de la protection de la Horde et de l\Alliance. Nos ordres sont clairs: apporter de l\aide aux membres de l\expdition, quelles que soient leurs autres allgeances.\n\nLes reprsentantes de la Horde, la dame de guerre Hache-Sinistre et sa fille, Shuja, ont pris leurs quartiers de l\autre ct du camp.\n\nJ\ai combattu le Flau aux cts de Hache-Sinistre. C\est une noble guerrire qui sera d\une aide prcieuse  cette expdition.\n\nAllez lui offrir votre assistance. Montrez-lui que l\Alliance tient ses promesses.', '', '', '', '', '', 'Parlez  la dame de guerre Breka Hache-Sinistre  l\ambassade de Trve-Aile.', 47187),
(67050, 'frFR', 'Morglas: causes et symptmes', 'Placez les totems pour librer les chasseurs et chasseresses roharts dans la trave d\Azur.', 'Les lments prisonniers de ces totems sont encore en vie, $r. Librez-les et brisez la glace qui emprisonne vos comparses roharts!', '', '', '', '', '', '', 47187),
(67047, 'frFR', 'Repousser les frissons', 'Cueillez $1oafeuilles de sagitte de Morsebise.', 'Sauf erreur de ma part, la plante que vous cherchez arbore des feuilles rouges qui poussent sur une tige relativement fine.\n\nPrudence tout de mme, car vous avez toutes les chances de tomber sur ces salets de rampantes pendant votre cueillette. Passez au large si possible, et dans le cas contraire, pensez  vous munir d\une arme bien affte.\n\nEt dites  votre amie dragonne que je me contenterai en change d\une tasse ou deux de son breuvage la prochaine fois que je passerai en ville.', '', '', '', '', '', 'Retournez voir Rumiastrasza au Festin rubis de Valdrakken.', 47187),
(67044, 'frFR', 'Rcit hroque: Yanikka', 'coutez l\histoire de Yanikka.', 'Laissez-moi vous conter l\histoire de Yanikka.', '', '', '', '', '', '', 47187),
(67039, 'frFR', 'Un voyage extraordinaire', 'Trouvez les animaux gars.', 'Certains des animaux domestiques du clan se sont gars lors de notre dernire migration. Ce ne sont pas des chasseurs, et je crains qu\ils ne puissent pas subvenir  leurs besoins tous seuls!\n\nPourriez-vous aller les chercher? Mme s\ils sont incapables de nous accompagner  la chasse, ils restent des membres importants du clan!', '', '', '', '', '', '', 47187),
(67036, 'frFR', 'Le courroux du Kirin Tor', 'Utilisez la ptoire des arcanes pour aider Khadgar  vaincre les Primalistes.', 'J\ai fini d\assembler les morceaux de l\appareil que vous avez rcuprs.\n\nPlacez-le prs de Khadgar et servez-vous-en pour repousser les Primalistes!\n\nIl faut juste qu\on tienne le temps que Kalecgos revienne.', '', '', '', '', '', '', 47187),
(67035, 'frFR', 'Prservation de la connaissance', 'Trouvez $1oatomes anciens dissmins dans le camp d\Antonidas.', 'Salutations, $r. Je m\appelle Altharus. J\aurais aim vous rencontrer en des circonstances moins chaotiques.\n\nNous tions en train d\aider le Kirin Tor  tudier l\histoire de cet endroit quand les Primalistes ont attaqu.\n\nPlusieurs ouvrages ont t abandonns sur place,  la merci de leurs dprdations.\n\nDe grce, vous devez  tout prix les rcuprer! S\ils sont dtruits, le pass de cette contre sera irrmdiablement perdu.', '', '', '', '', '', '', 47187),
(67034, 'frFR', 'De vent et d\eau', 'Rcuprez des composants dans les sources draconiques Rugissantes.', ' l\est se trouve une grande source draconique dans laquelle les aigles sauvages font leurs nids. Les plumes que perdent ces majestueux oiseaux conservent leur magie pendant un certain temps et sont utilises dans de nombreux rituels.\n\nDes esprits lmentaires dchans peuplent galement cette zone, et leurs noyaux sont d\une grande utilit.\n\nRapportez-moi un assortiment des deux et n\oubliez pas que les aigles sont sacrs. Je n\accepterai pas les plumes recueillies  leurs dpens.', '', '', '', '', '', '', 47187),
(67033, 'frFR', 'Assemblage des dfenses', 'Rcuprez $1oamorceaux de ptoire des arcanes.', 'Les Primalistes pourchassent le Kirin Tor depuis notre arrive dans la trave d\Azur, tant nos adversaires abhorrent la pratique de la magie des arcanes.\n\nJe vais contacter Kalecgos aux archives d\Azur pour lui demander de revenir. En attendant, nous allons devoir les retenir.\n\nL\une de nos principales dfenses arcaniques a t dtruite au cours de l\assaut initial. Rapportez-m\en les morceaux et je pourrai la rassembler.', '', '', '', '', '', '', 47187),
