(67007, 'frFR', 'Aide aux archives', 'Parlez  Kmora aux archives de Valdrakken.', '<L\criture lgante, prcise et soigne est en partie estompe par une bavure liquide dont l\odeur rappelle une boisson fermente.>\n\nAVENTURIERS ET AVENTURIRES, ARCHIVISTES EN HERBE--\n\nLes archives s\adressent  quiconque cherche des rponses, aspire aux dcouvertes et souhaite lever le voile sur le pass et pourquoi pas, le futur!\n\nmes sensibles et volont vacillante s\abstenir.\n\nSi votre courage et votre got pour l\aventure sont plus forts, entendez mon appel.\n\n Kmora', '', '', '', '', '', '', 47187),
