(67004, 'frFR', 'Des grosses botes pleines de bonnes choses', 'Trouvez un coffre du Gardeterre. Si vous me le rapportez, nous partagerons les richesses qu\il contient.', 'Grce  nos efforts, nous avons pu fabriquer tout le ncessaire pour ouvrir un coffre du Gardeterre. Les souterrains de la citadelle en abritent plusieurs. Localisez-en un et je vous rcompenserai.\n\nJ\ai conu des chanes permettant de le dplacer. Si vous me le rapportez, nous partagerons les richesses qu\il contient.\n\nAttention, le coffre est peut-tre dj en train d\tre dplac: vous n\tes pas la seule personne que j\ai envoye  sa recherche.', '', '', '', '', '', 'Retournez voir l\attiseur Volrax avec ou sans le coffre du Gardeterre.', 47187),
