(66998, 'frFR', 'Combattre le feu par l\eau', 'Tuez des lmentaires de lave dans la grotte ruptive.', 'Cela fait des annes que je m\occupe des lmentaires de lave, et je ne les avais encore jamais vus se comporter ainsi! Nous parvenons  peine  les contenir dans la grotte.\n\nAuriez-vous une minute  nous accorder? Nous pouvons surveiller l\entre pendant que vous rduisez leur nombre  l\intrieur.\n\nTenez, prenez cet lmentaire d\eau en bouteille.\n\nJ\en ai toujours en rserve lorsque je m\occupe des lmentaires de lave. Les ennemis naturels font de bonnes diversions!', '', '', '', '', '', '', 47187),
(66997, 'frFR', 'Direction de la nourricerie', 'Allez voir Varos aux jardins des bassins de l\Essence rubis.', 'Je suis tellement heureux que Lasztak ait embrass une vocation de soigneur de Dragonnets! Surtout lorsque l\on voit le nombre de petits trsors qui font leurs dents en ce moment.\n\nQuoi qu\il en soit, les jardins de la nourricerie font face  des difficults. Les Dragonnets sont stresss, et celles et ceux qui s\en occupent sont plus  cran qu\ l\accoutume.\n\nLorsque vous aurez un moment de libre, n\hsitez pas  venir me trouver dans les jardins en contrebas. Nous aurions bien besoin de votre aide, nous aussi!', '', '', '', '', '', '', 47187),
