(66972, 'frFR', 'Vieux Dfense-de-Pierre', 'Abattez le vieux Dfense-de-Pierre prs du camp d\Antonidas.', 'J\ai une mission pas trs rjouissante  vous confier, $p. Plus qu\une faon de mesurer son talent, la chasse est parfois une uvre de misricorde.\n\nUn vieux mammouth mle rde dans la fort,  l\est du camp d\Antonidas. Je l\ai aperu de loin l\autre jour, et j\entends rgulirement ses barrissements dchirants. Cette pauvre bte souffre, c\est vident.\n\nFou de douleur, il s\est mis  tout dtruire sur son passage et j\ai bien peur qu\il devienne un danger pour ses congnres.\n\na me mettrait du baume au cur si vous pouviez accorder le repos  ce vieux frre. Rapportez-moi sa dfense, qu\on puisse lui rendre hommage.', '', 'Ancien mammouth mle devenu un danger pour lui-mme et les autres.', 'Vieux Dfense-de-Pierre', '', '', 'Parlez  Hemet Nesingwary Jr au camp Nulle-Part.', 47187),
(66971, 'frFR', 'Le visage de la mort', 'Pourchassez Givremors au nord de la combe des Crins-d\Hiver.', 'Dites-moi, mon $gami:amie;, vous avez dj vu la mort en face?\n\n<Nesingwary s\interrompt pour mnager ses effets.>\n\nMais qu\est-ce que je raconte? Bien sr, que vous l\avez dj vue!\n\nC\est qu\elle a de nombreux visages, la bougresse.\n\nEt  en croire les Roharts d\Imbou, l\un d\eux svit au sommet de ces collines. Suffit de prononcer son nom pour s\exposer  une fin aussi violente que glaciale.\n\nGivremors, qu\il s\appelle.\n\n<Nesingwary jette un regard circonspect  la ronde.>\n\nIl vous reste plus qu\ le mettre hors d\tat de nuire, ne serait-ce que pour ma scurit!', '', 'Prsage lgendaire d\une mort glaciale.', 'Givremors', '', '', 'Parlez  Hemet Nesingwary Jr au camp Nulle-Part.', 47187),
(66970, 'frFR', 'Ty\fon le Transcend', '', '', '', '', '', '', '', '', 47187);
