(66969, 'frFR', 'Les clans des plaines', 'Allez voir la khan Sansok  Maruuka.', 'En attendant l\arrive de l\missaire, la khan Sansok aimerait savoir comment s\est passe la rencontre entre les clans. Elle m\envoie vous demander d\aller la retrouver au centre de Maruuka pour en discuter.', '', '', '', '', '', '', 47187),
(66968, 'frFR', 'Tailler dans la meute', 'Pourchassez Ytor prs du Bouclier de Ronin.', '<Nesingwary dsigne le bas-ct du sentier.>\n\nVous voyez ces empreintes dans la neige?\n\nCe sont des traces de yti.\n\nFaut qu\ils soient drlement nervs pour venir chasser si prs de la route. Essayez de remonter la piste de leur chef de meute avant qu\ils s\en prennent aux voyageurs.\n\nEt s\il s\avre que c\est une sale brute sans foi ni loi, rapportez-moi sa tte. a devrait suffire  calmer ses potes.', '', 'La seule chose qui soit pire encore qu\un yti, c\est un yti bien entour.', 'Ytor', '', '', 'Parlez  Hemet Nesingwary Jr au camp Nulle-Part.', 47187),
(66964, 'frFR', 'Des artfacts entre de mauvaises mains', 'Trouvez Alia Lever-de-Soleil dans les ruines Perdues de la trave d\Azur.', 'Nous avons des problmes  ne plus savoir qu\en faire!\n\nMisre, je ne sais mme pas par o commencer!\n\nLe Kirin Tor a dcouvert un complot de la Flamme fracture, qui cherche  s\emparer d\un artfact surnomm Valthrux.\n\nNon seulement il dtient un immense pouvoir, mais il est aussi dot d\une forme de de conscience, vous imaginez? Autant dire que, si l\on met tout a bout  bout, il reprsente un danger incalculable.\n\nUne certaine Alia Lever-de-Soleil est partie vers le sud avec deux Roharts afin d\enquter sur les oprations adverses et elle n\est toujours pas rentre.\n\nAllez la trouver et empchez la Flamme fracture de mettre la main sur cet artfact!', '', '', '', '', '', '', 47187),
(66963, 'frFR', 'Livraison retarde', 'Informez l\inventoriste Wulfred au camp de base  proximit que ses fournitures sont retardes.', 'J\ai essay de dire  Vvsi qu\il suffisait de tirer le chariot pour le sortir de la boue\n\nMais non, il voulait absolument utiliser la magie. Et regardez le rsultat!\n\n<La transporteuse Bennet soupire.>\n\nEn attendant que je raisonne Vvsi, vous voulez bien vous rendre au camp au sommet de la colline pour faire savoir  l\inventoriste Wulfred qu\il devra peut-tre faire venir une autre caisse de matriel photo de Boralus?', '', '', '', '', '', 'Annoncez la mauvaise nouvelle  l\inventoriste Wulfred au camp de base du Dracaret.', 47187),
(66962, 'frFR', '[DNT] 10.0 Explorers - Ch1 - Fake Quest Requirement (SMART)', '', '', '', '', '', '', '', '', 47187),
(66961, 'frFR', 'Bienvenue dans la grande chasse', '', '', '', '', '', '', '', '', 47187),
(66960, 'frFR', 'Klozicc le Transcend', '', '', '', '', '', '', '', '', 47187),
(66958, 'frFR', 'Un troupeau  protger', 'Pourchassez Cornesang  l\est d\Iskaara.', 'J\ai crois un groupe de chasse venu d\Iskaara pas plus tard que l\autre jour. Ces gens m\ont dit avoir assist  un spectacle  vous retourner l\estomac.\n\nApparemment, un rhino sanguinaire surnomm Cornesang s\amuse  ventrer les bruffalons de la rgion.\n\nCes pauvres petites btes ont dj assez de concurrence comme a dans la trave d\Azur sans se faire massacrer par la premire brute venue!\n\nRapportez-moi sa corne,  ce fumier. a me permettra de faire bonne impression  nos camarades roharts!', '', 'Bte rancunire qui dcime les bruffalons de la rgion.', 'Cornesang', '', '', 'Parlez  Hemet Nesingwary Jr au camp Nulle-Part.', 47187),
(66957, 'frFR', 'Une ombre dans la glace', 'Explorez le sommet du glacier qui surplombe le camp d\Antonidas.', 'J\ai entendu de drles de rumeurs, au camp d\Antonidas. Des cratures sauvages mutiles auraient t retrouves aux quatre coins des steppes glaces. Pour certaines, il n\en restait plus que des tranes de sang.\n\nQuoi qu\il se passe, les mages sont dans tous leurs tats et la faune locale est dcime.\n\nAllez jeter un coup d\il au sommet du glacier. Si j\tais joueur, je parierais que c\est le nichoir idal pour n\importe quel prdateur dominant qui se respecte.\n\nTuez-le et rapportez-m\en un morceau, qu\on puisse rassurer le Kirin Tor.', '', 'Gant malveillant qui prend plaisir  jouer avec ses proies.', 'Givrepoing', '', '', 'Parlez  Hemet Nesingwary Jr au camp Nulle-Part.', 47187),
(66956, 'frFR', 'Chasseur de Dragons Igordan', '', '', '', '', '', '', '', '', 47187),
(66952, 'frFR', 'Les toffes gnolles', 'Rcuprez 20toffes gnolles sur les Gnolls des les aux Dragons pour Dothenos du concordat de Valdrakken.', 'Les Gnolls sont une menace constante. Ces vermines lancent des raids sanglants contre les expditions et s\en prennent aveuglment  celles et ceux qui vivent sur les les aux Dragons. Et malgr toute cette violence, leurs vtements restent d\une propret surprenante. Comment est-ce possible?\n\nPourriez-vous profiter de vos combats contre ces pillards pour me rcuprer quelques fragments de leurs toffes? J\aimerais les tudier.', '', '', '', '', '', '', 47187),
(66950, 'frFR', 'Cur de gant', 'Rcuprez 5curs de Gant sur les Gants des montagnes, de glace ou de lave des les aux Dragons pour Temnaayu, une Rohart d\Iskaara.', 'On dit que certains des Gants des les aux Dragons abritent en eux des gemmes d\une grande beaut. Il n\est pas dans nos habitudes de chasser les cratures des les pour les dpouiller de leurs trsors, mais ces colosses sment une belle pagaille.\n\nAutant profiter de leur limination pour rcuprer ces gemmes.', '', '', '', '', '', '', 47187),
(66948, 'frFR', 'Arrive de l\missaire', 'Apprenez-en plus sur la situation dans les jardins d\meraude.', 'Je dois bien avouer que je n\ai jamais quitt les jardins d\meraude, ce qui veut dire que je n\ai jamais crois de Centaures, et encore moins de cratures mortelles du continent.\n\nCela tant, je ne suis pas l pour une visite de courtoisie; non, je viens implorer les Centaures de nous aider  sauver notre pierre de vu et  protger notre charge.\n\nC\est un plaisir de voir que vous tes aussi $gvenu:venue; pour apporter votre aide. Nous avons beaucoup  nous dire.', '', '', '', '', '', '', 47187),
(66947, 'frFR', 'Sprint de la trave d\Azur  Avanc', 'Traversez les anneaux en planant.', 'Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 47187),
(66946, 'frFR', 'Sprint de la trave d\Azur', 'Traversez les anneaux en planant.', 'Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 47187),
(66944, 'frFR', 'Pigments de paon', 'Rcuprez 8plumes de paon sur les paons des les aux Dragons pour Gnoklin Folbobine, de l\expdition du Dracaret.', 'Le plumage des paons des les aux Dragons est remarquablement color! Nous devrions pouvoir en tirer des pigments pour les encres de nos calligraphes.', '', '', '', '', '', '', 47187),
(66943, 'frFR', 'Du bois pour crire', 'Rcuprez 15parchemins en corce sur les Trants putrfiants des les aux Dragons pour Dothenos, du concordat de Valdrakken.', 'Nous avons dcouvert des choses inhabituelles lors de notre tude des les aux Dragons. L\corce des Trants touchs par la putrfaction, par exemple, ragit comme du vlin.\n\nCe parchemin des plus tranges est capable de contenir la magie des inscriptions les plus puissantes. C\est trs utile! Pourriez-vous nous aider  en rcuprer?', '', '', '', '', '', '', 47187),
(66940, 'frFR', 'Exprience alchimique', 'Rcuprez 15mucus de Gorloc sur les Gorlocs des les aux Dragons pour Dhurrel, des Centaures maruuks.', 'Nos alchimistes se sont rcemment penchs sur de nouveaux ingrdients. Leur dernire toquade en date est pour le moins intressante\n\nIl semble que le mucus des Gorlocs possde des proprits susceptibles d\amliorer certains lixirs.', '', '', '', '', '', '', 47187),
(66939, 'frFR', 'Chasse au chasseur', 'Pourchassez le matre-chasseur Krakle au Bouclier d\Imbou.', 'Un des gardes du camp Nulle-Part m\a racont qu\un fumier de premire prenait plaisir  mutiler la faune locale. Mme qu\il se prend pour un matre-chasseur, le bougre.\n\nChasser est une chose, mais faut vraiment tre le fils de personne pour torturer de pauvres cratures sans dfense.\n\nPar ailleurs, mon chariot aurait bien besoin d\un petit porte-bonheur.\n\n<Nesingwary crache par terre.> \n\nRapportez-moi sa patte.', '', 'Gnoll malfaisant qui n\aime rien tant que torturer d\innocentes cratures sauvages.', 'Matre-chasseur Krakle', '', '', 'Parlez  Hemet Nesingwary Jr au camp Nulle-Part.', 47187),
