(66931, 'frFR', 'Qui fait tout ce raffut?', 'Dcouvrez les causes de l\agitation au sanctuaire de l\Essence rubis.', 'Ce n\tait pas une secousse ordinaire.', '', '', '', '', '', '', 47187),
(66929, 'frFR', 'Collectionnez-les toutes', 'Rcuprez le deck de Yumadormu.', '$PC, vous voulez bien m\aider  rcuprer mes cartes?\n\nJ\ai dit  Setogosa que j\en avais besoin pour apprendre aux autres lves  jouer  Hearthstone et fonder un club, mais elle refuse de me les rendre!\n\nElle a toujours t mchante avec moi, mais l, c\est vraiment le pompon.', '', '', '', '', '', '', 47187),
