(66897, 'frFR', 'Du feu pour la Forge', 'Rcuprez 10curs de magma sur les cratures de lave des les aux Dragons pour Dhurrel, des Centaures maruuks.', 'Les meilleures lames ncessitent une temprature de forge que seul un cur de magma peut atteindre, raison pour laquelle nous en avons toujours un certain nombre pour alimenter nos fourneaux. Mais nos rserves sont presque puises et nous aurions bien besoin de ravitaillement.\n\nIl est possible d\en obtenir sur la plupart des cratures de lave habitant les les aux Dragons.', '', '', '', '', '', '', 47187),
(66895, 'frFR', 'Les chefs se suivent et se ressemblent', 'liminez Vyzia la Prophte.', 'Les Draconiens brise-monde sont confiants de nature. Nous avons eu de nombreux chefs au fil des ans, persuads que chacun d\eux nous mnerait  l\Heure du Crpuscule et au retour d\Aile de mort.\n\nMais Aile de mort n\est plus et le Crpuscule tarde  venir.\n\nIl est temps de nous choisir un nouveau chef, et vous pouvez nous aider  impulser ce changement.', '', 'La dernire d\une longue srie de chefs.', 'Vyzia la Profiteuse', '', '', '', 47187),
(66893, 'frFR', 'Rhabilitation emplume', 'Soignez $1oatrotte-bois blesss dans les rapides Intarissables.', 'J\ignore peut-tre tout des lmentaires d\eau, mais je connais mes trotte-bois sur le bout des doigts!\n\nJ\ai prpar un baume qui devrait les apaiser et les revigorer. Je n\ai jamais eu la chance de l\essayer en vrai, mais j\ai tudi la thorie autant que je le pouvais.\n\nIl est temps de prendre mon courage  deux mains et de passer  la pratique!', '', '', '', '', '', '', 47187),
(66892, 'frFR', 'Dilemme diluvien', 'Tuez $1oalmentaires d\eau dans les rapides Intarissables.', 'Les lmentaires s\en prennent aux trotte-bois! Je sais me battre contre de grandes cratures, mais je ne pensais pas affronter des lmentaires un jour a n\a rien  voir avec un bb lzard-tonnerre!\n\n<Dazakros pousse un soupir nerveux.>\n\nJe vous en supplie, abattez certains de ces lmentaires. Les trotte-bois ont plus de bon sens qu\on ne le croit. Si on leur en donne les moyens, ils se battront!', '', '', '', '', '', '', 47187),
(66891, 'frFR', 'Cendre explosive', 'Rcuprez 20cendres explosives sur les phnix des les aux Dragons pour Gnoklin Folbobine, de l\expdition du Dracaret.', 'Les phnix de lave des les aux Dragons meurent en laissant derrire eux une trange substance cendreuse qui pourrait entrer dans la fabrication d\amliorations matrielles pour des machines rvolutionnaires. Mais en ce qui me concerne, je l\utiliserais sans doute comme explosif.', '', '', '', '', '', '', 47187),
(66890, 'frFR', 'Outils vols', 'Rcuprez 20outils vols sur les Gnolls des les aux Dragons pour Dothenos, du concordat de Valdrakken.', 'Ces abominables Gnolls s\enttent  piller nos caravanes de ravitaillement. Ces simples d\esprit semblent avoir une certaine fascination pour les diffrents outils d\ingnierie qu\elles transportent. Nous ne pouvons pas les laisser s\emparer ainsi de notre savoir-faire! Sans oublier que ces agressions ont totalement chamboul notre calendrier de production.\n\nRapportez-nous ces pices d\ingnierie, que nous puissions poursuivre notre travail!', '', '', '', '', '', '', 47187),
(66886, 'frFR', 'Ascension des jardins d\meraude  Avanc', 'Traversez les anneaux en planant.', 'Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 47187),
(66885, 'frFR', 'Ascension des jardins d\meraude', 'Traversez les anneaux en planant.', 'Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 47187),
(66884, 'frFR', 'quipement ignifuge', 'Rcuprez 10quipements ignifuges sur les troupes djaradines des les aux Dragons pour Temnaayu, une Rohart d\Iskaara.', 'L\quipement djaradin a des proprits ignifuges vritablement uniques et nous serait trs utile au combat!\n\nEssayez donc d\en rcuprer sur des troupes djaradines. Nous les tudierons et nous ferons en sorte de reproduire ces enchantements sur nos propres armures.', '', '', '', '', '', '', 47187),
(66883, 'frFR', 'Anneau de corne ancien', 'Apportez l\objet  Exadria.', '<Cet objet pourrait intresser Exadria.>', '', '', '', '', '', '', 47187),
(66882, 'frFR', 'Sac de bataille perdu', 'Apportez l\objet  la traque-serre Kavia.', '<La traque-serre Kavia sera sans doute intresse par ceci.>', '', '', '', '', '', '', 47187),
(66881, 'frFR', 'Descente des gorges  Avanc', 'Traversez les anneaux en planant.', 'Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 47187),
(66880, 'frFR', 'Descente des gorges', 'Traversez les anneaux en planant.', 'Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 47187),
(66879, 'frFR', 'Chaos chez les trotte-bois', 'Rencontrez Dazakros aux rapides Intarissables.', 'Les trotte-bois! Leurs puissants becs leur permettent de briser des os, leurs pattes rapides de fuir le danger, et ils peuvent se nourrir de tout ce qu\on trouve sur les les.\n\nCette vocation est la plus simple de toutes! Je n\ai qu\ passer du temps avec mes oiseaux favoris. En cas de problme, je suis capable de mater toutes les cratures de la rgion.\n\nVoulez-vous m\accompagner jusqu\aux plateaux des trotte-bois, au nord d\ici? Une paire de mains supplmentaire ne sera pas de trop pour m\y installer.', '', '', '', '', '', '', 47187),
(66878, 'frFR', 'Traverse des marais  Avanc', 'Traversez les anneaux en planant.', 'Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 47187),
(66877, 'frFR', 'Traverse des marais', 'Traversez les anneaux en planant.', 'Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 47187),
(66875, 'frFR', 'Protection du pass: acadmie d\Algeth\ar', 'Obtenez le feu follet du Rve de souvenirs entremls auprs de la doyenne dans l\acadmie d\Algeth\ar.', 'C\est merveilleux, l\acadmie d\Algeth\ar a rouvert! La doyenne Doragosa doit tre ravie de pouvoir  nouveau arpenter les couloirs de son antre du savoir.\n\nVoil bien longtemps que je n\ai pas eu l\occasion de discuter avec ma vieille amie. Vous pourriez peut-tre aller lui demander si elle aurait le temps de boire une tasse de th? a vous donnerait en plus une chance de vous inscrire  l\acadmie, puisqu\il parat qu\elle est dsormais ouverte  tout type d\lves.\n\nJe me suis dit que a pourrait vous intresser, vu le temps que vous passez  me rendre visite et  explorer les archives.', '', '', '', '', '', '', 47187),
(66874, 'frFR', 'Protection du pass: salles de l\Imprgnation', 'Obtenez le distributeur holographique en combattant le tsunami primordial dans les salles de l\Imprgnation.', 'Saviez-vous que loin sous le sol du bastion de Tyr se cache une immense installation appele les salles de l\Imprgnation? Tant de mystres! D\intrigues! De possibilits!\n\nLe gardien Tyr y conservait une grande partie de ses secrets. Je me demande bien de quoi il peut bien s\agir C\tait vraiment le plus brillant de tous les gardiens.\n\n<Le regard de Kmora se perd, comme si elle rvait.>\n\nCela tant, les Primalistes sont en train de tout saccager et n\hsiteront pas  dtruire toutes les merveilles du gardien Tyr si nous n\intervenons pas. Je vous en supplie, liminez-les avant que les dgts ne soient trop importants!', '', '', '', '', '', '', 47187),
(66868, 'frFR', 'Protection du pass: hritage de Tyr', 'Obtenez le bibelot perdu dans le temps du chronoseigneur Dios  Uldaman.', 'J\pluche les archives  la recherche d\informations sur le gardien Tyr, et tonnamment, toutes les mentions d\Uldaman ont disparu,  l\exception d\une demi-page portant la mention d\un secret que Tyr y aurait cach.\n\nC\est fascinant, non? Et je parierais mme qu\il n\en a pas cach qu\un seul. Vous pourriez peut-tre former un groupe pour aller jeter un coup d\il? Tout ce que vous pourrez me rapporter me sera prcieux.', '', '', '', '', '', '', 47187),
(66864, 'frFR', 'Rcupration de relique: creux des Fougerobes', 'Obtenez le ftiche de la dcatriarche en combattant la dcatriarche Occulcre au creux des Fougerobes.', 'Ah! J\ai une mission pour vous. On raconte que les Gnolls du creux des Fougerobes utiliseraient la putrfaction un outil puissant, entre de bonnes mains. Ce que les Gnolls n\ont pas.\n\nNous devrions tudier la question, eu plus vite. Rendez-vous au creux et rapportez-moi un peu de leur magie pour que je pour que nous puissions dcouvrir quel type de pouvoirs ils manient.\n\nMais allez-y en groupe; la prudence est de mise. Les Fougerobes sont capables de tout faire disparatre, jusqu\ vos os.\n\nCe serait tout de mme dommage.', '', '', '', '', '', '', 47187),
(66860, 'frFR', 'Rcupration de relique: hritage de Tyr', 'Obtenez le sablier des Sables changeants du chronoseigneur Dios  Uldaman.', 'Kmora m\a demand de chercher toutes les rfrences existantes au gardien Tyr et  Uldaman. Avec tous les volumes que j\ai dj d feuilleter, mes doigts ne sont plus qu\une immense microcoupure\n\nPresque toutes les mentions ont t dchires ou dtruites, si ce n\est celle-ci, que j\ai mise de ct pour la lui montrer plus tard: on aurait apparemment cach quelque chose de prcieux  Uldaman. J\aimerais beaucoup assouvir ma curiosit, alors si vous pouviez m\apporter a\n\nSi je vous demande ce service, c\est uniquement pour aider Kmora dans ses recherches, bien sr.', '', '', '', '', '', '', 47187),
(66848, 'frFR', 'Des augures ports par le vent', 'Aidez l\ohn Seshteng  accomplir son rituel.', 'Ohn\ahra ne parle pas la mme langue que nous Sa voix est porte par les vents. En tant que mystiques, nous apprenons  sentir sa prsence,  suivre son appel et  interprter ses messages.\n\nJ\ai utilis les objets que vous m\avez apports pour lier des totems  cet appel bien prcis. Aidez-moi  accomplir un rituel pour centrer sa voix, et je pourrai ensuite interprter son chant.', '', '', '', '', '', '', 47187),
(66847, 'frFR', 'Caveau des Incarnations: fureur de la Mange-temptes', 'Entrez dans le caveau des Incarnations et venez  bout de Raszageth.', 'Non! Nous avons enferm les Incarnations pour protger ce monde de leurs intentions malfiques, mais Raszageth cherche  les librer!\n\nNous devons l\en empcher, $n. Si vous ne l\arrtez pas, toute vie sur notre belle Azeroth sera menace!\n\nJe dois retourner auprs de Nozdormu au sige des Aspects pour tenter de nous prparer  ce qui nous attend. Mais ne vous en faites pas, je ne vous abandonne pas  votre triste sort. Kalecgos et Khadgar viendront vous rejoindre lorsque vous vous aventurerez dans le caveau.\n\nBonne chance, $gchampion:championne;.', '', '', '', '', '', 'Parlez  Kalecgos au sige des Aspects de Valdrakken.', 47187),
(66846, 'frFR', 'Au cur des cartes', 'Aidez l\apparition  crer une nouvelle carte.', 'Le jour o les les aux Dragons se sont endormies tait aussi le jour de ma dernire partie. Le destin s\est montr particulirement cruel: j\ai perdu ma meilleure carte avant mme d\entrer en lice.\n\nLa carte de Guo Hee m\appartenait autrefois. Je ne sais pas comment ses anctres ont russi  se la procurer.\n\nHlas, elle est dans sa famille depuis tant de sicles qu\il est trop tard pour la rcuprer. J\ai commis une erreur, et je m\en rends compte  prsent.\n\nPeut-tre que nous pourrions en crer une autre, vous et moi Une carte unique en son genre. Oui! Vous voulez bien m\aider?\n\nRevenez me voir quand vous serez $gprt:prte;.', '', '', '', '', '', '', 47187),
(66845, 'frFR', 'Carte mtallise lgendaire', 'Trouvez le fantme dracnide et rcuprez la carte lgendaire.', 'J\tais au lit la nuit dernire et je n\arrivais pas  dormir, quand soudain un vent glacial s\est engouffr dans l\auberge.\n\nC\est alors qu\un fantme dracnide a fait son apparition et a fouill mes valises avant de se volatiliser!\n\nImaginez un peu ma consternation ce matin quand je me suis rendu compte que ma carte prfre avait disparu!\n\nPourriez-vous partir  la recherche de ce fantme et rcuprer ma carte? J\y tiens plus que tout au monde!', '', 'Quelles que soient les circonstances, il y a toujours une meilleure solution que le vol.', 'Apparition mystrieuse', '', '', '', 47187),
(66844, 'frFR', 'La grande Shokhari', 'Tuez la renarde cleste Shokhari.', 'De tous les animaux que j\ai vus ici, la grande rusarde cleste Shokhari tait de loin la plus majestueuse.\n\nDommage qu\elle ait boulott un chaman gnoll et que la putrfaction l\ait rendue folle. Quand je l\ai vue dvorer un de ses petits, j\ai tout de suite compris que a tournait pas rond, chez elle.\n\nJ\ai rcupr les autres rusardeaux pour les amener en lieu sr, mais Shokhari s\en est prise  moi, et elle m\a coll une de ces racles! Croyez-moi, j\ai vu la mort de prs.\n\nIl va falloir l\abattre. Si la putrfaction continue  lui ramollir la cervelle, elle finira par becqueter tout le monde.', '', ' l\poque de sa magnificence, cette rusarde rendue folle par la putrfaction rgnait sur ces forts.', 'Renarde cleste Shokhari', '', '', '', 47187),
(66843, 'frFR', 'O est Lukh?', 'Retrouvez Lukh.', 'Mordiable! Vous auriez pas vu mon assistant, Lukh?\n\nIl voulait jeter un coup d\il aux alentours, mais a fait dj une heure qu\il est parti!\n\nJe lui ai dit que l\endroit tait dangereux et qu\il fallait qu\il reste  proximit, mais ce garon est ttu comme une mule.\n\nEnfin, je peux pas lui jeter la pierre. C\est beau par ici, et il aime beaucoup les fleurs.\n\nBref, vous pourriez m\aider  le retrouver? Moi et mon chariot, on est attendus au guet des Trois-Cascades!', '', '', '', '', '', '', 47187),
(66841, 'frFR', 'Un clat du pass', 'Rcuprez et remettez l\artfact  Thanessa Florargent.', 'Dites-moi, vous qui courez dans tous les sens pour aider les gens du camp, vous voudriez pas aussi rendre service au bon vieux Gannar?\n\nJ\ai pass toute la zone au peigne fin, vous voyez, et j\ai pas pu m\empcher de remarquer quelque chose. J\crois bien que ce sont les vestiges d\une poterie antique quelconque, juste au sud d\ici, au bord de la cascade? \n\nBon, la nage, c\est pas vraiment mon fort, mais je vous paierai volontiers, et vous aurez qu\ apporter votre trouvaille  Thanessa Florargent.', '', '', '', '', '', 'Apportez l\artfact  Thanessa Florargent.', 47187),
(66840, 'frFR', 'Scurit aquatique', 'Apportez 3chantillons d\eau  Manny Lector.', 'L\une de mes plus grandes responsabilits consiste  veiller  ce que cette expdition ait accs  de l\eau potable.\n\nPuisque les Gnolls de l\est sont plongs jusqu\au cou dans la putrfaction, il faut que je m\assure que le camp est sauf.\n\nJe ne tiens pas  alarmer les autres en faisant moi-mme des prlvements, mais le fait est que des analyses s\imposent.\n\nApportez-moi des chantillons recueillis dans les trois cascades voisines, et je vous rcompenserai gnreusement.', '', '', '', '', '', '', 47187),
(66839, 'frFR', 'Macration', 'Trouvez des baies-de-sang, des baies de corne-de-bronze et des fleurs de foliole draconique.', 'Comme on avait pas grand-chose  faire, avec les autres, on s\est dit qu\on allait se payer une tourne  l\auberge.\n\nVous allez pas l\croire, mais y a pas l\ombre d\une goutte de bire, dans cette maudite turne! Voil ce qui se passe quand on laisse les Roides-Ferrures aux commandes!\n\nDu coup, on a dcid d\prendre les choses en main. Y a des fleurs et des herbes qui poussent dans la fort  l\est, on pourrait s\en servir pour prparer une bonne cuve d\hydromel. Je peux vous demander de nous en rapporter quelques-unes? J\vous revaudrai a!', '', '', '', '', '', '', 47187),
(66838, 'frFR', 'Il fait froid, au sommet', 'Rcuprez des peaux d\ours paisses sur des ours crins-drus.', 'Toute aubergiste digne de ce nom se doit d\anticiper les besoins de ses clients. Malheureusement, je ne m\attendais pas  ce que les nuits soient aussi froides par ici. Ahem\n\nMes htes vont avoir besoin de couvertures bien paisses et bien chaudes, et je me suis dit que des peaux d\ours feraient parfaitement l\affaire.\n\nVous trouverez de beaux spcimens dans la fort  l\est. Rapportez-moi leurs peaux, et je vous les achterai un bon prix!\n\nSoyez chic Songez plutt  ces pauvres aventuriers et aventurires aux pieds gels', '', '', '', '', '', '', 47187),
(66837, 'frFR', 'Un djeuner de soleil', 'Procurez-vous de la viande de trotteur vorquin et de bruffalon  rayures au sud du guet des Trois-Cascades.', 'Mon frre Valdo tait cens passer une commande de nourriture, mais a fait une semaine que j\attends, et toujours rien.\n\nConnaissant ce tire-au-flanc, a ne me surprend pas. Je vous parie qu\il s\est encore accord une petite sieste au lieu de faire son boulot! Rsultat, on n\a plus rien  se mettre sous la dent et, entre mes corves et celle de Valdo, je n\ai pas une minute  moi pour aller chasser!\n\nVous voulez bien vous en charger  ma place? La viande des trotteurs vorquins et des bruffalons  rayures qui pturent au sud nous aidera  tenir le coup en attendant la prochaine livraison.', '', '', '', '', '', '', 47187),
