(66834, 'frFR', 'Rellen l\Instruit', 'Prsentez vos offrandes dans l\antre et assistez  chacun des enseignements de Rellen.', 'Dposez vos offrandes dans l\antre central. Vous pourrez y voir la lgende de Rellen l\Instruit, qui donna aux Centaures les traditions que nous connaissons aujourd\hui.', '', '', '', '', '', '', 47187),
