(66831, 'frFR', 'Ma place est aux cts des grenouilles', 'Retrouvez Keshki aux bassins de l\Essence et librez les grenouilles sauves.', 'Les grenouilles sont rassembles, $n! Eh bien, euh Je suppose que nous devons quand mme les amener  Akora. Elles seront en scurit aux bassins de l\Essence, en attendant que les bufflaciens se lassent de les importuner et trouvent une autre occupation.\n\nNous n\avons pas trouv de quoi redonner le sourire  Akora, mais j\espre qu\elle comprendra', '', '', '', '', '', '', 47187),
(66830, 'frFR', 'Affaire de bufflaciens!', 'Utilisez le bocal de lucioles de Keshki pour attirer $1oagrenouilles malmenes et les mettre en scurit.', 'Oh, ces fichus bufflaciens me tapent sur les nerfs!\n\n<Keshki tape furieusement du pied, faisant ainsi glisser ses lunettes .>\n\nCe sont de grosses, vilaines brutes! Cet endroit porte peut-tre leur nom, mais a ne les autorise pas  sauter partout et  gober tout ce qui est plus petit qu\eux!\n\nTenez, utilisez mon bocal de lucioles! L\outil de prdilection de tout bon ami des grenouilles. a les calmera suffisamment pour que vous puissiez les attraper et les mettre en scurit.\n\nSi un bufflacien vous cherche des noises, n\ayez pas peur de lui rendre la pareille!', '', '', '', '', '', '', 47187),
(66828, 'frFR', 'Au creux du creux', 'Retrouvez Keshki au creux des Bufflaciens.', 'Je n\avais encore jamais vu Akora aussi trouble. D\habitude, elle est aussi radieuse que ses fleurs, mais cette lgende est trs importante  ses yeux. Elle en parle tout le temps. Hum\n\n<Keshki tripote ses lunettes.>\n\nJe n\y connais pas grand-chose aux plantes, et je ne pense pas qu\elle aime les grenouilles autant que moi\n\nCela dit, il y a en endroit calme au nord d\ici o j\aime me rendre pour rflchir: le creux des Bufflaciens. On y trouvera peut-tre de quoi la rconforter, ou au moins une ide.', '', '', '', '', '', '', 47187),
(66827, 'frFR', 'Les fleurs de notre labeur', 'Ramassez $1oafruits du Dragon mrs, $1oaDracoflores parfumes et $1oacosses luxuriantes dans le jardin afin de les offrir  l\esprit draconique.', 'La lgende raconte qu\elle ne chante que pour celles et ceux qui ont prouv leur dvotion  la vie.\n\nJe m\occupe de ces jardins depuis des annes et je crois que mes plantes et moi sommes enfin prtes.\n\nJe vais commencer les prparatifs du bassin. Vous pouvez m\aider avec la rcolte!\n\nCueillez des cosses dans les buissons, des dracoflores dans les champs ensoleills, et des fruits du Dragon haut dans les arbres. Vous pouvez emprunter mon vieux rteau, si besoin. Mfiez-vous de la vgtation, elle est parfois froce!', '', '', '', '', '', '', 47187),
(66825, 'frFR', 'Vocation', 'Assistez  la crmonie d\Appel au sanctuaire de l\Essence rubis.', '$p! Quelle chance que vous soyez l! Nous sommes sur le point de commencer une crmonie de Vocation et ce serait un honneur de vous avoir comme $gassistant:assistante;.\n\nPour les Draconides, c\est une crmonie trs importante. Certains dveloppent leur expertise dans les jardins, d\autres souhaitent s\occuper de la faune sauvage.\n\nCes jeunes Draconides ont termin leur formation et peuvent dsormais recevoir leurs premires vocations. Je sais que nos novices adoreraient vous voir participer. Lorsque vous serez $gprt:prte;, prsentez-leur chacun des objets qui se trouvent sur cette table.', '', '', '', '', '', '', 47187),
(66805, 'frFR', 'Les cls de la loyaut', 'Rcuprez $1oagrande cl en obsidienne.', '', '', '', '', '', '', 'Apportez la cl assemble  Sabellian  la citadelle d\Obsidienne.', 47187),
(66788, 'frFR', 'Un bel avenir pour les ufs', 'Aidez la mre Elion  restaurer la zone.', 'Je n\en crois pas mes yeux! Des ufs du Vol draconique noir, aprs tout ce temps!\n\nMais regardez l\tat de cet endroit! a ne va pas du tout! Ces ufs mritent ce qui se fait de mieux.\n\nAvec ces deux bravaches qui s\arrachent les faveurs de la Lieuse-de-Vie comme des enfants, personne ne pense  nous! Vous, en revanche, vous ne laisseriez pas une vieille garde-uf livre  elle-mme si?', '', '', '', '', '', '', 47187),
