(66785, 'frFR', 'Dernire des garde-ufs', 'Allez parler  la mre lion.', 'Je comprends votre inquitude, $c, mais la situation va s\arranger sous peu. On dirait que nous avons de la compagnie.\n\nN\hsitez pas  rester pour assister  la suite des vnements. Cela devrait s\avrer cathartique.\n\nCela dit, pensez  aller voir notre garde-uf lorsque vous aurez le temps. Elle aura sans doute besoin de votre soutien.', '', '', '', '', '', 'Allez parler  la mre lion.', 47187),
(66784, 'frFR', 'Affaiblir la tempte', 'Tuez les invocateurs et invocatrices de temptes primalistes pour fermer le portail du couloir des temptes.', 'Vous vous battez bien, pour quelqu\un qui ne galope que sur deux pattes!\n\nMais notre ardeur au combat importe peu, tant que ces Primalistes continuent  faire venir des renforts. Nous devons fermer ce portail, le couloir des temptes!\n\nFrayez-vous un chemin dans la grotte prs d\ici et tuez les invocateurs et invocatrices de temptes primalistes qui le maintiennent ouvert. Je vous aiderai si je le peux.', '', '', '', '', '', '', 47187),
(66783, 'frFR', 'Promesse renouvele', 'Aidez la khan Sansok, la khan Tigari, la khanam matra Sarest et Mrithra  changer des offrandes.', 'Il y a des sicles de cela, le tout premier Centaure et moi firent un serment d\amiti et de coopration. Bien que la situation soit trs diffrente aujourd\hui, je pense qu\il est temps pour nous de renouveler cette promesse.\n\nUn texte sacr fut rdig afin d\aider les futures gnrations de Centaures  se rappeler leur lien au Vol draconique vert. Chaque couplet doit tre accompagn d\une offrande de la part des khans. J\espre que les Centaures sauront se remmorer le sens de ces mots.\n\nMais attention, tout repose sur les offrandes. Choisissez bien, et notre alliance sera aussi forte qu\au premier jour.', '', '', '', '', '', '', 47187),
(66781, 'frFR', 'Une question de got', 'Trouvez un caillou  faire lcher  Mordigan Gueule-de-Fer  la crique du Baleinier.', 'Quel manque de respect, franchement!\n\nDes vieux Gorlocs puants nous ont vol une partie de notre matriel, on va devoir tout remballer Ha! Je lche des cailloux depuis bien avant votre naissance, moi! Pas besoin de gadgets sophistiqus\n\nApportezmoi un caillou, je vais vous le prouver!', '', '', '', '', '', 'Retournez voir Mordigan Gueule-de-Fer.', 47187),
(66780, 'frFR', 'Royales prtentions', 'Parlez aux fidles d\Irion.', 'J\ai dvou ma vie  sauver Azeroth de la destruction, encore et encore, et cet imbcile pense qu\il lui suffit de dbarquer et d\exiger le titre d\Aspect? Je ne crois pas, non.\n\nParlez  mon peuple, $n. coutez ce que mes congnres ont  dire sur moi et sur tout ce que j\ai fait pour ce monde.', '', '', '', '', '', '', 47187),
(66779, 'frFR', 'Hritier prsomptif', 'Parlez aux fidles de Sabellian.', 'En tant qu\hritier de Neltharion et chef du dernier Vol draconique noir, je ne m\attendais pas  ce que mon droit de naissance soit un jour contest. Et encore moins par un Dragonnet prsomptueux encore plus jeune que vous, $gmortel:mortelle;.\n\nSi cette vidence ne vous suffit pas, vous pouvez vous adresser aux membres de mon Vol. Vous n\avez pas  me croire sur parole.', '', '', '', '', '', '', 47187),
