(66737, 'frFR', 'Un meilleur commencement', 'Plantez des graines dans $1oacarrs de terre fertile et laissez-les pousser.', 'Varos fait preuve d\une grande rigueur, mais les Dragonnets ont le don de s\attirer des ennuis. Pas les miens, bien sr mais je crois que tous les Dragons n\lvent pas leur couve de sorte qu\elle ait conscience de l\importance et de la solennit de son rang.\n\nJe ne voudrais pas encourager des jeux en extrieur plutt que l\tude, mais je vous aiderai  protger le jardin de faon plus efficace. Prenez ces graines et plantez-les dans les environs. Arrives  maturit, elles dgageront un parfum qui dplat aux insectes.\n\nLes jardiniers pourront vous aider, ainsi que les Dragons de bronze, si vous surveillez vos manires.', '', '', '', '', '', '', 47187),
(66735, 'frFR', 'Juste les pointes', 'laguez $1oabuissons broussailleux.', 'Ces abeilles qui effraient nos Dragonnets ne sont pas notre seul problme. La pollinisation est habituellement une bonne chose, mais le rcent essaim a compltement affol la flore.\n\nPourriez-vous prendre mes cisailles et commencer  laguer la vgtation qui a prolifr? De dangereux flagellants sont dj apparus, mais j\espre empcher leur propagation. Mieux vaut prvenir que gurir, aprs tout.\n\nEt j\ai vraiment, mais alors vraiment, besoin d\aide pour tout ce qui est prvention, $n.', '', '', '', '', '', '', 47187),
(66734, 'frFR', 'Pas touche aux abeilles', 'Utilisez le fumigateur pour calmer et rassembler $2oaabeilles irritantes, puis relchez-les prs du lac.', 'Oh, que la Lieuse-de-Vie soit loue! Je vois que vous avez les mains libres.\n\nCes jardins sont d\ordinaire un superbe terrain de jeu pour nos Dragonnets, mais les abeilles se multiplient d\une manire incontrlable. Les floraisons sont revenues en force, et avec elles la faune Les Dragonnets sont terrifis et les Dragons agacs Rien qu\hier, l\un de nos jeunes s\est fait piquer et\n\n<Varos prend une profonde inspiration pour se calmer, puis il vous lance un regard implorant.>\n\nAuriez-vous l\amabilit de rassembler les abeilles et de les conduire au lac? Prenez ce fumigateur, cela les calmera.', '', '', '', '', '', '', 47187),
