(66730, 'frFR', 'Survivants mrites', 'Trouvez le vieux Dfense-Sinistre au lac gel dans la trave d\Azur, et parlez-lui.', 'Il est difficile d\oublier pourquoi nous sommes ici, aussi malheureuses que soient nos circonstances. Notre peuple compte sur nous et je veux me montrer  la hauteur! Il est impratif que nous trouvions un refuge temporaire en ces terres sauvages, et je crois savoir o.\n\nAu diable les geignements et EN AVANT!', '', '', '', '', '', 'Trouvez le vieux Dfense-Sinistre et parlez-lui au lac gel de la trave d\Azur.', 47187),
