(66724, 'frFR', 'La Pche-Loupiotes', 'Rcuprez $1oaloupiotes et dposez-les dans le panier  offrandes.', 'Toutes mes excuses, je ne pensais pas que mon frre vous entranerait dans sa dernire lubie.\n\nIl a tendance  se laisser emporter. Mais cette fois-ci, j\ai bien peur qu\il ne coure  la mort.\n\nIl refuse de m\couter, et il ne vous coutera sans doute pas non plus.\n\nNotre anctre Kauriq la Pche-Loupiotes, par contre Elle est au centre de cette fixette, elle lui fera peut-tre entendre raison.\n\nPourriez-vous attraper des loupiotes et les apporter ici? Je m\en servirai pour communiquer avec son esprit, qui persiste dans cette pierre.', '', '', '', '', '', '', 47187),
