(66719, 'frFR', 'Un pas en arrire', 'Protgez-vous de l\Appel.', '$gCher ami:Chre amie;, cela m\attriste beaucoup, mais je dois vous dire que j\ai dj eu affaire au mal qui ronge vos semblables dans ces ruines. Si vous continuez plus avant, vous aussi sombrerez dans la folie.\n\nQu\il vous ait t inculqu, ou qu\il rsulte de votre nature profonde, l\appel que vous percevez est d\ordre physiologique! Vous tes en proie  une pulsion qui doit tre assouvie.\n\nCela me cote de l\avouer, mais je connais un moyen de satisfaire cette pulsion. Ce ne sera pas tout  fait pareil, mais au moins, serez-vous capable de tenir quelque temps.', '', '', '', '', '', '', 47187),
