(66715, 'frFR', 'L\extraction', 'Sauvez les Roharts du camp des Pelages-de-neige dans la trave d\Azur.', 'Le plus important pour l\instant, c\est de ramener les ntres en un seul morceau, idalement.\n\nEt bien que a me cote de l\avouer, je ne suis pas en tat de les affronter  moi seul.\n\ntes-vous $gdispos:dispose;  nous aider?', '', '', '', '', '', 'Parlez  Morglas pour en apprendre davantage sur les chasseurs et chasseuses roharts.', 47187),
