(66711, 'frFR', 'Spcialit culinaire nocturne', 'Rcuprez $1oabulots des rivires pour Hadari.', 'En raison de la nature nomade de notre clan, certaines ressources viennent parfois  manquer. En effet, nous ne pouvons pas nous permettre d\exploiter les gisements de minerai que ces terres ont  offrir.\n\nLe dfunt khan avait conclu de nombreux accords commerciaux, et je ne vois pas de raison d\interrompre nos relations.\n\nVous trouverez dans la baie toute proche des seaux avec lesquels nous rcuprons des bulots. Certains de nos voisins en sont particulirement friands. Pourriez-vous m\en rapporter quelques-uns? J\aimerais les utiliser pour un change.', '', '', '', '', '', '', 47187),
(66710, 'frFR', 'Survol de givrclair', 'Traversez les anneaux en planant.', 'Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 47187),
(66709, 'frFR', 'La mdecine militaire pour les nuls', 'Aidez le vieux Dfense-Sinistre  se remettre de ses blessures.', '<Difficile de dire depuis quand ce Rohart bless est allong au milieu de la fort, mais une chose est sre, il ne tiendra pas longtemps sans aide.>', '', '', '', '', '', '', 47187),
(66708, 'frFR', 'Surfer sur la neige', 'Trouvez les chasseresses et chasseurs roharts ports disparus dans la trave d\Azur.', 'Salutations, $c. Ce dme magique cr par le Kirin Tor est parfaitement ahurissant, vous ne trouvez pas? Mais mme s\il nous protge du froid mordant et de la nature sauvage, nous ne pouvons pas compter ternellement sur ces mages.\n\nVoil quelques jours, un groupe de nos chasseuses et chasseurs les plus aguerris s\est aventur dans les forts  la recherche de nourriture et de matriel, mais on est sans nouvelles depuis. J\ai beau savoir que leur chef, le vieux Dfense-Sinistre, est un baroudeur et un chasseur chevronn, je ne peux pas m\empcher de m\inquiter\n\nPourriez-vous les retrouver?', '', '', '', '', '', 'Trouvez les chasseresses et chasseurs roharts ports disparus dans la trave d\Azur.', 47187),
(66706, 'frFR', '[DNT]QuestNameHere', '', '', '', '', '', '', '', '', 47187),
(66704, 'frFR', 'Mugurlglrlgl!', 'Murglgulglrrlglgul!', 'Mrglgulglrrlglgul! Grurguglullgurl!\n\nGruglrlgllrugl rrgulgrulgrgl grugll gurgull gur. Murgllgllrugl gurgllglrl Murgul gruggullgl. Murguglegurgllgur gurgll gurgulgul guruulgurllgr guuglrllgl.\n\nMgrgulllglll gurl gugll.\n\n<Vous n\tes pas $gcertain:certaine; de ce qui se dit, mais les paroles sont accompagnes de nombreuses gesticulations. Il semblerait que ce Murloc vous demande de tuer quelque chose.>', '', '', '', '', '', '', 47187),
(66703, 'frFR', 'Effet boule de neige', 'Rcuprez $1oatotems pelages-de-neige auprs des chamans et chamanes pelages-de-neige dans la trave d\Azur.', 'Les Gnolls pelages-de-neige sont malins. Ils savent que la glace conserve les aliments. Mais pas n\importe quelle glace, non. La glace magique, c\est beaucoup mieux!\n\nC\est l\uvre des chamans. Ils pigent Morglas ici, et Morglas meurt de faim avec ce tas de viande juteuse sous le nez.\n\nSi $r veut aider les Roharts, il faut faire vite.\n\nHeureusement, Morglas sait comment conjurer le sort.\n\nPourquoi Morglas apporterait son aide? Parce qu\il n\aime pas les chamans non plus.', '', '', '', '', '', '', 47187),
(66700, 'frFR', 'Le locus noir', 'Apportez le locus noir  la tlmancienne Aerilyn.', 'Une merveille, n\est-ce pas? Le locus tait un bien trop lourd fardeau pour la Flamme fracture. Mais il semble presque fait pour reposer entre mes mains. C\est trs trange.\n\n<Adenedal secoue la tte.>\n\nMais non. Pas aujourd\hui. Plus jamais. Reprenez-le. Ce n\est pas non plus  moi d\endosser ce fardeau.\n\nAu revoir, $gcher ami:chre amie;.', '', '', '', '', '', '', 47187),
(66699, 'frFR', 'Interroger les autochtones', 'Parlez aux Roharts du camp d\Antonidas.', 'Kalecgos a raison. Les Roharts, qui vivent sur ces terres depuis des gnrations, sauront vous renseigner.\n\nBon nombre de ces nomades font halte ici avant de regagner leurs divers camps disperss aux quatre coins de la trave.\n\nDemandez autour de vous! Vous finirez forcment par trouver quelqu\un qui pourra vous renseigner sur les lignes telluriques.', '', '', '', '', '', '', 47187),
(66698, 'frFR', 'Compter les argalis', 'Parlez au berger aylaag et ramenez les moutons gars du clan.', 'Notre troupeau d\argalis est l\une de nos plus prcieuses ressources. Chaque fois que nous en perdons un, la puissance de notre clan s\en ressent.\n\nUne poigne de nos btes ont t spares du reste de leurs congnres, et nos bergers auraient bien besoin de votre aide pour les rcuprer.', '', '', '', '', '', '', 47187),
(66692, 'frFR', 'Boucle du sanctuaire de l\Essence rubis  Avanc', 'Traversez les anneaux en planant.', 'Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 47187),
(66691, 'frFR', 'Waking Shores - Race 01 - Intermediate', 'Traversez les anneaux en planant.', 'Ce circuit ressemble au prcdent,  la seule diffrence que le placement des points de passage est plus vari.\n\nSi vous vous retrouvez $gcoinc:coince;, utilisez le sifflet et je vous dpannerai.', '', '', '', '', '', '', 47187),
(66690, 'frFR', 'L\offensive nokhud: l\ultime anctre', 'liminez le khan Balakar et rcuprez le mdaillon ancestral  l\offensive nokhud.', 'Vous avez prouv que nous pouvions vous faire confiance et que vous portiez un intrt sincre  nos valeurs et nos coutumes. Il me reste un dernier anctre  voquer, mais cette fois-ci, la tche sera dangereuse.\n\nTuez ce tratre de Balakar, chef des Nokhuds et fils sans pre, et prenez son mdaillon. Si vous me le rapportez, vous aurez ma reconnaissance ternelle.', '', '', '', '', '', '', 47187),
(66689, 'frFR', 'Plus qu\une pierre', 'Montrez les fragments touchs par la tempte  Watu.', '<Les fragments sont lisses et tides au toucher. Des clairs jaillissent au plus profond de leur cur.>\n\n<Peut-tre que Watu ou Olekk en sauront davantage.>\n\n<L\ide de vous sparer des fragments vous fait ressentir le besoin de les serrer contre vous. De les garder  tout jamais.>', '', '', '', '', '', 'Retournez voir Watu au poste de la Pinde.', 47187),
(66688, 'frFR', 'Symboles du vent', 'Trouvez des gages du vent et dposez-les dans le rcipient d\offrande prs de la pierre chantante.', 'Lorsque les lments, les vritables primordiaux de ce monde, dfirent les Centaures, Himia s\opposa  eux avec notre don inn, celui du vent.\n\nUne pierre chantante trne firement dans les plaines. Allez y dposer des gages du vent pour voquer son souvenir. Vous en trouverez un peu partout autour de vouss, qu\il s\agisse de la plume d\un oiseau, de la spore d\une plante ou du roseau d\un cours d\eau.', '', '', '', '', '', '', 47187),
(66687, 'frFR', 'Le royaume des prdateurs', 'Rcuprez $1oatoiles de tisse-ombre, $2oaserres de rusard et $3oacailles d\chine-de-tonnerre.', 'Vous devriez connatre Rellen l\Instruit, lui qui offrit aux Centaures les outils ncessaires pour survivre sur des terres impitoyables. Son souvenir rclame des offrandes trouves sur des prdateurs dignes de ce nom.\n\nMais prenez garde. Si les cratures d\aujourd\hui ne sont plus aussi dangereuses que celles d\antan, elles restent de redoutables prdatrices.', '', '', '', '', '', '', 47187),
(66684, 'frFR', 'Chasser la tempte', 'Dtruisez les Primalistes et leur source de magie des temptes.', '<Watu arrache le fragment et prend une profonde inspiration.>\n\nJ\ai compltement perdu le contrle. Olekk avait raison. Cette pouvantable magie est forcment l\uvre des Primalistes. Je vous en prie, arrtez-les!\n\nJe dois ramener mon frre au camp.', '', '', '', '', '', '', 47187),
(66683, 'frFR', 'Analyse de dernier recours', 'Renseignez-vous sur les fragments touchs par la tempte au poste de la Pinde.', '<Les yeux clos et les bras croiss, Watu marmonne.>\n\nDe toutes les cratures possibles, il fallait que je me fasse encorner par un cerf. Je ne suis plus qu\un Centaure bless parmi tant d\autres. Mon frre va rcolter tous les honneurs, et personne ne sera surpris  la maison.\n\n<Watu lve les yeux.> Qu\est-ce que vous avez l? Des cailloux brillants? Je veux bien en regarder un, mais vous feriez mieux d\apporter le reste  quelqu\un d\autre. Je suis chasseur, pas archologue. <Watu grogne en regardant sa patte.> C\est peut-tre le signe qu\il est temps pour moi de changer de mtier. Allez-y, vous vous tes $gmontr:montre; plus utile que moi.', '', '', '', '', '', '', 47187),
(66681, 'frFR', 'La tempte abonde', 'Tuez $1oabtes touches par la tempte dans la pinde de Sagemont.', 'Si vous vous aventurez dans la pinde, je vous demande d\abattre tous les animaux touchs par la tempte. Cela me peine grandement, mais ils souffrent de toute vidence, ils ne peuvent tre soigns et rpandent leur agressivit.\n\n mon avis, c\est l\uvre des Primalistes. J\ai vu un autel magique trange dans leur avant-poste  ct, tout doit venir de l.\n\nJe vais y retourner pour mener l\enqute. Si je ne suis pas de retour lorsque vous reviendrez, l\claireur Watu pourra vous donner d\autres instructions. Merci beaucoup pour votre aide.', '', '', '', '', '', '', 47187),
(66680, 'frFR', 'Compter les moutons', 'Amadouez Talisman avec de la nourriture, et utilisez son sifflet pour sauver $3oaargalis perdus dans la pinde de Sagemont.', 'Comme c\est frustrant! Un cerf enrag m\a attaqu lors d\une patrouille de reconnaissance avec mon frre Olekk.\n\n<Watu vous montre sa patte ensanglante et grimace.>\n\ntes-vous $gvenu:venue; pour aider? Aprs l\attaque des Primalistes, nos argalis se sont disperss dans les bois. Leur laine et leur lait sont essentiels  la survie du camp.\n\nPrenez ce sifflet, il vous servira  diriger Talisman, la bakar, pour ramener le troupeau d\argalis au bercail. Si jamais elle a besoin d\une motivation supplmentaire, le boucher Sondo peut vous donner ses friandises prfres.', '', '', '', '', '', '', 47187),
(66679, 'frFR', 'Boucle du sanctuaire de l\Essence rubis', 'Traversez les anneaux en planant.', 'Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 47187),
(66676, 'frFR', 'Entre discrte', 'Retourner voir Radiya dans les sources des Ohn\irs.', 'Voici Lizi c\est elle, mon secret. Je m\en occupe depuis que sa mre l\a rejete.\n\nElle a l\air mal en point. Ce que ces montres lui ont fait subir est au-del de mes comptences. Je vais devoir la ramener  la maison. Mon ohn va certainement me punir jusqu\ la fin de mes jours, mais Lizi doit tre secourue. Je vous suis ternellement reconnaissante de nous avoir aides, $p. Dsole que la situation ait pris un tel tour.\n\nSi vous tes toujours $gpartant:partante; pour une dernire aventure a vous dirait d\affronter la colre de mon ohn avec moi? Retrouvez-moi aux sources!', '', '', '', '', '', 'Retournez voir Radiya dans les sources des Ohn\irs.', 47187),
(66675, 'frFR', 'La puissance des Aspects', 'Aidez Alexstrasza  la pierre de vu originelle.', 'La pierre de vu originelle est un cadeau que les Titans ont offert  nos Vols il y a fort longtemps. Si l\on en croit ce que nous avons dcouvert, je devrais pouvoir la ractiver et restaurer ce faisant nos pouvoirs aspectraux.\n\nNous ignorons ce qui nous attend, mais nos chances de succs ont beau tre minces, je dois tenter le tout pour le tout.\n\n$n, je vous saurais gr de bien vouloir m\accompagner.', '', '', '', '', '', '', 47187),
(66671, 'frFR', 'Le chemin de Nulle-Part', 'Allez voir Maddie Mitraille-Tout au camp Nulle-Part, dans la trave d\Azur.', 'Vous m\avez tout l\air de quelqu\un de capable et de volontaire! a vous dirait d\aider l\expdition du Dracaret?\n\nOn a un campement tout  fait sympathique au milieu d\une trs belle contre sauvage.\n\nVous y trouverez toutes sortes d\activits, si l\envie vous prend d\y faire un tour.\n\nPassez donc causer  ma frangine Maddie quand vous y serez. Elle vous expliquera quoi faire.', '', '', '', '', '', 'Allez voir Maddie Mitraille-Tout au camp Nulle-Part, dans la trave d\Azur.', 47187),
(66660, 'frFR', ' vos marques Prts', 'Rejoignez Andantenormu et Siaszerathel dans le pass.', '<Le regard de Nozdormu est perdu dans le vide.>\n\nPlus elles tombent, plus elles prennent de la vitesse. Elles percent des brches dans la trame mme du temps et provoquent de grandes ondes. Vous allez devoir tre rapide pour les attraper.\n\n<Nozdormu se reprend avant de se tourner vers vous.>\n\nJe vais envoyer mes marcheurs et marcheuses du temps pour vous aider  parcourir les voies temporelles et acclrer vos efforts. vitez de vous mler aux autochtones, et ne vous arrtez pas avant d\avoir trouv Chronormu!\n\nAllez-y. Nous avons trs peu de temps.', '', '', '', '', '', '', 47187),
(66658, 'frFR', 'L\offensive nokhud: Dfense des fondateurs', 'Entrez dans l\offensive Nokhud, venez  bout de Maruuk et Teera et placez leurs armes sur le kurgan teeraka.', 'Les armes de Teera et de Maruuk ont t voles avant que nous ne puissions arrter le mande-tombe Arban. Nos plus remarquables anctres combattent peut-tre  nouveau sur ces plaines pour les Nokhuds.\n\nRejoignez l\offensive nokhud. Trouvez Maruuk et Teera, et lorsque vous les aurez matriss, rapportez leurs armes au tertre funraire de Teeraka. Nous ferons en sorte que nos anctres retrouvent le repos avec tous les honneurs qu\ils mritent, dans un endroit plus facile  protger.', '', '', '', '', '', '', 47187),
(66657, 'frFR', 'Et te relve pas, cette fois!', 'Entrez dans le Kurgan principal et terrassez le mande-tombe Arban.', 'Le mande-tombe Arban s\est retranch dans le plus grand des kurgans, celui o reposent Maruuk et Teera, les tout premiers anctres des Maruuks. Arrtez-le avant qu\il ne les ressuscite!', '', '', '', '', '', '', 47187),
(66656, 'frFR', 'Un repos ternel bien mrit', 'Terrassez les esprits des plus braves anctres des Centaures, puis utilisez le totem de rpit de Zorig pour les librer.', 'Sous le joug de cette magie noire, nos anctres se battront plutt que de nous suivre. Les Ukhels ont ressuscit nos guerriers et guerrires les plus redoutables. Vous aurez bien du mal  les arrter.\n\nJe vais vous accompagner pour vous venir en aide. Il est grand temps que la lance de ma mre reprenne du service.\n\nUne fois les esprits vaincus, utilisez ce totem de ma fabrication pour les aider  retrouver le chemin de leurs Kurgans.', '', '', '', '', '', '', 47187),
(66655, 'frFR', 'Ingrdients de d-ncromancie', 'Rcuprez $1oacrnes intacts sur les compagnons ressuscits et $2oamottes de terre sacre.', 'J\ai peur que les esprits aient du mal  retrouver le chemin de leur tombe, mme si nous les librons du joug des Ukhels.\n\nCes hrtiques ressuscitent aussi les animaux de nos anctres, qui les guidaient et les protgeaient tout au long de leur vie.\n\nRapportez-moi les crnes de ces animaux et un peu de la terre que nos adversaires ont profane. Ensemble, ces composants devraient aider nos anctres  trouver le repos ternel.', '', '', '', '', '', 'Retrouvez Zorig plus loin dans les Kurgans ternels.', 47187),
(66654, 'frFR', 'Annihiler les profanateurs', 'Tuez les vandales nokhuds et les creuse-tombes ukhels et rcuprez les armes ancestrales voles.', 'Ma mre tait une hrone. Elle mrite la paix et le repos, pas cet asservissement! Tout comme nos autres hros et hrones, d\ailleurs.\n\nCes misrables doivent payer pour cela. Et nos anctres doivent retrouver le repos auprs de leurs armes. Reprenez-les  ces hrtiques!', '', '', '', '', '', 'Retrouvez Zorig plus loin dans les Kurgans ternels.', 47187),
(66652, 'frFR', 'Entre les mains du rparateur', 'Enqutez sur le rituel ukhel au tertre  proximit.', 'Je ne vois pas d\ici ce que ces misrables font, mais j\ai bien peur qu\ils soient en train de profaner les Kurgans.\n\nRendez-vous sur la tombe la plus proche et essayez de mettre un terme au rituel qui s\y droule.\n\nEt si vous trouvez un indice sur leur objectif, rapportez-le-moi.', '', '', '', '', '', 'Rapportez la lance  Zorig.', 47187),
(66651, 'frFR', 'Manigances des Nokhuds', 'Allez voir l\initi Zorig dans les Kurgans ternels.', 'Les Nokhuds et les Ukhels ont pris le contrle des Kurgans ternels, o reposent nos plus vnrables anctres. Leurs intentions ne peuvent tre que malveillantes.\n\nJ\ai dpch l\initi Zorig sur les lieux pour enquter, mais il n\est pas rentr.\n\nIl est comptent, mais manque de confiance en lui. Aidez-le  mettre un terme  leurs viles activits!', '', '', '', '', '', '', 47187),
(66650, 'frFR', 'Fatalit finale', 'Terrassez $1oaboss de raid fatidique diffrents.', '<Vous gardez votre calme. Si la nature exacte de cette exprience vous chappe encore, elle vous est dsormais familire. Vous avez su surmonter ces preuves, telle est votre ultime rcompense.>\n\n<C\est l\esprit clair et la main sre que vous avancez une dernire fois. Forgez votre propre destine et regardez-la s\accomplir  chacun de vos pas.>', '', '', '', '', '', '', 47187),
(66647, 'frFR', 'Dfocalisation lmentaire', 'Rcuprez le focalisateur lmentaire.', 'Kalecgos et moi-mme essuyons un feu nourri dans le ciel qui surplombe la montagne. Les Primalistes dchanent toutes leurs forces et leur arme est innombrable.\n\nSi a continue, ces misrables vont finir par nous submerger.\n\nPar chance, j\ai un plan\n\nVous trouverez au pied de la montagne une Orque drange rpondant au nom de Ruvine Meule-de-Pierre. Les mages du Kirin Tor ont eu maille  partir avec elle  maintes reprises.\n\nElle a en sa possession un appareil capable d\absorber et de rediriger les nergies lmentaires.\n\nPrenez-le-lui, puis retrouvez-moi un peu plus loin.', '', 'Ruvine dtient le tout-puissant focalisateur lmentaire.', 'Ruvine Meule-de-Pierre', '', '', 'Allez voir la projection de Khadgar un peu plus loin dans le massif du Vakthros.', 47187),
(66646, 'frFR', 'Apaiser les causalits', 'Tuez les lmentaires du temps.', 'Mauvaise nouvelle. L\Infinie a rendu les nergies temporelles terriblement agressives.\n\nAbattez tous les lmentaires du temps que vous croiserez tout en aidant l\ambassadrice Chronormu dans sa tche. Je vais rester ici pour l\aider  maintenir ternia en place.', '', '', '', '', '', '', 47187),
(66633, 'frFR', 'Dclaration', 'Planez une bannire des Dragons noirs dans $1oacadavres djaradins.', 'Les tribus djaradines croient que le Vol draconique noir est fini. Ces perfides ne craignent ni ne respectent l\autorit d\Irion en ces lieux.\n\nUne dmonstration de force s\impose pour leur rappeler que le Vol d\obsidienne est de retour, et qu\il est plus puissant que jamais.\n\nDcimez les rangs djaradins et marquez chaque cadavre afin que plus personne n\oublie qui commande ici.', '', '', '', '', '', '', 47187),
(66622, 'frFR', 'Outils gars', 'Sauvez $1oaoutils gars.', 'C\est terrible! Il chemblerait que mes *hic* outils aient pris la poudre d\escampette quand j\avais *hic* le dos tourn. Je peux pas *hic* supporter l\ide qu\ils choient perdus, ils doivent tre *hic* terrifis!\n\nVous pourriez me les retrouver? Les bruchquez pas, *hic* echayez de les rachurer, et ils ch\ouvriront  vous!', '', '', '', '', '', '', 47187),
(66612, 'frFR', 'Une soigne-crabes dans l\embarras', 'Tuez $1oa Gorlocs au camp de l\Escarpade.', 'Les crabes sont en danger!\n\nCe groupe en particulier a connu une saison difficile. Leur habitat prcdent a t ravag par les Primalistes. Je les ai guids jusqu\ici, mais ils se sont fait attaquer par les Gorlocs!\n\nJe croyais les mener en scurit, mais les Gorlocs exacerbent l\agressivit des crabes avant de les envoyer  une mort certaine.\n\nS\il vous plat, affrontez les Gorlocs pour donner aux crabes une chance de s\chapper.', '', '', '', '', '', '', 47187),
(66611, 'frFR', 'Nettoyage cleste', 'Tuez $1oainsectes.', 'Vous entendez a? Des insectes! Tout autour de nous Et plutt gros, pour certains!\n\nEt si vous utilisiez le puits derrire moi, avec votre monture aile, pour essayer de rgler ce problme?', '', '', '', '', '', '', 47187),
(66598, 'frFR', 'Savoir-faire sacrenuit', 'Trouvez l\invocatrice dimensionnelle Dlandra au camp d\Antonidas, dans la trave d\Azur.', 'Les symboles antiques, c\est pas vraiment mon truc. Mais bon\n\n<Thaelin fouille dans ses affaires et finit par en sortir une carte. Au sommet du parchemin, griffonn  la va-vite, se trouve le nom d\Antonidas.>\n\nAh ah! J\ai trouv!\n\nC\est pas la porte  ct, mais vous trouverez des spcialistes de cette ancienne magie ici.\n\n<Il pointe un endroit sur la carte.>\n\n\Pourront peut-tre vous filer un coup de main.', '', '', '', '', '', '', 47187),
(66597, 'frFR', 'Pierre d\antan', 'Inspectez le monolithe ancien grav.', 'Cette pierre derrire moi, c\est une pice de ce que vous autres appelez de la technologie antique. On l\a dcouverte par hasard ici, sur les les.\n\nSeulement voil, on ne sait pas exactement  quoi elle sert. C\est mme trs mystrieux,  vrai dire.\n\nOn a demand de l\aide  des collgues, mais en attendant leur arrive, pourriez-vous y jeter un coup d\il?', '', '', '', '', '', '', 47187),
(66596, 'frFR', 'Des murmures dans le vent', 'Parlez  l\archimage Khadgar  Hurlevent.', 'Bonjour, $p. a fait longtemps, et j\aimerais avoir le temps de discuter.\n\nMais voyez-vous, j\ai eu une conversation assez instructive non, disons plutt inquitante oui. Une conversation inquitante avec une vieille connaissance.\n\nUne rvlation peut tre les deux  la fois, aprs tout.\n\nIl faut absolument que je vous rapporte ce que j\ai appris.', '', '', '', '', '', '', 47187),
(66595, 'frFR', 'Dcouverte en sommeil', 'Apportez le message  Thaelin Sombrenclume  l\avant-poste de l\caille rubis sur les rivages de l\veil.', '<La faon dont ce curieux parchemin est apparu dans vos sacs importe peu; seul compte son contenu.>\n\nMembres de l\expdition du Dracaret:\n\nVotre aide est requise! Prsentez-vous immdiatement  l\avant-poste de l\caille rubis!\n\n<Avant que vous puissiez lire la signature, l\encre mystrieuse s\vapore dans un nuage d\une poussire entre blanc et bleu, laissant derrire elle une page blanche et un dlicieux parfum fleuri.>', '', '', '', '', '', '', 47187),
(66589, 'frFR', 'Coordination expditionnaire', 'Recrutez des explorateurs, des artisans et des rudits  travers Hurlevent pour l\expdition vers les les aux Dragons.', 'Je m\appelle Toddy. C\est moi qui dirigerai notre joyeuse petite bande sous la bannire de l\expdition du Dracaret. Je vous expliquerai tout en dtail plus tard, mais pour l\instant, vous pourriez nous aider en rassemblant les troupes.\n\nUne expdition qui se respecte doit fdrer tout un tas de gens. Il nous faudra des spcialistes de l\rudition, de l\artisanat et bien sr, de l\exploration!\n\nAlors? Qu\est-ce que vous attendez? Trouvez-moi un quipage digne de ce nom!', '', '', '', '', '', 'Informez Toddy Bourbon de votre succs au port de Hurlevent.', 47187),
(66586, 'frFR', 'Hritage de Tyr: les secrets du pass', 'Entrez dans Uldaman, dans les terres Ingrates, et dcouvrez la source des perturbations.', 'Si nous voulons empcher Raszageth de librer les autres Incarnations, nous devons rendre leur pouvoir aux Aspects.\n\nMais la tche ne sera pas simple: les Titans se sont tus, et le gardien Tyr est mort depuis longtemps.\n\nLa reine Alexstrasza a chafaud un plan: dans les profondeurs des terres Ingrates se trouve une installation des Titans connue sous le nom d\Uldaman, et selon la reine, des proches de Tyr y auraient dissimul un disque de ses souvenirs.\n \nRendez-vous  Uldaman avec vos allis et rcuprez ce disque pour la reine des Dragons. Avec un peu de chance, le savoir de Tyr s\avrera utile pour les Aspects.', '', '', '', '', '', '', 47187),
(66582, 'frFR', 'Procuration d\nergie', 'Rassemblez de l\nergie avec le rceptacle pour l\invocatrice dimensionnelle Dlandra, au camp d\Antonidas.', 'En temps normal, la rcupration d\nergie est un jeu d\enfants. Cependant, celle dont nous avons besoin est aussi volumineuse qu\instable. Ce rceptacle enchant devrait nanmoins nous permettre de la transporter.\n\nIl existe une zone au sud-ouest o des cratures sont imprgnes de cette nergie puissante, mais fluctuante.\n\nRcuprez-la et revenez me voir. Nous pourrons alors poursuivre nos aventures.', '', '', '', '', '', '', 47187),
(66578, 'frFR', 'A > B Reward Test (Low Health)', '', '', '', '', '', '', '', '', 47187),
(66577, 'frFR', 'L\invitation des Aspects', 'Parlez  Irion pour en apprendre davantage sur la runion du conseil.', 'Ah, $p. Vous tombez  pic!\n\nJe viens de rencontrer le seigneur-commandant Turalyon et ses allis, qui ont accept l\invitation des Aspects sur les les aux Dragons.\n\nVous les accompagnerez, n\est-ce pas? Ce ne serait pas pareil, sans vous!\n\nVous avez certainement remarqu que quelques visages inconnus se sont rassembls ici. Ces tres dots d\ailes se nomment les Dracthyrs. Ils ne me connaissent pas depuis longtemps, mais ce sont dj de grands admirateurs!\n\nAh, mais o sont passes mes bonnes manires? Discutons un peu, voulez-vous?', '', '', '', '', '', '', 47187),
(66575, 'frFR', 'Objet donneur de qute: fiole', 'Apportez l\objet  la garde des chemins Alvi.', '<Cette trange fiole, niche dans le bric--brac de la rserve taraske, semble remplie d\un liquide visqueux et frmissant.>\n\n<Mieux vaut la montrer  Alvi.>', '', '', '', '', '', '', 47187),
(66559, 'frFR', 'Retour au camp', 'Retournez voir l\examinateur Rowe dans la crique du Baleinier.', 'J\ai vu Mordigan filer comme un Nain possd. Je vais lui courir aprs et m\assurer qu\il rejoigne les autres en un seul morceau.\n\nTchez de bien coller  la paroi de la falaise et de sauter dans les cascades, et vous devriez viter d\nerver  nouveau les Gorlocs.\n\nJe vous retrouverai au camp.', '', '', '', '', '', '', 47187),
(66558, 'frFR', 'Rowie', 'Trouvez Rowie.', 'C\est vous qui avez ramen les autres des Fougerobes, n\est-ce pas? Alors, vous savez srement ce qui est arriv  Kaqiata\n\nSon fils, Rowie, est trs inquiet depuis que Brena et les autres ont finir par rentrer sans elle. Je vais rester ici au cas o il reviendrait, mais pourriez-vous le chercher?\n\nJe crois qu\il s\est dirig vers la grotte de glace,  l\est. Il a dit quelque chose  propos de combattre les ytis qui y vivent!', '', '', '', '', '', '', 47187),
(66557, 'frFR', 'Connaissances acadmiques', 'Trouvez un autre expert en dialectes furbolgs au camp Nulle-Part.', 'Eh ben, cette variante crin-d\hiver du furbolg est pas simple, mme pour l\illustre linguiste que je suis.\n\nJ\ai des collgues au camp Nulle-Part qui pourraient me filer un coup de main. Il parat qu\il y a d\autres tribus furbolgs dans la rgion, alors en comparant nos notes sur leurs dialectes, on saura peut-tre mieux sur quel pied danser.', '', '', '', '', '', '', 47187),
(66556, 'frFR', 'Une bien belle grotte', 'Inspectez la grotte.', 'Bon, votre accent est atroce, et c\est pas dix mille annes d\isolation et de drive linguistique qui vont nous aider, mais je crois que je me suis fait une vague ide.\n\nLe point commun dans ce que les Furbolgs ont essay de vous dire, c\est une histoire de mauvais vent caverneux, ou de grotte temptueuse malfique. Soit a, soit une histoire de lessive trop jeudi?\n\nOuais, bon, c\est pas aussi simple que d\apprendre  causer le gnome, hein. Mais pour la grotte, j\ai presque pas de doute, alors on va commencer par l.', '', '', '', '', '', '', 47187),
(66555, 'frFR', 'Comme un ours en cage', 'Aidez Sonova  traduire.', 'Eh b, a a l\air d\tre un sacr bazar l-haut, comme si une tempte avait tout ravag. Je comprends leur nervement, mais pourquoi s\en prendre  nous?\n\nCe serait plus simple si on pouvait en discuter, mais les Crins-d\Hiver ont pas la rputation d\tre trs loquaces et ont pas l\air de causer le furbolgien commun. Furbolgien ou furbolgi? Bref, vous voyez ce que je veux dire.\n\nJ\imagine que vous avez pas eu l\occasion de tailler le bout de gras avec qui que ce soit quand vous tiez dans leur village?', '', '', '', '', '', '', 47187),
(66554, 'frFR', 'Autodfense prventive', 'Terrassez $1oaFurbolgs crins-d\hiver.', 'Avec toute cette agitation dans leur tribu, les Crins-d\Hiver vont pas apprcier de vous voir farfouiller par l-bas.\n\nN\ayez pas peur de vous dfendre si vous tes $gattaqu:attaque;, a leur remettra peut-tre les ides en place.\n\nEssayez juste de tuer personne, d\accord? Je les connais, les gens comme vous, toujours  courir aprs de nouvelles aventures.', '', '', '', '', '', '', 47187),
(66553, 'frFR', 'De fond en combe', 'Dcouvrez $1oaindices dans la combe des Crins-d\Hiver.', 'Les Crins-d\Hiver, a a toujours t un cas  part parmi les Furbolgs.\n\nUn chouia isolationnistes, si vous voulez mon avis. On croirait des fantmes dans le vallon, avec leurs capes qui se confondent avec la neige.\n\nCe clan avait tendance  rester de son ct, mais en ce moment, ses membres se montrent d\une agressivit sans nom! Les Crins-d\Hiver ont mme attaqu notre camp sans la moindre provocation de notre part!\n\nQuelque chose les y a pousss, c\est sr. Je peux pas leur demander quoi; pas pour l\instant, en tout cas. Mais vous trouverez peut-tre des indices dans leur village?', '', '', '', '', '', '', 47187),
(66550, 'frFR', '[PH] More Storms!', '', '', '', '', '', '', '', '', 47187),
(66549, 'frFR', 'Course des rivages de l\veil', '', 'Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 47187),
(66534, 'frFR', 'Adieu  la terre ferme', 'Explorez Orgrimmar.', 'Notre arrive n\est pas passe inaperue, semble-t-il. Ces gens ne sont peut-tre pas des cas dsesprs, finalement.\n\nJe vais contacter byssian et les dignitaires de la Horde pour essayer d\arranger les choses. Pendant ce temps, vous allez partir en reconnaissance.\n\nVoyez ce que cet endroit a  offrir. Aprs tout, il y a de fortes chances que nous ayons  nous installer durablement.\n\nVenez nous trouver quand vous en aurez termin. Avec un peu de chance, nous aurons rgl entre-temps toutes ces formalits assommantes.', '', '', '', '', '', '', 47187),
(66529, 'frFR', 'Un millier de mots', 'Photographiez Dervichane prs du squelette de proto-dragon.', 'Aprs tout ce que nous avons appris ici, je ne peux pas imaginer repartir sans un souvenir!\n\nAuriez-vous l\amabilit de me prendre en photo prs des fossiles de proto-dragons?', '', '', '', '', '', '', 47187),
(66528, 'frFR', 'Le roi sans couronne', 'Inspectez le squelette de proto-dragon.', 'Ce proto-dragon devait tre une crature majestueuse, de son vivant; peut-tre l\une des plus grandes que le domaine Sauvage ait jamais connu.\n\nMais cela n\a pas suffi. Observez son squelette d\un peu plus prs, pour que nous puissions comprendre ses derniers instants.', '', '', '', '', '', '', 47187),
(66527, 'frFR', 'Protographie professionnelle', 'Utilisez l\appareil d\amlioration verticale et photographiez le proto-dragon assoupi.', 'Je n\avais encore jamais form de photographe aussi $gdou:doue; que vous qui soit encore en vie, j\entends. C\est un mtier des plus prilleux.\n\nEn parlant de pril: notre dernire cible est un immense proto-dragon qui pourrait tre l\un des prochains prdateurs dominants du domaine. Approchons-nous-en et tirons-lui le portrait!', '', '', '', '', '', '', 47187),
(66526, 'frFR', 'Prservons la vie sauvage', 'Librez 5proto-dragonnets capturs ou proto-drakes capturs.', 'Le domaine Sauvage est l\une des rares rgions o les proto-dragons peuvent s\panouir. Malheureusement, les Primalistes drangent leurs sites de nidification en envoyant des troupes capturer des proto-dragonnets et des proto-drakes pour leurs expriences.\n\nNe faites preuve d\aucune piti. Localisez ces Primalistes, liminez-les et librez leurs prisonniers. C\est la survie de l\espce des proto-dragons qui en dpend.', '', '', '', '', '', '', 47187),
(66525, 'frFR', 'Protographie de comptition', 'Photographiez un uf de proto-dragon imprgn et un proto-drake imprgn.', 'Bien!  prsent que vous vous tes fait la main avec ces clichs de nophyte, que diriez-vous de passer  des sujets plus complexes?\n\nJ\ai repr un superbe proto-drake qui volait dans la zone derrire nous. De belles cornes, et des cailles crpitant d\lectricit Certainement l\uvre des Primalistes, mais je sais reconnatre une uvre d\art quand j\en vois une!\n\nEssayez donc de prendre un clich du proto-drake et de ses ufs. Vous devrez peut-tre prendre de la hauteur pour avoir un bon point de vue!', '', '', '', '', '', '', 47187),
(66524, 'frFR', 'Protographie amateur', 'Prenez des photos de proto-dragons.', 'Alors comme a, vous voulez devenir inventoriste de renom, comme moi? Vous ne pouviez pas mieux tomber!\n\nLe domaine Sauvage foisonne de connaissances qui n\attendent que d\tre recueillies! Mais comment faire, me direz-vous? Eh bien, c\est trs simple: grce  la version spciale les aux Dragons de mon Inventorialisateur3000, dsormais quip d\une fonction de capture de mouvement amliore!\n\nPour faire vos preuves, vous devrez photographier un uf de proto-dragon, un Dragonnet apprenant  voler et un proto-drake en pleine chasse. Quand vous en aurez termin, retrouvez-moi prs du vieux squelette de proto-dragon,  l\ouest d\ici, et j\valuerai votre travail.', '', '', '', '', '', '', 47187),
(66523, 'frFR', 'Entretien de la forge', 'Rassemblez des composants pour la forge en runissant des peaux de bufflaciens, des pyrocnes inertes et des noyaux de vlage autour du camp d\Antonidas.', 'Si vous cherchez quelqu\un pour vous apprendre les ficelles du mtier, je suis au regret de Ah, vous n\tes pas $gapprenti:apprentie;? Au temps pour moi. Permettez que je me prsente.\n\nJe suis la protectrice Vernagos. Mes collgues et moi-mme avons pour mission de veiller sur ces ruines, ou plus prcisment, de rhabiliter cet ancien espace de travail. Et croyez-moi, ce n\est pas une mince affaire!\n\n ce propos, vous pourriez peut-tre nous aider? Tous les composants ncessaires se trouvent dans les parages: noyaux lmentaires de glace, pyrocnes, cuir de bufflacien\n\nBref, le fatras habituel, quoi. Je peux compter sur vous?', '', '', '', '', '', 'Retournez voir Vernagos au camp d\Antonidas.', 47187),
(66517, 'frFR', 'Une nouvelle source d\armes', 'Rcuprez 25armes dracthyrs intactes sur des membres de la Flamme fracture sur les les aux Dragons pour Dhurrel, des Centaures maruuks.', 'La Flamme fracture menace la scurit de nos frontires. Leurs armes, notamment, nous inquitent au plus haut point. Tchez d\en rcuprer. Nous pourrons alors tenter d\identifier leurs points faibles, voire de les utiliser pour notre propre dfense.\n\nJ\ai confiance en vous, $gtranger:trangre;. Alors, si vous menez cette mission  bien, je vous dvoilerai certains des secrets de notre art de la forge.', '', '', '', '', '', '', 47187),
(66516, 'frFR', 'Des gemmes certainement pas ordinaires!', 'Rcuprez 25gemmes ordinaires sur les troupes djaradines des les aux Dragons pour Gnoklin Folbobine, de l\expdition du Dracaret.', 'Quel gchis! Les tribus djaradines de la rgion utilisent de puissantes gemmes uniquement dans un but esthtique, alors qu\elles pourraient servir dans des tlescopes, des miroirs et des viseurs, sans parler de leurs proprits magiques!\n\nCette absurdit doit tre corrige. Privez-les certaines de leurs gemmes et rapportez-les-moi, je me chargerai de les utiliser  bon escient. Faites attention cependant, les clans djaradins comptent de redoutables guerriers et guerrires.', '', '', '', '', '', '', 47187),
(66513, 'frFR', 'Adieu  la terre ferme', 'Explorez Hurlevent.', 'Nous devrions tter le terrain avant de nous installer dans cette ville. Une mission de reconnaissance s\impose.\n\nAllez voir ce que cet endroit a  offrir. De mon ct, je vais accompagner Irion pour l\aider de mon mieux.\n\nSurtout, vitez de vous mettre les autochtones  dos. Je doute que ces gens aient l\habitude de voir des Dragons se promener dans leurs rues.\n\nVenez nous trouver quand vous aurez une bonne vue d\ensemble.', '', '', '', '', '', '', 47187),
(66511, 'frFR', 'Renomme auprs des Roharts iskaariens', 'Parlez  Murik  Iskaara.', 'Une fois de plus, vous avez prouv que vous tiez un vritable pilier de notre communaut.\n\nVenez me voir  Iskaara. Je vous ai prpar des fournitures afin d\honorer le lien qui nous unit.', '', '', '', '', '', '', 47187),
(66509, 'frFR', 'Paranoaque1', '', 'Agura m\a envoye ici pour cueillir des FLEURS afin de calmer mon ANXIT, mais l\endroit grouille de CRATURES qui me terrifient.', '', '', '', '', '', '', 47187),
(66504, 'frFR', 'Un clat de mana cristallis', 'Apportez le cristal  Lathos.', '<Le petit cristal bleu vibre lgrement au contact, avant d\mettre une petite mlodie, comme un chant lointain. Vous entendez ses paroles rsonner dans votre tte.>\n\nVoil qui pourrait intresser Lathos.', '', '', '', '', '', 'Apportez le cristal  Lathos.', 47187),
(66503, 'frFR', 'Dvouement dsintress', 'Explorez le sommet de la tour en ruines au camp d\Antonidas.', 'Ah, je vois que vous vous tes fait embarquer dans les petits jeux de mes novices.\n\n<Noriko rit.>\n\nIl semblerait que mes acolytes et vous ayez dnich quelque chose. L\origine de ces ruines se dvoile peu  peu  nous, bien au-del des images ternies et des chansons habituelles\n\nQuelque chose nous appelle au sommet de cette tour.\n\nJe remarque un soupon d\intrigue dans votre regard. Allez-y. Vous avez mon autorisation.\n\nAllez donc voir par vous-mme.', '', '', '', '', '', 'Retournez voir Noriko au camp d\Antonidas.', 47187),
(66500, 'frFR', 'Faons de voir', 'Dcouvrez des images anciennes au camp d\Antonidas.', 'On fait rien! On fait rien du tout!\n\nUne petite minute\n\nVous m\avez l\air d\$gun:une:r; $r de premier ordre Vous voulez connatre notre petit secret?\n\nFigurez-vous que ces ruines abritent de l\art magique! Et nous, on arrive  le voir!\n\n<Barbott bombe firement le torse.>\n\nJe peux vous montrer comment faire si vous voulez! Mais bon Faudra pas le dire  Noriko pour le moment', '', '', '', '', '', '', 47187),
(66493, 'frFR', 'Envoi prioritaire', 'Lancez des paquets aux recrues du Kirin Tor au camp d\Antonidas.', '<Vous entendez un marmonnement touff de l\autre ct du portail.>\n\nH! Vous, l-bas!\n\nJ\ai du courrier  remettre  nos recrues sur le terrain. Des colis, des cadeaux, des commandes passes par messagerie magique\n\nBref, la routine habituelle, quoi.\n\nVous me rendriez un fier service en vous chargeant de la distribution.', '', '', '', '', '', '', 47187),
(66489, 'frFR', 'Mise en place de la dfense', 'Imprgnez les armes des dfenseurs d\Azur au camp d\Antonidas.', 'Cynegos et moi tions en train de parler des consquences de l\attaque des Primalistes sur les plans d\offensive de l\assemble de Cobalt, quand une ide m\est venue.\n\n<Cleste sort une baguette des plis de sa robe.>\n\nPrenez ma baguette et imprgnez les armes de nos troupes!\n\nUne petite touche de magie du feu devrait faire l\affaire', '', '', '', '', '', '', 47187),
(66488, 'frFR', 'ON RECHERCHE: Frigellus', 'Tuez Frigellus prs du camp d\Antonidas.', '<Le texte de la page brille d\une faible lueur bleue.>\n\nAutrefois jouet prfr de Malygos, l\lmentaire Frigellus a grandement souffert d\tre abandonn par son matre.\n\nTandis que ses souvenirs heureux ont disparu en mme temps que ces lieux, la crature autrefois simple et joueuse a t corrompue par le mal qui svit ici.\n\nVeillez  ce que Frigellus soit neutralis.\n\nEt prvenez Cynegos une fois que ce sera fait.', '', '', 'Frigellus', '', '', '', 47187),
(66484, 'frFR', 'Connatre son adversaire: les Proto-dragons', 'Chassez quelques Proto-dragons dans la canope de l\Apoge.', 'Toute la zone grouille de ces puissantes cratures! Fort heureusement, la lunette topographique a permis d\identifier plusieurs points faibles dans leur physionomie, et ces observations devraient vous permettre d\laborer diffrentes stratgies pour viter leurs griffes et leurs crocs acrs.', '', '', '', '', '', '', 47187),
(66482, 'frFR', 'Chasse aux trophes: Terramors', '', '[PH] Get rid of that annoying flying lizard!', '', '', 'Terramors', '', '', '', 47187),
(66473, 'frFR', 'L\veil de la terre', 'Terrassez le Courroux primordial et la Grle primordiale au belvdre des Gelikyrs.', 'Les monstres de cette grotte se sont rvls trop forts pour moi.\n\n<Sharnaxa tousse avec difficult.>\n\nJe sais de quoi vous tes capable.\n\nIl faut que vous tuiez ces lmentaires avant qu\ils n\atteignent leur plein potentiel. Nous ne pouvons pas laisser les Primalistes prendre le contrle du bastion de Tyr.', '', '', '', '', '', '', 47187),
(66472, 'frFR', 'Liste primordiale', 'Apportez le paquet d\ordres primalistes au commandant Thadezus, sur le pont du belvdre des Gelikyrs.', 'Les portails ferms, les lmentaires abattus et les Primalistes dans l\incapacit de nuire pour l\instant.\n\n<Sharnaxa s\esclaffe.>\n\nExiste-t-il une prouesse qui soit au-dessus de vos forces, $c? J\imagine que seul le temps nous le dira.\n\nRapportez les plans au commandant. Je suis certaine que notre succs le ravira.', '', '', '', '', '', 'Allez parler au commandant Thadezus sur le pont du belvdre des Gelikyrs.', 47187),
(66471, 'frFR', 'Planification parfaite', 'Rcuprez $1oaordres primalistes sur les Primalistes alentour sur la terrasse suprieure du belvdre des Gelikyrs.', 'Le commandant m\a ordonn d\tablir une base avance et d\liminer toute rsistance. Et c\est en liminant  tour de bras que j\ai ralis quelque chose.\n\n<Sharnaxa laisse chapper un long soupir.>\n\nLes Primalistes parlaient du bastion de Tyr.\n\n moins que vous ne soyez exceptionnellement $gdou:doue; pour les interrogatoires, j\ai besoin que vous dcouvriez leurs plans.', '', '', '', '', '', 'Allez voir Sharnaxa prs de la grotte du belvdre des Gelikyrs.', 47187),
(66470, 'frFR', 'En avant!', 'Obtenez les pierres de portail touches par la brume, terrestre et forge dans la glace, puis fermez les $7oaportails lmentaires.', '<Sharnaxa se gratte le menton.>\n\nLe commandant avait raison. Les Primalistes font venir des renforts depuis les plans lmentaires.\n\n<Un rictus narquois fleurit sur les lvres de Sharnaxa.>\n\nIl serait vraiment dommage que quelque chose arrive  leurs portails, $c.', '', '', '', '', '', 'Allez voir Sharnaxa prs de la grotte du belvdre des Gelikyrs.', 47187),
(66468, 'frFR', 'Ce qui nous appartenait', 'liminez les Primalistes qui occupent le belvdre des Gelikyrs.', '<Thadezus ricane  votre approche.>\n\ntes-vous $gun mortel:une mortelle; d\action, ou allez-vous nous laisser le champ libre, $c?\n\nJ\ai perdu beaucoup de braves sous les coups des Primalistes qui sont un peu plus loin.\n\nNous avons une ide de ce qui nous attend, mais avant toute chose, nous devons radiquer cette vermine et porter secours  mes troupes.', '', '', '', '', '', 'Allez parler  Sharnaxa au belvdre des Gelikyrs.', 47187),
(66467, 'frFR', 'Quand l\art imite la vie', 'liminez la toxide majeure.', 'La dernire fois que je suis venue dans cette grotte, j\ai dessin une fleur gigantesque qui dgoulinait d\une sve infme et visqueuse. C\est l\un de mes meilleurs dessins, je ne pourrais pas l\oublier mme si j\essayais.\n\nJe suis sre que c\est cette sve que les Taraskes appliquent sur la pointe de leurs lances. Ces monstres ont d la rcolter pour envenimer leurs armes.\n\nLa plante est magnifique, c\est une honte de devoir la dtruire. Mais nous ne pouvons pas laisser les Taraskes continuer  l\utiliser ainsi. $n, s\il vous plat, dtruisez la plante et mettez un terme  cette catastrophe.', '', '', 'Toxide majeure', '', '', '', 47187),
(66465, 'frFR', 'Rejet sans rserve', 'Dtruisez $1oaRserves de lances empoisonnes.', 'Mme avec la disparition de leur chef, il est peu probable que les Taraskes abandonnent leurs lances empoisonnes parce que nous le leur demandons gentiment. Nous ne pouvons pas risquer qu\une seule de ses armes fasse d\autres victimes innocentes.\n\nElles doivent toutes tre dtruites. Si vous n\en avez pas trouv dans les caches prs des bassins, c\est probablement parce que les Crocs-de-Braise les gardent plus prs de la source.\n\nPlus personne ne sera bless du fait de ma ngligence. Entrez dans la grotte et dtruisez toutes les rserves d\armes que vous trouverez.', '', '', '', '', '', '', 47187),
(66464, 'frFR', 'Les champs de Frocit: matre de la chasse!', 'Terrassez la matresse-chasseresse Amaa.', 'Nous y sommes. C\est le grand moment pour vos camarades et vous. Un match contre notre championne, la matresse-chasseresse Amaa en personne. Mais n\allez pas vous reposer sur vos lauriers, elle est redoutable. Prparez-vous  faire vos adieux.\n \nQuand elle vous aura fait passer de vie  trpas, je peux prendre vos affaires?', '', '', '', '', '', '', 47187),
(66463, 'frFR', 'Les champs de Frocit: revanche lmentaire!', 'liminez le champion primaliste.', 'Nous avons un changement de dernire minute dans la liste des participants: un gros bonnet des Primalistes veut entrer dans la comptition pour vous affronter. Et je ne suis pas du genre  dire non  un Dragon lmentaire en colre.\n\nJe suis sr que a va aller. Et si ce n\est pas le cas euh, vous avez sign la dcharge, n\est-ce pas?', '', '', '', '', '', '', 47187),
(66462, 'frFR', 'Les champs de Frocit: en perdition dans le Rve!', 'liminez Sherath et Taresh.', 'Pour des les aux Dragons, il faut bien reconnatre qu\on voit finalement assez peu de ces cratures. Mais nous avons tout de mme russi  inscrire des Draconiens dans la comptition!\n\nNotre duo a l\air de vouloir faire ses preuves, alors bonne chance  vous!', '', '', '', '', '', '', 47187),
(66461, 'frFR', 'Les champs de Frocit: menace volcanique!', 'liminez Ceeqa le Pacificateur.', 'C\est l\un des tout premiers  s\tre port volontaire pour la comptition. Un grand Djaradin, tout droit venu des rivages de l\veil, qui ne parat pas aussi belliqueux que ses semblables.\n\nIl semblerait qu\il soit simplement ici pour la beaut du combat ce qui me convient parfaitement!', '', '', '', '', '', '', 47187),
(66460, 'frFR', 'Les champs de Frocit: seigneur de la putrfaction!', 'liminez Putrenuit.', 'J\ai essay d\enrler un de ces Gnolls vicieux pour la comptition, mais malheureusement, aucun de mes collaborateurs ne sait comment leur adresser la parole.\n\nNous avons tout de mme russi  attraper l\une de leurs crations bizarres. a devrait vous faire un adversaire digne de ce nom! Dites-moi quand vous serez $gprt:prte;  commencer la deuxime manche!', '', '', '', '', '', '', 47187),
(66459, 'frFR', 'Les champs de Frocit: terreur des marais!', 'Terrassez Maneet.', 'Bienvenue aux champs de Frocit!\n\nAlors que ce terrain est habituellement le thtre d\vnements traditionnels, les Centaures m\ont gracieusement autoris  m\y installer quelque temps. Ils y voient un bon moyen de mettre leur force  l\preuve et de gagner plus d\honneur.\n\nVous voulez remporter le titre de $gchampion:championne;? Eh bien dans ce cas, faites-moi savoir lorsque vous serez $gprt:prte; et vous pourrez vous lancer dans la comptition.', '', '', '', '', '', '', 47187),
(66458, 'frFR', 'Hritage de Tyr: les secrets du pass', 'Entrez dans Uldaman: l\hritage de Tyr, dans les terres Ingrates, et rcuprez le disque.', 'Si nous voulons empcher Raszageth de librer les autres Incarnations, nous devons rendre leur pouvoir aux Aspects.\n\nMalheureusement, les Titans sont assez proccups, et le gardien Tyr est mort depuis longtemps.\n\nLa reine Alexstrasza a propos un plan: dans les profondeurs des terres Ingrates, on trouve une installation des Titans connue sous le nom d\Uldaman, et il semblerait que des allis de Tyr y aient dissimul un disque de ses souvenirs.\n\nAttention cependant, on raconte que l\endroit grouillerait de Troggs. Rassemblez vos allis et rendez-vous  Uldaman. Rcuprez ce disque au nom de la reine des Dragons!', '', '', '', '', '', '', 47187),
(66457, 'frFR', 'Mettre un terme  la priode bleue', 'Tuez caille-Bleue.', 'Les Crocs-de-Braise sont aux ordres d\une gigantesque brute que j\ai baptise Griffe-Bleue. Ce monstre a toujours t du genre agressif, mais il gardait sa meute de charognards  l\cart des routes principales. Ces Taraskes ont toujours t territoriaux, certes, mais hostiles? Pas jusqu\ prsent.\n\nGriffe-Bleue est certainement responsable de cette escalade soudaine. Trouvez-le et liminez-le.', '', 'Chef des Crocs-de-Braise. Rfractaire aux ngociations.', 'caille-Bleue', '', '', '', 47187),
(66456, 'frFR', 'Palette toxique', 'Ramassez 8Lances envenimes.', 'Je ne suis peut-tre pas la meilleure dans mon travail, mais au moins, j\ai prt attention lors de ma formation. Une garde des chemins digne de ses cailles sait comment prparer un bon antidote. Tout ce qu\il me faut, c\est suffisamment de poison pour obtenir le bon dosage.\n\n en croire Nori, les Taraskes qui l\ont attaque portaient des lances enduites de cette substance. Trouvez-les, et apportez-moi leurs armes. Si mon intuition est bonne, je devrais pouvoir prparer un antidote avec le rsidu de poison sur les fers de lance.\n\nJ\espre simplement qu\il nous reste assez de temps.', '', '', '', '', '', '', 47187),
(66449, 'frFR', 'Opration Bas les pattes!', 'Secourez $1oaDragonnets en pril et liminez $2oaphnix griffe-ardente et la lieuse de cendres Torncha.', 'Les lie-poussire tentent d\emprisonner nos Dragonnets. Il semblerait que leur cheffe projette de les utiliser dans un but malveillant. Nous ne pouvons pas les laisser faire!\n\nMalheureusement, nous ne faisons pas face qu\aux Djaradins. Les phnix griffe-ardente, encore plus dangereux, traquent galement les Dragonnets.\n\nVous devez protger les petits et liminer celles et ceux qui les menacent. Osoria vous aidera.', '', 'Une redoutable adversaire capable de manipuler les cendres et la suie.', 'Lieuse de cendres Torncha', '', '', '', 47187),
(66448, 'frFR', 'Une garde des chemins imprvisible', 'Trouvez la garde des chemins Alvi.', 'D\aussi loin que je me souvienne, les gardes des chemins ont toujours assur la scurit des voyageurs et voyageuses sur les routes de Thaldraszus. C\est un devoir que ma famille s\honore d\accomplir depuis des gnrations.\n\nHlas, ma sur Alvi semble se dsintresser de ces questions ces derniers temps. Elle est cense se prsenter  moi chaque matin, mais je ne l\ai pas vue depuis hier.\n\nSi vous croisez une Draknide de bronze  l\est d\ici, la tte perdue dans les nuages, soyez assez aimable de me l\envoyer. Cela m\vitera d\aller  sa recherche moi-mme.', '', '', '', '', '', '', 47187),
(66447, 'frFR', 'Au-del de la barrire', 'Inspectez le caveau d\Essence dans les ruines du caveau d\Essence.', 'Maintenant que la barrire est tombe, nous allons pouvoir explorer le caveau!', '', '', '', '', '', '', 47187),
(66445, 'frFR', 'Honorer nos morts', 'Rcuprez les objets suivants vols par l\arme djaradine.', 'Les armes djaradines ne se contentent pas de piller la citadelle, elles s\en prennent aussi aux dpouilles de nos congnres! Ces monstres brisent leurs os et s\emparent de tout objet de valeur en guise de souvenir.\n\nCe manque de respect total est une entaille dans le cur de chaque Dragon noir. Nos camarades ne mritent pas un tel dshonneur.\n\nRcuprez les objets que ces pleutres ont drobs  nos morts.', '', '', '', '', '', '', 47187),
(66442, 'frFR', 'Soyons thoriques', 'Aidez  tester les orbes sur la barrire des Titans des ruines du caveau d\Essence.', 'Nous avons quatre orbes lmentaires en notre possession! Voyons quelle hypothse s\avre la bonne', '', '', '', '', '', '', 47187),
(66441, 'frFR', 'Effort distill', 'Tuez Acquian dans la grotte  l\est des ruines du caveau d\Essence.', 'L\orbe de pierre primordiale est une heureuse trouvaille, mais Acadia et Tae\shara ont mis diffrentes hypothses  propos de la barrire.\n\nEt j\ai ma propre hypothse Peut-tre qu\avec davantage d\orbes lmentaires, nous trouverons la rponse  nos questions.\n\nL\un des explorateurs a aperu un norme lmentaire d\eau dans une grotte  proximit. liminez-le et vous trouverez peut-tre un autre orbe.', '', 'D\aprs les rapports de reconnaissance, l\lmentaire grossit  vue d\il.', 'Acquian', '', '', '', 47187),
(66439, 'frFR', 'Plans en rafales', 'Rcuprez des fragments de flammes primordiales sur les Primalistes du creux des Bufflaciens.', 'Des orbes lmentaires? S\il y a de la terre, il doit aussi y avoir du feu!\n\nLes Primalistes du ct des nids de bufflaciens utilisent de la lave pour refaonner la terre. Si l\orbe de flammes primordiales intresse quelqu\un, ce sera eux, c\est sr!\n\nliminez-les et voyez si vous trouvez quelque chose d\utile!', '', '', '', '', '', '', 47187),
(66438, 'frFR', 'De nobles objectifs', 'Trouvez l\claireuse Ri\tal au creux des Bufflaciens.', 'L\air est un lment puissant. Il rode la pierre et gonfle les voiles qui nous emmnent o nous le dsirons.\n\nSelon mon hypothse, c\est l\air qui sera le plus  mme de supprimer cette barrire. Ce n\est vraiment pas bien compliqu.\n\nMes quipes de reconnaissance disent avoir localis l\orbe de trombes primordiales. Allez donc au creux des Bufflaciens. Vous y trouverez l\claireuse Ri\tal, qui pourra vous mener  l\orbe. Faites vite!', '', '', '', '', '', '', 47187),
(66437, 'frFR', 'lment cl', 'Apportez l\orbe de pierre primordiale  l\lmentaliste Taiyang dans les ruines du caveau d\Essence.', '<Cet orbe de terre vibre d\nergie.>\n\n<L\lmentaliste Taiyang saura peut-tre quoi en faire.>', '', '', '', '', '', '', 47187),
(66436, 'frFR', 'lmentaires dltres', 'Tuez $1oa lmentaires de terre dans les ruines du caveau d\Essence.', 'Les lmentaires de terre ne s\en prennent pas seulement  nous, ils ont mme dtruit des artfacts et de l\quipement! C\est comme s\ils avaient t programms pour radiquer tout ce qui provient des Titans\n\nNous avons russi  les repousser jusqu\ maintenant, mais nous ne pourrons pas tudier ce site tant qu\ils seront l. S\il vous plat, aidez-nous  les vaincre afin qu\on puisse partir en exploration!', '', '', '', '', '', '', 47187),
(66435, 'frFR', 'Site de sauvetage', 'Sauvez $1oaexploratrices ou explorateurs en difficult dans les ruines du caveau d\Essence.', 'En tant que chamane, j\ai travaill avec beaucoup d\lmentaires, mais je n\en ai jamais vu d\aussi agressifs!\n\nL\expdition a dcouvert un caveau des Titans, mais la chambre intrieure est protge par une barrire magique. Quand nous avons essay de la dissiper, nous avons dclench une sorte de systme de scurit et une nue d\lmentaires furieux a surgi de nulle part!\n\nAu moment de l\attaque, des collgues travaillaient encore sur le site de fouilles. La plupart sont toujours  l\intrieur et ne savent pas se battre!\n\nRendez-vous au site de fouilles et aidez-les  fuir, je vous en supplie!', '', '', '', '', '', '', 47187),
(66429, 'frFR', 'Je ne l\oublierai pas', 'Retrouvez Rannan prs du camp Nulle-Part.', 'Je j\ai besoin de quelques instants, s\il vous plat.\n\nRetournez au camp Nulle-Part, $p, je vous y retrouverai.', '', '', '', '', '', '', 47187),
(66428, 'frFR', 'Une amiti  sens unique', 'Dissipez la barrire arcanique avec l\aide du S.U.P.R.E.M.E.', 'Trs bien! Le S.U.P.R.E.M.E. est calibr et prt  l\emploi!\n\nPourquoi je ne l\utilise pas moi-mme? La raison est simple!\n\nIl faut parer  toutes les ventualits.\n\nImaginez qu\il explose. Qui irait le rparer si je suis bless, inconscient ou mme mort?\n\nAllez-y, dissipez la barrire, que nous puissions rentrer au camp et soigner Lathos. Moi, je vais vous regarder faire d\ici.', '', '', '', '', '', '', 47187),
(66427, 'frFR', 'Une menace imminente', 'Tuez Tharohn.', 'Ces blessures arcaniques ne peuvent pas tre soignes  la vole et vont m\empcher de me battre.\n\n$n, je dois vous demander votre aide une fois encore.\n\nTrouvez Tharohn et empchez-la de surcharger les consoles.\n\nRannan profitera ainsi de ces prcieuses minutes pour calibrer son S.U.P.E.R ou son S.U.P.R.A Argh, je m\y perds avec tous ces acronymes.\n\nQuoi qu\il en soit, nous devrions alors pouvoir contrecarrer les machinations de la Flamme fracture.', '', 'Un membre de la Flamme fracture qui ne reculera devant rien pour s\emparer du pouvoir des ruines de Karnthar.', 'Tharohn la Manipulatrice des arcanes', '', '', '', 47187),
(66426, 'frFR', 'Course contre la montre', 'Atteignez la tour est.', 'Je sens l\afflux d\nergie arcanique monter en puissance en ce moment mme.\n\nIl ne doit pas nous rester beaucoup de temps avant que les ruines ne fassent disparatre le P.A.F. de Rannan.\n\nNous devons nous rendre sur place pour intervenir.\n\nPrudence, $p.\n\nNous vous attendrons prs de la tour,  l\est. Nous ferons le point sur la situation l-bas.', '', '', '', '', '', 'Allez voir Rannan et Lathos prs de la tour de l\est.', 47187),
(66425, 'frFR', 'Surcharge arcanique', 'Aidez Rannan  dissiper les bulles arcaniques.', 'Et voil, le tour est jou!\n\nLaissez-moi vous prsenter le S.U.P.R.A.!\n\nTIN TIN TIIIIIN!\n\nJe l\ai calibr sur la frquence des nergies qui environnent les consoles draconiques et je l\ai galement agrment d\un glyphe de dissipation de la magie.\n\nIl pourra donc dissiper l\nergie arcanique et dsactiver les consoles, le seul inconvnient tant que le glyphe perdra de sa puissance  chaque utilisation.\n\nPratique, n\est-ce pas?\n\nJ\ai dtect quatre de ces consoles dans les environs. Alors, qu\attendez-vous pour les mettre hors service?', '', '', '', '', '', '', 47187),
(66423, 'frFR', 'Craintes et confirmations', 'Trouvez des indices sur l\origine des ruines.', 'La mort des membres de la Flamme fracture montre bien  quel point les ruines de Karnthar sont dangereuses.\n\nRannan estime tout de mme qu\il est possible de bricoler le S.U.P.E.R. pour contrler les nergies environnantes.\n\nEncore une fois, nous traitons les symptmes et non la cause du problme.\n\nFouillez donc les ruines en qute d\indices et essayez de dterminer leur fonction d\origine. Mais faites vite, $n. Le temps presse.', '', '', '', '', '', '', 47187),
(66422, 'frFR', 'L\expdition continue!', 'Retrouvez Rannan et Lathos prs de la tour.', 'Des ruines anciennes, une organisation aux motifs impntrables, et mme le S.U.P.E.R. de Rannan et ses analyses.\n\nTout contribue  stimuler l\explorateur en moi.\n\nNous devons dcouvrir ce qui se trame par ici.\n\nAu sud, des escaliers mnent  une tour. Allons-y.', '', '', '', '', '', '', 47187),
(66421, 'frFR', 'Balafre des temptes', '', '', '', '', '', '', '', '', 47187),
(66419, 'frFR', 'Allgeance  cible unique', '', '', '', '', '', '', '', '', 47187),
(66412, 'frFR', 'Basilton, jusqu\au bout', 'Parlez  Basilton dans les jardins.', 'Le vieux Draknide que je suis aimerait vous demander une dernire faveur avant votre dpart.\n\nMa rencontre avec Basilton a t l\occasion de vivre avec lui toutes sortes d\aventures et l\exploration lui manque. Je crois que c\est pour cette raison qu\il disparat rgulirement.\n\nJe ne peux plus lui offrir ce plaisir, mais vous, si! Je vois bien que vous pouvez lui faire dcouvrir des endroits dont je n\aurais jamais rv.\n\nMais allons avant tout lui demander ce qu\il en pense.', '', '', '', '', '', '', 47187),
(66391, 'frFR', 'En route pour les ruines', 'Retrouvez Rannan et Lathos dans les ruines de Karnthar.', 'Vous voulez en savoir plus sur mon invention, le S.U.P.E.R.? Non?\n\nBah, je vais quand mme tout vous dire, car mon formidable appareil a trouv quelque chose.\n\nFigurez-vous qu\aujourd\hui, le S.U.P.E.R. a dtect un NORME PIC d\nergie arcanique en provenance des ruines de Karnthar. Lathos souponne la Flamme fracture d\tre  l\origine du phnomne. Bref, c\est l\occasion IDALE de dmontrer les possibilits du S.U.P.E.R.\n\nVous voulez venir? On va passer un SUPER moment!', '', '', '', '', '', '', 47187),
(66369, 'frFR', 'Protection terrestre', 'Activez la protection terrestre.', 'J\ai utilis les anneaux que vous avez trouvs pour renforcer une protection. Elle s\est entoure de rocs et d\un dfenseur terrestre pour garder son territoire.\n\nTestez ce dfenseur terrestre pour nous assurer qu\il fonctionne comme prvu.', '', '', '', '', '', '', 47187),
(66368, 'frFR', 'Une le dans la tempte', 'liminez $1oamanifestations flamboyantes et fondeurs igns.', 'Nous n\avons pas eu le temps de nous reposer. Ces lmentaires nous attaquent sans cesse!\n\nUn moment de rpit serait le bienvenu, et cela me permettrait de fabriquer d\autres protections pour nous dfendre.\n\nVoyez donc ce qu\il vous est possible de faire pour soulager un peu la pression sur notre primtre.', '', '', 'Fondeur ign', '', '', '', 47187),
(66364, 'frFR', 'Le vol d\un cerf-volant', 'Rassemblez 10ailes de proto-dragon fraches sur les proto-drakes et proto-dragons des les aux Dragons pour Temnaayu, une Rohart iskaarienne.', 'J\ai une proposition  vous faire.\n\nLes ailes des proto-drakes et des proto-dragons bnficient d\une incroyable amplitude de mouvements et d\une structure particulirement extensible. Nous fabriquons habituellement nos cerfs-volants  partir de peaux tendues. Mais vu les dgts causs par les proto-drakes ces derniers temps, je me demandais si vous accepteriez de me rapporter quelques-unes de leurs ailes. J\aimerais m\en servir pour fabriquer des cerfs-volants que toute la tribu m\enviera.', '', '', '', '', '', '', 47187),
(66363, 'frFR', 'Targes de basilic', 'Rcuprez 20peaux rigides de crocilisque sur les basilics des les aux Dragons pour Dhurrel, des Centaures maruuks.', 'Des cailles bien imbriques sont la cl pour arrter les flches. Les targes que je fabrique sont les meilleures des plaines. Mais je suis malheureusement  court de peaux de basilic.\n\nVous semblez cependant avoir envie d\en apprendre plus sur notre savoir-faire! Apportez-moi des peaux de basilic sur les les aux Dragons et je partagerai nos techniques avec vous.', '', '', '', '', '', '', 47187),
(66356, 'frFR', 'Arbre-de-fer', '', '', '', '', '', '', '', '', 47187),
(66354, 'frFR', 'L\tincelle', 'Restaurez les fragments endommags de la pierre de vu.', 'La forge est prte. Il ne reste plus qu\ l\allumer.\n\nPlacez les fragments endommags de la pierre d\obsidienne sur la forge et Irion fournira l\tincelle qui la rallumera.', '', '', '', '', '', '', 47187),
(66353, 'frFR', 'S.U.P.E.R. anomalies', 'Utilisez le S.U.P.E.R. pour dissiper 3anomalies arcaniques.', 'Il y a une NORME quantit d\nergie arcanique par ici\n\nHeureusement, le S.U.P.E.R. est l pour y remdier! Ce petit bijou, de son vrai nom le Sondeur Universel Professionnel Extraordinaire de Rannan, est capable de dtecter et de dissiper l\nergie arcanique.\n\nTenez prenez! Alors, vous sentez cette PUISSANCE entre vos mains? Non?\n\nBon, maintenant que vous tes $gpar:pare;, allez donc me dissiper ces anomalies!', '', '', '', '', '', '', 47187),
(66352, 'frFR', 'Ce que savent nos adversaires', 'Trouvez des documents de la Flamme fracture et rapportez-les  Lathos.', 'Il est essentiel de dcouvrir l\objectif exact de la Flamme fracture dans ces ruines et le rapport avec la vague d\nergie.\n\nOn va procder  l\ancienne,  coup de missions de reconnaissance et d\espionnage.\n\nLes ruines grouillent de fidles de la Flamme fracture. Certains d\entre eux transportent srement des ordres qui permettront de mieux cerner leurs objectifs mystrieux.\n\nUtilisez tous les moyens ncessaires pour mettre la main sur ces documents.', '', '', '', '', '', '', 47187),
(66351, 'frFR', 'Montagnes enfumes', 'Trouvez l\appareil de la guide Jap.', '<Le guide Jeb observe les montagnes qui se dressent au-del du camp en reniflant.>\n\nJe n\aime pas a. Jap aurait d rentrer il y a des jours. Elle devait m\aider  apprendre  cette bleusaille comment escalader ces piliers sans se briser la nuque.\n\nEt maintenant, j\aperois de la fume au loin.\n\nNon, je n\aime pas a du tout.', '', '', '', '', '', '', 47187),
(66349, 'frFR', 'Roc d\entranement', 'Retirez $1oapierres.', 'Retirez ces pierres!', '', '', '', '', '', '', 47187),
(66344, 'frFR', 'Avec le vent pour nous porter', 'Volez avec Grithus et Mrithra.', 'Ainsi donc, les Primalistes ont form une alliance avec le clan des Nokhuds\n\nSi jusqu\ maintenant, nous avons pu repousser les Primalistes, les Nokhuds leur ont fait don d\une nouvelle arme: une baliste tueuse de Dragons. J\ai bien peur que Solethus ne soit que la dernire victime en date de son horrible magie des temptes.\n\nVenez. Je vais vous conduire au refuge des Dragons, le sanctuaire Ombrag. Vous pourrez me dire tout ce que vous savez sur les Nokhuds pendant que la khanam matra rassemblera ses forces. Nous devons prparer notre riposte.', '', '', '', '', '', '', 47187),
(66340, 'frFR', 'Vers l\Azur', 'Allez voir Mahud le Sage au gu de la Fourche.', 'Nous avons accompli notre mission. Bien que je doive rester ici pour surveiller la pierre de vu et guider le Vol draconique vert, sachez que vous quittez ces lieux avec notre gratitude et notre confiance.\n\nOn m\a fait savoir que le Kirin Tor avait besoin d\aide pour reprendre la pierre de vu d\Azur. En acceptant de lui porter secours, nous nous rapprocherions un peu plus de notre but: gurir Azeroth.\n\nPakina et Mahud le Sage du Kirin Tor pourront vous en dire davantage. Allez donc les trouver. Bon voyage et bons rves, $n.', '', '', '', '', '', '', 47187),
(66339, 'frFR', 'L\offensive nokhud: le vent appartient aux cieux', 'liminez le khan Balakar et sauvez Ohn\ahra  l\offensive nokhud.', 'Allez-vous nous abandonner, $n, ou pouvons-nous compter sur vous une fois de plus?\n\nMes quipes de reconnaissance nous signalent que Balakar s\est retir dans son bastion, o il retient Ohn\ahra prisonnire. C\est inacceptable!\n\nEt pendant ce temps, ses infmes Nokhuds sment le chaos  travers les plaines. Pendant que nous les combattons, vous pourriez infiltrer son bastion et librer Ohn\ahra Acceptez-vous de nous aider?', '', '', '', '', '', '', 47187),
(66337, 'frFR', 'Brise-tempte', 'liminez Koroleth.', '$n, approchez! Nous sommes  deux doigts de la victoire!\n\nLes rangs des Primalistes sont briss, et leur offensive n\est dj plus qu\un mauvais souvenir. L\ampleur de notre victoire va dpendre de cet ultime combat contre la cheffe des Primalistes, Koroleth.\n\nFinissons-en, vous et moi! Ensemble!  l\attaque!', '', 'Cette tte pensante des Primalistes cherche  dtruire le sanctuaire des Dragons verts.', 'Koroleth', '', '', '', 47187),
(66336, 'frFR', 'L\le d\meraude', 'Allez voir Mrithra dans les frondaisons Antiques.', 'C\est en grande partie grce  votre courage que nous avons pu vaincre les Primalistes, et j\en ai bien conscience.\n\nJ\ai invit les Centaures  me rejoindre sous les frondaisons Antiques. Vous avez largement mrit cet accueil, tout comme la khanam matra et son peuple.\n\nLongez le chemin qui passe sous l\arche, sur l\autre rive, et empruntez le sentier qui s\enfonce dans les arbres. Je vous attendrai.', '', '', '', '', '', '', 47187),
(66335, 'frFR', 'Pylnes  pilonner', 'Marquez les pylnes primalistes avec les graines enchantes.', 'Maintenant que ces armes ignobles ont t dtruites, le Vol draconique vert va pouvoir se joindre  la bataille.\n\nPuisque nous connaissons mieux qu\eux la situation au sol, nous devons marquer des cibles pour que Mrithra et ses Dragons puissent frapper depuis les airs.\n\nMrithra m\a donn ces graines enchantes; placez-les prs des pylnes primalistes. Nous utiliserons leur lumire pour demander aux Dragons d\attaquer depuis le ciel.', '', '', '', '', '', '', 47187),
(66333, 'frFR', 'Justice pour Solethus', 'liminez $1oabellicistes nokhuds et dtruisez $2oabalistes tueuses de Dragons.', 'Tant qu\il restera au moins un Dragon vert en vie, ces Primalistes ne profaneront pas les frondaisons Antiques sans que nous nous y opposions.\n\nNous aimerions beaucoup prendre part  ce combat, mais avec ces balistes tueuses de Dragons sur le champ de bataille, impossible d\approcher. Elles sont protges par les meilleurs lments des Nokhuds, que vous devrez donc liminer avant de pouvoir agir.\n\nDtruisez les balistes et les bellicistes nokhuds. liminez cette menace, et les Dragons verts renverseront le cours de la bataille.', '', '', '', '', '', '', 47187),
(66331, 'frFR', 'En premire ligne face aux Primalistes', 'Allez parler  Tomul, Ari, Belika, l\ohn Seshteng et Mrithra dans la Balafre des temptes.', 'La khanam matra a fait prvenir que ses troupes et elle taient arrives aux jardins d\meraude. On a retrouv la trace de Koroleth et de ses Primalistes: il semblerait qu\une gigantesque invasion se prpare, depuis une plage au nord.\n\ntant de nature prudente, la khanam matra a envoy plusieurs quipes de reconnaissance surveiller des points stratgiques un peu partout sur le champ de bataille. Allez rcuprer leurs rapports, puis venez me retrouver sur la ligne de front. Ce combat nous promet la gloire et la vengeance, si nous l\emportons.', '', '', '', '', '', '', 47187),
(66329, 'frFR', 'Quand sonne le cor', 'Prenez connaissance des plans de Balakar et Koroleth.', 'Pourquoi amener Ohn\ahra ici?  moins que\n\n$n! Je ne pense pas que Balakar ait l\intention de dtruire le cor. Non, c\est un pige! Nous devons trouver un moyen de franchir ce vent, et vite!', '', '', '', '', '', '', 47187),
(66328, 'frFR', 'Dragons verts  terre', 'Allez voir la khanam matra  l\Abreuvoir.', 'Les Dragons sont tombs dans les plaines  l\ouest. Nous devons nous dpcher de les rejoindre, avant que les Nokhuds ne les trouvent.\n\nNous ne pouvons pas laisser les Dragons dduire des actions de Balakar que tous les Maruuks sont indignes de confiance.', '', '', '', '', '', '', 47187),
(66327, 'frFR', ' la poursuite du vent', 'coutez le rapport de l\claireuse Tomul.', 'Nous devons faire une pause pour convenir d\une stratgie.\n\nNous aurons besoin de la bndiction d\Ohn\ahra pour faire rsonner le cor de Drusahl, et ainsi appeler les Dragons verts, car sans leur aide, cette guerre est perdue d\avance. Les Nokhuds sont dj bien plus nombreux que les autres clans, et leurs troupes peuvent dsormais compter sur la force des Primalistes. Et maintenant, Koroleth a captur notre mre des vents! Nous devons donc trouver Ohn\ahra avant que ces tratres ne lancent leur assaut final pour assiger Maruuka.\n\nJe vais immdiatement envoyer toutes nos quipes de reconnaissance  sa recherche. J\espre que nous la trouverons  temps.', '', '', '', '', '', '', 47187),
(66326, 'frFR', 'Outils de travail', 'Rcuprez $4oamarteau de prcision  cailles, $3oaenclume en obsidienne, $2oapinces en noiracier et $1oapoinons en griffe draconique.', 'Une forge d\une telle puissance requiert des outils uniques, capables de supporter l\incroyable chaleur qu\elle dgage.\n\nHlas, les troupes djaradines ont pill l\endroit et drob une bonne partie de notre matriel.\n\nSi vous le pouvez, essayez de les rcuprer pour nous permettre de continuer nos efforts en matire d\armement.', '', '', '', '', '', '', 47187),
(66324, 'frFR', 'Nous nous souvenons', 'Rcuprez des objets et sauvez des survivants et survivantes dans le couvoir Auxiliaire.', 'L\antidote est prt. Utilisez-le pour fouiller le couvoir Auxiliaire. Faites vite, car son effet ne durera pas longtemps. Il vous faudra peut-tre mme en reprendre.\n\nSi les ntres respirent encore, sauvez-les.\n\nEt dans le cas contraire, rcuprez leurs chevalires  cornes afin que leurs noms puissent tre honors.\n\nProfitez-en pour chercher des indices sur l\origine de cette infestation.', '', '', '', '', '', '', 47187),
(66320, 'frFR', 'Le courant du temps', 'Rendez-vous dans les Sables changeants pour parler  Chromie.', 'Le fil du temps est comme une rivire: il est sinueux et comporte de nombreux embranchements. Parfois, son cours peut tre modifi, ce qui cre une anomalie qui, si elle n\est pas rsolue, peut nous condamner  une mauvaise ligne temporelle.\n\nNous nous approchons  grands pas d\une telle anomalie, et j\ai envoy Chronormu aux Sables changeants pour mener l\enqute et rectifier la chronologie de la seule vraie ligne temporelle.\n\nJe prdis que votre assistance lui serait inestimable.\n\nDe grce, aidez-nous en secondant Chronormu dans sa tche.', '', '', '', '', '', '', 47187),
(66308, 'frFR', 'Souffler sur les braises', 'Rcuprez $1oacharbons cendrclats.', 'La forge du Gardeterre va nous permettre de fabriquer de nouvelles armes et armures qui assureront  terme notre victoire sur les armes djaradines.\n\nSes flammes doivent cependant tre alimentes en permanence. Le charbon cendrclat fournira la chaleur intense ncessaire  la fabrication des armes.\n\nVous en trouverez dans des gisements et sur des lmentaires du filon Cendrclat.', '', '', '', '', '', '', 47187),
(66299, 'frFR', 'Une ufsplosion trs attendue', 'Tuez la matriarche hurlevol.', 'Notre prototype a fonctionn! Excellent!\n\nIl est temps de passer au plat principal. Et cette fois, c\est VOUS qui porterez la toque!\n\nLe temps d\apporter quelques modifications  votre dguisement, et vous pourrez vous en vtir  nouveau. Vous devrez ensuite plonger notre splendide uf explosif dans ce ragot malodorant avant d\aller le servir  la matriarche. Profitez alors du souffle des dtonations pour vous laisser planer jusqu\en bas!\n\nSi tout se passe comme prvu, ses carottes seront cuites. Par l\explosion. Alors, inutile de vous attarder sur place une fois votre tche accomplie.', '', 'La matriarche des harpies Hurlevols! Allez-vous satisfaire son apptit vorace de cette recluse avec un explosif de Sarcasiffle, ou votre propre chair?', 'Matriarche Avethyra, cheffe des Harpies hurlevols', '', '', '', 47187),
(66279, 'frFR', 'L\horloge tourne', 'Apportez la montre de gousset  Orizmu dans les jardins.', 'Oh oui, cette montre de gousset appartient  l\un des auxiliaires qui m\aident  entretenir les jardins.\n\nIl est au service de Nozdormu. Comment s\appelle-t-il dj? Orizmu?  mon ge, tous ces gamins se ressemblent. Il passe le plus clair de son temps prs du sablier  ct de l\arbre d\Alexstrasza sans bouger d\un pouce. Ni mme cligner des yeux.\n\nLes disciples de Nozdormu ont toujours t bizarres, si vous voulez mon avis. Mais il vous sera reconnaissant de lui rapporter ceci.', '', '', '', '', '', 'Apportez la montre de gousset  Orizmu dans les jardins.', 47187),
(66278, 'frFR', 'La camelote d\un Draknide', 'Apportez la montre de gousset  Gryrmpech dans les jardins.', '<Une montre de gousset scintille parmi les tas de bric--brac. Gryrmpech saura peut-tre quoi en faire.>', '', '', '', '', '', 'Apportez la montre de gousset  Gryrmpech dans les jardins.', 47187),
(66277, 'frFR', '[DNT] Making Quest', 'Tuez $1oabandits.', 'Bienvenue dans votre premire qute! Aujourd\hui, nous allons tuer des bandits crapuleux. Allez-y!', '', '', '', '', '', '', 47187),
(66270, 'frFR', 'Cogne-Gnoll', 'Terrassez les prtendants au titre de seigneur de guerre.', 'Oh, par la Lumire il en arrive encore! Comment est-ce possible?\n\nTous mes plans qui tombent  l\eau! Toutes ces longues journes  me cacher dans ce lac ftide, tous ces assassinats commandits!\n\na aurait pourtant d suffire  les plonger dans le chaos et  provoquer la chute de leur colonie, mais c\est  peine si nous avons russi  les ralentir!\n\nVous avez peut-tre raison, $n. Si a se trouve, je fais fausse route depuis le dpart\n\nMais non! C\est impensable! Et puis, il est trop tard pour faire machine arrire.\n\nAllez allez vous occuper de ces nouvelles ttes. J\ai besoin d\un moment pour rassembler mes ides.', '', '', '', '', '', '', 47187),
(66269, 'frFR', 'Mesure de prcaution', 'Tuez $1oalmentalistes croc-des-temptes.', 'Bon Tuez quiconque a l\air de s\intresser de prs ou de loin  la magie. Ou toute personne ayant une tte  savoir s\organiser. Ou juste une mine un peu ambitieuse.\n\nAllez-y, je vous laisse $gseul:seule; juge.\n\n Eh bien quoi, vous ne voulez plus m\adresser la parole, c\est a? Allons, $c, un peu de srieux! Puisque je vous dis que ces misrables prparent un mauvais coup!', '', '', '', '', '', '', 47187),
(66268, 'frFR', 'Tripl gagnant', 'Tuez Griffesang.', 'Quoi? Encore un nouveau chef?! Je sais bien que la nature a horreur du vide, mais ces rustres pourraient au moins respecter une certaine priode de deuil, ne serait-ce que pour les apparences\n\nEt la morale, dans tout a? La correction? Le respect d\un plan soigneusement mis au point? J\ai prpar des tableaux, moi!\n\nOccupez-vous de ce Griffesang. J\ai besoin d\un instant.\n\nEt je me passe allgrement de vos rflexions oiseuses, merci bien!', '', 'Qui a cass sa pipe et en a fait le chef de guerre?', 'Griffesang', '', '', '', 47187),
(66267, 'frFR', 'S.V.P.A.', 'Librez $1oaanimaux maltraits.', 'Sales monstres! Piller et tuer, passe encore, mais maltraiter des animaux?! Hors de question de laisser passer a!\n\nLes Gnolls ont pos des piges afin de capturer de pauvres btes pour nourrir leurs salets de hynes galeuses. Trouvez un moyen de librer leurs prisonniers  poils, et montrez  cette vile engeance comment les mages traitent les animaux de faon thique!\n\nBien sr que c\est en parfaite cohrence avec l\thique de mes agissements rcents! On peut savoir ce que vous insinuez?', '', '', '', '', '', '', 47187),
(66266, 'frFR', 'Roquets rpugnants', 'Tuez $1oamatriarches des hynes et $2oahynes infrieures.', 'Nous devons  tout prix nous dbarrasser des ignobles sacs  puces qu\lvent les Gnolls! Non contents d\tre horriblement mal duqus  vous n\imaginez mme pas o certains ont l\ide de se soulager!  ces monstres pourraient bien avoir assez de flair pour me dmasquer, malgr mes illusions pourtant exceptionnelles!\n\nLe monde de la biensance a besoin de vous: repoussez-les une bonne fois pour toutes!', '', '', '', '', '', '', 47187),
(66265, 'frFR', ' qui le tour?', 'Tuez Casse-Dents.', 'Ah! Il semblerait qu\un nouveau Gnoll ait dcid de prendre la tte du groupe. Exactement comme je l\avais prvu! Oui!\n\nQuoi de plus normal que d\avoir un vice-seigneur de guerre de confiance afin de garantir une passation de pouvoir sans heurts, vous en conviendrez Il va simplement nous falloir frapper un peu plus fort afin de renverser leur bureaucratie.\n\nVous dites? Si je vais profiter de ce moment pour rflchir  la manire dont je les condamne un peu trop htivement? Peuh, ne soyez pas ridicule! Ce sont des Gnolls, voyons!\n\nDpchez-vous de tuer Casse-Dents avant que le fer ne refroidisse, ou pire, que cette tribu n\organise des lections!', '', 'Combien de hynes un Gnoll peut-il avoir, au fait?', 'Casse-Dents', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(66264, 'frFR', 'Dociles et dsarms', 'Rcuprez $1oaarmes ronge-os.', 'Les gens du coin agitent une quantit d\armes absolument inquitante. Si on en faisait disparatre quelques-unes, les tensions s\apaiseraient peut-tre un peu ou du moins, a me calmerait, moi.\n\nAprs tout, qu\est-ce que cette peuplade va bien pouvoir faire sans armes? Nous attaquer  mains nues? Ha!', '', '', '', '', '', '', 47187),
(66263, 'frFR', 'Une approche chirurgicale', 'Tuez corche-Poing.', 'Les Gnolls sont des cratures rpugnantes. D\horribles boules puantes qui passent leur temps  se gratter les puces en vous riant btement au nez. Et le pire dans tout a, c\est que leurs effectifs ne cessent d\augmenter! Nous pourrions  et par nous, j\entends vous  les faucher comme les bls jour aprs jour sans jamais russir  les arrter. Nous ne pouvons pas les laisser continuer  svir ici.\n\nJe propose donc que nous frappions ce serpent en plein cur! Tranchez-lui la tte, et le reste sera paralys par l\indcision et le dsespoir.\n\nComment a, pourquoi? C\est pourtant vident! Ce sont des Gnolls, que vous faut-il de plus?', '', 'Comment vont-ils s\en sortir sans leur chef bien-aim?', 'corche-Poing', '', '', '', 47187),
(66262, 'frFR', 'puration des eaux uses', 'Nettoyez $1oapiles de dtritus en dcomposition dans le lac.', 'Pour commencer, je vais avoir besoin d\un camp de base digne de ce nom! Hlas, avec les lmentaires qui font des leurs dans les parages, la tche est particulirement complique.\n\nEt comme par hasard, c\est encore la faute de ces salets de Gnolls.\n\nCes misrables ont dvers tellement d\ordures, d\abats et je ne sais quoi d\autre dans le lac que les lmentaires qui y vivent commencent  s\nerver.\n\nSi vous pouviez avoir l\amabilit de nettoyer les coins les plus rpugnants avant qu\il ne soit trop tard et surtout, avant que mes vtements ne soient tachs de faon irrversible!', '', '', '', '', '', '', 47187),
(66261, 'frFR', 'Un lger contretemps', 'Rejoignez Dtri.', 'Ah, vous, l! J\esprais justement tomber sur quelqu\un d\arm jusqu\aux dents.\n\nVoyez-vous, je suis venu jusque dans ces contres recules sur ordre exprs du Kirin Tor et je commenais  peine  tablir mon campement quand des salets de Gnolls galeux m\ont pris en chasse.\n\nPour tout vous dire, un nombre inquitant de Gnolls s\est mass prs d\ici, et cette prsence menace toute la rgion.\n\nMais n\ayez crainte, j\ai un plan! Retrouvez-moi au lac un peu plus loin, et je vous expliquerai tout.', '', '', '', '', '', '', 47187),
(66259, 'frFR', 'Une tempte de mauvais augure', 'Allez faire votre rapport  la khanam matra  Maruuka.', '$n, nous devons raconter  la khanam matra tout ce qui s\est pass, et notamment la capture d\Ohn\ahra.\n\nRendez-vous  Maruuka aussi vite que possible. Malheureusement, je ne vais pas pouvoir vous accompagner: je me suis bless dans la chute, je ne ferais que vous ralentir.\n\nNe vous en faites pas pour moi, je vous rejoindrai plus tard. Partez, vite!', '', '', '', '', '', '', 47187),
(66258, 'frFR', 'Oh non, Ohn\ahra!', 'liminez les troupes ennemies pendant que Bokou tente de librer Ohn\ahra.', 'Cette Primaliste retient Ohn\ahra prisonnire, mais au prix d\une immense concentration. Elle n\a pas l\air de nous remarquer.\n\nComme le dit souvent la khan Tigari, mme la plus faible des brises peut renverser une pierre branlante. Si je parviens  interrompre son sort, ne serait-ce qu\un instant, Ohn\ahra pourra peut-tre se librer\n\nFaites en sorte de dtourner l\attention des gardes. J\ai une ide.', '', '', '', '', '', '', 47187),
(66257, 'frFR', 'Armes sacrilges', 'Utilisez les totems de vent de Bokou pour dtruire les chariots nokhuds.', 'Selon la lgende, Ohn\ahra aurait un jour imprgn de son pouvoir la lance de notre anctre, Maruuk. Le khan Balakar a d en parler aux Primalistes.\n\nIls volent le pouvoir des enfants d\Ohn\ahra et le pollue avec leur magie des temptes, pour ensuite en imprgner des carreaux de baliste. Qu\est-ce que les Nokhuds pourraient bien faire de ces armes?\n\nN\attendons pas de le dcouvrir. Ces carreaux temptueux sont en train d\tre chargs dans des chariots en vue de leur transport. Prenez mes totems et placez-en un sur chaque chariot que vous croiserez. Ma magie du vent les fera voler en clats.', '', '', '', '', '', '', 47187),
(66256, 'frFR', 'Touche pas  mes aigles', 'Librez $1oaenfants d\Ohn\ahra et liminez $2oaPrimalistes  la cime Chant-du-Vent.', 'Nous savons dsormais pourquoi les Nokhuds s\emparent de tous ces totems mystiques: ils leur permettent de capturer les enfants d\Ohn\ahra. Mais les vritables tratres  l\origine de ce blasphme sont les Primalistes; les Nokhuds se chargent simplement de voler les totems.\n\nLes enfants d\Ohn\ahra sont des ohunas sacrs, bnis par la mre des vents en personne. Je vous en supplie, $n, librez les ohunas que vous trouverez! Et si vous croisez des Primalistes\n\n<Bokou s\interrompt, mais son visage est srieux et dtermin.>', '', '', '', '', '', '', 47187),
(66254, 'frFR', 'Mystique pessimiste', 'Placez les totems de renforcement autour de Bokou.', 'Une guerre? Des Dragons? Vous voulez que je contacte Ohn\ahra?\n\nMais c\est impossible! Je n\entends pas Ohn\ahra. Je ne suis qu\un initi, et Ohn\ahra semble m\avoir priv de ses bndictions. Je n\en suis peut-tre pas digne\n\n<Bokou se met  fouiller dans une sacoche.>\n\nLorsque ma tutrice m\a affect  ce clan, elle m\a confi ces totems en me disant qu\ils me renforceraient si je devais un jour douter de mes capacits.\n\nVous voulez bien m\aider  les placer? Comme a, je pourrai  nouveau tenter de contacter Ohn\ahra.', '', '', '', '', '', '', 47187),
(66252, 'frFR', 'Le point sur la situation', 'Retournez  Valdrakken et faites votre rapport au capitaine Drine.', 'La menace primaliste est  prsent sous contrle, $n. Nos troupes de Valdrakken ne tarderont plus  venir liminer les retardataires.\n\nVous devriez retourner en ville informer le capitaine Drine. Ce qui s\est pass ici avec le commandant ranog l\intressera au plus haut point.\n\nMerci encore pour tout, $n.', '', '', '', '', '', '', 47187),
(66251, 'frFR', 'Du feu dans les veines', 'Tuez Serre-de-Magma.', 'Le commandant ranog est un tratre de la pire espce, qui a cd sa place  cette crature.\n\nJe sais que vous avez dj fait beaucoup pour moi, mais je ne peux m\attaquer  ce monstre dans mon tat.\n\nFaites en sorte que la porte du bastion sud ne tombe pas aux mains des Primalistes, et je ne vous demanderai plus rien.\n\nNous devons tuer leur chef!\n\nJe vous en prie, aidez-moi, $n.', '', 'Chef des Primalistes attaquant la porte du bastion sud.', 'Serre-de-Magma', '', '', '', 47187),
(66250, 'frFR', 'O est le chef?', 'Accompagnez le gardien Velomir et inspectez la tour de guet de la porte du bastion sud.', 'Cette partie de la forteresse est la seule que nous n\avons pas encore fouille, $n. Si le commandant ranog est encore de ce monde, c\est ici que nous le trouverons.\n\n<Velomir jette un regard en direction de la porte.>\n\nAllons voir ce qu\il en est.', '', '', '', '', '', '', 47187),
(66249, 'frFR', 'Dgager l\espace arien', 'Prenez le contrle d\un scorpion de sige pour liminer les Vraie-ligne magmaliges.', 'Avec les lances et la corde que vous nous avez procures, nous pourrons bientt empcher ces Primalistes sans vergogne de rgner sur les cieux!\n\nEn haut des marches, vous trouverez une plateforme avec plusieurs scorpions de sige. Installez-y la corde et utilisez les lances comme munitions. Cela vous permettra d\abattre les Dragons magmaliges en plein vol!\n\nUne fois que vous les aurez limins, le chemin jusqu\ la flche sera entirement dgag et nous pourrons continuer  chercher le commandant ranog.', '', '', '', '', '', 'Rejoignez le gardien Velomir au sommet de la tour de guet de la porte du bastion sud.', 47187),
(66248, 'frFR', 'Liens serrs', 'Rcuprez $1oaBobines de corde lourde.', 'Cette bobine de corde lourde semble en bon tat.\n\nLe gardien Velomir nous a demand de rester  l\afft des matriaux utiles. Si vous parveniez  trouver d\autres bobines, il pourrait peut-tre en faire bon usage.', '', '', '', '', '', '', 47187),
(66247, 'frFR', 'Armes lgrement uses', 'Rcuprez $1oaLances magmaliges.', 'Cette lance semble en bon tat, ce qui n\allait pas de soi au vu du sort qu\a connu son ancien propritaire.\n\nLe gardien Velomir vous a demand de lui procurer tout matriel qui pourrait lui tre utile. Peut-tre pourrez-vous trouver d\autres lances sur des Magmaliges?', '', '', '', '', '', '', 47187),
(66246, 'frFR', 'Brouillard de guerre', 'Recherchez les membres de l\unit du gardien Velomir  la porte du bastion sud.', 'Les Primalistes ont attaqu par surprise. Mon unit a tent de trouver notre chef, le commandant ranog, de l\autre ct de la garnison, mais les troupes adverses nous ont barr la route.\n\nLe chef de mon unit, le sergent Tagrik, a repouss trois Primalistes  lui seul tandis que Kaora, Mikor et moi nous battions  ses cts.\n\nLeurs cris sont la dernire chose dont je me souvienne avant de perdre connaissance.\n\nJe vous en conjure, $r, voyez si vous pouvez trouver une trace de mon unit et revenez m\informer du sort de mes frres et surs d\armes.', '', '', '', '', '', '', 47187),
(66245, 'frFR', 'En souvenir des disparus', 'Procurez-vous $1oachevalires de la garnison du bastion sud.', 'Tant de mes camarades ont trouv la mort au combat.\n\nDe grce Rcuprez leurs chevalires personnelles afin que leurs noms ne sombrent pas dans l\oubli.', '', '', '', '', '', '', 47187),
(66244, 'frFR', 'Vers Valdrakken', 'Allez  Valdrakken et rencontrez Alexstrasza la Lieuse-de-Vie.', 'Grce  vous, nous avons chapp de peu  une vritable catastrophe.\n\nCependant, il nous faut  prsent runir les autres Aspects afin de les informer de ce qu\il s\est produit ici.\n\nJe souhaite que vous me retrouviez au sige des Aspects de Valdrakken. Nul doute que mes congnres pourront nous renseigner quant aux objectifs de Raszageth et de ses Primalistes.\n\nVous trouvez au nord-est de votre position actuelle un passage vers Thaldraszus. Les paysages que vous survolerez valent le coup d\il, mais ne tranez pas trop en route quand mme.', '', '', '', '', '', '', 47187),
(66242, 'frFR', 'Contrle de la mto', 'Tuez $1oaessences temptueuses et $2oadisciples mande-foudre.', 'Cette tempte surnaturelle regorge d\nergie magique. Tout porte  croire que les Nokhuds s\entranent  manipuler l\essence sacre de la cime Chant-du-Vent pour crer des lmentaires de tempte. Et certains ont visiblement plus de talent que d\autres\n\n<Bokou vous montre de la main un pauvre Nokhud encore fumant de ses brlures causes par la foudre.>\n\nNous ne pouvons pas les laisser continuer, $n.', '', '', '', '', '', '', 47187),
(66241, 'frFR', 'Course de Thaldraszus', '', 'Volez  travers les anneaux qui jalonnent le circuit.', '', '', '', '', '', '', 47187),
(66239, 'frFR', 'Putrfaction galopante', 'Allez trouver Brena au comptoir.', '<Brena tourne l\trange totem dans ses grosses pattes afin de l\inspecter sous tous les angles.>\n\nKargapatte n\est qu\un pion dans cette histoire. La source de cette putrfaction est ailleurs, et nous allons devoir la trouver avant qu\elle ne se propage davantage.\n\nLa colonie rohart la plus proche est un comptoir implant juste de l\autre ct du pont, sur la route d\Iskaara.\n\nLa meilleure chose  faire est d\aller nous renseigner sur place et vite.', '', '', '', '', '', '', 47187),
(66237, 'frFR', 'Alliance spirituelle', 'Parlez aux autorits.', 'Notre arrive n\est pas passe inaperue.\n\nLaissez-moi m\entretenir avec nos htes avant que nous n\entrions. Je connais bien le conseil.\n\nNous ferons les prsentations par la suite.', '', '', '', '', '', '', 47187),
(66236, 'frFR', 'Danger imminent', 'Retrouvez Bokou  la cime Chant-du-Vent.', 'Les Nokhuds rassemblent des totems, les Primalistes capturent des ohunas et Ohn\ahra reste silencieuse.\n\nJe ne sais pas ce que fomentent les Nokhuds, mais nous devons les arrter. Rendez-vous  la cime Chant-du-Vent avec Bokou. Nos adversaires s\y trouvent sans doute dj.\n\nEssayez d\y retrouver Ohn\ahra. Si ses enfants sont en danger, elle tentera certainement de les rejoindre, et nous devons l\aider. La mre des vents est puissante, mais ces Primalistes reprsentent une menace que nous ne devons pas ngliger.', '', '', '', '', '', 'Retrouvez Bokou  la cime Chant-du-Vent.', 47187),
(66232, 'frFR', 'Le sel de la vie', 'Trouvez $1oapaillettes cristallines sur la cte aux Gorlocs.', 'a ne nous drange pas de vous accueillir chez nous, vos potes et vous, bien que personne ne nous ait pos la question Dites-moi, auriez-vous l\amabilit de me rapporter des paillettes cristallines si vous vous rendez aux sources? On s\en sert pour prserver toutes sortes de choses. Sans a, on mourrait certainement de faim, par ici.\n\nLes grands Gorlocs en sont entirement recouverts. Vous pourriez peut-tre vous servir sur eux?', '', '', '', '', '', '', 47187),
(66230, 'frFR', 'Une demande trange', 'Retrouvez le registre de la garde des chemins Alvi et rendez-le-lui.', 'Les Taraskes ont pris tout ce qui leur tombait sous la main, y compris mon registre de reconnaissance.\n\nCes lzards gants amassent les trophes par centaines. Je suis certaine qu\ils ont planqu mon registre quelque part. Lorsque vous passerez le col, vous pourrez essayer de le reprer?\n\nOh, $n? Si vous parvenez  mettre la main dessus, ne le lisez pas, s\il vous plat. Il contient des choses trs personnelles.', '', '', '', '', '', '', 47187),
(66228, 'frFR', 'Le camp d\Antonidas', 'Allez voir Noriko la Mnsique au camp d\Antonidas.', 'Le Kirin Tor s\est install au sud d\ici, dans le camp d\Antonidas.\n\nNoriko et Khadgar y recrutent en ce moment mme des aventuriers et aventurires pour aider Kalecgos  retrouver la pierre de vu d\Azur.\n\nSi vous souhaitez nous aider, prsentez-vous  eux.', '', '', '', '', '', 'Allez voir Noriko la Mnsique au camp d\Antonidas.', 47187),
(66227, 'frFR', 'Une pche d\enfer', 'Attrapez $3oavairons  queue bleue dans le coin de pche de Khuri.', 'Vous tombez bien! J\avais justement besoin d\une paire de bras supplmentaire pour m\aider  attraper la pche du jour.\n\nLe Kirin Tor semble s\inquiter de la prsence d\anomalies magiques dans la rgion, quoi que a veuille dire.\n\nVous avez votre place parmi nous,  condition que vous vous impliquiez et que vous acceptiez de nous aider.\n\nPrenez une canne  pche et mettez-vous au travail.  plusieurs, ce sera plus facile!', '', '', '', '', '', '', 47187),
(66226, 'frFR', 'Compagnons de soutien motionnel', 'Sauvez les cratures innocentes aux mains des Nokhuds au refuge d\Ondecrte.', 'Piti, ne me faites pas de mal\n\nQuoi? Vous tes l pour m\aider? Vous devez sauver les animaux!\n\nL\attaque des Nokhuds a t si soudaine que nous avons pris nos jambes  notre cou! J\ai russi  chapper  la mort en plongeant dans le lac.\n\nLes animaux! Nous avons d les laisser Je vous en supplie, sauvez ces pauvres cratures. Qui sait ce que les Nokhuds leur font subir?', '', '', '', '', '', '', 47187),
(66225, 'frFR', 'Transport de totems', 'Reprenez $1oapaquets de totems aux Nokhuds du refuge d\Ondecrte.', 'Bokou a demand pourquoi j\avais envoy un message pour demander aux autres mystiques de se rendre au refuge d\Ondecrte.\n\nMais ce n\est pas moi. Balakar a attir mes mystiques dans un pige, dans le seul but d\affaiblir le clan des Ohn\irs.\n\nCela dit il y a peut-tre une autre raison. Les Nokhuds rassemblent des totems mystiques en trs grand nombre; des totems bnis par Ohn\ahra.\n\nJe ne sais pas ce que cherchent les Nokhuds, mais nous ne pouvons pas les laisser accaparer les dons d\Ohn\ahra. Rcuprez le plus de totems possible.', '', '', '', '', '', '', 47187),
(66224, 'frFR', 'Mystre mystique', 'Retrouvez Bokou et rendez-vous au refuge d\Ondecrte.', 'Pardonnez-moi, je n\ai pas russi  communier avec Ohn\ahra. Vous allez devoir demander  quelqu\un d\autre de rpondre  la demande de la khanam matra.\n\nVoil plusieurs jours, mes camarades mystiques ont d se rendre au refuge d\Ondecrte  la demande expresse de la khan Tigari. Vous les trouverez sans doute encore l-bas.\n\nRejoignez-moi prs de la ville. Le moins que je puisse faire, c\est de vous montrer le chemin.', '', '', '', '', '', '', 47187),
(66223, 'frFR', 'On peut le garder?', 'Rapportez  Nilo $1oafrais algides obtenus auprs d\un vendeur  Iskaara ou pchs au large des les aux Dragons.', 'S\il essaie de nous manger, c\est juste qu\il a faim!\n\nAh, le poisson! Personne peut rsister  l\appel d\un bon poisson cru tout frais!\n\nLe frai algide, y a rien de mieux! Vous pouvez en pcher un peu partout dans l\ocan ou en acheter auprs de Jinkutuk,  Iskaara.\n\nRapportez-en tout un tas, pour qu\il ait plus jamais faim!', '', '', '', '', '', '', 47187),
(66222, 'frFR', 'Le calme avant la tempte', 'Transmettez les ordres de Jebota aux habitants et habitantes de Teeraka.', 'Les Nokhuds forment un clan puissant, aux nombreux allis. Nous devrons mobiliser toutes nos forces pour leur rsister.\n\n$n, la khanam matra vous fait confiance. Elle a donn l\ordre de rallier nos amis et allis et de prparer nos congnres.\n\nJ\ai besoin de votre aide. Allez voir Hojin pour rassembler les gardes du khanat encore sur place. Prvenez l\claireuse Khenyug que les Nokhuds risquent de tenter des perces, et dites  Agura de s\attendre  recevoir des victimes et  Gensa de prparer nos provisions.\n\nQuant aux mystiques, je vais voir s\il en reste encore  Teeraka, suite  leur rcent dpart.', '', '', '', '', '', '', 47187),
(66221, 'frFR', 'Aller de l\avant', 'Parlez  Alexstrasza au sige des Aspects de Valdrakken.', 'Maintenant que la pierre de vu de Bronze est restaure, Alexstrasza peut poursuivre son plan.\n\nRendez-vous  Valdrakken, $n. La reine voudra tre informe de votre russite.', '', '', '', '', '', '', 47187),
(66218, 'frFR', 'Sacrs sacripants', 'Trouvez Nilo et Nau.', 'Rebonjour.\n\nNorukk et moi avons un service  vous demander. Nos enfants, Nilo et Nau, sont partis jouer. Ces canailles devraient dj tre rentres.\n\nJ\ai du travail et j\aimerais que vous les retrouviez. Je ne me fais pas trop de souci, mes bambins savent se dbrouiller.', '', '', '', '', '', '', 47187),
(66217, 'frFR', 'ON RECHERCHE: Krojek l\Arpente-Rivage', 'Tuez Krojek l\Arpente-Rivage.', 'Voil dj quelques annes que nous observons le grand requin Krojek, attendant le meilleur moment pour frapper.\n\nSon terrain de chasse se rapproche de plus en plus du rivage, il est donc temps de passer  l\action. Rassemblez votre groupe et rglez-lui son compte!', '', 'Ancien pilier de l\cosystme local, l\Arpente-Rivage chasse dsormais un peu trop prs d\Iskaara.', 'Krojek l\Arpente-Rivage', '', '', '', 47187),
(66213, 'frFR', 'L\art de tisser une histoire', 'Racontez une histoire de poisson  l\ancienne Poa.', 'Mon pouse bien-aime, Poa, est une conteuse de talent.\n\nMais voil trente ans qu\elle nous rabche les mmes histoires! Alors, je vous en supplie, $c: allez parler  Poa et donnez-lui un nouveau rcit  partager.\n\nQuoi donc? Lui raconter l\une de vos aventures? Ne dites pas n\importe quoi, personne n\a envie d\couter a! Les plus grandes histoires au monde parlent toutes de poissons. Alors, racontez-lui une histoire de poisson, quitte  en inventer une!', '', '', '', '', '', '', 47187),
(66212, 'frFR', 'Pche: phalne aquatique alifre', 'Attrapez $1oaphalnes aquatiques alifres dans les mers qui entourent les les aux Dragons.', 'PERSONNE ne sait plus pcher CORRECTEMENT de nos jours, ou quoi?\n\n<Lukoturukk frtille furieusement des moustaches.>\n\nVous, l-bas, avec la drle de tte! Allez me chercher du poisson. Et du BON, hein, pas du charu-varu!', '', '', '', '', '', '', 47187),
(66211, 'frFR', 'Creux des Fougerobes: retour aux sources', 'Entrez dans le creux des Fougerobes et affrontez la dcatriarche Occulcre.', 'Nous ne vous remercierons jamais assez d\avoir aid  repousser les Gnolls fougerobes.\n\nMais cette tribu continue  se rassembler et  puiser son ignoble magie de putrfaction dans une source au plus profond du creux des Fougerobes. Pire encore, voil plusieurs semaines que nous sommes sans nouvelles des Roharts de cette rgion.\n\nJ\ai bien peur qu\il s\y passe quelque chose de terrible. Nous devons protger notre foyer. Je vous en supplie, runissez vos troupes, trouvez les ntres et voyez ce que vous pouvez faire pour cette putrfaction!', '', '', '', '', '', '', 47187),
(66210, 'frFR', 'Rassembler la famille', 'Rcuprez $1oaoffrandes funraires d\Iskaara, puis placez-les dans le bateau funraire.', 'Puisque votre ami Kalecgos souhaite me parler des lignes telluriques, je dois vous confier les derniers prparatifs des funrailles.\n\nTandis que je m\entretiendrai avec lui, pouvez-vous rassembler le reste des offrandes d\Iskaara et les placer dans le bateau funraire, aux cts de notre trs cher Ponoliak?\n\nPrenez galement le temps de dcouvrir le village! Mon peuple vous accueillera  bras ouverts, surtout depuis ce que vous avez accompli dans les Fougerobes.', '', '', '', '', '', '', 47187),
(66206, 'frFR', 'Nozdormu, je viens ngocier', '', '', '', '', '', '', '', '', 47187),
(66201, 'frFR', 'Sabots de guerre', 'Apportez le message de la khanam matra au garde du khanat Jebota,  Teeraka.', 'Balakar va prparer ses troupes  la guerre. Je vais en faire de mme, mais nous sommes en infriorit numrique.\n\nLes Dragons nous ont demand de l\aide, et avec ces colosses  nos cts, nous pourrions combattre sur un pied d\galit. Pour rpondre  leur appel, je dois souffler dans le cor de Drusahl, mais ceci implique d\obtenir la bndiction d\Ohn\ahra. Accepteriez-vous de m\aider?\n\nAllez  Teeraka apporter ma dclaration de guerre  mon lieutenant, Jebota. Il mobilisera mes troupes et vous conduira aux mystiques capables de retrouver Ohn\ahra.', '', '', '', '', '', 'Apportez le message de la khanam matra au garde du khanat Jebota,  Teeraka.', 47187),
(66196, 'frFR', 'Un coin-coin  l\abri', 'Ramenez le caneton embull au camp des cologistes.', '<Le caneton se dbat dsesprment dans la bulle et cancane de peur.>\n\n<Peut-tre que les cologistes sauraient comment l\aider?>', '', '', '', '', '', 'Ramenez le caneton embull au camp des cologistes.', 47187),
(66187, 'frFR', 'Mordigan le Fol et le roi de cristal', 'Dcristallisez Mordigan Gueule-de-Fer sur la cte aux Gorlocs.', 'J\ai explor le primtre. Si Mordigan est ici, il sera dans cette grotte.\n\n<Des insultes touffes s\lvent depuis l\entre.>\n\nOui, il est bien  l\intrieur.\n\nD\aprs ANN-A, ces cristaux ont d\inquitantes proprits de dshydratation. Essayez de trouver un moyen de le sparer de ses trouvailles gologiques. Mais ne lui faites pas trop de mal!\n\nIl est assez respect dans son domaine.', '', '', '', '', '', 'Parlez  Aelnara.', 47187),
(66177, 'frFR', 'On n\abandonne aucun Nain!', 'Suivez le chemin de Mordigan Gueule-de-Fer sur la cte aux Gorlocs.', 'Les niveaux de sel sont bien trop levs! Nous devons trouver Mordigan et le tirer de l, il doit tre horriblement dshydrat\n\nCela ne fait que quelques heures qu\il est parti. Essayez de comprendre quel chemin ce vieux ronchon a emprunt!', '', '', '', '', '', 'Allez trouver Aelnara sur la cte aux Gorlocs.', 47187),
(66176, 'frFR', 'Exprimentation lmentaire', 'Menez $1oaexpriences sur des lmentaires sur la cte aux Gorlocs.', 'Allez mener des expriences sur les lmentaires d\eau qui harclent les Gorlocs!', '', '', '', '', '', 'Beau travail!', 47187),
(66175, 'frFR', 'Exprience de terrain', 'Aidez ANN-A Fitzrouage  effectuer ses tests dans la crique du Baleinier.', 'Grce  vous, notre tude gologique se poursuit avec une efficacit de prs de 96%!\n\n<ANN-A fronce les sourcils.>\n\nCe sont des chiffres bien insuffisants.\n\nAidez-moi  analyser vos chantillons avec ma Gosonde289-07. Ainsi, nous aurons un point de rfrence pour essayer de comprendre ce qui se passe sur le plateau.', '', '', '', '', '', 'Parlez  ANN-A Fitzrouage dans la crique du Baleinier.', 47187),
(66169, 'frFR', 'La vengeance est un plat qui se mange bouillant', 'Tuez $1oaPrimalistes magmaliges  la porte du bastion sud.', 'Les Primalistes ont russi  nous prendre par surprise.\n\n<Velomir crache de dgot.>\n\nLes autres gardiens et gardiennes ont succomb  ces monstres. Je serais moi-mme tomb  leurs cts si vous n\tiez pas $garriv:arrive; si opportunment.\n\nMais j\entends encore le fracas des armes qui rsonne au loin. Cela signifie-t-il que certaines de nos troupes rsistent toujours? Peut-tre le commandant ranog s\en est-il tir?\n\nAccepteriez-vous de m\aider en crant une diversion pour que je puisse m\approcher discrtement?\n\nL\limination d\une poigne de ces Magmaliges devrait y suffire.', '', '', '', '', '', '', 47187),
(66167, 'frFR', 'Exposition plein sud', 'Rendez-vous  la garnison du bastion sud.', 'Si j\en crois ce que vous avez dcouvert, je prsume que les Primalistes attaquent en ce moment mme la garnison du commandant ranog au bastion sud. Cela tant dit, mes Ligcailles ne peuvent quitter la ville, car c\est prcisment ce qu\esprent nos adversaires.\n\nJ\ai donc encore besoin de votre aide, $n.\n\nRejoignez le bastion sud, valuez les armes ennemies dployes contre nous et, si possible, entrez en contact avec les troupes stationnes dans la garnison.', '', '', '', '', '', '', 47187),
(66166, 'frFR', 'Les yeux et les oreilles grand ouverts', 'Trouvez des indices  Valdrakken.', 'Les Primalistes rpandent leur propagande dans tout Valdrakken.\n\nNos adversaires sont trop habiles pour parler ouvertement en prsence de mes Ligcailles, mais peut-tre parviendrez-vous  approcher suffisamment pour surprendre leurs conversations et en tirer quelques informations utiles.\n\nJ\ai marqu plusieurs emplacements prometteurs sur votre carte.\n\nPrenez donc cette pierre enchante. Elle nous permettra de rester en contact tant que vous l\aurez sur vous.\n\nPuis-je compter sur votre aide dans cette affaire?', '', '', '', '', '', '', 47187),
(66164, 'frFR', 'Bas les nageoires!', 'Rcuprez $1oapices voles sur la cte aux Gorlocs.', 'Maintenant que Mordigan est parti lchouiller des cailloux, nous allons pouvoir nous attaquer au cur du problme\n\nCes humanodes  tte de poisson ont pill mes pices!\n\n peine une heure dans ce trou perdu, et BAM! Des Gorlocs nous tombent dessus! Rowe se met  pousser des hurlements, Aelnara crie  pleins poumons, et moi, je ne peux qu\agiter les bras avec ma cl  molette comme un dment!\n\nEssayez de nous tirer ce mauvais pas et de retrouver quelques-unes de mes pices!', '', '', '', '', '', '', 47187),
(66163, 'frFR', 'Nulle part o se rfugier', 'Tuez $2oaInfiltrateurs et infiltratrices primalistes  Valdrakken.', 'Bienvenue  Valdrakken, $r.\nJe crains hlas que vous ne trouviez le climat gnral  l\orage et je ne parle pas de la mto.\n\nLes Primalistes sment les graines de la contestation parmi la population de notre ville.\n\nNos adversaires sont trs habiles et se font dsormais passer pour des gens du commun afin d\chapper aux Ligcailles. Par chance, contrairement  nos gardes, vous ne devriez pas veiller leurs soupons.\n\nPrenez cette gemme d\il de Dragon, elle vous permettra de voir clair dans leur jeu.\n\nAllez dmasquer ces fourbes et tuez-les!', '', '', '', '', '', '', 47187),
(66159, 'frFR', 'Un message trs inquitant', 'Parlez  Alexstrasza au sige des Aspects de Valdrakken.', 'Kalecgos a refus de parler des terribles vnements de la trave d\Azur en votre absence.\n\nQuelles que soient les nouvelles qu\il souhaite nous communiquer, tout cela ne me dit rien qui vaille, $n.', '', '', '', '', '', '', 47187),
(66156, 'frFR', 'Renomme auprs de l\expdition du Dracaret', 'Allez voir l\inventoriste Jakes au camp de base du Dracaret.', 'Vos prouesses ne sont pas passes inaperues, et vous continuez de prouver que vous tes $gun explorateur rput:une exploratrice rpute;!\n\nRepassez au camp de base du Dracaret, j\ai prpar quelques fournitures supplmentaires pour vous aider dans vos aventures.', '', '', '', '', '', '', 47187),
(66155, 'frFR', 'Descente des rapides avec Ruriq', 'Descendez la rivire  bord du Tmraire.', 'Je ne m\attendais pas  recevoir l\aval de mon frre mais je ne vais pas m\en plaindre.\n\nLe moment est venu! Voyons si notre dur labeur va porter ses fruits!\n\nRetrouvez-moi  bord du Tmraire, $n, et on descendra la rivire tout en attrapant du poisson pour Iskaara!', '', '', '', '', '', '', 47187),
(66154, 'frFR', 'chantillons salivaires', 'Trouvez $1oachantillons de salive sur la cte aux Gorlocs.', '<Le mort-vivant dcharn se pince l\arte du nez dans un grand soupir.>\n\nVoil qui va faire tache dans mon dossier professionnel. C\est inexplicable; en une seule journe, nous avons russi  aiguillonner les Gorlocs du coin,  garer la moiti de notre matriel et  perdre un Nain.\n\nPour ce genre de situation, le protocole rclame une efficacit absolue. Allez donc rduire les rangs de nos antagonistes aux crocs acrs, et rapportez-moi leur salive afin que je l\tudie plus avant.\n\nMais attention, que de la BONNE salive!', '', '', '', '', '', '', 47187),
(66152, 'frFR', 'Dans l\impasse', 'Retrouvez Garz au camp Nulle-Part.', 'Nous ne pouvons pas rester ici.\n\nJe ne sais pas quoi faire ni mme o aller\n\nNous allons retourner  votre camp Nulle-Part. Les Roharts doivent savoir ce qui est arriv aux Rouges-Pins.\n\nSi nous racontons notre histoire et veillons  ce qu\elle reste dans les mmoires, peut-tre ne se reproduira-t-elle jamais', '', '', '', '', '', '', 47187),
(66151, 'frFR', 'Sa Majest au cur de pierre', 'Tuez Cur-de-Pierre.', 'Nous hurlons de chagrin pour notre chef, mais il est toujours en vie.\n\nCe qu\il reste de Cur-de-Pierre se trouve dans cette grotte, l-bas. Beaucoup d\entre nous ont tent de le raisonner.\n\nIl ne leur a laiss aucune chance. Mme Narn a bien failli rejoindre ses victimes.\n\nIl est devenu un monstre, et c\est a, l\objectif des Primalistes: faire de nous des esclaves de pierre et de flamme.\n\nLe chef des Rouges-Pins n\existe plus. Il faut  tout prix le tuer avant que d\autres Furbolgs ne connaissent le mme sort.', '', 'Le don des Primalistes a ptrifi le corps du chef des Rouges-Pins.', 'Cur-de-Pierre', '', '', '', 47187),
(66150, 'frFR', 'Secourir Radza', 'Sauvez Radza Griffe-Tonnerre.', 'Radza Griffe-Tonnerre est notre gardienne spirituelle. C\est elle qui prserve nos traditions et notre histoire.\n\nLes croyances des Primalistes vont  l\encontre de toutes les valeurs de notre clan. Je savais qu\elle s\opposerait  Cur-de-Pierre!\n\nMais il fera tout pour la soumettre. Personne ne devient chef sans la bndiction de Radza!\n\nNarn dit que Khargall Cinq-Crocs, le garde du chef, essaie de la briser. Si Radza meurt, notre clan prira avec elle.\n\nAllez l\aider, $n, et tenez-vous $gprt:prte;. Il ne la laissera pas partir sans se battre.', '', '', '', '', '', 'Allez trouver Radza Griffe-Tonnerre  la tanire des Rouges-Pins.', 47187),
(66149, 'frFR', 'Influence lmentaire', 'Dtruisez $1oatotems de lien terrestre primalistes, puis retrouvez Narn plus avant dans la tanire des Rouges-Pins.', 'Narn dit qu\une partie du clan des Rouges-Pins n\a pas suivi Cur-de-Pierre et les Primalistes.\n\nDes totems rpriment  coups de pierres et de boue celles et ceux qui rsistent. jusqu\ ce que les pauvres finissent par cder.\n\nDtruisez ces totems et librez-les!', '', '', '', '', '', 'Allez trouver Narn  la tanire des Rouges-Pins.', 47187),
(66148, 'frFR', 'Feu la famille furbolg', 'Tuez $1oaFurbolgs et lmentaires rouges-pins, puis retrouvez Narn plus avant dans la tanire des Rouges-Pins.', 'Des Primalistes nous ont offert la force un pouvoir sur les lments.\n\nJe ne pensais pas que Cur-de-Pierre accepterait leurs prsents. Notre clan n\avait pas besoin de pouvoir. Il n\a pas rflchi aux consquences.\n\nIl a fait un choix terrible, irrversible, et la magie a corrompu les miens comme la maladie gangrne une racine.\n\na me brise le cur, mais la mort sera leur seule chappatoire.', '', '', '', '', '', 'Allez trouver Narn  la tanire des Rouges-Pins.', 47187),
(66147, 'frFR', 'Des cristaux dans l\eau', 'Trouvez $1oachantillons de cristaux sur la cte aux Gorlocs.', 'C\est peut-tre difficile  croire  premire vue, mais nous sommes des pros. Notre groupe a pour mission de trouver des cristaux rares dans la rgion Une sorte d\tude gologique, quoi.\n\nJe ne me suis pas encore remise de l\attaque des Gorlocs. Auriez-vous l\amabilit d\aller chercher ces cristaux? Rapportez-moi des chantillons, si vous le pouvez.', '', '', '', '', '', '', 47187),
(66141, 'frFR', 'Traditions brises, corps briss', 'Retrouvez Garz et Narn sur le chemin de la tanire des Rouges-Pins.', 'Mes camarades furbolgs ont chang du tout au tout et ont commis des actes terribles. Aujourd\hui, ce ne sont plus que des monstres.\n\nJamais les Furbolgs n\avaient affront les leurs.\n\nMon frre et moi avons russi  nous enfuir, et tandis que je venais ici chercher de l\aide, lui est rest  la tanire de notre clan.\n\nAidez-nous, avant que notre clan ne soit perdu!', '', '', '', '', '', '', 47187),
(66139, 'frFR', 'Tout feu, tout flamme', 'Utilisez l\essence d\eau concentre pour vaincre l\inferno flamboyant dans les jardins.', 'Trs bien, mon enfant. J\ai plac toutes les essences d\lmentaires d\eau dans cette jarre.\n\nAllez la lancer sur notre norme indsirable. L\eau a toujours eu un effet radical sur le feu, n\est-ce pas? a ne peut pas rater.\n\nHeu la chaleur me donne de l\arthrite, alors je vais vous attendre ici. Vous vous en sortirez trs bien sans moi.\n \nBonne chance, mon enfant!', '', '', '', '', '', '', 47187),
(66138, 'frFR', 'Comme les grains dans un sablier', 'Rcuprez $1oatas de sable temporel emport par le vent dans les jardins.', 'L\agitation des lmentaires n\a pas davantage pargn le sablier de Nozdormu que le reste des jardins. Des lmentaires de vent turbulents ont ainsi dispers son sable magique.\n\nSans ce sable, l\influence de Nozdormu se trouve grandement rduite.\n\nEn tant qu\intendant en formation, j\ai t charg de veiller sur le sablier en toute circonstance. Je vous serais donc ternellement reconnaissant de bien vouloir rcuprer ce sable pour moi.', '', '', '', '', '', '', 47187),
(66137, 'frFR', 'Dferlement', 'Tuez $1oafatales invasives et herbelins flagellants dans les jardins.', 'Je suis sr que les boguelins ne sont pas les seules cratures  se comporter comme de vritables vandales.\n\nL\arbre d\Alexstrasza m\a toujours caus des ennuis. Sa magie de vie attire toutes sortes de plantes et d\animaux. Et devinez qui doit s\occuper des indsirables? Gryrmpech, videmment!\n\nPar les Aspects, je me fais trop vieux pour tout a.\n\nLes auxiliaires ne savent pas se battre, alors c\est  vous qu\il revient de rgler le problme de mauvaises herbes de la Lieuse-de-Vie.', '', '', '', '', '', '', 47187),
(66136, 'frFR', 'Extrait lmentaire', 'Rcuprez $1aessences aqueuses dans les jardins.', 'Un norme lmentaire de feu a dtruit l\tang il y a quelques jours. C\est certainement  lui que nous devons cette pagaille. Hlas, il est trop gros pour tre combattu en l\tat. Nous devons trouver une manire de l\affaiblir.\n\nMais le vieux Gryrmpech a encore de la ressource. J\ai un plan!\n\nDes lmentaires d\eau ont lu domicile dans le belvdre du Vol bleu. Procurez-vous suffisamment de leur essence et nous pourrons peut-tre retourner leur magie contre ce monstre.\n\nIl faut combattre le feu par le feu, pas vrai? Ou plutt par l\eau, en l\occurrence.\n\nBref, vous feriez mieux de vous y mettre.', '', '', '', '', '', '', 47187),
(66135, 'frFR', 'Aide paysagiste', 'Cherchez Basilton dans l\abri de jardin en nettoyant des tas de bric--brac.', 'Basilton! O es-tu, Basilton?\n\nMon assistant et apprenti a disparu! Basilton adore l\exploration, mais il est encore pire que moi lorsqu\il s\agit de se dfendre. Je suis un jardinier, pas un guerrier!\n\nPourriez-vous retrouver ce fugueur? J\ai besoin de sa prsence pour rflchir. Il aime gnralement fouiner dans le bric--brac entrepos dans l\abri de jardin.\n\nMais mfiez-vous. Il est parfois un peu revche avec les inconnus.', '', '', '', '', '', '', 47187),
(66134, 'frFR', 'Contrle des nuisibles en Azeroth', 'Tuez $1oagermelins agits dans les jardins.', 'Vous, l! Oui, vous, mon enfant!\n\nDonnez-moi un coup de main, voulez-vous? Ces boguelins arrachent toutes mes plantes!\n\nToutes sortes d\lmentaires ont envahi les jardins et leur prsence semble affecter la faune. Comme si leur nergie avait enrag ces boguelins! Enfin, encore plus que d\habitude.\n\nCes trois-l me donnent du fil  retordre. Je vous en prie, occupez-vous-en avant que mes parterres de fleurs n\y passent.', '', '', '', '', '', '', 47187),
