(66124, 'frFR', 'Une sortie russie', 'chappez-vous de l\enclave de Givrclair avec Slistra.', 'D\aprs ce que j\ai vu, la reine s\est replie dans le couvoir Sauvage. C\est un avant-poste qui nous permet de surveiller les proto-drakes de la zone J\espre que ses dfenses tiendront.\n\nNous devons nous y rendre immdiatement!', '', '', '', '', '', '', 47187),
(66123, 'frFR', 'Qu\on leur coupe la tte!', 'liminez Jadzigeth dans l\enclave de Givrclair.', 'Jadzigeth, l\un des abjects lieutenants de Raszageth, mne les Primalistes dans notre direction.\n\nMontrons-leur ce qu\il se passe lorsque l\on s\oppose  nous.', '', 'La lieutenante de Raszageth ne sera qu\une immense source d\ennuis tant que nous ne l\aurons pas arrte.', 'Jadzigeth', '', '', '', 47187),
(66122, 'frFR', 'Proto-combat', 'liminez $2oaproto-dragons dans l\enclave de Givrclair.', 'Ces proto-dragons nous abhorrent. Ils nous considrent comme une version corrompue du peuple draconien, manipule et enchane par les Titans. Ils ne nous comprennent pas.\n\nC\est pour cela qu\ils se croient intouchables, alors mme qu\ils attaquent nos murs.\n\nMais ils font erreur!\n\nPrenez cette lance, $p. Tuez nos adversaires.', '', '', '', '', '', 'Allez voir Slistra, camriste de la reine,  l\enclave de Givrclair.', 47187),
(66121, 'frFR', 'vacuation des ufs', 'Sauvez 4ufs dans l\enclave de Givrclair.', 'Les Primalistes ont russi  s\emparer de nos ufs pour leurs rituels retors! Il faut les arrter.\n\nAidez-nous  rcuprer nos ufs avant qu\il ne soit trop tard. Marquez tous ceux que vous trouverez, $p, et je les ferai sortir de la zone en toute sret.', '', '', '', '', '', 'Allez voir Slistra, camriste de la reine,  l\enclave de Givrclair.', 47187),
(66119, 'frFR', 'Bassins de l\Essence rubis: invasion primaliste', 'Accdez aux bassins de l\Essence rubis et arrtez l\attaque primaliste.', 'Les Primalistes ont forc le passage. Nous n\tions pas capables de faire front  une attaque d\une telle intensit Plusieurs ont russi  passer.\n\nL\un de nos Draknides s\est lanc  leurs trousses, mais il n\est pas encore rentr faire son rapport. Je crains le pire.\n\nTant que nous n\aurons pas rendu notre dernier soupir, nul autre ne passera, mais il faut que quelqu\un arrte les Primalistes qui sont dj  l\intrieur.\n\nAllez-y!', '', '', '', '', '', '', 47187),
(66118, 'frFR', 'Assaut basaltique', 'Dtruisez $1oafalaises enrages  l\assaut de Givrclair.', 'Raszageth et ses Primalistes ont invoqu de gigantesques lmentaires de terre pour dtruire nos murs. Il faut les arrter!', '', '', '', '', '', '', 47187),
(66117, 'frFR', 'Nettoyer le champ de bataille', '', '', '', '', '', '', '', '', 47187),
(66116, 'frFR', 'La menace principale', 'Retrouvez le commandant Lthanak  l\assaut de Givrclair.', 'Ces ufs sont bien trop vulnrables et trop nombreux pour que nous puissions tous les protger. Si les troupes ennemies parviennent  percer nos dfenses, tout sera perdu!\n\nNos gardes doivent tre en train de se rassembler sur le terrain pour repousser cet assaut. Rendez-vous sur place et adressez-vous au commandant Lthanak. Il saura faire bon usage de vos atouts.', '', '', '', '', '', '', 47187),
(66115, 'frFR', 'Le mandat des rouges', 'Parlez aux soigneurs du sanctuaire de l\Essence rubis.', 'Nous avons pour vocation de soigner avec compassion. Quand nous volons au secours d\un Vol, ce n\est pas lui seul que nous aidons, mais tous les peuples draconiens.\n\nVous comprendrez peut-tre mieux ce que j\entends par l en parlant aux Draconides qui se trouvent ici, au sanctuaire de l\Essence rubis.', '', '', '', '', '', '', 47187),
(66114, 'frFR', 'Pour le bnfice de la reine', 'Voler jusqu\au sanctuaire de l\Essence rubis avec Slistra.', 'Nous protgeons nos ufs pour assurer un avenir  tous les Vols draconiques. Par leurs actes, les Primalistes ne menacent pas seulement de nous infliger de terribles souffrances.\n\nC\est notre existence mme qui est en pril.\n\nJe dois en informer la reine au plus vite.', '', '', '', '', '', '', 47187),
(66113, 'frFR', 'Convoyage anodin', 'Rparez le chariot emprunt.', '[DNT] Our foes watch the skies. I will risk no harm to the future of my flight, so we must travel by less traditional mean.\n\nI ordered a more... down to earth means of transport be acquired, but it seems to have suffered some damage during the exchange. You are undoubtedly more familiar with such things than I, $r, so your assistance in repairing the wagon would be most appreciated.', '', '', '', '', '', '', 47187),
(66112, 'frFR', 'L\artisanat avant tout', 'Rcuprez un noyau terrestre primordial et un cur de magma primordial.', 'Aviez-vous dj vu des lmentaires aussi puissants?!\n\n<Grun se rjouit.>\n\nLes gardes se plaignent sans cesse de devoir les affronter, mais ils oublient l\essentiel Ces gros lmentaires sont de vritables mines de matriaux d\artisanat!\n\nQuand vous irez vous battre pour notre scurit ou je ne sais trop quoi, pensez  ramasser les morceaux des plus gros lmentaires. J\essaierai d\en faire quelque chose!', '', '', '', '', '', '', 47187),
(66111, 'frFR', 'lmentaires envahissants', 'Tuez $1oalmentaires primordiaux  l\ambassade de Trve-Aile.', 'L\expdition du Dracaret verse dans l\artisanat et l\exploration, pas dans l\art de la guerre.\n\nMais c\est une discipline que nous matrisons, vous et moi, $p.\n\nMettons nos forces  la disposition des plus vulnrables, ici, sur les les aux Dragons.\n\nliminez les lmentaires qui gagnent du terrain au nord afin que l\expdition puisse se concentrer sur sa noble mission.', '', '', '', '', '', '', 47187),
(66110, 'frFR', 'Une chance de paix', 'Prsentez-vous aux reprsentants de l\Alliance.', 'Aka\Magosh, $p.\n\nCette expdition bnficie de la protection de la Horde et de l\Alliance. Nos instructions sont claires: apporter de l\aide aux membres de l\expdition du Dracaret, quelles que soient leurs autres allgeances.\n\nLes reprsentants de l\Alliance, la capitaine Garrick et son fils Henry, ont pris leurs quartiers de l\autre ct du camp.\n\nJ\ai combattu le Flau aux cts de la capitaine Garrick. C\est une femme d\honneur qui sera d\une aide prcieuse  cette expdition.\n\nAllez lui offrir votre assistance. Montrez-lui que la Horde tient ses promesses.', '', '', '', '', '', 'Allez parler  la capitaine Garrick  l\ambassade de Trve-Aile.', 47187),
(66108, 'frFR', 'Une solution au marteau-pilon', 'liminez Sogglmoggl, le roi des Suinte-Gueules, et Whirglgurgl, le roi des Nage-Vents.', 'Je suis ravi de constater que Tharu comprend mon point de vue, et je lui suis reconnaissant de vous avoir demand de secourir la faune locale pendant que je lambinais ici.\n\nLa situation est bien plus grave que je ne le pensais; il a eu raison de passer  l\action. Si j\en crois ce que vous avez dcouvert, je crains que ce bombardement lmentaire ne s\arrte pas tant que nous n\aurons pas rgl le problme des Gorlocs.\n\n la place de Tharu, je m\en prendrais directement  leurs chefs. Sans personne pour les commander, les combats devraient bien vite s\arrter, ce qui mettra un terme  la menace qui pse sur les marais.', '', '', '', '', '', '', 47187),
(66107, 'frFR', 'Sauvetage de la faune', 'Sauvez les animaux des marais Fbriles.', 'Inutile d\tre cologiste pour se rendre compte que les marais ne se portent pas bien du tout.\n\nIskha nous fait examiner des cadavres, alors que nous devrions empcher ces cratures de mourir! Le Vol draconique rouge est l pour prserver la vie, pas pour la dissquer, bon sang!\n\nJe l\aime beaucoup, et Iskha est trs dou, mais si nous attendons qu\il ait fini ses petites affaires, il ne restera plus rien  sauver de ces marais.\n\nJe vais m\occuper de lui et de sa cogitation pathologique pendant que vous vous salissez les bottes et que vous sauvez quelques animaux.', '', '', '', '', '', '', 47187),
(66106, 'frFR', 'Sortez-les de leurs coquilles!', 'Rcuprez $1oacoquilles imprgnes d\eau et $1oacoquilles imprgnes de vent sur des Gorlocs suinte-gueule et nage-vent.', 'Je n\aurais jamais d douter d\Iskha quand il m\a dit que toute cette histoire n\tait pas si simple. Nous ne serions pas amis s\il ne pensait pas toujours avec trois coups d\avance sur moi.\n\nNous pouvons nous rattraper en passant  l\action, bien entendu. Si ces coquilles sont la source de tout ce chaos lmentaire, pourquoi n\allez-vous pas dans leur camp pour les arracher aux griffes visqueuses des Gorlocs?\n\nRapportez des piles de coquilles imprgnes d\eau et de vent  Iskha pour lui permettre de mener ses recherches.', '', '', '', '', '', '', 47187),
(66105, 'frFR', 'Une solution au scalpel', 'Tuez $1oalmentaires d\eau dchans et $1oalmentaires de vent dchans.', 'Je crois que nous collectons suffisamment de donnes ici, mais\n\nTharu est un cologiste exceptionnel qui prfre l\action  la rflexion. Cela dit, cet cosystme est fragile et nous risquons de faire beaucoup de dgts si nous agissons  la hte.\n\nSelon moi, il pourrait tre utile de nous prter  son jeu dans une certaine mesure.\n\nEn liminant certains des lmentaires dchans, nous devrions gagner un peu de temps sans mettre nos recherches en pril. Rduisez leur nombre de manire quitable, ou nous risquons de dsquilibrer encore plus l\cosystme.', '', '', '', '', '', '', 47187),
(66104, 'frFR', 'Autopsie cologique', 'Procdez  la dissection des cadavres de Gorlocs.', 'Je ne sais plus quoi faire, $n. Tharu et moi avons examin presque tous les cadavres, mais nous ne parvenons pas  nous mettre d\accord sur une mthodologie. Si seulement il voulait bien m\couter pour une fois!\n\n<L\cologiste Iskha soupire.>\n\nLe stress de la situation nous pse  tous les deux. Je n\ai mme pas encore d\hypothse srieuse.\n\nVous avez l\estomac bien accroch, non? Vous ne voudriez pas jeter un coup d\il  ces deux derniers Gorlocs? Je vous prte mon scalpel, si vous voulez.', '', '', '', '', '', '', 47187),
(66103, 'frFR', 'Tout pour faire plaisir', 'prouvez $1oasicaires et vengeurs de la Griffe noire au rempart d\Obsidienne.', 'Il nous faut plus de bras pour dfendre la citadelle d\Obsidienne. Maintenant que nous tenons une position digne de ce nom, nous devons faire en sorte de pouvoir compter sur du sang frais le moment venu.\n\nNous avons des troupes de rserve postes au rempart d\Obsidienne qui pourraient venir en renfort.\n\nElles sont bien entranes, mais elles gagneraient encore  se mesurer  quelqu\un d\aussi habile que vous. Ce serait l\occasion de vrifier qu\elles sont prtes pour le combat.', '', '', '', '', '', 'Allez voir Fao l\Acharn au rempart d\Obsidienne.', 47187),
(66101, 'frFR', 'Depuis de telles hauteurs', 'Utilisez le disque de gomtre pour bondir dans les cieux et observer la zone.', 'Toddy et Naleda m\ont demand un rapport sur les environs au plus vite.\n\nFort heureusement, j\ai fait l\acquisition d\un tlescope magique et d\un disque de gomtre qui nous permettront d\observer les zones environnantes depuis les nuages.\n\nLe problme, c\est que j\ai le vertige et que je ne peux pas me rsoudre  mettre mon plan  excution\n\nCe n\est pas votre cas, si?', '', '', '', '', '', '', 47187),
(66100, 'frFR', 'Approvisionnement de poids', 'Rcuprez $1oaSacs de fournitures de garde des chemins.', 'Cette fois, j\ai vraiment fait n\importe quoi. Je ne me suis loigne du campement que quelques instants, mais suffisamment pour que les Taraskes volent tout ce que je n\avais pas solidement arrim.\n\nCes fournitures taient prcieuses, et je ne peux pas vraiment demander de l\aide pour en rcuprer d\autres! Ma sur Nori est dj convaincue que je suis inutile, je ne veux pas apporter d\eau  son moulin.\n\nSi vous comptez traverser la valle, pourriez-vous ouvrir l\il et rcuprer d\ventuels sacs de fournitures gars?', '', '', '', '', '', '', 47187),
(66087, 'frFR', 'Fin du temps imparti', 'Venez en aide aux marcheurs et marcheuses du temps en tuant des adversaires perdus dans le temps, en apportant des amliorations aux allis de bronze, en retrouvant des artfacts perdus et en fermant des failles temporelles dans les Sables changeants.', 'Ces incursions rptes fragilisent cette ligne temporelle et menacent de la briser. Si seulement nos effectifs de marcheurs du temps taient au complet!\n\nS\il est vrai que vous ne matrisez pas encore totalement le maniement du bton, vous nous avez tout de mme t d\une aide prcieuse. Encore un petit effort, et vous nous serez encore plus utile.\n\nEn temps normal, je vous imposerais une formation exhaustive, mais nous vivons une poque anormale. Prenez ce parchemin de connaissances avances et servez-vous-en pour nos adversaires! Faites vite, cependant, car ses effets ne sont que temporaires.', '', '', '', '', '', '', 47187),
(66085, 'frFR', 'Si nous pouvions remonter dans le temps', 'Fermez les failles temporelles des Sables changeants avec Siaszerathel.', 'Les marcheurs et marcheuses du temps dignes de ce nom ne laissent jamais une situation de crise  moiti rsolue. Pourquoi attendre et peser le pour et le contre quand nous avons dj tous les outils  notre disposition?\n\nPuisque c\est vous qui avez mon bton, je m\en suis procur un autre pour mon usage personnel. Je doute qu\il manque  qui que ce soit. Nous allons donc nous associer pour nous occuper de ces brches et rgler le problme une bonne fois pour toutes. Une bonne fois pour toutes les fois? Je n\ai pas encore trouv les mots adapts  cet imbroglio temporel.\n\nQu\est-ce que vous en dites? Cela ne devrait pas tre bien compliqu, si?', '', '', '', '', '', '', 47187),
(66084, 'frFR', 'Par les temps qui courent', 'Rcuprez $1oarsidus temporels sur des adversaires perdus dans le temps dans les Sables changeants.', 'Malgr cette petite msaventure au cours de votre formation, je pense que vous tes fin $gprt:prte;  nous aider.\n\nAvec les distorsions temporelles dans la valle, de nombreuses poques ont commenc  croiser la ntre. Nous ne connaissons pas encore la raison pour laquelle ces lignes temporelles sont relies, et c\est inquitant. Nous devons en apprendre davantage.\n\nVoyez si vous trouvez quelque chose sur les cratures provenant d\autres lignes. Leur passage dans les voies temporelles a certainement laiss des rsidus. En les tudiant, nous pourrons peut-tre trouver un moyen d\endiguer cette crise.', '', '', '', '', '', '', 47187),
(66083, 'frFR', 'Comme la premire fois', 'Parlez  Andantenormu et prenez part  la formation des marcheurs du temps.', 'La surveillance des voies temporelles est une charge trs dangereuse.\n\nVous n\tes pas $gun marcheur:une marcheuse; du temps, mais l\ambassadrice Chronormu a entire confiance en vos capacits. Cela tant dit, il nous faut veiller  votre scurit, et pour ce faire, vous allez devoir suivre une formation adquate.\n\nMalheureusement, nos instructeurs manquent encore  l\appel. Je vais donc faire de mon mieux pour vous aider. Voyons comment nous nous dbrouillons, vous et moi. L\ambassadrice Chronormu compte sur nous.', '', '', '', '', '', '', 47187),
(66082, 'frFR', 'Temps en bouteille', 'Rcuprez de l\nergie temporelle sur les cadavres d\animaux chronochargs dans la fort Ondoyante de Thaldraszus.', 'Bonne nouvelle! Le bton de marcheur du temps est intact! En revanche, il est compltement puis.\n\nJ\ai une ide! L\nergie temporelle agglutine sur la faune sauvage de la fort va nous permettre de le recharger. Mais pour ce faire, je crains hlas que nous ne devions abattre les cratures affectes. Cette magie les rend dangereusement instables et tt ou tard, nous aurions d faire quelque chose pour rguler leurs effectifs, de toute faon\n\nParfois, il faut savoir faire des sacrifices pour servir l\intrt gnral. Vous pouvez vous en charger? J\ai encore besoin d\un petit moment.', '', '', '', '', '', '', 47187),
(66081, 'frFR', ' court de temps', 'Rcuprez $1oacollecteurs temporels dans la fort Ondoyante de Thaldraszus.', 'L\assaut du temple de Bronze a provoqu un dferlement d\nergie temporelle dans toute la rgion.\n\nLes marcheurs du temps ont dispos dans cette fort des collecteurs afin de recueillir cette magie. Nous pourrons ainsi nous constituer un rservoir de puissance supplmentaire! Ce ne sera pas du luxe, tant donn le rythme effrn auquel cette crise puise nos ressources.\n\nC\est moi qui suis cense les rcuprer, mais j\ai besoin de souffler un peu.\n\nPourriez-vous vous en charger  ma place?', '', '', '', '', '', '', 47187),
(66080, 'frFR', 'Difficults temporelles', 'Trouvez la recrue porte disparue dans la fort Ondoyante de Thaldraszus.', 'Bonjour, $c. Vous arrivez pile  l\heure!\n\nDes problmes dans le temple perturbent les voies temporelles et s\tendent dsormais jusque dans la valle. Et pour couronner le tout, un certain nombre de marcheurs du temps manquent  l\appel!\n\nNous avons demand des renforts, mais l\une de nos dernires recrues n\est toujours pas arrive.\n\nPourriez-vous partir  sa recherche? Restez sur vos gardes, le temps dans la valle est particulirement instable et il est trs difficile d\anticiper les dangers qui nous guettent!', '', '', '', '', '', '', 47187),
(66079, 'frFR', 'Irion attend', 'Allez voir Irion au rempart d\Obsidienne.', 'Ces ufs reprsentent une nouvelle gnration de Draconides. Nous devons imprativement les protger et les couver. Pourtant mon cur souffre et je m\inquite pour Irion. Je crains que sa dtermination excessive ne se solde par quelque folie. \n\nVotre amiti n\a jamais vacill au fil des ans, $n. Peut-tre pourriez-vous aller le voir et lui prter main-forte?\n\nVous le trouverez au rempart d\Obsidienne. Et de grce, veillez sur lui. Il est l\un des derniers reprsentants de son Vol.', '', '', '', '', '', 'Aller voir Irion au rempart d\Obsidienne', 47187),
(66078, 'frFR', 'Entranement tranchant', 'prouvez $1oaassassins et vengeurs de la Griffe noire.', 'Cela fait des annes que je m\occupe des Griffes noires. Je leur enseigne ce qu\il leur faut savoir et je les encourage  viser aussi haut que vous.\n\nLeurs ambitions ne sont peut-tre pas aussi leves que les vtres, mais mes Griffes n\en sont pas sans mrite pour autant. Je suis fier de ce que nous avons accompli.\n\nCe serait un honneur pour mes lves de se mesurer  vous. Je crois que vous retrouverez un peu de vous-mme en ces jeunes gens.', '', '', '', '', '', '', 47187),
(66076, 'frFR', 'Vieux bufflacien', '', '', '', '', '', '', '', '', 47187),
(66074, 'frFR', 'Reine des scythides primordiales', '', '', '', '', '', '', '', '', 47187),
(66071, 'frFR', 'Rocs volants', 'Soignez $1oarocs plumebleues blesss.', 'Je me prsente: professeure Harleen Sarcasiffle, ornithologue mrite de renomme mondiale! Je suis venue ici pour tudier les mythiques rocs plumebleues des les aux Dragons, mais je crains que nous n\ayons d\autres volatiles  fouetter.\n\nJe parie que ces harpies sont arrives de Kalimdor lorsque l\accs aux les a t ouvert. Elles sont envahissantes au possible. Elles dvorent tout sur leur passage avec l\apptit d\une bande d\ogres au buffet du casino de Baille-Fonds.\n\nDonnons un coup de pouce aux rocs de la rgion, voulez-vous? Prenez cette trousse mdicale et utilisez-la pour remettre sur pied les spcimens blesss.', '', '', '', '', '', '', 47187),
(66057, 'frFR', 'Rtablir la foi', 'Rparez la pierre de vu d\obsidienne.', 'Les fragments pars ont t restaurs. Nous allons pouvoir rparer la pierre de vu.\n\nAllez aider Irion  terminer les rparations.', '', '', '', '', '', 'Allez voir Irion au trne d\Obsidienne.', 47187),
(66056, 'frFR', 'Forger un nouvel avenir', 'Prparez la forge du Gardeterre.', 'La forge du Gardeterre est la plus puissante de toutes les forges draconiques. Nos anctres l\utilisaient pour crer des armes et des armures sans pareilles au service de la dfense d\Azeroth.\n\nAu cur de cette forge sommeille un pouvoir capable de runir les fragments pars de la pierre de vu.\n\nAllons la prparer pour nous mettre au travail.', '', '', '', '', '', 'Apportez le charbon cendrclat au matre-forge Bazentus.', 47187),
(66055, 'frFR', 'Un pass en morceaux', 'Rcuprez $2oafragments de la pierre de vu.', 'La pierre de vu est endommage et trois de ses fragments ont disparu.\n\nVous devez les retrouver Il existe peut-tre encore un moyen de restaurer la pierre!', '', '', '', '', '', '', 47187),
(66049, 'frFR', 'Pierre de vu d\obsidienne', 'Localisez la pierre de vu d\obsidienne.', 'Neltharion a jur de protger ce monde lorsqu\il a endoss la charge de Gardeterre, $n. Il s\est engag  prserver les profondeurs de la terre et  se faire le dfenseur d\Azeroth avec son Vol. La pierre de vu d\obsidienne est le symbole de cette promesse.\n\nNous devons l\activer et faire savoir aux les aux Dragons que le Vol draconique noir est de retour!\n\nSuivez-moi, $n.', '', '', '', '', '', '', 47187),
(66048, 'frFR', 'Plans et calculs parfaits', 'tudiez les plans des diffrents membres des troupes d\Irion.', 'Attaquer les troupes djaradines qui contrlent la citadelle d\Obsidienne ne sera pas une mince affaire. Un combat acharn nous attend, mme avec le soutien d\Irion et de ses Griffes noires. Notre alli a beau tre confiant je n\arrive pas  me dpartir de mes rserves.\n\nNous devrions peut-tre nous entretenir avec ses stratges afin de voir s\il n\y aurait pas moyen d\amliorer notre plan de bataille d\une manire ou d\une autre.', '', '', '', '', '', 'Allez faire votre rapport  Irion, au rempart d\Obsidienne.', 47187),
(66044, 'frFR', ' l\assaut des remparts', 'liminez les 3arbalestes de sige et le champion Choruk.', 'Sabellian et les autres Dragons tiennent les armes djaradines en respect pour l\instant. Nous devons agir au plus vite pour nous emparer des hautes tours et asseoir notre victoire.\n\nVous et moi allons anantir depuis les cieux les arbalestes de sige qui nous menacent.\n\nFaites-moi savoir quand vous serez $gprt:prte;.', '', '', '', '', '', 'Rencontre avec Irion', 47187),
(66040, 'frFR', 'Retour vers le futur', 'Dfendez vos allies contre l\Empire noir jusqu\ ce que le portail temporel soit cr.', 'Nous ne tomberons plus dans le temps, mais nous sommes loin dans le pass. Trs trs loin dans le pass. Un pass dans lequel les Titans n\ont pas encore visit Azeroth. Rentrer chez nous va tre dlicat.\n\nMais nous autres Dragons en sommes capables!\n\nNous allons avoir besoin de votre aide pour contenir les armes de l\Empire noir. Cela ne devrait pas nous prendre trop de temps!\n\nEnfin, je pense\n\nProbablement.\n\nNe vous inquitez pas pour a! Contentez-vous de tenir ces monstres en respect et nous nous occuperons du reste! Un vrai jeu d\enfant, vous verrez!', '', '', '', '', '', '', 47187),
(66039, 'frFR', 'Le temps de Chromie', 'Trouvez Chromie et accomplissez le rituel de stabilisation temporelle.', 'C\est l\Empire noir. Il semblerait que nous ayons russi  remonter trs loin dans le temps.\n\nRegardez! J\aperois Chronormu et ternia! Nous devons nous dpcher et achever le rituel.\n\nJ\ai beau tre curieux, je ne tiens pas  dcouvrir o elles risquent d\atterrir la prochaine fois.', '', '', '', '', '', '', 47187),
(66038, 'frFR', 'Course  travers le temps!', 'Foncez  travers le temps, en suivant la trace de Chromie et ternia.', '$n, nous devons agir vite pour rattraper Chronormu, et j\emploie cette expression au sens propre.\n\nZera et moi allons faire tout notre possible pour acclrer notre progression, mais il est impratif d\entrer le moins possible en contact avec cette poque. Cela nous ralentirait et nous empcherait peut-tre de rattraper Chronormu avant qu\elle ne soit perdue, mme pour Nozdormu.\n\nNous n\avons pas un instant  perdre!\n\n|cFF0000FF(Accepter cette qute lancera un dcompte)|r', '', '', '', '', '', '', 47187),
(66037, 'frFR', 'Retour  la ralit', 'Retournez voir Nozdormu dans le prsent.', 'Nous avons pu renforcer le lien de Chronormu avec notre poque. Nul doute que la prochaine fois que nous la trouverons, nous serons en mesure de finaliser le rituel.\n\nPour le moment, retournons dans notre prsent et dans un monde abritant nettement moins de Murlocs.', '', '', '', '', '', '', 47187),
(66036, 'frFR', 'Mugurlglrlgl!', 'Murglgulglrrlglgul!', 'Mrglgulglrrlglgul! Grurguglullgurl!\n\nGruglrlgllrugl rrgulgrulgrgl grugll gurgull gur. Murgllgllrugl gurgllglrl Murgul gruggullgl. Murguglegurgllgur gurgll gurgulgul guruulgurllgr guuglrllgl.\n\nMgrgulllglll gurl gugll.\n\n<Vous n\tes pas $gcertain:certaine; de ce qui se dit, mais les paroles sont accompagnes de nombreuses gesticulations. Il semblerait que ce Murloc vous demande de tuer quelque chose.>', '', '', '', '', '', '', 47187),
(66035, 'frFR', 'Granules murlocs', 'Drainez $1oagranules temporels.', 'Une ligne temporelle alternative reposant sur les Murlocs?\n\nVeuillez pardonner mon gosme, mais pourriez-vous rcuprer quelques granules temporels pendant que vous recherchez Chronormu?\n\nIl vous suffit d\y pntrer, votre bton de marcheur du temps fera le ncessaire. J\examinerai les donnes lorsque nous aurons termin notre petite excursion dans les diffrentes ralits d\Azeroth.', '', '', '', '', '', '', 47187),
(66033, 'frFR', 'Vers le pass?', 'Franchissez le portail et allez voir Andantenormu en Azmerloth.', 'Il est regrettable que nous ne soyons pas parvenus  stabiliser Chronormu, mais il existe un autre endroit potentiel o nous pourrions l\attraper et mettre un terme  sa chute dans le temps.\n\n<Nozdormu fronce les sourcils.>\n\nLes visions de cette ligne temporelle passe sont tranges, mme pour moi.\n\nRestez sur vos gardes, $n. Il est difficile de savoir ce que vous allez affronter, mais cette menace semble puissante et trangement familire.', '', '', '', '', '', 'Franchissez le portail et allez voir Andantenormu en Azmerloth.', 47187),
(66032, 'frFR', 'Retourner dans le prsent', 'Retournez voir Nozdormu dans le prsent.', 'Cette ligne temporelle est domine par les tnbres et le chaos. La perturbation l\a grandement affecte. Je vais m\attarder ici pour aider  mettre fin aux derniers drglements encore susceptibles de se produire.\n\nRetournez voir Nozdormu. Il doit tre inform de notre russite, mme si elle n\est pas aussi totale qu\escompte.', '', '', '', '', '', '', 47187),
(66031, 'frFR', 'Trouver le temps', 'Rcoltez de l\Essence lmentaire pour le camp des survivants.', 'Je suppose qu\il n\y a rien d\tonnant  me retrouver ici.\n\nCe n\est pas l\Azeroth que j\avais appele de mes vux, mais c\est celle que j\ai. Nous nous battons pour prserver ce qui peut encore l\tre et reconqurir le monde, mais votre arrive a provoqu quelques problmes.\n\nNous nous servons de l\essence de ces lmentaires pour alimenter nos protections et garantir notre scurit. Vous voyez ce bouclier? C\est la seule chose qui nous permette de cacher nos troupes et de ne pas nous faire massacrer, mais vous avez puis nos ressources. Si vous nous rapportez un peu de cette essence, nous pourrons peut-tre survivre un jour de plus.', '', '', '', '', '', '', 47187),
(66030, 'frFR', 'Une rsistance toujours utile', 'Soignez les rsistants et rsistantes de l\avenir des Primalistes.', 'Les ondes temporelles ont caus des soucis aux gens d\ici. Des nues ennemies apparaissent l o elles ne devraient pas, ou sont bien plus puissantes qu\elles ne devraient l\tre. De tels changements, mme mineurs, peuvent avoir des consquences dsastreuses.\n\nJe vous demande de porter secours aux membres de la rsistance de cette ralit. Soignez leurs blessures et remettez-les en tat de combattre. Ramenez leur ligne temporelle sur sa vritable trajectoire, comme si elle n\avait jamais crois la ntre. Ce n\est pas grand-chose, mais c\est tout ce que nous pouvons faire pour les aider.', '', '', '', '', '', '', 47187),
(66029, 'frFR', 'Affinage temporel', 'Utilisez le chronocristal sur ternia et Chromie dans l\avenir des Primalistes pour les empcher de tomber dans le temps.', 'Chronormu et ternia chutent dans le temps, mais je sens qu\elles s\arrtent priodiquement. Ces brefs moments sont notre chance de les retrouver.\n\n<Nozdormu fait apparatre un petit chronocristal.>\n\nElles ont atterri dans un avenir potentiel particulirement inquitant. J\ai imprgn ce cristal de puissance et de ma propre rsonance temporelle. Trouvez-les et utilisez-le. Avec un peu de chance, vous parviendrez  figer leur position et  les empcher de sombrer  nouveau dans le temps.', '', '', '', '', '', 'Retournez voir Nozdormu dans le prsent.', 47187),
(66028, 'frFR', 'Pour l\avenir!', 'Rendez-vous  l\avenir des Primalistes.', 'J\ai suivi la piste de Chronormu et ternia jusque dans un futur potentiel. Je ne sais pas ce que vous y trouverez, hormis les tnbres et le chaos qui y rgnent.\n\nSoridormi a pris les devants avec une partie des ntres pour stabiliser notre lien avec cette poque. Son immense pouvoir ne sera pas de trop pour maintenir le portail ouvert, aussi s\appuiera-t-elle sur vos talents.\n\nSoridormi sera en mesure de vous donner de plus amples informations lorsque vous la rejoindrez.\n\nDpchez-vous, $n. Trouvez Chronormu.', '', '', '', '', '', 'Parlez  Soridormi  l\avenir des Primalistes.', 47187),
(66027, 'frFR', 'Appel aux Dragons bleus', 'Observez Kalecgos alors qu\il rappelle le Vol draconique bleu.', 'Il est grand temps de surmonter mes craintes  l\ide de runir les Dragons bleus, $n. Si nous ne renouons pas les liens familiaux, nous resterons  jamais l\ombre de ce que nous tions autrefois.\n\nSi la pierre de vu m\chappe encore, je peux tout de mme utiliser son pouvoir pour envoyer un message  l\ensemble de mes congnres.\n\nL\heure est venue pour mes frres et surs de reprendre contact avec leur Aspect.', '', '', '', '', '', '', 47187),
(66026, 'frFR', 'Urgence vitale', 'Allez trouver Brena en territoire fougerobe.', 'Ce sont trs probablement les Gnolls fougerobes qui sont  l\origine de ces attaques.\n\nCela fait des gnrations que nous sommes en guerre avec eux, mais jusqu\ prsent, ces rustres n\taient gure plus qu\une vulgaire pine dans notre pied.\n\nAujourd\hui, avec cette corruption abjecte qui menace de dtruire la trave d\Azur et l\objet de vos recherches, nous n\avons d\autre choix que de prendre des mesures drastiques.\n\nRetrouvez-moi prs du territoire des Fougerobes. Nous allons avoir besoin de toute l\aide possible.', '', '', '', '', '', '', 47187),
(66025, 'frFR', 'La menace nokhud', 'Parlez des prochaines tapes  entreprendre.', 'L\arme du clan des Nokhuds assige Maruuka.\n\nDiscutons de ce qu\il convient de faire dans les chambres des khans. Nous devons protger les Maruuks.', '', '', '', '', '', '', 47187),
(66024, 'frFR', ' la rescousse des Centaures', 'Tuez la garde Bahir.', 'Les Nokhuds se repaissent des histoires de guerre de notre peuple. Mais en ralit, ces bravaches sont faibles et ne font que jouer la comdie. D\un seul clair de foudre, ces lches ont rompu leur lien avec Ohn\ahra.\n\nSi les Nokhuds dcident d\emprunter la voie de la corruption pour provoquer la guerre, qu\il en soit ainsi!\n\nSans surprise, Bahir a t laisse aux commandes pour couvrir sa fuite. Son sang coulera bientt.', '', 'Place aux commandes par Balakar, Bahir attend ce moment depuis longtemps.', 'Garde Bahir', '', '', 'Retournez voir la khanam matra Sarest', 47187),
(66023, 'frFR', 'Rupture de trve', 'Tuez $1oamembres du clan des Nokhuds.', 'Balakar dshonore son clan. Aveugl par sa soif de pouvoir, il l\entrane dans la tempte.\n\nLeur trahison est un signe de faiblesse. Abattez-les.', '', '', '', '', '', '', 47187),
(66022, 'frFR', 'La khanam Matra', 'Prsentez-vous au garde du khanat Akato pour participer  l\audience de Gmisath avec la khanam matra.', 'Je ne peux pas rester en territoire centaure; je dois retourner aux jardins au plus vite.\n\nLa khanam matra a accept d\entendre notre appel  l\aide. Elle attend mon arrive au sommet du Krutal, le btiment au centre de Maruuka.\n\nJe dois d\abord m\entretenir avec elle en priv, mais vous pourrez ensuite vous joindre  nous.', '', '', '', '', '', '', 47187),
(66021, 'frFR', 'Un accueil glacial', 'Terrassez $1oaCentaures nokhuds.', 'Ha! Regardez-vous. Vous tes faible, tout comme les moins que rien qui vous ont $gamen:amene; ici.\n\nVous voulez connatre les Nokhuds? Nous nous exprimons avec nos armes.\n\nNotre rituel de bataille s\appelle le tabarr. Nous nous entranons. Nous nous affrontons, et cela nous endurcit. Notre clan ne connat pas la faiblesse.\n\nAssez parl. Allez vous entraner.', '', '', '', '', '', 'Retournez voir l\claireuse Tomul.', 47187),
(66020, 'frFR', 'Augures et encens', 'Cueillez $1oadoucefeuilles en fleurs, crasez-les pour obtenir de l\encens de doucefeuille et aidez l\ohn Seshteng  accomplir le rituel.', 'J\ai transmis  la khan Tigari le prsage que nous avons reu avant d\entrer  Maruuka. Elle s\est montre inquite, car le vent lui paraissait bien froid  elle aussi.\n\nNous cultivons ici certaines fleurs, qui peuvent tre rduites en poudre et brles pour entrer dans une sorte de transe. C\est une faon pour nous d\approfondir notre lien avec un prsage.\n\nJe vous demanderai d\aller chercher quelques-unes de ces fleurs, pour que nous puissions prparer un encens  brler. Avec l\aide de ma khan, nous pourrons peut-tre en apprendre davantage sur le sort d\Ohn\ahra.', '', '', '', '', '', '', 47187),
(66019, 'frFR', 'Hommage  nos anctres', 'Aidez Qariin Dotur  cuisiner un plat pour les anctres.', 'Marchant  nos cts sur les vents d\Ohn\ahra, nos anctres nous guident et nous protgent. Tous les Maruuks, de ce monde ou du suivant, se rassemblent lors de la trve du khural.\n\nL\odeur de ce repas appelle les anctres  rejoindre notre campement.  leur arrive, le khural pourra commencer.', '', '', '', '', '', '', 47187),
(66018, 'frFR', 'Clan des Nokhuds', 'Accompagnez Tomul  la rencontre de la garde Bahir.', '<Okir interprte les gestes de la khan Sansok.>\n\nLe clan des Nokhuds est le dernier en date  s\tre arrog le pouvoir. Son prcdent khan, Jhakan, avait lev une puissante arme pour s\emparer du territoire de son prdcesseur. Ainsi vont les coutumes de notre peuple.\n\nMais si Jhakan a gagn le respect de toutes et tous, ce n\est pas le cas de son fils. Balakar a tu son pre afin de prendre le contrle du clan, qui vit en autarcie depuis lors. Pour comprendre les Maruuks, il vous faut les connatre.', '', '', '', '', '', 'Retrouvez l\claireuse Tomul prs du campement des Nokhuds.', 47187),
(66017, 'frFR', 'Clan des Ohn\irs', 'Retrouvez l\ohn Seshteng aux bassins mystiques.', '<Okir interprte les gestes de la khan Sansok.>\n\nSur nos terres, les mystiques comme l\ohn Seshteng appartiennent au clan des Ohn\irs. Le clan n\est pas constitu de familles, mais plutt de Centaures provenant des quatre coins de la plaine et qui ont un lien inn avec Ohn\ahra. Ces mystiques consacrent leur vie entire  renforcer ce lien et  affiner leurs comptences.  terme, ces sages ont pour rle de conseiller les diffrents clans et de protger nos terres.\n\nOhn Seshteng est alle parler  sa khan du prsage qu\elle a reu. Rejoignez-la pour en apprendre davantage sur les Ohn\irs.', '', '', '', '', '', 'Retrouvez l\ohn Seshteng aux bassins mystiques.', 47187),
(66016, 'frFR', 'Clan des Teeras', 'Allez voir Qariin Dotur.', '<Okir interprte les gestes de la khan Sansok.>\n\nLe clan des Teeras est celui de notre khanam matra, notre lien direct avec nos anctres maruuks. Ce clan a pour charge de sauvegarder nos traditions et de conter nos lgendes.\n\nPour comprendre les Maruuks, il vous faut comprendre le clan des Teeras. L\une des filles de la khanam matra, Qariin Dotur, est en train de prparer un repas pour nos anctres. Venez-lui en aide, et elle vous enseignera les voies de notre peuple.', '', '', '', '', '', 'Allez voir Qariin Dotur.', 47187),
(66015, 'frFR', 'La pierre de vu des Dragons bleus', 'Allez rcuprer la pierre de vu des Dragons bleus avec Kalecgos.', 'La trave d\Azur est stabilise jusqu\ nouvel ordre et d\autres Dragons bleus ont rejoint nos rangs in extremis.\n\nIl est temps de regagner les archives afin de rcuprer la pierre de vu.\n\nVous nous avez t d\une grande aide au cours de cette preuve, et je vous saurais gr de bien vouloir nous accompagner, $n.', '', '', '', '', '', '', 47187),
(66011, 'frFR', 'En souvenir d\Ysera', 'Retrouvez Thramus une fois de plus.', 'Oh non! Je crois que je comprends enfin Si Thramus est aussi triste, c\est parce qu\Ysera lui manque et qu\elle ne peut pas revenir.\n\nVenez! Je crois savoir o il est parti. Nous ne l\embterons pas plus longtemps, mais je tiens  lui prsenter mes excuses et  lui dire de prendre tout le temps qu\il faudra.\n\nNous sommes l pour nous soutenir, au sein de la nature qui nous entoure.', '', '', '', '', '', '', 47187),
(66009, 'frFR', 'La dfense du Vakthros', 'Terrassez Korthrox le Destructeur.', 'Voici venu l\instant de vrit, $n. Maintenant que vous avez pris les choses en main au sol, les troupes ariennes ennemies commencent  se disperser.\n\nGrce  vous, Raszageth a appel l\un de ses lieutenants en renfort afin de soutenir les Primalistes.\n\nOccupez-vous de ce monstre pendant que je vais affronter Raszageth et aider Khadgar.\n\nOuvrez l\il au cours de votre combat. Je ferai de mon mieux pour vous seconder  l\aide de mes pouvoirs.\n\nRaszageth va enfin tter de la fureur de l\Aspect de la magie!', '', 'Ce lieutenant de Raszageth brle de prcipiter la ruine des Dragons bleus.', 'Korthrox le Destructeur', '', '', 'Parlez  Khadgar plus haut dans le Vakthros.', 47187),
(66007, 'frFR', ' l\air libre', 'Dtruisez $1oabalises de lave.', 'Les Primalistes se servent de ces orbes gigantesques pour tenir Kalecgos en respect.\n\n ce rythme, notre ami ne sera bientt plus en tat de se battre et je doute de pouvoir repousser Raszageth  moi seul.\n\nServez-vous de la gemme renforce que vous avez en votre possession pour vous dguiser en lmentaire et vous approcher sans vous faire reprer.\n\nDtruisez ces orbes et Kalecgos sera libre de dchaner sa pleine puissance.\n\nDe mon ct, je me charge de protger la tour face  Raszageth.', '', '', '', '', '', 'Allez voir Kalecgos dans une grotte du sommet du Vakthros.', 47187),
(66006, 'frFR', 'Retour auprs de Roscha', 'Rapportez les fournitures  la marchale-ferrante Roscha.', 'Baba s\est repos et nous avons rcupr les fournitures de Roscha. Nous pouvons rentrer sans rajouter  ses inquitudes.\n\nPrenez quelques-unes de ces botes quand vous vous mettrez en route. J\enverrai des guerriers et guerrires pour rcuprer le reste.', '', '', '', '', '', '', 47187),
(66005, 'frFR', 'Le mdaillon d\une amie disparue', 'Rapportez le mdaillon d\une amie disparue  Khasar.', '<Ce morceau de mtal mchouill tait autrefois un magnifique ornement de grande importance pour une Centaure shikaar.\n\nKhasar en saura peut-tre davantage sur sa propritaire.>', '', '', '', '', '', 'Rapportez le mdaillon d\une amie disparue  Khasar.', 47187),
(66004, 'frFR', 'Galgresh', '', '', '', '', '', '', '', '', 47187),
(66003, 'frFR', 'Des anneaux pour les unir', 'Rcuprez $1oaanneaux de lien magmatique.', 'Le peuple djaradin s\enhardit. Il lie des lmentaires de flammes et les dchane dans la rgion. La faune a fui et les lmentaires se rapprochent dangereusement de nos camps.\n\nHeureusement, j\ai pu riger un petit bastion de pierre pour rsister  cette tempte de feu et nous n\chouerons pas!\n\nRcuprez les anneaux magiques qui lient ces lmentaires de flammes, ils nous permettront de crer des dfenses contre leurs attaques.', '', '', '', '', '', '', 47187),
(66001, 'frFR', 'Un dernier espoir', 'Sauvez le dernier uf de Dragon imprgn.', 'Une couve entire de jeunes Dragonnets perdue.\n\n<Sendrax se redresse et relve le menton.>\n\nIl reste un endroit que nous n\avons pas encore fouill. L\immense site de rituel o ce proto-dragon a dpos les ufs.\n\nAttaquons leurs cruelles dfenses ensemble, $p, et sauvons tout ce que nous pourrons.', '', '', '', '', '', '', 47187),
(66000, 'frFR', 'La bibliothque d\Alexstrasza', 'Sauvez $1oauvres de grande importance culturelle.', '<Les pages de ce livre sont calcines.\n\nLes Primalistes mettent le feu aux tomes antiques entreposs ici, mettant en pril l\hritage des Vols draconiques.  croire que les Primalistes cherchent  rayer toute mention des Vols draconiques des livres d\histoire\n\nSauvez ce qui peut encore l\tre.>', '', '', '', '', '', '', 47187),
(65999, 'frFR', 'Rouges jusqu\au bout des crocs et des griffes', 'Tuez $1oaenvahisseurs et envahisseuses primalistes.', 'Le commandant Lthanak a prvenu toutes les recrues que selon les rapports reus, la Mange-temptes Raszageth s\est chappe de sa prison. Il semblerait que ses fidles aient suivi son exemple et menacent  prsent tout ce qui nous est cher.\n\nLa situation volue trs vite. Ces ruines taient encore abandonnes lors de la dernire patrouille.\n\nNous devons arrter les Primalistes ici.\n\nPour la Lieuse-de-Vie, et pour tous les Vols draconiques!', '', '', '', '', '', '', 47187),
(65998, 'frFR', 'Vols et avenir', 'Sauvez les ufs des Dragons rubis.', 'Il n\y a pas de plus grand honneur pour un Draknide que de se voir confier la dfense des ufs de Dragons au pril de sa vie.\n\nC\est pour cela que nous nous entranons. C\est notre raison d\tre.\n\nJe ne peux plus me contenter d\observer sans agir, $p. En volant et en imprgnant ces ufs, les Primalistes mettent en pril l\avenir des Vols draconiques tout entier!\n\nNous sommes en large infriorit numrique, mais vous tiendrez-vous  mes cts? Vous battrez-vous pour sauver les Vols draconiques?', '', '', '', '', '', '', 47187),
(65997, 'frFR', ' la recherche de Sendrax', 'Trouvez Sendrax dans les ruines du conservatoire de la Lieuse-de-Vie.', 'La cadette Sendrax est passe par ici il y a peu.\n\nElle a relay les ordres du commandant Lthanak pour que tous les Draknides se rassemblent aux bassins de l\Essence. Notre rgiment de dfense tout entier s\est mis en route peu de temps aprs.\n\nMais nos groupes de reconnaissance taient en patrouille dans les vieilles ruines, elle y est donc entre pour les rallier eux aussi.', '', '', '', '', '', 'Allez voir Sendrax dans le conservatoire de la Lieuse-de-Vie.', 47187),
(65996, 'frFR', 'Renforts de vtrans', 'Venez en aide aux gardes blesss et trouvez Sendrax.', 'Le commandant Lthanak a t perspicace, comme toujours. Nous allons avoir besoin de l\aide de nos gardes les plus chevronns pour contrer cette menace. Les rassembler tait une tche idale pour une jeune cadette comme Sendrax, mais elle va probablement avoir besoin de soutien.\n\nSendrax est partie vers l\ouest, une zone qui a peut-tre t envahie par nos adversaires. Prenez cette dcoction et apportez votre aide  celles et ceux qui pourraient en avoir besoin.', '', '', '', '', '', 'Allez voir Sendrax  l\avant-poste du Conservatoire.', 47187),
(65995, 'frFR', 'La citadelle d\Obsidienne', 'Apportez les plans de Qalashi  Irion.', '< premire vue, ces plans semblent reprsenter les dispositifs de communication interne entre les camps djaradins.\n\nVous remarquez les mots citadelle d\Obsidienne.\n\nIrion aimerait sans doute y jeter un coup d\il.>', '', '', '', '', '', '', 47187),
(65994, 'frFR', 'Justice djaradine', '', '', '', '', '', '', '', '', 47187),
(65993, 'frFR', 'Rabat-joie', 'Tuez la hache-viande Sotok au donjon Craqucaille.', 'Ah, oui.\n\nAprs mon arrive, j\ai aperu la cheffe de ces Gants de retour d\un raid. Elle est en train de fter leur victoire, quelque part dans le camp. \n\nCe serait vraiment dommage que quelqu\un vienne gcher ses petites rjouissances, non?', '', 'La tte pensante de la terrible attaque de l\avant-poste de Cur-de-Dragon.', 'Hache-viande Sotok', '', '', 'Allez voir Irion  l\intrieur du donjon Craqucaille.', 47187),
(65992, 'frFR', 'Renseignements de la Griffe noire', 'Parlez aux espions et espionnes d\Irion dans le donjon Craqucaille.', 'Alors que Slistra et moi attirions leur attention dans les cieux, des ombres se sont glisses  travers leurs dfenses.\n\nMes agents, les Griffes noires, gardent un il et une oreille attentive dans tout le donjon. Partez  leur rencontre et faites-leur savoir que vous tes de notre ct. Ils vous donneront de prcieux renseignements sur nos adversaires.', '', '', '', '', '', 'Allez voir Irion  l\intrieur du donjon Craqucaille.', 47187),
(65991, 'frFR', 'L\heure du jugement', 'Allez voir Irion et Slistra dans le donjon Craqucaille.', 'La cadette Sendrax m\a fait part des plans de notre camriste. La Lieuse-de-Vie soit loue, son aide nous est prcieuse. Ses actions nous offrent un sursis indispensable pour ramener nos blesss aux bassins de l\Essence et prendre soin d\eux.\n\nJ\aimerais pouvoir envoyer des renforts  Slistra, mais je dois garder mes troupes prs des blesss. Pourriez-vous aller  sa rencontre dans le bastion ennemi?\n\nS\il y avait un autre moyen de rgler la menace djaradine, j\y aurais volontiers recours, mais\n\nFaites le ncessaire.', '', '', '', '', '', '', 47187),
(65990, 'frFR', 'Dlivrer les Dragonnets du mal', 'Sauvez $1oajeunes Dragonnets gmissants dans l\avant-poste de Cur-de-Dragon.', 'Ces fourbes nous sont tombs dessus sans crier gare. Mes gardes ont tenu aussi longtemps que possible pour nous permettre d\vacuer les faibles et les jeunes, mais je crains qu\il en reste encore dans l\avant-poste.\n\nTraversez ce pont et cherchez des survivants.', '', '', '', '', '', '', 47187),
(65989, 'frFR', 'Invasion djaradine', 'Tuez $1oaunits djaradines  l\avant-poste de Cur-de-Dragon.', 'Nous ne sommes peut-tre pas en mesure de reprendre notre avant-poste, mais cela ne veut pas dire que nous devons nous rendre sans combattre.\n\nMontrez-leur qu\on ne se laissera pas faire.', '', '', '', '', '', '', 47187),
(65977, 'frFR', 'Au secours du Kirin Tor', 'Secourez $1oamages  l\agonie.', 'Lorsque les Primalistes ont attaqu notre expdition, j\ai bien cru que nous avions dfinitivement perdu bon nombre de nos mages.\n\nMais apparemment, l\adversaire les retient en otages et s\amuse  les torturer en ce moment mme!\n\nSecourez les mages qui sont toujours entre leurs griffes, je vous prie. Les pauvres ne seront peut-tre pas en tat de nous aider dans ce combat, mais ce n\est pas une raison pour les abandonner.', '', '', '', '', '', 'Allez voir la projection de Khadgar encore plus loin dans le massif du Vakthros.', 47187),
(65962, 'frFR', 'Compte  rebours sempiternel', 'Allez parler  Chromie lorsque vous serez $gprt:prte;.', 'Jamais je n\aurais imagin que nous sauverions notre temple en liminant le systme de scurit que nous avions mis en place pour le protger!\n\nNous sommes dbarrasss des lmentaires du temps, nos marcheurs du temps sont librs et nos gardiens sont prts. L\heure est donc venue de percer la dernire bulle de stase et de nous occuper d\ternia.\n\nFaites-moi signe quand vous serez $gprt:prte;. Avec vous  mes cts, je sais que tout va bien se passer.', '', '', '', '', '', '', 47187),
(65958, 'frFR', 'Puissance primordiale', 'Servez-vous du focalisateur lmentaire pour drainer l\nergie lmentaire des Primalistes et des lmentaires tombs au combat.', 'Il m\est de plus en plus difficile de maintenir mes images miroirs, tant les Primalistes se dmnent pour m\abattre.\n\nNe cdons pas  la panique pour autant, car j\ai un plan.\n\nPrenez l\orbe que vous avez rcupr et recueillez la magie lmentaire des cadavres de Primalistes.\n\nNous en aurons besoin pour dtourner leurs troupes de ma personne.', '', '', '', '', '', 'Allez voir la projection de Khadgar encore plus loin dans le massif du Vakthros.', 47187),
(65957, 'frFR', 'Hrosme superflu', 'Tuez Modak la Crache-flamme, la perceuse Gigra et Olphis le Magmatique.', 'D\aprs nos observations, la socit djaradine repose sur la force. Les plus froces servent d\exemple aux autres qui se battent avec d\autant plus d\ardeur. \n\nLes troupes alignes en contrebas comptent dans leurs rangs trois des plus redoutables Djaradins et Djaradines qui soient et qui seront vos cibles du jour.\n\nJe vous charge de les liminer personnellement, $n. Leur mort devrait porter un coup terrible au moral de leurs congnres.', '', '', '', '', '', '', 47187),
(65956, 'frFR', 'Coup de serre', 'Dfenses djaradines perturbes.', 'Avec votre aide, mes assassins de la Griffe noire nous dbarrasseront des troupes djaradines qui assurent la dfense du primtre extrieur. Marquez les cibles avec une petite bombe tourdissante afin de les appeler  vos cts.\n\nFaites vite et liminez tout obstacle susceptible d\entraver notre progression.', '', '', '', '', '', '', 47187),
(65955, 'frFR', 'Le meilleur ami des Centaures', 'Librez Khasar et rejoignez-le dans la grotte.', 'Il est imprudent de rester  dcouvert, $p.\n\nLes Gorlocs ont forc mon compagnon de chasse, Baba,  se rfugier dans une grotte  l\est d\ici.\n\nLibrez-moi, puis nous irons secourir Baba. Je vous retrouverai dans la grotte quand la voie sera dgage.', '', '', '', '', '', '', 47187),
(65954, 'frFR', 'Lcher les chiens', 'Librez les bakars shikaars.', 'J\ai entendu les aboiements et les hurlements des bakars qui ont disparu du camp.\n\nNos chiens adors sont pigs dans des cages et attendent d\tre mis en pices par ces ces choses.\n\nNous sommes responsables du bien-tre de nos compagnons. Librez-les et soyez tmoin de la vritable puissance d\un bakar shikaar!', '', '', '', '', '', '', 47187),
(65953, 'frFR', 'Profanation des vents', 'Rcuprez $1oatotems sur des chamans gorlocs.', 'De toutes les trangets du village des Gorlocs, rien ne m\a plus tonn que leurs chamans.\n\nCes viles cratures sont particulirement cruelles et s\amusent  manipuler la magie des temptes sans s\inquiter des consquences de leurs actes.\n\nNous devons mettre un terme  leurs agissements. Tuez-les et rapportez-moi leurs totems. Ils devraient intresser nos mystiques.', '', '', '', '', '', '', 47187),
(65952, 'frFR', 'Un chef lgendaire', 'Tuez le chef Grrlgllmesh.', 'Les Gorlocs de ce marais taient autrefois des cratures tout ce qu\il y a de plus ordinaires. Des parasites, certes, mais qui n\auraient jamais os piller nos villages, voler nos biens et manger nos chiens.\n\nC\est leur chef, Grrlgllmesh, qui est responsable de cette drive.\n\nAbattez-le, et les Gorlocs ne nous menaceront plus.', '', 'Il ne reste  Grrlgllmesh, le plus puissant des Gorlocs, que ses yeux pour pleurer.', 'Chef Grrlgllmesh', '', '', '', 47187),
(65951, 'frFR', 'Fournisseur exclusif', 'Cherchez Khasar dans les bois.', 'Pauvre Roscha! Elle a travaill d\arrache-pied pour la caravane, mais ces ignobles Gorlocs ont vol son matriel\n\nAvec tout ce qu\elle a perdu, je fais de mon mieux pour l\aider.\n\nKhasar a d partir seul  la recherche de ses fournitures, sans rien dire  personne. Ce serait bien son genre. Mais voil bien trop longtemps qu\on ne l\a plus vu, et de nombreux chiens manquent aussi  l\appel.\n\nAccepteriez-vous de partir  la recherche de Khasar et des chiens, $p?', '', '', '', '', '', 'Parlez  Khasar dans le village des Nageboue.', 47187),
(65950, 'frFR', 'Gorlocs chapardeurs', 'Rapportez les fournitures voles du village des Nageboue.', 'La marchale-ferrante Roscha est-elle invite  voyager avec la caravane? Non! Mais qui est charge de fournir des fers pour toute la caravane? Roscha. De qui les Nageboues volent-ils le matriel? Roscha, bien videmment. Pff!\n\nJ\enverrais bien Khasar  leurs trousses, mais o est-il encore pass?\n\nTrouvez mes fournitures, et apprenez  ces fripouilles qu\on ne vole pas impunment la marchale-ferrante Roscha.\n\nEt plus vite que a!', '', '', '', '', '', 'Parlez  Khasar dans le village des Nageboue.', 47187),
(65949, 'frFR', 'La ferrante', 'Rapportez le mdaillon  la marchale-ferrante Roscha.', 'Quand nous rejoignons Ohn\ahra sur les ailes du vent, nous laissons ces mdaillons derrire nous.\n\nJ\ai certes contribu  la fabrication de celui-ci, mais il ne m\appartient pas.\n\nIl devrait tre restitu  Roscha. C\est tout ce qu\il reste de sa promise.\n\nApportez-le-lui pour qu\elle puisse faire son deuil et tre en paix.', '', '', '', '', '', '', 47187),
(65948, 'frFR', 'Les fissures du temps', 'Renforcez votre bton de marcheur du temps avec les cristaux est et ouest.', 'Quand le temple s\est referm, nos gardiens se sont retrouvs pris au pige derrire ses portes. Nous devons faire clater cette bulle de stase pour les librer! Mais pour ce faire, vous allez avoir besoin d\un bton pleinement oprationnel\n\nMais j\y pense! Vous pourriez drainer les cristaux prsents sur les plateformes pour rcuprer la puissance ncessaire.\n\nIls disposent de leurs propres champs de stase. Vous n\aurez qu\ les dloger et absorber leur nergie avec votre bton.\n\nEt s\ils se brisent, pas d\inquitude: leur pouvoir reste prsent mme dans les morceaux!', '', '', '', '', '', '', 47187),
(65947, 'frFR', 'Marcheurs du temps scells par le temps', 'Librez $1oamarcheurs et marcheuses du temps des bulles temporelles.', 'Vous arrivez  point nomm! J\ai besoin de vous pour stabiliser la situation sur les plateformes pendant que Dante et Zera m\aideront  retenir notre amie Dragonne de l\infini.\n\nLes mesures de scurit du temple ont emprisonn ternia dans une bulle de stase temporelle quand elle a tent de prendre le contrle de notre pierre de vu. Malheureusement, les autres marcheurs du temps se sont aussi fait piger par la mme occasion.\n\nVotre bton de $gmarcheur:marcheuse; du temps devrait vous permettre de les librer Mais prenez garde aux enfants du temps qui risquent de faire leur apparition!', '', '', '', '', '', '', 47187),
(65944, 'frFR', 'Explosion de lave', 'Dtruisez $1oaorbes de lave.', 'Les Primalistes ont scind la montagne en deux et leurs troupes affluent en masse dans le Vakthros!\n\nJ\ai aperu des orbes de lave dans le couloir initial. Nos adversaires s\en servent pour propager encore davantage leur chaos lmentaire.\n\nDtruisez-les afin de ralentir leur progression. Kalecgos et moi-mme ferons de notre mieux depuis les hauteurs.', '', '', '', '', '', 'Allez voir la projection de Khadgar un peu plus loin dans le massif du Vakthros.', 47187),
(65943, 'frFR', 'Offensive primordiale', 'Terrassez $1oaPrimalistes dans le Vakthros.', 'Khadgar et moi-mme faisons de notre mieux pour tenir en respect les Primalistes dans le ciel, mais nous n\arrivons pas  nous approcher de cette tour.\n\nNous devons d\abord affaiblir leurs troupes au sol. C\est le seul moyen d\atteindre Raszageth afin de l\arrter avant qu\il ne soit trop tard.\n\nTaillez-vous un chemin  travers les rangs des Primalistes. Si je parviens  rester suffisamment concentr, une autre image miroir vous attendra de l\autre ct.', '', '', '', '', '', 'Allez voir l\image miroir de Kalecgos un peu plus loin dans le massif du Vakthros.', 47187),
(65940, 'frFR', 'Par une route difficile', 'Accompagnez la caravane du clan des Shikaars jusqu\au gu des rivires.', 'J\espre que a ne vous drange pas de vous mouiller les pieds La prochaine partie de notre voyage va nous faire traverser deux cours d\eau.\n\nL\ohn Seshteng souhaiterait vous raconter une histoire sur notre gardienne sacre, Ohn\ahra. Je me fais une joie de vous laisser avec elle.', '', '', '', '', '', '', 47187),
(65939, 'frFR', 'Le courage de ses convictions', 'Prenez le contrle de la citadelle d\Obsidienne.', 'La prochaine bataille sera sans doute froce, mais notre courage et notre dtermination viendront  bout de leur supriorit numrique.\n\nJe compte sur votre exceptionnelle habilet pour nous aider  conduire nos troupes  la victoire.\n\nNous donnerons l\assaut  votre signal.', '', '', '', '', '', '', 47187),
(65938, 'frFR', 'L\quipe du pass et de l\avenir', 'Utilisez votre bton de marcheur du temps pour dloger la bulle de stase de la porte du temple.', 'Bien! Il est temps de dissiper la bulle de stase des portes du temple et de librer nos gardiens! tes-vous $gprt:prte; pour une lutte acharne contre le temps lui-mme?\n\nTirez sur la bulle de la porte comme vous l\avez fait avec les cristaux. Et restez sur vos gardes! Toute l\nergie temporelle ainsi libre ne manquera pas de s\en prendre  vous. Je ne sais pas ce qui vous attend, mais quoi qu\il arrive, vous aurez les gardiens librs  vos cts.\n\nBonne chance, $n!', '', '', '', '', '', '', 47187),
(65937, 'frFR', 'Preuve de ngligence', 'Trouvez une preuve de la dgradation des Lilas enchanteurs et apportez-la  Thramus.', 'On ne peut pas baisser les bras. Il faut qu\il comprenne ce qui se passe! S\il refuse de sortir de sa grotte, nous allons devoir lui apporter une preuve irrfutable.\n\nN\importe laquelle fera l\affaire. Ce ne sont pas les problmes qui manquent, entre la flore corrompue et la faune hostile.', '', '', '', '', '', '', 47187),
(65935, 'frFR', 'Rattraper Chromie', 'Retrouvez Chromie sur les plateformes de la Confluence Temporelle.', 'Grce  vous, nous avons repris l\avantage au sol, mais je sens que nous ne sommes pas au bout de nos peines sur les plateformes du temple. Envolons-nous et retrouvons l\ambassadrice Chronormu.\n\nComme toujours, le temps presse.', '', '', '', '', '', '', 47187),
(65930, 'frFR', 'Un combat entre le vent et l\eau', 'Affrontez Kraunot, l\esprit des airs, prs de l\Anse-aux-Loupiotes de Kauriq.', 'On devrait pouvoir affronter les esprits,  prsent.\n\nComment, Ruriq ne vous a rien dit? Comme le veut la tradition, on doit affronter les esprits en combat avant de pouvoir leur demander une faveur. Votre performance influera sur la force de leur bndiction.\n\nC\est peut-tre pour a que la Pche-Loupiotes a insist pour qu\on travaille ensemble.\n\nSi vous affrontez Kraunot, l\esprit des airs, Ruriq et moi, on s\occupera de Lout\rorq, l\esprit des eaux.\n\nIls sont dans la grotte, derrire la cascade voisine. On vous retrouvera sur place.', '', 'L\esprit des vents farfelus qui soufflent sur l\Anse-aux-Loupiotes de Kauriq. Il aime tre dfi par de jeunes Roharts qui cherchent  faire leurs preuves.', 'Kraunot', '', '', '', 47187),
(65929, 'frFR', 'Brise-glace', 'Brisez les eaux figes par la glace prs de l\Anse-aux-Loupiotes de Kauriq.', 'Je savais que notre anctre approuverait!\n\nJe ne m\y connais pas trop en esprits C\est Kauj, le chaman de notre tribu. Mais il va falloir apaiser les grands esprits de l\air et de l\eau, si on veut qu\ils se prsentent  nous.\n\nTout le monde a pu voir les lmentaires d\eau geler au ralenti dans les hauteurs; ce n\est pas un gel naturel. Le froid descend plus fort qu\ l\accoutume ces derniers temps. Si on ne fait rien, c\est notre rivire tout entire qui risque de se figer.\n\nLibrez-les de leur prison de glace!', '', '', '', '', '', '', 47187),
(65928, 'frFR', 'Vents imprvisibles', 'Rcuprez $1oagranules de vent sans repos sur des vents agits, prs de l\Anse-aux-Loupiotes de Kauriq.', 'Bah! Elle veut qu\on travaille ensemble, vraiment?\n\nMais Si la Pche-Loupiotes estime qu\on a une chance de pouvoir aider les autres tribus On a le devoir d\essayer.\n\nPour que l\esprit du vent Kraunot nous reconnaisse, on doit d\abord veiller au bien-tre de son lment. Les lmentaires de vent des environs sont agits depuis que la terre a commenc  se rveiller.\n\nPendant que j\inspecte le bateau que vous avez fabriqu, allez donc les combattre et rapportez-moi leurs granules sans repos. Cela devrait ramener le calme dans la rgion.', '', '', '', '', '', '', 47187),
(65926, 'frFR', 'Braver les chutes', 'Aidez Ruriq  construire le Tmraire.', 'Dites-moi, connaissez-vous l\histoire de la Pche-Loupiotes? Elle s\tait fabriqu un merveilleux bateau, capable de descendre les rapides!\n\nL\ancienne Nava adore raconter cette histoire.\n\nLes nobles esprits des mammouths on\tuqs seraient honors de nous voir utiliser leurs restes pour fabriquer  nouveau un tel bateau.\n\nMon frre s\oppose  cette ide, mais ce serait pour nous l\occasion de fournir du poisson aux tribus qui peinent  survivre.\n\nVous avez prouv votre talent et votre passion! Ensemble, je ne doute pas que nous russirons.', '', '', '', '', '', '', 47187),
(65925, 'frFR', 'Rgulation des espces', 'Tuez des siffleurs et des fouisseurs des glaces prs de l\Anse-aux-Loupiotes de Kauriq.', 'Ces wyrms n\ont rien  faire ici. Je ne sais pas ce qui les a pousss  sortir de leurs tanires, mais nous ne pouvons plus rien pour eux.\n\nNous devons les empcher de dcimer la faune locale.\n\nTuez ces wyrms, $n. Conservez leurs restes si ncessaire, puis revenez me voir  l\Anse-aux-Loupiotes quand ce sera fait.', '', '', '', '', '', 'Allez trouver Ruriq  l\Anse-aux-Loupiotes de Kauriq.', 47187),
(65921, 'frFR', 'Reprsailles reftis', 'Tuez des Primalistes et sauvez les Reftis au rservoir du Bastion de Tyr.', 'Les images repassent en boucle dans ma tte, $p. Tant de mes surs massacres! Toutes ces vies fauches Leur sacrifice ne restera pas impuni!\n\nMes guerrires ont remont la piste des Primalistes, et il s\avre que certaines de nos surs sont encore en vie.\n\nNous devons les secourir. Ces brutes vont voir ce qu\il en cote de s\attirer ma colre!', '', '', '', '', '', '', 47187),
(65920, 'frFR', 'Protection du rservoir', 'Utilisez les pierres-cls manquantes pour rparer les protections du rservoir, puis activez la console.', 'Nous allons enfin pouvoir rtablir les protections. Malgr toutes les pertes subies, notre devoir passe avant tout.\n\nNous allons encore avoir besoin de votre aide, $p. Remettez chacune des pierres  sa place de manire  restaurer l\intgrit des protections.\n\nQuand ce sera fait, revenez et nous activerons la console afin de rtablir l\ordre dans le rservoir.', '', '', '', '', '', '', 47187),
(65918, 'frFR', 'Maintenance prventive', 'Tuez $1oalmentaires dchans dans le rservoir du bastion de Tyr.', 'Les lmentaires primordiaux se multiplient  une vitesse fulgurante. En temps normal, mes surs et moi nous en occupons nous-mmes, mais nous ne sommes plus en tat de les affronter. Nous avons perdu tant de monde.\n\nEt puis, les rares d\entre nous qui sont encore l ont bien d\autres choses  faire.\n\n<Zuttiki esquisse une grimace de douleur.>\n\nC\est l que vous intervenez, $p. Pourriez-vous rgler leur compte  ces lmentaires?', '', '', '', '', '', '', 47187),
(65916, 'frFR', 'On ne parlemente pas avec les Primalistes', 'liminez la tte pensante des Primalistes, Ko\jo, et rcuprez les pierres-cls manquantes dans le rservoir du bastion de Tyr.', 'Si les Primalistes s\imaginaient pouvoir surmonter la puissance de Tyr, ces imbciles se trompaient.\n\nMes reftis ont russi  remonter leur piste jusqu\ une grotte, non loin d\ici. C\est l-bas que vous trouverez les pierres manquantes, comme je m\y attendais.\n\nSi nous voulons restaurer le rservoir, nous devons commencer par rcuprer ces pierres.\n\nPendant que vous y tes, tuez la tte pensante de ce groupe, de faon  mettre un terme dfinitif  ses agissements.', '', '', '', '', '', '', 47187),
(65914, 'frFR', 'Mille et un mammouths', 'Rcuprez des lanires de peaux et des dfenses sur les corps des mammouths on\tuqs prs de l\Anse-aux-Loupiotes de Kauriq.', 'Voil plusieurs gnrations que notre tribu prend soin du troupeau de mammouths on\tuq avec fiert, et aujourd\hui, ils sont tous morts.\n\nAprs un massacre pareil, leurs mes vont s\accrocher  notre monde par la seule force de leur colre. Nous devons rendre hommage  leur vie en faisant bon usage de ce qu\il reste d\eux.\n\nIls sont trop nombreux pour que nous puissions nous en occuper nous-mmes. Alors, je vous le demande: rcuprez les matriaux que vous pourrez sur les jeunes et les matriarches, et venez me retrouver  l\Anse-aux-Loupiotes de Kauriq.', '', '', '', '', '', 'Allez trouver Ruriq dans l\Anse-aux-Loupiotes de Kauriq.', 47187),
(65913, 'frFR', 'Gardienne en pril', 'Sauvez la gardienne Mara des Primalistes au rservoir du Bastion de Tyr.', 'Lous soient les Titans! Nous avons besoin de votre aide, $C!\n\nLes Primalistes ont attaqu il y a quelques instants. Mes surs et moi avons russi  les repousser, mais nous avons subi de lourdes pertes\n\nMais le deuil devra attendre que ma gardienne soit en scurit! Un dtachement de Primalistes a fil pendant le combat et je vous jure que si ces brutes osent toucher  un seul de ses cheveux\n\nAidez-la avant qu\il ne soit trop tard!', '', '', '', '', '', '', 47187),
(65911, 'frFR', 'Alignement azuren', 'Retournez voir Kalecgos aux archives d\Azur.', 'Les liens qui unissent cette communaut La valeur qu\elle attache  la famille et  l\amiti.\n\nJe je n\ai jamais connu a. Le Vol draconique bleu dans son ensemble ne sait pas ce que c\est. Mais peut-tre est-ce simplement une question de circonstances.\n\nIl est temps d\y remdier. L\heure est venue de rassembler mes congnres.\n\nRejoignez-moi aux archives d\Azur. Nous avons encore fort  faire.', '', '', '', '', '', 'Retournez voir Kalecgos aux archives d\Azur.', 47187),
(65907, 'frFR', 'Fruit favori', 'Cueillez des baies rsurgentes dans les geysers des Ohn\irs et donnez-les  $1oafoule-vase nonchalants.', 'L\entranement pour devenir mystique est assez rasoir Je passe la moiti de mes journes  regarder l\eau couler, alors que mes frres sont par monts et par vaux,  chasser les drakes sauvages et les Primalistes et  changer le monde!\n\nEnfin bref, j\avais promis de vous montrer quelque chose! Vous saviez que les foule-vase adorent les baies rsurgentes? Elles poussent  ct, dans les geysers. Allez en cueillir quelques-unes et nous irons les nourrir ensemble.', '', '', '', '', '', '', 47187),
(65906, 'frFR', 'Une initie mcontente', 'Parlez  l\initie Radiya aux sources des Ohn\irs, dans les plaines d\Ohn\ahra.', 'Je viens de recevoir une lettre tonnante des sources des Ohn\irs.\n\nLa personne qui l\a crite y dpeint, je cite, d\horribles conditions de dtention, des tuteurs dirigistes et un ennui effroyable, et elle est signe par l\initie Radiya. Oh, et regardez, il y a mme le croquis d\un aigle qui fait tomber une Centaure nomme Meluun du haut d\une falaise.\n\nEh bien, ceci m\a tout l\air d\tre un appel  l\aide, si l\envie vous prend d\aller voir par vous-mme. Honntement, je pense que Radiya ne court aucun danger. C\est typiquement le genre de missives qu\elle m\envoie tout le temps.', '', '', '', '', '', 'Parlez  l\initie Radiya aux sources des Ohn\irs, dans les plaines d\Ohn\ahra.', 47187),
(65905, 'frFR', 'Bien plus que des herbes', 'Nettoyez la vgtation et liminez les monstres dans les Lilas enchanteurs.', 'Nous ferions peut-tre mieux de laisser Thramus tranquille.\n\nMais nous ne pouvons pas rester sans rien faire: le bosquet se dsagrge  une vitesse alarmante! Vous devez nous aider.', '', '', '', '', '', '', 47187),
(65904, 'frFR', 'a suffit comme a', 'Apportez la preuve de la dgradation des Lilas enchanteurs  Thramus.', 'Qu\il soit content ou non, Thramus a des responsabilits. Et tant qu\il restera cach, il ne risque pas de voir les consquences de son absence.\n\nAllons-y ensemble. Montrons-lui votre preuve.', '', '', '', '', '', '', 47187),
(65903, 'frFR', 'De vraies peluches', 'Attrapez $1oasautilleurs des clairires.', 'Pauvre Thramus. J\ai une ide pour lui remonter le moral!\n\nPrenez ce filet et allez attraper quelques sautilleurs du coin. Ils sont dociles, mais rapides, et ont pour ainsi dire envahi la cte.\n\nNous allons les apporter  Thramus. Il succombera en un rien de temps au charme de ces adorables peluches!', '', '', '', '', '', '', 47187),
(65902, 'frFR', 'Boules de poils ou en-cas savoureux?', 'Apportez la viande de tortue aux herbes et les sautilleurs des clairires  Thramus.', 'Regardez-moi cette viande de tortue marine aux herbes, si dlicieusement juteuse! Et je dis cela en toute objectivit, bien sr. Je suis vgtarienne.\n\nAllez-y! Je parie qu\il n\a encore rien mang de la journe.', '', '', '', '', '', '', 47187),
(65901, 'frFR', 'Sortie discrte', 'Placez les totems dans les sources des Ohn\irs puis prvenez Radiya.', 'Je suis punie jusqu\ nouvel ordre! Mon ohn ne sait donc pas que je vais avoir seizeans au printemps prochain? Je devrais pouvoir aller et venir quand je veux.\n\nVous avez l\air de pouvoir m\aider. J\ai un plan pour m\chapper: en canalisant ces totems, je peux concentrer l\air et crer un beau bazar. Impossible de les placer moi-mme, je suis sous surveillance maximale. Et Togo refuse de m\aider.\n\nMais avec vous S\il vous plat, je vous montrerai quelque chose de vraiment gnial, promis!', '', '', '', '', '', 'Allez voir Radiya au Miroir cleste.', 47187),
(65900, 'frFR', 'Un steak trangement pic', 'Rcuprez $1oamorceau(x) de viande de tortue trs tendre, $2oacoquilles d\uf de reptile et $3oafloramres.', 'L\ide de ma sur n\est pas sans mrite, mais Thramus a besoin d\un vrai remontant.\n\nEt pour a, il me faut une belle quantit de floramres! Nous pourrons en faire une pte, que j\utiliserai ensuite pour badigeonner son mets prfr: la viande de tortue!\n\nVous voulez bien m\aider  runir ces ingrdients?', '', '', '', '', '', '', 47187),
(65899, 'frFR', ' la recherche de Thramus', 'Fouillez les grottes des environs  la recherche de Thramus.', '$R! Vous tes l pour admirer nos magnifiques Lilas enchanteurs? Il faudra me pardonner pour leur triste tat, je vous promets que a n\a rien d\habituel!\n\nThramus, le gardien de ce jardin, tait cens nous rejoindre aujourd\hui pour que nous nous attaquions au problme. Il a du mal  assurer l\entretien des lieux, depuis quelque temps, c\est pourquoi Flina et moi avons dcid de l\aider. Mais la tche est trop ardue, mme  deux.\n\nPourriez-vous essayer de le retrouver? Il a peut-tre oubli notre rendez-vous.', '', '', '', '', '', 'Retournez voir Clina Craquefeuilles.', 47187),
(65898, 'frFR', 'Proto-problmes', 'Rcuprez le locus et liminez le proto-drake qui le garde.', 'Je ne porte pas la Flamme fracture dans mon cur, mais ce n\est pas une raison pour rester les bras croiss quand ces imbciles s\entre-dchirent comme a. Je ne connais cette situation que trop bien.\n\nQuoi que soit ce locus, il sera plus en scurit entre nos mains que dans les leurs. Si nous suivons la piste des corps, je pense que nous le trouverons.\n\nSoyez $gprudent:prudente;, $p. Je crains que le nid ne soit pas aussi abandonn qu\il y parat.', '', '', '', '', '', '', 47187),
(65896, 'frFR', 'Bon rtablissement', 'Aidez les habitants de Hurlevent  se remettre du traumatisme.', 'Vous pensiez vraiment pouvoir entrer dans cette ville sans que je m\en rende compte? Un peu de srieux!\n\nJ\avais raison sur votre espce  l\poque, et je refuse de laisser les Dragons dtruire  nouveau le lieu o je vis.\n\nAutrefois, ce parc dbordait de joie et de paix et puis votre progniteur, Aile de mort, a fait son apparition. Oh oui, je le connais bien.\n\nAdmirez donc la destruction qu\il a laisse dans son sillage. La douleur qui hante encore ces rues.', '', '', '', '', '', '', 47187),
(65895, 'frFR', 'Des rivaux bien informs', 'Rcuprez des renseignements sur des membres de la Flamme fracture.', 'Bah! Ce n\est pas en massacrant des sbires que nous apprendrons quoi que ce soit.\n\nAllez trouver leurs chefs. L\un d\entre eux saura ce dont nous avons besoin.\n\nEt cette fois-ci, $n, coutez ce que vos victimes ont  dire avant de les tuer. Vous pourriez obtenir des informations utiles.', '', '', '', '', '', 'Retrouvez Adenedal prs du sommet des ruines.', 47187),
(65893, 'frFR', 'Enqute sur les reliques', 'Ramassez $1oafragments d\artfact de Nelthazan.', 'La Flamme fracture est ici. Feriez-vous confiance  une personne qui se prtend fracture pour manipuler de prcieux artfacts?\n\nC\est bien ce qui me semblait. Quoi qu\il en soit, nous devons connatre la raison de leur prsence avant de poursuivre. Rassemblez tout ce que vous pouvez rcuprer sur nos adversaires et revenez me faire un rapport.\n\nCe mystre ne s\claircira pas uniquement avec ce que nous allons trouver par terre.', '', '', '', '', '', '', 47187),
(65892, 'frFR', 'Fracture brise', '', '', '', '', '', '', '', '', 47187),
(65891, 'frFR', 'Des sons plein la tte', 'Dployez les outils enchants sur $1oapiles de dbris.', 'Bien. Il me fallait justement $gun aventurier:une aventurire; de votre trempe. $gFort:Forte;. Solide. $gPrt:Prte;  travailler pour une somme modique.\n\nC\est comme si vous tiez $gapparu:apparue; par ma simple volont. Bravo moi. Ces ruines semblent avoir attir l\attention d\autres personnes. Soyez $gcertain:certaine; que ces rustres ne procderont pas  des fouilles dignes de ce nom et vont contaminer les prlvements!\n\nPrenez cet outil et dployez-le prs des artfacts les plus intressants dans les ruines. Il est enchant et accomplira toutes les tches ncessaires.', '', '', '', '', '', '', 47187),
(65890, 'frFR', 'Les ruines de Nelthazan', 'Allez voir le scribeciel Adenedal dans les ruines de Nelthazan.', 'L\expdition du Dracaret a besoin de votre aide.\n\nUn scribeciel a t envoy dans les ruines pour rcolter des informations. Elles devraient tre dsertes, mais je peux entendre ses cris jusqu\ici.\n\ntant donn la distance qui nous spare, il doit tre en grand pril.\n\nNous prenons soin des ntres dans cette expdition, mme des plus insupportables. Trouvez-le et protgez-le des dangers qui le menacent.', '', '', '', '', '', '', 47187),
(65887, 'frFR', 'En route pour la montagne', 'Allez voir les images miroirs de Khadgar et Kalecgos au pied du massif du Vakthros.', 'Khadgar et Kalecgos aux prises avec les Primalistes dans le ciel! Ma foi, on ne voit pas a tous les jours.\n\nIls ont invoqu plusieurs images miroirs d\eux-mmes pour vous aider  franchir les gouffres monstrueux que l\arme ennemie a crs.\n\nIl y en a justement une paire au pied des montagnes  l\heure o nous parlons.\n\nSi par malheur la situation devait dgnrer j\en informerais le reste de nos camarades dans la trave d\Azur.', '', '', '', '', '', 'Allez voir les images miroirs de Khadgar et Kalecgos au pied du massif du Vakthros.', 47187),
(65886, 'frFR', 'En route pour le bouclier de Rhonin', 'Allez voir Drok Surine-Parchemins dans la Tour de garde.', 'En ce moment mme, Raszageth et les Primalistes lancent un assaut d\envergure contre le Vakthros. Nous ne pouvons pas la laisser faire!\n\nKhadgar et moi-mme allons partir devant pour prendre la situation en main depuis le ciel.\n\nDe votre ct, frayez-vous un chemin jusqu\au Bouclier de Rhonin. C\est l\un des derniers camps du Kirin Tor dans la rgion.\n\nVotre drake et vous gagnerez un temps prcieux en prenant votre envol depuis le sommet des archives.\n\nAssurez-vous que les mages sont hors de danger, puis rendez-vous au Vakthros.\n\nNous aurons besoin de vous pour nous seconder depuis le plancher des vaches.', '', '', '', '', '', 'Allez voir Drok Surine-Parchemins au Bouclier de Rhonin.', 47187),
(65875, 'frFR', 'Vacances de Dragon', 'Trouvez les diffrentes boissons pour Vazallia.', 'On a pass toute une vie en Outreterre toujours  se battre, avec si peu de temps pour se dtendre!\n\nParfois, les Dragons ont besoin d\un jour de repos, en bord de mer, une boisson bien frache entre les griffes\n\nDites, vous pourriez peut-tre m\aider  me dtendre! Rendez-moi service, et voyez si vous pouvez trouver quelques-uns de ces breuvages pour en approvisionner nos rserves.', '', '', '', '', '', '', 47187),
(65874, 'frFR', 'La putrfaction rvle', 'Parlez  Hanu,  l\ancienne Poa et  Norukk.', 'Hmm\n\n<Brielle tourne l\trange totem dans ses grosses pattes afin de l\inspecter sous tous les angles.>\n\nNous allons devoir nous tortiller les moustaches pour dcouvrir ce que cela signifie.', '', '', '', '', '', '', 47187),
(65873, 'frFR', 'Chef de la meute pattombre', 'Tuez Kargapatte et rcuprez son totem.', 'Kargapatte est le seul vritable chef gnoll de cette partie de la fort. Nous avons dj eu affaire  lui par le pass et disons simplement que je ne vous le recommande pas.\n\nMais cette fois-ci, il y a du nouveau. Il portait un trange totem qui semblait altrer son essence mme.\n\n charge pour vous de le mettre hors d\tat de nuire et de rcuprer son totem. Je crains que les Gnolls ne jouent avec des forces plus noires encore que tout ce que nous pouvons imaginer.', '', 'Kargapatte a toujours t mchant, mais il est encore plus agressif depuis qu\il a en sa possession ce totem impie.', 'Kargapatte le Ftide', '', '', '', 47187),
(65872, 'frFR', 'Gnoll y soit qui mal y pense', 'Tuez $1oaGnolls pattombres dans la tanire de Kargapatte.', 'Sentez-vous comme moi ces effluves tranges, ports par le vent? Quelque chose ici ne tourne pas rond\n\n en croire la description que Hanu m\en a faite, les Gnolls de cette grotte seraient bizarres et souffreteux.Il nous faut dcouvrir de quoi il en retourne.\n\nCela tant dit, ne baissez surtout pas votre garde. Quel que soit le mal qui les ronge, ces cratures sont trs probablement aussi agressives et dangereuses que d\habitude.', '', '', '', '', '', '', 47187),
(65871, 'frFR', 'Pluie de torgnolls', 'Secourez Norukk et $1oa$lautre Rohart:autres Roharts; en captivit.', 'J\ai remont la piste des otages roharts, dont mon mari Norukk fait partie, jusqu\ cette grotte, l.\n\nNorukk ayant tendance  prendre des risques inconsidrs, je ne peux compter que sur moi-mme pour assurer ses arrires. Cela tant dit, je n\ai pas honte de demander de l\aide quand les circonstances l\exigent.\n\nPiti, secourez-les!', '', '', '', '', '', '', 47187),
(65870, 'frFR', 'Ravitaillement!', 'Rcuprez les caches de fournitures de chasse.', 'Nous n\avons pas retrouv la moindre trace du matriel de chasse qu\on nous a drob dans les collines aux Grands Feuillus. Ces canailles ont d les cacher dans cette grotte.\n\nAllez rcuprer la marchandise et restez sur vos gardes.\n\nJe doute que ces Gnolls l\aient laisse sans surveillance.', '', '', '', '', '', '', 47187),
(65869, 'frFR', 'Une autre embuscade', 'Parlez  Akiun et inspectez $2oacadavres proches.', 'C\est une tragdie. Pire encore, ce n\est peut-tre que la premire d\une longue srie.\n\nInterrogez Akiun, puis examinez les victimes tombes pendant l\attaque.\n\nJ\ai ma petite ide sur ce qui s\est pass ici, et nous allons bien voir si les indices confirment ma thorie.\n\nDe mon ct, je vais m\efforcer de rassurer mes pauvres camarades.', '', '', '', '', '', '', 47187),
(65868, 'frFR', 'Les dents longues', 'Rcuprez $1oaoffrandes funraires.', 'J\ai retrouv l\une des offrandes funraires destines  Ponoliak, profane puis laisse  l\abandon Ces salets de Gnolls pattombres ont os se faire les dents dessus!\n\nCes offrandes, nous en avons besoin pour rendre un dernier hommage au dfunt chef d\Iskaara, disparu rcemment.\n\nC\est une honte de voir un objet aussi sacr ainsi malmen. Ouvrez l\il et rapportez-nous les ventuelles offrandes funraires que vous trouverez sur votre chemin.', '', '', '', '', '', 'Allez voir Hanu  l\entre de la tanire de Kargapatte, dans les collines aux Grands feuillus.', 47187),
(65867, 'frFR', 'Les collines hurlantes', 'Tuez Durgun, Kerwal et Bakra.', 'Les Gnolls qui ont attaqu notre caravane taient sous les ordres de trois lieutenants.\n\nDurgun, flanqu d\une bonne dizaine de hynes.\n\nKerwal, qui riait comme un maniaque chaque fois que les ntres tombaient dans ses piges aux mchoires d\acier.\n\nEt enfin, l\impitoyable Bakra, qui n\a eu de cesse de nous provoquer.\n\nSi nous voulons rcuprer ce qui nous a t vol, il va falloir les tuer.', '', '', '', '', '', 'Allez voir Hanu  l\entre de la tanire de Kargapatte, dans les collines aux Grands feuillus.', 47187),
(65866, 'frFR', 'Dclencher les piges', 'Dclenchez $1oapiges  mchoires.', 'Les collines voisines sont jonches de redoutables piges  mchoires.\n\nOuvrez l\il, et vous devriez russir  les reprer. Ensuite, vous n\aurez plus qu\ les dsarmer trs dlicatement  l\aide de cette vieille technique rohart Un bton bien long. S\il est galement possible de les dsactiver en marchant dessus, ce n\est pas la mthode la plus recommande.\n\nQuand vous en aurez neutralis suffisamment, allez en informer Hanu. L\ancienne Poa et moi-mme vous rejoindrons ds que possible.', '', '', '', '', '', 'Allez voir Hanu  l\entre de la tanire de Kargapatte, dans les collines aux Grands feuillus.', 47187),
(65865, 'frFR', 'La souricire', 'Tuez des tireurs de prcision gnolls.', 'Ces tireuses et tireurs gnolls n\y vont pas de main morte et sont d\une prcision tonnante, qui plus est.\n\nNous ne pourrons pas nous approcher des collines aux Grands feuillus tant que leurs armes resteront braques sur nous.\n\nclaircissez leurs rangs et montrez-leur que nous ne sommes pas l pour leur servir de cibles d\entranement!', '', '', '', '', '', 'Allez voir Hanu  l\entre de la tanire de Kargapatte, dans les collines aux Grands feuillus.', 47187),
(65864, 'frFR', 'Rattraper la caravane', 'Rattrapez Brena prs des collines aux Grands feuillus.', 'Vous devriez parler  Brena. Elle est passe par ici avec sa caravane il y a quelques heures  peine.\n\nSa tribu et elle font le tour de la rgion en qute des souvenirs les plus prcieux de notre dfunt chef, dont les funrailles doivent avoir lieu prochainement.\n\nVu le poids que transporte la caravane, elle n\a pas d aller bien loin.', '', '', '', '', '', '', 47187),
(65855, 'frFR', 'Au secours de la trave d\Azur', 'Retournez voir Noriko la Mnsique au camp d\Antonidas.', 'L\nergie de la pierre de vu ne pourra tre rcupre qu\une fois les lignes telluriques de la trave d\Azur restaures.\n\nSi certaines ne sont accessibles qu\aux individus de grand pouvoir comme Kalecgos, cela ne vous empche pas de vous rendre utile.\n\nAllez trouver les Roharts en esprant que leurs tribus aient survcu.  mon poque, c\est ici que vivait ce peuple qui en sait long sur ces terres.\n\nAdressez-vous  l\un de nos auxiliaires arcaniques pour retourner auprs de vos allis.', '', '', '', '', '', 'Parlez  Noriko la Mnsique au camp d\Antonidas.', 47187),
(65854, 'frFR', 'Rcuprer la pierre de vu', 'Accompagnez Kalecgos parti rcuprer la pierre de vu d\Azur.', 'Beau travail, mon $gami:amie;. Nous avons russi  rparer les lignes telluriques des archives d\Azur.\n\n l\poque o le Vol draconique bleu tait uni, je rptais  mes frres et surs de ne jamais douter de la force des cratures mortelles.\n\nVenez me trouver auprs de la pierre de vu, au sud. Je partirai pour Thaldraszus ds qu\elle sera en ma possession.', '', '', '', '', '', 'Parlez  Sindragosa.', 47187),
(65852, 'frFR', 'Cap sur le sommet', 'Fouillez le sac de marchandises utiles  la recherche de la pierre de gu arcanique, puis servez-vous-en  un point de focalisation arcanique pour atteindre le sommet des archives d\Azur.', 'Quelque chose semble puiser dans les nergies arcaniques au sommet de la tour.\n\nMaintenant que vous avez russi  stabiliser les nergies en bas, vous devriez pouvoir emprunter les flux d\nergie arcanique des environs.\n\nSaisissez-vous de la pierre de gu arcanique qui se trouve dans le sac de marchandises utiles, puis servez-vous-en pour me rejoindre au sommet.', '', '', '', '', '', 'Retrouvez Kalecgos au sommet des archives d\Azur.', 47187),
(65850, 'frFR', 'Le cycle de la mer', 'Parlez  Brena pour assister  la crmonie funraire.', 'Merci, $n. Nos nouveaux amis m\ont appris tout ce que j\avais besoin de savoir pour l\instant.\n\nLes funrailles de leur ancien chef sont sur le point de commencer et, tant donnes leur hospitalit et leur gentillesse, nous lui devons bien un dernier hommage avant de regagner les archives.\n\nAllez voir Brena et dites-lui que nous pouvons y aller.', '', '', '', '', '', '', 47187),
(65849, 'frFR', 'En route pour Iskaara', 'Allez voir Brena  Iskaara.', 'Merci pour votre aide, $n. Ma famille tout entire vous doit la vie.\n\n prsent, nous allons enfin pouvoir rentrer  Iskaara et rendre ce bon vieux Ponoliak  la mer. C\tait un bon chef, vous savez et c\tait aussi mon mentor.\n\nFaites-moi plaisir et joignez-vous  nous. Toutes et tous sont invits  communier lors de la clbration du cycle de la mer.', '', '', '', '', '', 'Allez voir Brena  Iskaara.', 47187),
(65848, 'frFR', 'Une situation alarbrante', 'Parlez  Kalecgos pour ouvrir le portail, puis servez-vous de ce qu\il aura invoqu pour liminer les putrfieurs fougerobes et dtruire l\ancien distordu.', 'Nous devons arrter cet arbre! Muni de ces cristaux telluriques, je vais enfin pouvoir me rendre utile.\n\nPrvenez-moi quand vous serez $gprt:prte;. J\ouvrirai un portail sur les archives d\Azur et j\essaierai d\en rapporter quelque chose d\utile.\n\nVous feriez mieux de reculer, le rsultat pourrait s\avrer instable.', '', '', '', '', '', 'Parlez  Kalecgos dans la grotte aux cristaux telluriques.', 47187),
(65847, 'frFR', 'Ralignement', 'Concentrez-vous sur le cristal tellurique, puis dtruisez 3amas de putrfaction contagieuse.', 'Mes craintes sont avres: la maladie s\est propage  la ligne tellurique.\n\nIl nous faut liminer la putrfaction et acclrer la gurison, mais je n\arriverai pas  canaliser suffisamment d\nergie avec ma seule image miroir.\n\nConcentrez-vous sur ce cristal tellurique. Le lien qui nous unit me permettra de me tlporter jusqu\ici. Alors seulement, j\aurai la puissance ncessaire.', '', '', '', '', '', 'Allez voir Kalecgos  l\extrieur du territoire des Fougerobes.', 47187),
(65846, 'frFR', 'Tanire tellurique', 'Rcuprez $1oacristaux telluriques sur le territoire des Fougerobes.', 'La ligne tellurique est ici, je le sens!\n\nMais d\abord, nous devons arrter les Gnolls. Cet ancien est leur arme la plus redoutable.\n\nSi les Gnolls ont russi  mettre la main sur un certain nombre de cristaux telluriques, par chance, leur pouvoir les dpasse.\n\nApportez-m\en un maximum. Ils m\aideront  alimenter mes images miroirs et  invoquer quelque chose d\utile depuis les archives afin d\abattre ce monstre!', '', '', '', '', '', '', 47187),
(65845, 'frFR', 'Les chos des dfunts', 'Placez le totem de Brena prs de $1oacadavres de Roharts afin de contacter leurs esprits.', 'Des Roharts! Mes camarades, ma tribu ma famille. Les pauvres taient partis chasser il y a quelques jours  peine.\n\nLa putrfaction galopante a dj fait son uvre, et il est trop tard pour les sauver.\n\nMais leurs mes en peine s\attardent en ces lieux, retenues captives par la colre et le regret. Kaqiata, Lutokk, Tuyuki\n\nDe grce, $n, prenez ce totem et placez-le  proximit de leurs corps afin de contacter leurs esprits et les aider  trouver le repos.', '', '', '', '', '', '', 47187),
(65844, 'frFR', 'radiquer la putrfaction', 'Tuez $1oaTrants pourrissants et $2oalance-pourriture fougerobes.', 'Il faut croire que la putrfaction ne leur a pas seulement rong les chairs, elle leur a aussi ramolli la cervelle!\n\nAussi nuisibles que soient ces Gnolls, ce sont les enfants de ces terres, tout comme nous.\n\nPour autant, ces cratures ont dj rpandu leur mal jusque dans la tribu des Grands Feuillus, et  ce rythme, elles auront tt fait de dvaster la trave et de prcipiter leur propre destruction.\n\nNous ne pouvons pas les laisser faire. C\est malheureux, mais il faut les mettre hors d\tat de nuire.', '', '', '', '', '', '', 47187),
(65842, 'frFR', 'Un comportement dsarmant', 'liminez la fabricante d\armes Vordak et rcuprez $1oaarmes brise-monde.', 'Je n\apprcie gure les Draconiens brise-monde. Ces fanatiques adhrent  un dogme ridicule annonant le retour prochain d\Aile de mort et refusent de nous aider  protger le trne d\Obsidienne.\n\nLa fabricante d\armes Vordak, autrefois fidle au prince noir, a vol de nombreuses armes forges ici mme, dans la citadelle, pour les livrer aux Brise-monde. Il est hors de question que je tolre cette trahison.\n\nRendez-vous au perchoir Fulminant et rcuprez ces armes par la force, si ncessaire.', '', '', 'Fabricant d\'armes Vordak', '', '', '', 47187),
(65841, 'frFR', 'Endiguer la propagation', '', '', '', '', '', '', '', '', 47187),
(65838, 'frFR', 'Incursion en territoire fougerobe', 'Explorez le territoire des Fougerobes.', 'Si les Gnolls ont effectivement dcouvert la magie de putrfaction, j\ai peur que la ligne tellurique locale et ces terres dans leur ensemble ne soient en grand danger.\n\nMes images miroirs n\tant pas assez robustes pour rsister aux perturbations lmentaires qui svissent dans cette fort, je compte sur vous pour aller y mener l\enqute.\n\nJe vous rejoindrai ds que j\aurai trouv un endroit d\o je pourrai maintenir la stabilit de cette image. Nos camarades roharts m\y aideront.\n\nNous devons  tout prix viter le pire!', '', '', '', '', '', 'Parlez  Kalecgos dans la ronceraie des Fougerobes.', 47187),
(65837, 'frFR', 'Problme  la pinde', 'Parlez  la sentinelle Olekk au poste de la Pinde, dans les plaines d\Ohn\ahra.', 'Des Primalistes ont attaqu les hautes-terres Shikaars.\n\nSi vous avez des informations ou si vous pensez pouvoir apporter votre aide, dirigez-vous vers le poste de la Pinde et allez trouver Olekk. <Tirren rit.> J\espre que le bougre se souviendra de moi.\n\nNe vous loignez pas des routes, $p. Les plaines ne sont plus aussi paisibles depuis les derniers vnements.', '', '', '', '', '', 'Parlez  la sentinelle Olekk au poste de la Pinde, dans les plaines d\Ohn\ahra.', 47187),
(65836, 'frFR', 'Manifestation temptueuse', 'Rejoignez Watu dans la pinde de Sagemont.', '<Watu se lve sans effort, comme si la blessure avait disparu.>\n\nJe j\ai plant le fragment dans ma patte. Je n\ai plus mal. Je me sens bien. Trs bien. Puissant.\n\nOlekk n\est toujours pas rentr. Quelque chose a d mal tourner. Il n\aurait jamais d partir sans moi!', '', '', '', '', '', '', 47187),
(65834, 'frFR', 'Tuer la reine', 'Tuez la reine tremble-toile.', 'Et voil! Une dose d\ducation, une pince de bon sens, un ou deux coups de burin sur les runes, et paf, un anti-imprgnateur magique! Un dprgnateur?\n\nEnfin bref! a va faire des guilis dsagrables  la reine, vous pouvez me croire. Et faut qu\elle dgage, si on veut que a se tasse. On a beau crabouiller les petites, a sert qu\ les ralentir; non, faut qu\on coupe tout  la source!', '', 'Il ne devrait jamais y avoir de reine araigne.', 'Reine tremble-toile', '', '', '', 47187),
(65833, 'frFR', 'Sabotage primaliste', 'Rcuprez les pierres runiques des trois mande-givre.', 'Les Primalistes imprgnent des araignes de glace lmentaire, histoire de les envoyer attaquer les dfenses des Dragons dans la trave. On peut pas les laisser faire!\n\nC\est les trois tout givrs qui ont l\air de tirer les ficelles. Tuez-les et rapportez-moi les pierres runiques qui leur servent  concentrer leur magie primordiale, comme a, on pourra leur couper la chique.', '', '', '', '', '', '', 47187),
(65832, 'frFR', 'Antigel nain', 'Trouvez $1oaflacons d\antigel nain.', 'Je suis un poil embt, dites Ces lche-glace de Primalistes m\ont coll dans ce glaon gant, et si je suis pas encore gel jusqu\aux doigts de pied, c\est uniquement grce  ma planque secrte de super matos.\n\nMais manque de bol, mes planques moins secrtes se sont fait dpouiller quand ces ordures se sont jetes sur moi, et je commence  manquer!\n\nVous voulez bien me rapporter mes flacons, avant que mon sang soit compltement congel?\n\nOh, et si jamais vous les retrouvez dans les parties honteuses d\une araigne, me dites rien. Je tiens pas  le savoir.', '', '', '', '', '', '', 47187),
(65806, 'frFR', 'Maruuka', 'Entrez dans Maruuka.', '<Okir interprte les gestes de la khan Sansok.>\n\nPrs de ce bosquet se trouve Maruuka, niche contre le flanc de la montagne. Notre voyage touche  sa fin.\n\nLe khural est une priode de trve parmi les Maruuks, mais le prsage de l\ohn Seshteng est troublant. Nous devons rester sur nos gardes.', '', '', '', '', '', '', 47187),
(65805, 'frFR', 'Un lien troit avec Ohn\ahra', 'Rcuprez $1oaroseaux des rives, $2oaplumes de queue de canard et un cur de dracamandre sur les berges de la rivire.', 'Les vents sont agits, $n. Ohn\ahra nous parle, et je dois rpondre  son appel.\n\nJe vais avoir besoin d\ingrdients pour mon rituel: des roseaux des rives, des plumes de queue de colvert et le cur d\une dracamandre. Vous trouverez le tout prs de la rivire; rapportez-moi ensuite ces objets, et je pourrai entendre sa voix.', '', '', '', '', '', '', 47187),
(65804, 'frFR', 'Approvisionnement et mulation', 'Rcuprez $1oamorceaux de venaison frache en chassant les animaux de la steppe du Voyageur.', 'Les Maruuks arrivent des quatre coins des plaines pour participer au khural. Les clbrations dureront plusieurs jours.\n\nIl n\est pas simple de nourrir autant de Centaures  la fois! Les chasseurs et chasseuses du clan des Shikaars fournissent de la viande pour tous les banquets. La coutume est de s\arrter pour chasser sur le chemin menant  Maruuka.\n\nEt vous allez devoir participer.', '', '', '', '', '', '', 47187),
(65803, 'frFR', 'En route vers la ville', 'Accompagnez la caravane du clan des Shikaars jusqu\ la steppe du Voyageur.', 'Le khural est une rencontre consacre  la discussion entre les clans, qui y partagent toutes sortes de rcits. Si les clans centaures sont nombreux dans les plaines, nous sommes toutes et tous des Maruuks.\n\nLa caravane est prte  partir. Maruuka n\est pas toute proche, nous devrons donc faire plusieurs escales.\n\nQuand vous voudrez y aller, venez me rejoindre prs de la caravane. Mais ne nous faites pas trop attendre!', '', '', '', '', '', '', 47187),
(65802, 'frFR', 'Ravitaillement pour la route', 'Rcuprez $1oaprovisions de camp dans l\avant-poste de Pas-de-bois, et $2oabulbes de fleur froce dans les bois environnants.', '<Okir interprte les gestes de la khan Sansok.>\n\nSi vous entendez voyager  nos cts, vous allez devoir mettre la main  la pte. Des Gorlocs dchans pillent nos stocks de cataplasmes, et nous allons devoir en fabriquer de nouveaux, alors allez chercher des fleurs d\oranger prs de l\avant-poste.\n\nIl faudrait aussi apporter  la caravane diffrentes fournitures disperses dans l\avant-poste. Profitez de cette petite sortie pour les rcuprer.\n\nUne fois que vous aurez tout a, allez voir Tomul.', '', '', '', '', '', 'Prsentez-vous  l\claireuse Tomul.', 47187),
(65801, 'frFR', 'Prsentations', 'Allez vous prsenter aux membres du clan des Shikaars.', '<Okir interprte les gestes de la khan Sansok.>\n\nVoil bien des gnrations $gqu\aucun tranger:qu\aucune trangre; n\avait pos le pied sur nos terres. Avec ces Primalistes qui nous tournent autour, leur magie interdite au bout des doigts, mon peuple est sur ses gardes; et on peut le comprendre.\n\nSi vous souhaitez nous accompagner, vous allez devoir vous faire connatre. Allez vous prsenter aux membres de mon clan.', '', '', '', '', '', 'Prsentez-vous  l\claireuse Tomul.', 47187),
(65798, 'frFR', 'Une approche opportuniste', 'Rcuprez des armes et terrassez les forces nokhuds au domaine Nokhud.', 'Les Shikaars ont form une ligne offensive contre les Nokhuds au nord d\ici. Je n\aime pas m\abaisser au pillage des corps, mais c\est un mal ncessaire pour approvisionner nos troupes. Si vous acceptez de vous aventurer sur le champ de bataille et d\en rapporter des armes, je vous rcompenserai.\n\nEt si vous parvenez  concentrer vos efforts sur le camp nokhud, mes anctres me jugeront peut-tre moins svrement', '', '', '', '', '', '', 47187),
(65796, 'frFR', 'La meilleure dfense', 'Tuez Sirena la Brise-Croc.', 'La prochaine tape va nous conduire en territoire nokhud. Si nous avons longtemps vcu en paix relative avec leur clan, ce n\est plus le cas aujourd\hui.\n\nNous devons prendre les devants, sans quoi nous prterons le flanc  une attaque alors que nous sommes vulnrables. Mes quipes de reconnaissance ont repr une de leurs cheffes de guerre prs de la Croise-du-Dragon.  charge pour vous d\aller lui rgler son compte avant qu\elle ne rassemble ses troupes pour nous attaquer en chemin.', '', '', '', '', '', '', 47187),
(65795, 'frFR', 'tape des steppes', 'Allez voir l\ambassadeur Taurasza  l\avant-poste de l\caille rubis.', 'Le Vol draconique vert a besoin de notre aide au plus vite, $ghros:hrone;. Ma nice et son Vol sont entrs dans le Rve d\meraude pour renforcer leur propre pierre de vu, mais n\ont pas donn de signe de vie depuis le dbut de leur sommeil.\n\nPartez en qute des Centaures qui rgnent sur les plaines d\Ohn\ahra. Vous aurez srement besoin de leur lien  la terre et  ses esprits pour esprer veiller les Dragons verts.\n\nSachez toutefois que ce sont des tres fiers et territoriaux qui ne tolrent aucune offense. Adressez-vous  notre ambassadrice: elle vous prparera.', '', '', '', '', '', 'Allez voir l\ambassadeur Taurasza  l\avant-poste de l\caille rubis.', 47187),
(65794, 'frFR', 'Une vocation de soins', 'Regardez les ufs de Dragon noir rejoindre les bassins de l\Essence.', 'Je vous dois des remerciements, $c, et je suis navre pour le temps que vous avez perdu avec ces deux-l.\n\nLe Vol draconique rouge est charg de protger et de soigner tous les Dragons, mme ceux dont nous nous lassons parfois.\n\nMaintenant que les ufs des Dragons noirs sont de retour, les peuples draconiens sont unis pour la premire fois depuis des milliers d\annes. Cela devrait nous permettre de restaurer la pierre de vu rubis.\n\nRevenez me voir lorsque vous serez $gprt:prte;  transporter les ufs vers le bassin de l\Essence obsidienne.', '', '', '', '', '', '', 47187),
(65793, 'frFR', 'Vol du chariot noir', 'Escortez les ufs jusqu\aux bassins de l\Essence.', ' prsent que la pierre de vu est renforce, nous devons emmener notre progniture aux bassins de l\Essence. Tout Vol draconique digne de ce nom a le droit de voir ses ufs baigner dans leurs eaux.\n\nMalheureusement, les armes ennemies scruteront attentivement les cieux, maintenant qu\elles sont au courant de notre prsence. Nous parcourrons la dernire tape  pied pour chapper aux regards.\n\nRetrouvez-moi prs du rempart d\Obsidienne, $c. En tant que $gchampion:championne; de la Lieuse-de-Vie, vous tes plus que $gbienvenu:bienvenue;  nos cts.', '', '', '', '', '', 'Parlez  Sabellian au sommet du sanctuaire de l\Essence rubis.', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(65792, 'frFR', 'Dents pour dent', 'Tuez $1oarochecrocs avec Toluijin.', 'Toliqui se targue d\avoir tu  elle seule un rochecroc pas plus tard que l\autre jour. tant donns les liens qui nous unissent, je m\en voudrais de la traiter de menteuse. Au lieu de a\n\nJe vais lui prouver,  elle et aux autres, que c\est moi la meilleure moiti de nos mes jumelles! Le rochecroc le plus proche se trouve au nord-est. Je vous attendrai sur place!', '', '', '', '', '', '', 47187),
(65791, 'frFR', 'La Lieuse-de-Vie en action', 'Allez voir Alexstrasza prs de la pierre de vu rubis.', 'Les bassins de l\Essence seront bientt  nouveau remplis.\n\nMerci pour le rle que vous avez jou dans tout cela, $n. Je ne vous remercierai jamais assez.\n\nAllez trouver la Lieuse-de-Vie prs de la pierre de vu. Dites-lui que les bassins sont prts  accueillir les ufs.', '', '', '', '', '', 'Allez voir Alexstrasza prs de la pierre de vu rubis.', 47187),
(65789, 'frFR', 'O dorment les rivires', 'Rcuprez des composants dans le marais de Bourbebois.', 'Le marais de Bourbebois abrite des ingrdients indispensables pour entrer en communication avec nos anctres. Malheureusement, la tribu des Nageboue a envahi le secteur et il nous est de plus en plus difficile de nous ravitailler.\n\nSi vous pouviez aller me cueillir quelques fleurs dans le marais, vous me rendriez un fier service. Au passage, profitez-en pour puiser dans les rserves des Nageboue.', '', '', '', '', '', '', 47187),
(65783, 'frFR', 'Bienvenue autour de notre feu', 'Allez voir l\claireuse Tomul  l\avant-poste de Pas-de-bois.', 'Vous avez combattu aux cts de nos chasseurs et chasseresses, et mrit votre place parmi nous.\n\nNotre khan se trouve dans le campement de chasse du marais; elle y prpare la prochaine caravane. Je vais l\informer de votre arrive et de vos intentions.\n\nVous saurez bien trouver votre chemin.', '', '', '', '', '', 'Allez voir l\claireuse Tomul  l\avant-poste de Pas-de-bois.', 47187),
(65782, 'frFR', 'Sous les verrous', 'Rcuprez la cl de cellule brise-monde et librez Ayasanth.', 'Lorsque la rumeur de l\existence d\un culte ddi  Aile de mort est arrive jusqu\ nous, Slistra, camriste de la reine, m\a ordonn de ramener ces anciens mergcailles dans nos rangs. Nous esprions avoir affaire  un simple malentendu.\n\nVisiblement, nous avions tort.\n\nIl va nous falloir dcapiter la bte pour la mettre  terre mais pour a, je dois d\abord sortir de cette cage. Trouvez la cl et rapportez-la-moi.', '', '', '', '', '', '', 47187),
(65780, 'frFR', 'Faire ses preuves', 'Tuez le proto-dragon flamboyant.', 'Mme si une partie des Centaures se laisse impressionner par un simple cadeau des Dragons, d\autres, comme les membres de mon clan, prfreront vous observer  la chasse.\n\nL\un de nos groupes vient justement de ramener un proto-dragon imprgn du pouvoir de la flamme. Prouvez-nous votre talent en participant  sa mise  mort.', '', 'Lors de leur entre dans l\ge adulte, les jeunes Centaures participent gnralement  leur premire chasse au proto-drake.', 'Proto-dragon flamboyant', '', '', '', 47187),
(65779, 'frFR', 'Incursion dans les plaines', 'Allez voir l\claireuse shikaar dans les plaines d\Ohn\ahra.', 'Le Vol draconique vert est retourn dans ses jardins, dans les plaines voisines. La reine Alexstrasza souhaite que vous entriez en contact avec Mrithra du Rve.\n\nLes Centaures qui peuplent ces plaines sont de farouches chasseurs. Pour parvenir jusqu\aux jardins d\meraude, vous allez devoir, dans un premier temps, tablir des relations diplomatiques avec eux.\n\nFaites preuve de respect, mais ne montrez aucune faiblesse.', '', '', '', '', '', 'Allez voir l\claireuse shikaar dans les plaines d\Ohn\ahra.', 47187),
(65778, 'frFR', ' table avec les Hurlevols', 'Enfilez votre costume et utilisez le prototype d\uf sur la cheffe personnelle de la matriarche.', 'Vous tes $gprt:prte;  faire la dmonstration de vos talents d\$gacteur:actrice;, $n?\n\nComment? Vous n\avez pas la fibre thtrale? J\ai donc bien fait d\utiliser les matriaux que vous avez rassembls pour rendre ce dguisement de Hurlevol invulnrable aux coups de bec!\n\nSgallia et moi avons encore besoin de temps pour terminer la fabrication de l\uf final qui nous dbarrassera de la matriarche, mais j\ai assembl un prototype plus modeste que vous allez pouvoir essayer sur la cheffe.\n\nEt rassurez-vous, ces plumes augmenteront de 12% vos chances de survie aux explosions!', '', '', '', '', '', '', 47187),
(65777, 'frFR', 'Collier boueux', 'Trouvez quelqu\un qui s\y connaisse en chasse des plaines et en artfacts artisanaux.', '<Les anciennes inscriptions du collier sont difficiles  dchiffrer, mais il semble compos de peau de bte et de fragments d\os sculpts.\n\nPeut-tre un chasseur aguerri pourrait-il vous en dire plus sur la valeur de cet objet.>', '', '', '', '', '', '', 47187),
(65770, 'frFR', 'Une promesse est une promesse', 'Promettez  l\initie Radiya de garder son secret.', 'Les animaux sont  l\aise avec vous. Cela en dit long sur votre esprit.\n\nEn fait pouvez-vous garder un secret? J\aimerais vous prsenter une amie. Personne d\autre n\est au courant.\n\nMais d\abord, vous devez me promettre que vous garderez a pour vous. Mon ohn m\exilerait des plaines si elle l\apprenait.', '', '', '', '', '', 'Parlez  Godoloto, l\ohuna.', 47187),
(65769, 'frFR', 'Toiles de glace', 'Librez $1oasurvivants entoils dans le val Tremble-Toile.', 'La plupart de mes collgues ont fini par se faire capturer lors de l\attaque des arachnides et de leurs matres primalistes.\n\nJ\ai vu mes camarades se faire immobiliser dans des toiles et emmener pour subir un sort que je refuse d\imaginer.\n\nJe vous en supplie, librez-en autant que possible!', '', '', '', '', '', '', 47187),
(65761, 'frFR', 'Une aventure plus riche que prvue', 'Collaborez avec Godoloto pour trouver et sauver Radiya.', '<Le regard de Godoloto est perant et accusateur. Elle souffle.>\n\n<L\ohuna peut peut-tre vous aider  retrouver et secourir Radiya.>', '', '', '', '', '', '', 47187),
(65760, 'frFR', 'Au rapport', 'Suivez Sendrax jusqu\ l\avant-poste de Cur-de-dragon.', 'Je n\ai entendu parler du peuple djaradin que dans les livres.\n\nIl rivalisait autrefois avec les Dragons. On dit que ses membres titanesques matrisent la terre et la lave et se vouent corps et me  l\annihilation des Dragons.\n\n<Sendrax lance un regard inquiet au volcan lointain.>\n\nD\aprs les enseignements que j\ai reus, ces cratures n\ont plus t aperues depuis le dpart des Dragons, car elles se seraient endormies au cur de la terre.\n\nSi leurs armes se sont effectivement rveilles, les Dragonnets de ces les courent un terrible danger!\n\nSuivez-moi: je vous emmne au commandant Lthanak,  l\avant-poste de Cur-de-Dragon.', '', '', '', '', '', 'Parlez au commandant Lthanak  l\avant-poste de Cur-de-dragon.', 47187),
(65758, 'frFR', 'Grungir l\Explorateur', 'Trouvez Grungir Trombe-Fer.', '$N! Mon homologue de la Ligue des explorateurs, Grungir Trombe-Fer, ne figurait pas parmi les gens auxquels vous avez port secours. Il avait russi  se librer par la force, mais voyant que si peu d\entre nous en avaient rchapp, il a dcid de faire demi-tour! Tout seul!\n\nCet imbcile est aussi courageux qu\impulsif, il ne mrite pas le sort qui l\attend.\n\nJe vous en supplie, trouvez-le!', '', '', '', '', '', '', 47187),
(65752, 'frFR', 'Tracasseries arcaniques', 'Tuez $1oawyrms voraces.', 'De nombreux wyrms de mana viennent se nourrir de la magie des arcanes qui s\chappe des archives.\n\nLa vitesse  laquelle ils l\absorbent est en train de dsquilibrer les lignes telluriques et nous empcher de rcuprer la pierre de vu d\Azur.\n\nJe vais utiliser l\arcana instable que vous avez ramass pour faonner une sorte de crochet.\n\nServez-vous-en pour liminer plusieurs de ces wyrms. Pendant ce temps, je m\occupe d\ajuster les nergies plus bas.', '', '', '', '', '', '', 47187),
(65751, 'frFR', 'Plateforme  gomtrie variable', 'Dissipez $1oanergies arcaniques instables au sommet des archives d\Azur.', 'Sauf erreur de ma part, la dernire perturbation arcanique vient de l-haut.\n\nPendant que je me chargerai de canaliser les nergies telluriques, servez-vous de l\arcana rcolt pour dissiper les perturbations.', '', '', '', '', '', '', 47187),
(65750, 'frFR', 'Menace  huit pattes', 'Tuez $1oagrouillantes ou rampantes tremble-toile et $2oasoigneurs ou soigneuses primalistes dans le val Tremble-Toile.', '$C!\n\nJ\aurais besoin de votre aide, si vous le voulez bien\n\nCette expdition avait pour but d\tudier les arachnides endmiques de cette rgion, mais comme vous pouvez le constater, rien ne s\est vraiment droul comme prvu.\n\nCe que nous avions pris pour une volution naturelle de l\espce s\est avr une cruelle perversion des Primalistes!\n\nJe prends mes responsabilits envers la nature trs au srieux, mais je crois que l\tude de spcimens vivants n\est plus  l\ordre du jour. Nous ne pouvons pas laisser leur corruption s\tendre; tudions plutt les carcasses de ces cratures.\n\nAcceptez-vous de nous aider?', '', '', '', '', '', '', 47187),
(65711, 'frFR', 'Pas de quartier pour les tortionnaires', 'Tuez les extracteurs de tempte et sauvez Lizi l\chine-de-tonnerre au campement kaghan.', 'C\est vous! Ohn\ahra soit loue. Je faisais semblant d\tre blesse pour tromper la prochaine brute  oser entrer ici. Argh Ces lche-sabots m\ont jet un sort pour m\empcher de bouger Je vais trouver une solution.\n\nCes misrables ont pig Lizi dans la grotte. Allez la sauver, je vous en supplie. Je vais trouver un moyen de me librer.\n\nFaites ce que vous avez  faire.', '', '', '', '', '', '', 47187),
(65709, 'frFR', 'lagage arcanique', 'Fouillez le sac de marchandises utiles  la recherche du sceptre tellurique, puis utilisez-le pour rparer 2plateformes.', 'Nous ne pourrons pas activer la pierre de vu des archives d\Azur avant d\avoir stabilis l\nergie tellurique qui se dchane en ces lieux.\n\nSur les trois runes draconiques censes la contrler, deux sont hors service en raison d\un trop-plein d\arcana instable.\n\nJe suis navr de vous solliciter, mais Khadgar a bien trop de responsabilits et mes frres se sont apparemment volatiliss.\n\nIl devrait y avoir un sceptre tellurique dans le sac de marchandises utiles que vous avez rcupr.\n\nUtilisez-le pour aider  rhabiliter des runes.', '', '', '', '', '', '', 47187),
(65702, 'frFR', 'Hystrie collective', 'Rcuprez $1oanergies arcaniques instables.', 'Il fut un temps o les Dragons bleus se retrouvaient aux archives d\Azur pour discuter de magie.\n\nJe me retrouve aujourd\hui livr  moi-mme.\n\nCet difice rgissait autrefois les immenses lignes telluriques qui sillonnent la rgion mais ses gardiens et lui-mme sont dsormais hors de contrle.\n\nJe pense nanmoins qu\en rtablissant l\ordre, je pourrai reprendre possession de la pierre de vu d\Azur.\n\nLes divers assemblages et lments sont saturs d\une nergie arcanique instable qu\il va nous falloir rediriger.\n\nDtruisez-les et rcuprez-en un maximum.', '', '', '', '', '', '', 47187),
(65701, 'frFR', 'Prservation ou Dvastation', 'Choisissez une spcialisation.', 'S\il faut en croire ces Dragons, nous sommes  la veille d\une grande bataille. Vous allez devoir dployer des trsors de force et de dtermination, $gvocateur:vocatrice;.\n\nIl est temps pour vous de choisir une spcialisation de combat. Que prfrez-vous? Protger vos allis ou dcimer vos adversaires?\n\nOptez pour la Dvastation si vous souhaitez dvelopper vos comptences de combat  leur maximum.\n\nEn revanche, si vous prfrez vous concentrer sur vos capacits de soins, engagez-vous plutt sur la voie de la Prservation.\n\nL\une comme l\autre vous seront fort utiles. Et gardez  l\esprit que vous pourrez toujours en changer ou l\adapter ultrieurement.', '', '', '', '', '', '', 47187),
(65691, 'frFR', 'L\ombre de ses ailes', 'Affrontez Cygenoth, la Voix de Neltharion.', 'La Voix de Neltharion passe sa vie sous terre,  propager ses mensonges parmi ses disciples.\n\nIl semble s\agir d\un Draconide comme moi; mais sa matrise de notre langue est balbutiante, indigne de ses cailles.\n\nJe souponne une imposture, ou peut-tre une illusion. Si nous pouvions le matriser, la vrit ne manquerait pas d\clater au grand jour.', '', 'Voix autoproclame de Neltharion et dirigeant des Brise-monde.', 'Cygenoth', '', '', '', 47187),
(65690, 'frFR', 'Proccupations sectaires', 'Trouvez Ayasanth au perchoir Fulminant.', 'Une autre trangre est arrive hier. Elle se prtend ambassadrice du Vol draconique rouge et a demand  s\entretenir avec notre chef, la Voix de Neltharion.\n\nMais la Voix est entre dans une colre noire avant de dclarer qu\il s\agissait d\une mise  l\preuve du Gardeterre et de rclamer l\excution de l\trangre!\n\nJe sais que nous ne devons pas faire confiance aux personnes extrieures, mais de l  les tuer! Je vous en supplie, aidez-moi  la sauver.', '', '', '', '', '', 'Allez parler  Ayasanth au perchoir Fulminant.', 47187),
(65689, 'frFR', 'Les mille images de Kalecgos', 'Utilisez le pylne de cristal pour atteindre les archives d\Azur.', 'Ravi de faire officiellement votre connaissance, $n. Je m\appelle Kalecgos, archimage du Kirin Tor et Aspect du Vol draconique bleu.\n\nJ\ai quelques difficults  rparer les archives d\Azur, j\en ai pourtant besoin pour rcuprer la pierre de vu d\Azur. Une paire de bras supplmentaire ne serait pas de refus.\n\nJe vous attends dans les hauteurs des archives. J\ai russi  ractiver le pylne extrieur, servez-vous-en pour me rejoindre.', '', '', '', '', '', 'Parlez  Kalecgos aux archives d\Azur.', 47187),
(65688, 'frFR', 'Rencontre avec Kalecgos', 'Rcuprez le sac de marchandises utiles, puis allez trouver Kalecgos au pied des archives d\Azur.', 'Je crains que les Primalistes  l\est ne reprsentent une menace que nous ne pouvons ignorer.\n\nIl faut que vous vous rendiez aux archives d\Azur  ma place, afin d\aider Kalecgos  rcuprer la pierre de vu d\Azur.\n\nVous aurez besoin de matriel.\n\nAdressez-vous  notre intendante des portails; elle vous remettra quelque chose qui vous aidera dans votre mission.\n\nBonne chance, $n. Kalecgos vous en sera reconnaissant.', '', '', '', '', '', 'Retrouvez Kalecgos au pied des archives d\Azur.', 47187),
(65687, 'frFR', 'a s\anime', 'liminez $1oaDraconiens brise-monde.', 'Certains des autres disciples sont trs mchants.\n\n<Ling\Ot se frotte une plaie rcente sur le museau.>\n\nC\tait pas toujours comme a, mais quand Cygenoth est arriv, il a dit: La plus grande des qualits, c\est la force. Depuis, tout le monde passe son temps  se battre.\n\nJe fais tout pour riposter! Mais leur cuir est trop pais et je suis trop petit.\n\nMais vous, non! Je suis sr que vous affrontez des brutes tous les jours! Vous pourriez peut-tre m\aider?', '', '', '', '', '', '', 47187),
(65686, 'frFR', 'En route pour la trave d\Azur', 'Allez trouver Glania des Dignes dans la trave d\Azur.', 'Salutations, $n!\n\nPakina et moi sommes ici en mission pour le Kirin Tor.\n\nNous cherchons  contenir la magie arcanique brute qui s\est rpandue un peu partout dans la trave d\Azur.\n\nKalecgos, l\Aspect du Vol draconique bleu qui nous dirige, aurait galement besoin de retrouver la pierre de vu d\Azur.\n\nSi vous souhaitez nous prter main-forte, suivez cette route jusqu\ ce que vous tombiez sur Glania des Dignes.\n\nElle vous donnera vos instructions.', '', '', '', '', '', 'Allez trouver Glania des Dignes dans la trave d\Azur.', 47187),
(65615, 'frFR', 'Intrusion des arcanes', 'Examinez le relais.', 'Je jurerais que ce fanal n\tait pas l quand la stase s\est empare de nous.\n\nJe ne suis pas spcialiste des sorts, mais je sais reconnatre l\uvre de la magie arcanique. Le Dragon bleu a utilis cette mme magie dans le couvoir.\n\nIl a mentionn un nom Malygos. Il m\est familier, mais les enseignements du Gardeterre me semblent fragments et distants.\n\nSi c\est ce Malygos qui nous a fait subir la stase, le fanal arcanique a peut-tre t plac sur ses ordres.\n\nFouillez la zone et revenez me faire votre rapport. Assurez-vous que personne ne puisse utiliser ce fanal pour appeler des renforts ennemis.', '', '', '', '', '', '', 47187),
(65613, 'frFR', 'Icne draconique', 'Adoptez une forme anthropique.', 'Votre arrive  Orgrimmar aura attir l\attention de ses habitants, certains probablement plus  l\aise que d\autres  votre vue.\n\nAlors que je n\tais qu\un jeune Dragon, j\ai adopt l\apparence mortelle que vous voyez aujourd\hui et qui m\a permis de vivre parmi les Taurens de Haut-Roc.\n\nMme si votre histoire diffre de la mienne, l\essence des Draconides coule dans vos veines, $p. Peut-tre vous permettra-t-elle d\adopter une forme qui vous sera propre?\n\nAccompagnez-moi.', '', '', '', '', '', '', 47187),
(65606, 'frFR', 'Renomme auprs des Maruuks', 'Parlez  Agari  Maruuka.', 'Votre dvouement  la cause de notre clan n\est pas pass inaperu.\n\nRevenez  Maruuka: je vous ai prpar de quoi vous aider dans vos missions  notre service.', '', '', '', '', '', '', 47187),
(65595, 'frFR', 'Pomme pourrie', 'Tuez la racine de putrfaction.', 'Pourriture affamer Gnolls.\n\nPourriture faire souffrir amis.\n\nNous tuer pourriture. a tre mission Mon-Arc.', '', 'Cet horrible Trant a montr aux Gnolls comment utiliser la magie de putrfaction. En plus de leur inculquer une hygine discutable.', 'Racine de putrfaction', '', '', '', 47187),
(65594, 'frFR', 'Gnognoll  gogo', 'Dtruisez $2oatotems de putrfaction.', 'Pourriture dbile croire elle dcider, mais MOI dcider. Nous tuer. Moi ami avec limon!', '', '', '', '', '', '', 47187),
(65490, 'frFR', 'Excrments explosifs', 'Remplissez l\excrcollecteur automatique de Sarcasiffle.', 'La prsence des harpies est plutt une bonne surprise, mais je suis venue dans ces montagnes  la recherche d\une seule chose: des EXCRMENTS!\n\nEt plus spcifiquement, des excrments de rocs plumebleues dvors et digrs par des insectes, car les sucs gastriques des scarabes dcuplent leur quantit d\azote explosif!\n\nTenez, prenez cet excrcollecteur automatique de Sarcasiffle. Allez craser les scarabes qui grouillent dans la grotte et utilisez le collecteur pour effectuer des prlvements.\n\nUne fois rempli, rapportez-le-moi pour que nous puissions enfin passer aux choses srieuses: TOUT FAIRE SAUTER!', '', '', '', '', '', '', 47187),
(65486, 'frFR', 'Photo parfaite', 'Embarquez sur le radeau des Inventoristes avec Fren et photographiez la faune locale.', 'J\espre que je ne vous ai pas fait attendre! La notion du temps, je la perds avec ce tlescope.\n\nLe monde, il parat plus simple quand on l\observe de loin, vous ne trouvez pas? La nature, elle est laisse  elle-mme, sans aucune perturbation\n\n<Akunda l\Inventoriste pousse un profond soupir.>\n\nJe vois que Coralie, elle vous a donn un appareil photo, c\est parfait.\n\nAllez faire un tour sur la rivire avec Fren et faites des photos de la faune dans son milieu naturel afin que je puisse les tudier.', '', '', '', '', '', 'Retrouvez Akunda l\Inventoriste au camp.', 47187),
(65475, 'frFR', 'Hurlements en vol', 'Apportez le parchemin hurlevol  Harleen Sarcasiffle aux falaises Plumebleue.', '<Vous tirez de la sacoche dgoulinante de sang de Croque-Roc un bout de parchemin sur lequel il vous semble distinguer des Harpies dvorant des ufs de grande taille.\n\nVotre ornithologue favorite, Harleen Sarcasiffle, n\aura srement aucun mal  dchiffrer les marques de griffures qui accompagnent le dessin.>', '', '', '', '', '', 'Apportez le parchemin hurlevol  Harleen Sarcasiffle aux falaises Plumebleue.', 47187),
(65453, 'frFR', 'Vermine primordiale', 'Tuez $1oaproto-drakes primordiaux sur la cte Sauvage.', '<Cendrcraz lance un regard suspicieux aux proto-dragons qui rdent sur la crte derrire elle.>\n\nJe jurerais que ces proto-dragons se rapprochent un peu plus du camp chaque fois que je tourne le dos\n\nCe ne sont pas les Dragons qu\byssian a invits  nous rencontrer.\n\nLes proto-dragons sont d\impitoyables prdateurs avec qui il est impossible de raisonner. Nous devons tre impitoyables en retour.\n\nRduisez leur nombre pour refroidir leurs ardeurs, ou notre expdition prendra fin avant d\avoir commenc.', '', '', '', '', '', 'Allez voir la squammandante Cendrcraz  l\ambassade de Trve-Aile.', 47187),
(65452, 'frFR', 'Prilleuse exploration', 'Secourez 3membres de l\expdition du Dracaret sur la cte Sauvage.', 'Ne mprenez pas les aspirations acadmiques de l\expdition pour de la couardise, $p.\n\nNous ne sommes pas des ermites qui tudient d\antiques manuscrits dans des tours d\ivoire.\n\nNous sommes des aventuriers et aventurires en qute de connaissances aux quatre coins d\Azeroth!\n\nC\est  cause de cette soif d\aventure que nous nous retrouvons souvent dans des situations prilleuses. Et justement, quelques membres de l\expdition ont eu les yeux plus gros que le ventre', '', '', '', '', '', 'Allez voir Naleda  l\ambassade de Trve-Aile.', 47187),
(65451, 'frFR', 'Matriel d\entranement', 'Rcuprez $1oacailles de proto-dragonnets primordiaux.', 'Jamais je n\avais vu sur Azeroth des cratures semblables  ces proto-drakes.\n\nLeurs cailles sont naturellement ignifuges et plus rsistantes que l\acier, mais n\en restent pas moins flexibles. C\est incroyable!\n\nTous mes artisans et artisanes, sans exception, se battent pour mettre la main sur ces cailles.\n\nCommencez par les drakes juvniles. Les petites cailles devraient tre plus souples et nous permettre de parfaire nos techniques.', '', '', '', '', '', 'Allez voir le chef Magor  l\ambassade de Trve-Aile.', 47187),
(65444, 'frFR', 'Direction, les les aux Dragons!', 'Embarquez  bord du Dracaret intrpide pour les les aux Dragons  la tour aux zeppelins,  l\extrieur d\Orgrimmar.', 'Notre expdition prliminaire a atteint les les aux Dragons.\n\nGrce aux efforts des braves membres du Dracaret, nous avons tabli une tte de pont scurise sur les les et nous avons pu entrer en contact avec l\ambassade draconique.\n\ntes-vous $gprt:prte;  nous accompagner dans notre prochain voyage vers les les aux Dragons?', '', '', '', '', '', 'Allez voir Naleda Mirerive sur les rivages des les aux Dragons.', 47187),
(65443, 'frFR', 'Coordination expditionnaire', 'Recrutez des explorateurs, des artisans et des rudits  travers Orgrimmar pour l\expdition vers les les aux Dragons.', 'C\est un plaisir de vous rencontrer! Je m\appelle Naleda.\n\nCette invitation  nous rendre sur les les aux Dragons est une perspective trs stimulante, vous ne trouvez pas?\n\nLe Reliquaire s\est associ  ses homologues des corps expditionnaires pour nous aider  coordonner nos efforts. En tant que membre de l\expdition du Dracaret, j\ai l\honneur de vous souhaiter la bienvenue.\n\nCela tant dit, nous devons d\abord rassembler quelques personnes supplmentaires pour nous accompagner. Commenons, voulez-vous?', '', '', '', '', '', 'Retrouvez Naleda Mirerive  la tour des zeppelins, prs d\Orgrimmar.', 47187),
(65439, 'frFR', 'Des murmures dans le vent', 'Parlez  l\Archimage Khadgar  l\extrieur d\Orgrimmar.', 'Bonjour, $p. a fait longtemps, et j\aimerais avoir le temps de discuter.\n\nMais voyez-vous, j\ai eu une conversation assez instructive non, disons plutt inquitante oui. Une conversation inquitante avec une vieille connaissance.\n\nUne rvlation peut tre les deux  la fois, aprs tout.\n\nIl faut absolument que je vous rapporte ce que j\ai appris.', '', '', '', '', '', '', 47187),
(65438, 'frFR', 'Lancement de qute gnial', '', 'Dbut de la trave d\Azur.', '', '', '', '', '', '', 47187),
(65437, 'frFR', 'L\invitation des Aspects', 'Parlez  byssian.', 'Vous arrivez  point nomm, $p.\n\nJe viens de consulter le conseil de la Horde, qui a accept l\invitation des Aspects sur les les aux Dragons.\n\nCette invitation vous concerne galement.\n\nVous avez certainement remarqu quelques visages inconnus dans Orgrimmar. Les Dracthyrs viennent d\arriver, et vous apprendrez  les connatre au cours du voyage.\n\nPoursuivons notre conversation, voulez-vous?', '', '', '', '', '', '', 47187),
(65436, 'frFR', 'Les les aux Dragons vous attendent', 'Allez voir Irion  Hurlevent.', 'J\ai une formidable nouvelle, mon $uami:amie;! Les les aux Dragons s\veillent!\n\nMon peuple a quitt ses terres endormies  l\aube de la Fracture, mais aujourd\hui, nous entendons enfin l\appel de notre foyer!\n\nLes les regorgent de merveilles, mais aussi de dangers. Nous aurons besoin du soutien des armes mortelles pour reprendre notre hritage.\n\nRetrouvez-moi  Hurlevent. Je dois y prsenter l\invitation des Aspects  l\Alliance.', '', '', '', '', '', '', 47187),
(65435, 'frFR', 'Les les aux Dragons vous attendent', 'Allez voir byssian  Orgrimmar.', 'Hros et hrones de la Horde, j\apporte des nouvelles. Les les aux Dragons s\veillent!\n\nElles s\taient endormies  l\aube de la Fracture, mais aujourd\hui, enfin, elles nous appellent  rentrer chez nous.\n\nSi ces les abritent bien des merveilles, elles sont aussi prilleuses. Nous aurons besoin du soutien des armes mortelles pour reprendre notre hritage.\n\nJe m\apprte  prsenter l\invitation des Aspects au conseil de la Horde,  Orgrimmar. Retrouvez-moi l-bas, et nous dcouvrirons son verdict.', '', '', '', '', '', '', 47187),
(65422, 'frFR', 'La chasse au trsor, c\est pas de la tarte', 'Prenez l\quipement d\escalade, trouvez une prise et grimpez jusqu\au sommet de la montagne sans dvisser!', 'Je lis dans vot\ regard que a vous dmange d\escalader c\te montagne, rien que pour contempler son sommet!\n\nNous autres, alpinistes, on se reconnat les uns les autres. Et on est pas du genre  se laisser intimider par un tas de cailloux.\n\nEh bien, vous avez de la veine, j\ai apport tout un tas de matriel d\escalade. Alors, prenez un sac et ouvrez une voie vers le sommet!', '', '', '', '', '', 'Parlez  Pppi Finrouage au sommet de la montagne.', 47187),
(65421, 'frFR', 'Escalader toutes les montagnes', 'Prenez l\quipement d\escalade, trouvez une prise et grimpez la falaise afin de sauver la guide Jap!', 'J\espre que vous apprenez vite, $c, parce qu\on n\a pas le temps pour une leon!\n\nPrenez un sac et ouvrez une voie vers le sommet.\n\nUne fois l-haut, balancez ce parachute  cette chre Jap. La pauvre s\est enchevtre dans des lianes aprs qu\ces lmentaires d\air ont fait s\craser not\ engin volant!\n\nHtez-vous, qu\on file d\ici en vitesse!', '', '', '', '', '', '', 47187),
(65417, 'frFR', 'Les pices s\embotent', '', '', '', '', '', '', '', '', 47187),
(65374, 'frFR', 'Ultime plumage', 'Rcuprez $1oaplumes d\oisillon.', 'Harleen m\a dit qu\elle vous fabrique un dguisement! J\ai hte de voir a! Mais elle va avoir besoin de plumes de jeunes rocs pour parachever votre tenue.\n\nFort heureusement, je viens de finir de rparer le super-plumeur3300!\n\nLes Hurlevols des falaises infrieures capturent de jeunes rocs dans le but de les lever et les faire se reproduire. Utilisez le super-plumeur pour sauver ces pauvres cratures et prlever quelques plumes au passage.\n\nD\un plumeur deux coups, comme qui dirait!', '', '', '', '', '', '', 47187),
(65373, 'frFR', 'Plumes  part', 'Rcuprez les 4pices du super-plumeur3300.', 'Oh non J\ai commis une terrible erreur.\n\nHarleen m\a confi son clbre super-plumeur3300, l\une de ses extraordinaires inventions!\n\nJ\avais l\intention de rcolter des plumes de rocs pour ses recherches dans la grotte au sud d\ici, mais j\ai t attaque par des Harpies, et l\appareil s\est cass alors que je prenais la fuite.\n\nVous voulez bien aller rcuprer les diffrentes pices? Elles sont probablement parpilles dans la grotte comme autant d\cailles perdues.\n\nJe suis sre de pouvoir le remettre en tat. Enfin, je l\espre.', '', '', '', '', '', '', 47187),
(65371, 'frFR', 'Un petit nid rien qu\ nous', 'Rcuprez $1oaserres hurlevols, $2oabtons hurlevols et $3oanoyaux des criques.', 'Le parchemin que vous avez trouv ordonne d\apporter tous les ufs de Plumebleues  la cheffe harpie Frit\aire. Apparemment, la matriarche des Hurlevols exige que chacun de ses repas soit soigneusement prpar et assaisonn.\n\nNous allons donc lui offrir un de nos ufs spciaux qui lui fera EXPLOSER les papilles et le reste, bien sr.\n\nEt comment allez-vous le lui faire parvenir? Mais en vous dguisant, bien sr!\n\nTuez les cratures des falaises infrieures, rcuprez le contenu de cette liste, et je vous fabriquerai une tenue emplume.', '', '', '', '', '', '', 47187),
(65313, 'frFR', 'Roc en stock', 'Tuez Hawthia Croque-Roc.', 'Tharzera est pleine de bonne volont, elle se dbrouille bien avec mes gadgets, mais elle panique facilement.\n\nComme lorsque je l\ai envoye dans les grottes au sud d\ici, d\o elle s\est fait promptement chasser par une Harpie d\une taille inhabituelle. Et il semble que ses congnres lui obissaient.\n\nSe pourrait-il que ce soit la matriarche de cette couve? Ou peut-tre une sorte de commandante? Allez tirer cela au clair, $n.\n\nEt ne craignez par de leur voler dans les plumes, si vous voyez ce que je veux dire.', '', 'Une Harpie hurlevol particulirement imposante, qui n\aime rien de mieux que croquer les os des plumebleues.', 'Hawthia Croque-Roc', '', '', '', 47187),
(65307, 'frFR', 'La compassion avant tout', 'Soignez les Dracthyrs et Draknides blesss.', 'Le niveau de toxicit dans le couvoir est tel que nous avons tous failli prir. Trouvez des victimes et soignez-les pendant que je prpare l\antidote.\n\nOui, mme les Draknides bleus. Les Caduces ne resteront pas sans rien faire quand d\autres souffrent.', '', '', '', '', '', '', 47187),
(65306, 'frFR', 'levage de pourriture', 'Rcuprez $1oalimon(s) ftide(s) dans la fange.', 'Pourriture sale, puante et faire mal. Moi ide, mais besoin limon. VOUS TROUVER LIMON!', '', '', '', '', '', '', 47187),
(65302, 'frFR', 'Les cls du royaume', 'Trouvez la cl et utilisez-la pour ouvrir la cache d\armes.', 'Besoin armes pour plan. Moi avoir bonnes armes, mais enfermes. Gnolls laisser cl au camp, et protger cache.\n\nVous trouver btons pointus et faire beaucoup taches de sang.', '', '', '', '', '', '', 47187),
(65287, 'frFR', 'Sparer le blanc du jaune', 'Rcuprez $1oaufs plumebleues.', 'J\ai dchiffr le parchemin, et surprise son contenu est alarmant!\n\nLes Hurlevols ne se contentent pas de dvorer les plumebleues pour s\alimenter. Il s\avre qu\elles ont appris un sort ou deux leur permettant d\absorber la force intrinsque des rocs lorsqu\elles s\en nourrissent. Ce qui explique pourquoi elles s\intressent tant  ces ufs!\n\nSauvez autant d\ufs de roc que possible au niveau des falaises. Quant  moi, je retiendrai les Harpies le temps de mettre mon plan  excution.\n\nEt mfiez-vous des lmentaires. La magie des jeteuses de sorts a un effet dltre sur eux.', '', '', '', '', '', '', 47187),
(65286, 'frFR', 'Contacts draconiques', 'Entrez dans Hurlevent.', 'D\ordinaire, un tel vol aurait d nous prendre bien plus de temps. Mais quand l\Aspect de bronze en personne vous presse, le temps n\est plus un obstacle.\n\nOh, les soldats en armes? N\ayez nulle inquitude. Simple formalit.\n\nJe vais tenter d\obtenir une audience avec le seigneur commandant. Profitez-en pour prendre vos marques avec Azurathel.\n\nC\est une chance que je possde une influence considrable dans cette ville.', '', '', '', '', '', 'Parlez  Azurathel.', 47187),
(65279, 'frFR', 'Par dcret royal', 'Tuez $1oaguerriers et guerrires fougerobes et $2oachamans et chamanes fougerobes  la tanire de Ruissedent.', 'Imbciles de Gnolls pas comprendre couronne. Juste comprendre violence. Vous frapper imbciles, ou moi manger vous.', '', '', '', '', '', '', 47187),
(65274, 'frFR', 'Navigation Playtest: Level Up', '', 'This is a single quest. It will guide you though the high points of the level up story for Thaldraszus', '', '', '', '', '', '', 47187),
(65267, 'frFR', 'Plumage intgral', 'Tuez $1oafltrisseuses hurlevols et $2oagriffe-sorts hurlevols.', 'Ces tranges cratures ailes ont attir mon attention, et j\ai tent de me prsenter  elles. Sans l\intervention du professeur et de son norme volaille mcanique, elles m\auraient dvore sans autre forme de procs!\n\nPouvez-vous nous aider avec ces Hurlevols? Les rocs plumebleues des environs ont bien du mal  dfendre leurs nids.\n\nSans compter que je dtesterais voir une telle mprise se reproduire', '', '', '', '', '', '', 47187),
(65220, 'frFR', 'Navigation Playtest: Level Up (PART 2)', '', 'Fin de la trave d\Azur.', '', '', '', '', '', '', 47187),
(65218, 'frFR', 'Navigation Playtest: Level Up (PART 1)', '', 'Dbut de la trave d\Azur.', '', '', '', '', '', '', 47187),
(65133, 'frFR', 'Comment profiter de votre lan avec votre Dragon', 'Plongez  travers les anneaux et atterrissez dans la zone d\arrive.', 'Que faire en cas d\obstacle sur votre trajectoire, vous demandez-vous?\n\nTant que vous volez correctement, vous pouvez conserver votre lan et reprendre de l\altitude aprs une descente en piqu.\n\n votre prochain piqu, vous constaterez que votre trajectoire vous amne en dessous de la zone d\atterrissage. Il vous suffira d\utiliser votre lan pour reprendre de l\altitude  la fin du circuit et d\atterrir dans la zone prvue.\n\nSi vous avez besoin de revenir au dpart, utilisez la montre en bronze et Clormu se chargera du reste.', '', '', '', '', '', '', 47187),
(65120, 'frFR', 'Comment faire un piqu avec votre Dragon', 'Plongez puis planez  travers les anneaux, puis atterrissez dans la zone d\arrive.', 'Planer pourrait suffire s\il ne fallait pas battre des records de vitesse.\n\nFaites un piqu aprs un saut depuis une hauteur pour bnficier d\une acclration.\n\nTraversez les anneaux en volant jusqu\ la zone indique.\n\nSi vous avez besoin de revenir au dpart, utilisez la montre en bronze et Clormu se chargera du reste.', '', '', '', '', '', '', 47187),
(65118, 'frFR', 'Comment planer avec votre Dragon', 'Planez  travers les anneaux et atterrissez dans la zone d\arrive.', 'Commenons par les rudiments.\n\nVous puiserez rapidement votre monture si vous volez en ligne droite. Tirez parti de la gravit et faites un lger piqu pour parcourir une longue distance. Les anneaux vous indiquent l\angle  adopter pour planer.\n\nCommencez donc par appeler votre drake.\n\nTraversez ensuite les anneaux et atterrissez dans la zone indique.\n\nSi vous avez besoin de revenir au dpart, utilisez la montre en bronze et Clormu se chargera du reste.', '', '', '', '', '', '', 47187),
(65101, 'frFR', 'Icne draconique', 'Adoptez votre forme anthropique.', 'Votre arrive  Hurlevent a attir l\attention, $p. Nul doute qu\une partie des autochtones est plus favorable qu\une autre  votre prsence.\n\nNous autres Dragons avons pour habitude de faciliter nos rapports avec les autres races en prenant l\apparence de cratures mortelles, comme celle que vous voyez devant vous. Non seulement cela les apaise, mais cela nous pargne galement bien des dsagrments pour franchir des portes.\n\nL\essence des Draconides coule manifestement dans les veines des Dracthyrs. Je vous souponne d\tre capables comme nous d\adopter une forme anthropique.\n\nVenez avec moi.', '', '', '', '', '', 'Montrez votre forme anthropique  Irion.', 47187),
(65100, 'frFR', 'Les derniers ordres', 'Organisez l\vacuation des confins Interdits.', 'La tempte libre par Raszageth est trop forte. Nous devons vacuer le seul foyer que notre peuple ait connu.\n\nLe Gardeterre n\est plus l pour nous commander. C\est la premire fois que nous sommes libres de nos choix. De forger notre propre destine.\n\nO que vous dcidiez d\aller, je vous conjure de trouver de fidles allis pour affronter cette nouvelle re. Racontez-leur notre histoire.\n\nQuant  moi je vais rester ici pour chercher des rescaps et peut-tre mme trouver des rponses sur notre pass.\n\nPuisse la chance nous sourire, $p.', '', '', '', '', '', 'Prsentez-vous  votre squammandant.', 47187),
(65098, 'frFR', 'Les consquences du courage', 'Trouvez byssian.', 'Merci de m\avoir soign, $n. J\ose y voir le signe que nos liens de confiance se resserrent.\n\n<Irion frmit.>\n\nLa Mange-temptes Je n\avais encore jamais affront une Dragonne imprgne d\une telle puissante lmentaire. Je tremble  l\ide qu\il puisse en exister d\autres\n\nAttendez O est pass byssian? A-t-il survcu? Vous devez  tout prix le retrouver!', '', '', '', '', '', 'Parlez  Ardenthal.', 47187),
(65097, 'frFR', 'Courez!', 'Repliez-vous!', 'Des temptes s\amassent au-dessus de nos ttes! Nous devons vacuer les lieux!\n\nSauvez ceux et celles qui peuvent encore l\tre. Et trouvez ces Dragons noirs!', '', '', '', '', '', 'Parlez  Irion.', 47187),
(65087, 'frFR', 'Le trsor du caveau', 'Dfendez le caveau.', 'Ainsi, les Primalistes veulent faire main-basse sur le contenu de ce caveau?\n\n<Sarkareth plisse les yeux.>\n\nQu\ils viennent.\n\nNous allons leur montrer ce dont sont capables les Dracthyrs!', '', '', '', '', '', '', 47187),
(65084, 'frFR', 'Le caveau Givre-Pierre', 'Rendez-vous au caveau Givre-Pierre.', 'Regardez l-bas, de l\autre ct de la trave! Des troupes ennemies convergent sur le caveau Givre-Pierre.\n\nLa tempte que ces Primalistes cherchent  librer doit se trouver  l\intrieur.\n\n<Ardenthal grimace, aux prises avec sa mmoire dfaillante.>\n\nNous avons dj combattu ces adversaires et nous en avons triomph. Neltharion avait donn l\ordre de dfendre ce caveau, mais je ne parviens pas  me souvenir pourquoi.\n\nL\heure n\est pas  la contemplation. Rejoignez Sarkareth et les cailles d\bne au caveau. Assurez-vous que l\arme ennemie n\y pntre pas!', '', '', '', '', '', 'Prsentez-vous au squammandant Sarkareth, au caveau Givre-Pierre.', 47187),
(65075, 'frFR', 'Les Caduces', 'Parlez  Ardenthal.', '$gvocateur:vocatrice;, vous avez toute ma gratitude pour avoir secouru mon weyrn alors que nous tions si vulnrables.\n\nLes Caduces partiront rejoindre le reste de nos troupes une fois que nous aurons repris des forces.\n\nJ\ai appris par Cendrcraz qu\Ardenthal a perdul\ensemble des membres de son weyrn. Hlas, je ne connais aucun sort pour panser pareille blessure.\n\nMalgr son dtachement apparent, elle souffre terriblement de ces pertes, $n. Dites-lui que je la rejoindrai sous peu.', '', '', '', '', '', 'Parlez  Ardenthal.', 47187),
(65074, 'frFR', 'Proie facile', 'Tuez $1oascythides.', 'Des scythides ont lu domicile autour de ce couvoir. Ces insectodes sont voraces, et souvent aussi territoriaux qu\agressifs.\n\nToutes ces victimes seraient des proies faciles pour ces monstres. Je ne veux pas que ces sales btes attaquent nos soigneurs et soigneuses, qui se remettent  peine de leurs preuves.\n\nRduisez leur nombre pendant que je m\occupe de Viridia.\n\nElle est trs courageuse.', '', '', '', '', '', '', 47187),
(65073, 'frFR', 'Un problme toxique', 'Collectez $1oaglandes  toxine.', 'Vous vous remettez rapidement, $n. Tant mieux.\n\nCelles et ceux qui ont russi  s\chapper de mon couvoir se rtablissent, mais d\autres sont toujours  l\intrieur. Et il me faudra retourner vous chercher si vous foncez tte baisse pour leur porter secours.\n\nDes scarabes nichent tout autour de la caldeira. Leurs glandes  toxines pourraient nous permettre de contrer les effets de ce poison.\n\nN\tant pas en tat d\aller en chercher moi-mme, je me vois contrainte de faire appel  vos talents, $gvocateur:vocatrice;.', '', '', '', '', '', '', 47187),
(65071, 'frFR', 'Au secours!', 'Sauvez la petiteKo.', 'J\ai besoin d\aide!\n\nJe m\appelle To\no. J\tais en train d\explorer les lieux, vu que c\est ce que je sais faire de mieux, mais je n\ai pas remarqu que ma petite sur, Ko, m\avait suivi. Vous devez m\aider  la retrouver, elle a des ennuis. S\il vous plat!\n\nElle est entre dans cette grotte, mais elle n\est pas aussi doue que moi pour se cacher, et nos parents sont trop loin pour nous aider.\n\nVous pouvez la retrouver avant les monstres?', '', '', '', '', '', 'Raccompagnez les enfants auprs de leurs parents.', 47187),
(65063, 'frFR', 'Au cur de la ruche', 'Suivez Cendrcraz pour trouver Viridia.', 'La toxine qui a infect ce couvoir est assez puissante pour avoir raison de nos meilleurs soigneurs et soigneuses.\n\nCela n\augure rien de bon pour nous, $n.\n\nMais qu\importent les risques. Il reste des Dracthyrs  l\intrieur. Nous devons entrer.\n\nInspirez un bon coup et suivez-moi!', '', '', '', '', '', 'Parlez  Viridia.', 47187),
(65060, 'frFR', 'La caldeira des Soigneurs', 'Rejoignez Cendrcraz  la caldeira des Soigneurs.', 'La vision que vous avez reue du fanal arcanique prouve que d\autres Dracthyrs sont encore dans leurs couvoirs. Nous ne pouvons pas nous permettre d\en perdre davantage.\n\n<Ardenthal s\interrompt en plissant le front.>\n\nLes Caduces n\ont pas leur pareil pour gurir blessures et maladies. Leur couvoir se trouve dans la caldeira des Soigneurs. Cendrcraz sait comment s\y rendre.\n\nNous n\abandonnerons personne, $gvocateur:vocatrice;.', '', '', '', '', '', 'Parlez  Cendrcraz dans la caldeira des Soigneurs.', 47187),
(65057, 'frFR', 'Rejoindre Ardenthal', 'Prsentez-vous  Ardenthal.', 'Plat-il? Vous voulez que je rejoigne Ardenthal maintenant que le combat est termin? Azurathel s\imagine-t-elle que je vais obir  ses ordres?\n\nVous divaguez.\n\nLes cailles d\bne n\en rpondent qu\au Gardeterre. Et jusqu\ici, je n\ai reu aucun ordre de Neltharion.\n\n<Sarkareth vous lance un regard noir.>\n\nCela tant dit, je suis bien conscient de la menace que reprsentent ces Primalistes. Je suis certain d\avoir eu  les combattre par le pass, et pourtant\n\nNous serons au rendez-vous une fois que nous aurons rcupr. Vous pouvez disposer, $gvocateur:vocatrice;.', '', '', '', '', '', '', 47187),
(65052, 'frFR', 'Les cailles d\bne', 'Rejoignez le squammandant Sarkareth.', 'Nous avons surmont l\incursion des Primalistes. Il nous faut  prsent atteindre le couvoir.\n\nLe squammandant Sarkareth est un dur  cuire, et son weyrn a su faire face  la menace. Reste ce Dragon qui cloue les cailles d\bne au sol.\n\nIl est temps de leur prter main-forte.\n\nVous mnerez l\assaut. Quand nous serons  porte du Dragon, donnez le signal et nous l\attaquerons de toutes nos forces.\n\nMfiez-vous des embuscades. J\ai un mauvais pressentiment.', '', 'Une bte antique qui retient les cailles d\bne prisonnires.', 'Ekrazathal', '', '', 'Parlez au squammandant Sarkareth.', 47187),
(65050, 'frFR', 'Arme conjure', 'Tuez $1oalmentaires conjurs.', 'Ces Primalistes invoquent une arme d\lmentaires. Tout porte  croire qu\ils comptent les jeter contre nos troupes.\n\nNous n\allons pas les laisser faire.\n\nFrappez-les d\une pluie de feu, $gvocateur:vocatrice;! Rduisez en cendre les lmentaires des confins et assurez-vous que celles et ceux qui les ont appels n\en invoqueront pas davantage.', '', '', '', '', '', 'Retrouvez Azurathel au cratre Trombclat.', 47187),
(65049, 'frFR', 'Maille  partir avec les Taraskes', 'Tuez $1oaTaraskes.', 'Les Taraskes sont aussi imprvisibles que sauvages, comme des sortes de Draknides primordiaux.\n\nPour Neltharion, ce peuple n\tait rien de plus que de la chair  canon, des cibles sur lesquelles s\entraner. Mais ce sont d\habiles spcialistes de la chasse et leurs meutes ont eu raison de bien des imprudents.\n\nLes Taraskes deviendraient considrablement plus redoutables si ces Primalistes venaient  leur confrer des pouvoirs lmentaires.\n\nNous devons  tout prix les en empcher, $n. Rduisez leur nombre.', '', '', '', '', '', 'Retrouvez Azurathel au cratre Trombclat.', 47187),
(65046, 'frFR', 'Les Primalistes', 'Trouvez des informations sur les origines et les intentions des Primalistes.', 'Mes souvenirs sont encore embrums par la stase, mais je jurerais que nous avons dj crois ces Primalistes.\n\n<Dervichane serre les crocs.>\n\nInutile. Je n\arrive pas plus  m\en souvenir qu\ me remmorer les fragments d\un rve qui s\estompe.\n\nVous aurez peut-tre plus de succs. Cherchez des informations sur ce qui ou qui est  l\origine de cette invasion.', '', '', '', '', '', 'Retrouvez Dervichane au cratre Trombclat.', 47187),
(65045, 'frFR', 'Le cratre Trombclat', 'Retrouvez Azurathel au cratre Trombclat.', 'Le rapport de Dervichane est trs inquitant. Des troupes ennemies qui se font appeler Primalistes ont envahi le cratre Trombclat, pigeant ainsi les cailles d\bne au couvoir du Sige.\n\nCes indsirables invoquent de violents lmentaires et rallient les impitoyables Taraskes  leur cause.\n\nAzurathel va avoir besoin de votre aide au cratre.  coups de serres ou  tire d\ailes, sauvez les ntres.\n\nUne fois les cailles d\bne en scurit, demandez  leur commandant de me rejoindre. Mais je prfre vous prvenir: Sarkareth peut se montrer irascible.', '', '', '', '', '', 'Parlez  Azurathel dans le cratre Trombclat.', 47187),
(65036, 'frFR', 'Apprentissage du vol offensif', 'Entranez-vous  l\Envol.', 'Les parcours d\anneaux sont parfaits pour apprendre les bases, mais nous devons nous entraner comme nous combattons sans relche.\n\nContinuez  survoler les environs jusqu\ ce que vous ayez l\impression de matriser la technique. Et bien sr, gardez un il sur la faune locale et les menaces ventuelles Aprs tout, c\est bien pour a que nous nous entranons.\n\nRetournez voir Ardenthal quand vous vous sentirez  l\aise. Bonne chance!', '', '', '', '', '', 'Parlez  la squammandante Ardenthal quand vous serez $gprt:prte;  continuer.', 47187),
(64877, 'frFR', 'Navigation Playtest: Level Up (PART 2)', '', 'Profitez bien de la fin des Plaines!', '', '', '', '', '', '', 47187),
(64873, 'frFR', 'Dployer ses ailes', 'Entranez-vous  lancer Envol.', 'Savoir que tant des ntres ont pu chapper au couvoir Martial me met du baume au cur. Mon propre weyrn n\a pas eu cette chance.\n\n<Ardenthal demeure silencieuse pendant un moment.>\n\nD\autres couvoirs abritant nombre de Dracthyrs en pril sont dissmins dans tous les confins. Il faudra des ailes puissantes pour les rejoindre.\n\nConcentrez-vous. Souvenez-vous de votre entranement. Profitez  nouveau de la caresse du vent. Vous devez reprendre des forces et voler jusqu\aux autres couvoirs.\n\nLe temps n\est plus au repos.', '', '', '', '', '', '', 47187),
(64872, 'frFR', 'Le feu qui nous anime', 'Apprenez Souffle de feu et entranez-vous  excuter des attaques renforces.', 'Vous tes $gun vocateur:une vocatrice;, $n. Vous faites partie de l\lite, vous avez appris  matriser les techniques de chacun de nos weyrns.\n\nJ\attends normment de vous.\n\nSi la stase a morcel nos souvenirs, la force des Dragons coule toujours dans vos veines. Faites-en usage.\n\nL\une des plus terribles armes dont dispose $gun vocateur:une vocatrice; est son souffle. Plus vous inspirez profondment, plus le feu en vous devient puissant.\n\nLes insectes qui grouillent au-dessus de notre terrain d\entranement devraient constituer des cibles appropries.', '', '', '', '', '', '', 47187),
(64871, 'frFR', 'Dragon aux portes', 'Terrassez Lapisagos et fuyez le couvoir Martial.', 'Ce Dragon bleu veut faire s\effondrer le couvoir et nous piger  l\intrieur!\n\nIl prtend servir Malygos. Ce nom me semble familier, mais Pourquoi un Dragon voudrait-il nous emprisonner?\n\ncoutez, $p On nous a appris  combattre aux cts des Dragons, pas  les affronter. Mais aujourd\hui, nous n\avons pas le choix.\n\nIl va falloir agir, $gvocateur:vocatrice;.', '', 'Il vous barre la route.', 'Lapisagos', '', '', '', 47187),
(64866, 'frFR', 'Dpart imminent', 'Prparez-vous  quitter le couvoir.', 'Nous avons besoin de votre savoir-faire, $gvocateur:vocatrice;.\n\nLe couvoir s\effondre et nous manquons de rations. Nous devons sortir d\ici, mais il va d\abord falloir franchir cette barrire arcanique.\n\nLes Dracthyrs qui se trouvent dans la salle un peu plus loin ont besoin de notre aide. Soignez leurs blessures et liminez les adversaires qui se dresseront sur votre chemin.\n\nC\est peut-tre la dernire fois que nous parcourons ces lieux ensemble, $n. N\chouez pas.', '', '', '', '', '', '', 47187),
(64865, 'frFR', 'S\quiper', 'Trouvez des armes, une armure et des fournitures.', 'Des troupes hostiles ont envahi notre bastion, les ntres sont en proie  une stase magique, et notre couvoir semble s\effondrer.\n\nC\est pour ce genre de situations que nous nous entranons, $n. De solides acquis sont prcieux face  l\incertitude.\n\nCommenons par le commencement: des armes, des armures, des fournitures. Rassemblez tout ce que vous pourrez trouver et quipez-vous pendant que je runis nos troupes.\n\nNous partirons ensuite  la recherche du Gardeterre. Neltharion pourra nous fournir des rponses, j\en suis sr.', '', '', '', '', '', '', 47187),
(64864, 'frFR', 'Rveillez-vous, Dracthyrs!', 'Rveillez les autres Dracthyrs.', '<Tandis que vous vous veillez d\un sommeil qui vous a paru ternel, il ne vous reste que des bribes de souvenirs.\n\nLes Dracthyrs devant vous ne bougent pas, comme ptrifis par une magie inconnue. Vous sentez que le pouvoir de briser l\emprise de vos allis repose en vous.\n\nIl y en a peut-tre d\autres dans le couvoir, en proie  cette mme stase.\n\nIl va de votre devoir de les rveiller.>', '', '', '', '', '', 'Parlez au squammandant Azurathel.', 47187),
(64863, 'frFR', 'Gardiens arcaniques', 'liminez $1oagardiens ou assemblages.', 'Les assemblages qui patrouillent dans le couvoir ne sont pas anims par la magie du Gardeterre.\n\n<Dervichane plisse les yeux.>\n\nNous ne pouvons pas permettre aux forces ennemies d\infiltrer nos rangs.\n\nDtruisez-les pour librer la voie.', '', '', '', '', '', '', 47187),
(64856, 'frFR', '[DNT] A Little Pruning', 'Tuez %1oaflagellants carnivores.', 'Salutations, $gmortel:mortelle;. J\ai besoin de votre aide.\n\nLes jardins sont tombs en dcrpitude pendant la longue absence des Vols draconiques. Nombre de leurs plantes sont devenues turbulentes.\n\nJe dois prendre soin des boutures et la situation me proccupe liminez les plantes les hostiles et vous serez dment $grcompens:rcompense;.', '', '', '', '', '', '', 47187),
(64163, 'frFR', 'Vengeance contre les perfides', 'Trouvez et liminez les rebelles centaures des camps de fortune sur l\autre rive.', 'Des clans rebelles ont pris possession de nos camps de l\autre ct de la rivire.\n\nNous ne pouvons laisser faire ces vermines sditieuses.\n\nJe compte donc sur vous pour leur donner une bonne leon de ma part.\n\nNe vous proccupez pas du chaos qui rgne dans ces camps, nous nous pencherons sur la question une fois l\ordre rtabli.', '', '', '', '', '', '', 47187),
(64162, 'frFR', 'Rival rituel', 'Trouvez et liminez le khan rebelle des camps de fortune sur l\autre rive.', 'Les tribus rebelles ont dsign un autre khan pour les diriger.\n\nJe m\en occuperais bien moi-mme, mais j\ai beaucoup trop  faire ici.\n\nVous devriez tre en mesure de leur faire comprendre leur erreur, n\est-ce pas?', '', '', '', '', '', '', 47187),
(64159, 'frFR', 'Rcupration de fournitures rares', 'Rcuprez les fournitures dans les camps de fortune sur l\autre rive.', 'Les rebelles ont vol des fournitures dans les camps du secteur.\n\nVous avez prouv votre valeur, je vous fais donc confiance pour rgler cette situation.', '', '', '', '', '', '', 47187),
(62366, 'frFR', 'Troisime tour', '', '', '', '', '', '', '', '', 47187),
(62325, 'frFR', 'Deuxime tour', '', '', '', '', '', '', '', '', 47187),
(62324, 'frFR', 'Premier tour', '', '', '', '', '', '', '', '', 47187),
(61620, 'frFR', 'Forge: menottes d\orgueil', '', '', '', '', '', '', '', '', 47187),
(54349, 'frFR', 'Donations pour Sombrivage: bandage en lin battu par les mares', '', '', '', '', '', '', '', '', 47187),
(37484, 'frFR', 'Sifflet de capitaine', 'Apportez 100 Fragments d\artfact  Anne Dunworthy pour obtenir un Sifflet du capitaine.', '', '', '', '', '', '', '', 47187),
(3632, 'frFR', 'Ingnierie des gnomes', 'Pour en apprendre davantage sur l\'ingnierie gnome, apporter le Manuel d\'Ingnierie au matre-artisan Suprtincelle,  Forgefer.', 'L\'ingnierie pratique  un niveau d\'expert connat deux disciplines: celle des gnomes et celle des gobelins. L\'ingnierie gnome est de loin suprieure! Elle consiste  construire de merveilleux dispositifs qui rendent la vie meilleure!$B$B$n, lisez ce manuel. Si vous voulez en apprendre plus sur l\'ingnierie gnome, apportez ce manuel au matre-artisan Suprtincelle dans Forgefer. Mais le choix de cette discipline est dfinitif et exclut l\'autre, alors soyez $gsr:sre; de votre choix!', '', '', '', '', '', '', 47187);
